 background-color: #f8f8f8; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Quantity: one positive and one reverse is one set, 10 sets</span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 15pt; font-family: Arial; color: #333333; background-color: #f8f8f8; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Material: ABS engineering plastic, PVC high-quality material</span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 15pt; font-family: Arial; color: #333333; background-color: #f8f8f8; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Bearing capacity: 10kg</span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 13pt; font-family: Arial; color: #333333; background-color: #f8f8f8; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">PACKAGE INCLUSION:</span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 12pt; font-family: Arial; color: #333333; background-color: #f8f8f8; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">10 X Double-Sided Adhesive Wall Hooks Hanger.</span></p>', 'Available', 'facebook_ads,trending_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-09 18:40:28', '2021-06-09 18:40:28', NULL, NULL),
(5, 'Hammock Mosquito Net', 55.00, 19.19, 35.76, 2321, '44539.99', 146010, '18-24,25-34,34-44', 1, 'Unisex', 'United States, Canada, Australia, Japan, Netherlends, Europe, Singapur', 'Hammock Mosquito Net,Home,Gerden', 'Home & Gerden', '<p><strong>Relax comfortably and pest-free on your outdoor adventure with our Portable Mosquito Net Hammock.</strong></p>\r\n<h2><strong>FEATURES:</strong></h2>\r\n<p style=\"text-align: left;\">Fits two people<br />Full mosquito net to keep out insects and debris<br />Durable parachute material<br />Portable and easy to carry and store away<br />Strong grip and barring capacity</p>\r\n<h3><strong>SPECIFICATIONS:</strong></h3>\r\n<p><strong>Product Size:</strong> 260*130cm/102*51 inches<br /><strong>Packaging Size: </strong>20cm*24cm<br /><strong>Material:</strong> 210T Nylon fabric, polyester mesh<br /><strong>Maximum Safe Load: </strong>200kg/441lb<br /><strong>Weight:</strong> 700 g</p>\r\n<h4><strong>PACKAGE INCLUDES:</strong></h4>\r\n<p>1*Camping Hammock + mosquito net<br />2pcs buckle<br />2pcs lashing<br />2pcs mosquito net rope inside and outside the bag of each</p>', 'Available', 'facebook_ads', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-10 05:31:50', '2021-06-10 05:31:50', NULL, NULL),
(6, 'Electric Scraping Massager', 60.00, 21.17, 38.78, 2412, '51062.04', 1296877, '18-24,25-34,34-44', 1, 'Men,Baby', 'United States, Canada, Australia, Japan, Europe, Singapur,Netherlands', 'Health,Beauty,Electric Scraping Massager', 'Health & Beauty', '<p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 12pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Our day-to-day lives can cause us to build up tons of tension throughout our bodies. Over time, this tension builds up and can cause serious discomfort, it&rsquo;s incredibly unhealthy to live with these sensations. That&rsquo;s why we have this best back massager that can massage your back just like fingers! Our Dr. Scraping gua sha massage machines can effectively relieve symptoms such as brain fatigue, insomnia, dreaminess, dizziness, headache, and more!</span><strong id=\"docs-internal-guid-b991b61c-7fff-35dc-5a47-549ca398ff87\" style=\"font-weight: normal;\"></strong></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 13.999999999999998pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Features:</span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;\">&nbsp;</p>\r\n<ol style=\"margin-top: 0; margin-bottom: 0; padding-inline-start: 48px;\">\r\n<li dir=\"ltr\" style=\"list-style-type: decimal; font-size: 12.499999999999998pt; font-family: Roboto,sans-serif; color: #333333; background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre;\" aria-level=\"1\">\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;\" role=\"presentation\"><span style=\"font-size: 12.499999999999998pt; font-family: Roboto,sans-serif; color: #333333; background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Enjoying All Benefits of Gua Sha Massage:&nbsp;</span></p>\r\n</li>\r\n</ol>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-left: 36pt; background-color: #ffffff; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 11.5pt; font-family: Roboto,sans-serif; color: #333333; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Gua sha is a natural, alternative therapy that involves scraping your skin with a massage tool to improve your circulation. This ancient Chinese healing technique may offer a unique approach to better health, addressing issues like chronic pain. Gua sha may reduce inflammation, so it&rsquo;s often used to treat ailments that cause chronic pain, such as arthritis and fibromyalgia, as well as those that trigger muscle and joint pain.</span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; background-color: #ffffff; margin-top: 0pt; margin-bottom: 0pt;\">&nbsp;</p>\r\n<ol style=\"margin-top: 0; margin-bottom: 0; padding-inline-start: 48px;\" start=\"2\">\r\n<li dir=\"ltr\" style=\"list-style-type: decimal; font-size: 12.499999999999998pt; font-family: Roboto,sans-serif; color: #333333; background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre;\" aria-level=\"1\">\r\n<p dir=\"ltr\" style=\"line-height: 1.38; background-color: #ffffff; margin-top: 0pt; margin-bottom: 0pt;\" role=\"presentation\"><span style=\"font-size: 12.499999999999998pt; font-family: Roboto,sans-serif; color: #333333; background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">About Electric Scraping Massager:&nbsp;</span></p>\r\n</li>\r\n</ol>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-left: 36pt; background-color: #ffffff; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 12pt; font-family: Arial; color: #2d2d2d; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Scraping is an electric Gua Sha massager designed to apply heat and negative pressure on the whole body, for pain relief, body detoxification, and dredge meridians.<br /></span>&nbsp;</p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-left: 36pt; background-color: #ffffff; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 12pt; font-family: Arial; color: #2d2d2d; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Our day-to-day lives can cause us to build up tons of tension all over our bodies. This leads to serious discomfort, bodily stresses, and an overall negative impact on our health.</span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-left: 36pt; background-color: #ffffff; margin-top: 0pt; margin-bottom: 0pt;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-left: 36pt; background-color: #ffffff; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 12pt; font-family: Arial; color: #2d2d2d; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Combined with heat and suction, Scraping can reach different acupuncture points. The smooth curve of the grip also perfectly fits your palm so that you can master it with only one hand without any trouble.</span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-left: 36pt; background-color: #ffffff; margin-top: 0pt; margin-bottom: 0pt;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-left: 36pt; background-color: #ffffff; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 12pt; font-family: Arial; color: #2d2d2d; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">It is suitable to be used on your whole body parts including arm, abdomen, calf, elbow, wrist, knee, ankle, foot, spine, etc.</span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-left: 36pt; background-color: #ffffff; margin-top: 0pt; margin-bottom: 0pt;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-left: 36pt; background-color: #ffffff; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 12pt; font-family: Arial; color: #2d2d2d; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">With Scraping, you can effectively boost metabolism, dredge the meridians, and improve immunity. It works by massaging the skin surface, promoting blood circulation, relieving the pain, and allowing your body to detoxify at the same time.</span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-left: 36pt; background-color: #ffffff; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 12pt; font-family: Arial; color: #2d2d2d; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Unlike going to massage parlors to have traditional physiotherapy, you can have self-massages at home with Scraping Cupping and Gua Sha Massager to get the same effects, which is time-saving and labor-saving.</span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-left: 36pt; background-color: #ffffff; margin-top: 0pt; margin-bottom: 0pt;\">&nbsp;</p>\r\n<ol style=\"margin-top: 0; margin-bottom: 0; padding-inline-start: 48px;\" start=\"3\">\r\n<li dir=\"ltr\" style=\"list-style-type: decimal; font-size: 13pt; font-family: Arial; color: #2d2d2d; background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre;\" aria-level=\"1\">\r\n<p dir=\"ltr\" style=\"line-height: 1.38; background-color: #ffffff; margin-top: 0pt; margin-bottom: 0pt;\" role=\"presentation\"><span style=\"font-size: 13pt; font-family: Arial; color: #2d2d2d; background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">How Does Scraping Electric Scraping Massager Work?</span></p>\r\n</li>\r\n</ol>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-left: 36pt; background-color: #ffffff; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 12pt; font-family: Arial; color: #2d2d2d; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Gua Sha &amp; Hot Compression Cupping (and Magnetic Physiotherapy) are a natural, alternative therapy that involves scraping your skin with a massage tool to improve your circulation.</span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-left: 36pt; background-color: #ffffff; margin-top: 0pt; margin-bottom: 0pt;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-left: 36pt; background-color: #ffffff; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 12pt; font-family: Arial; color: #2d2d2d; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Scraping and Cupping stimulate micro-circulation of the soft tissue, which increases blood flow, leaving you full of vitality and free of aching pains.</span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-left: 36pt; background-color: #ffffff; margin-top: 0pt; margin-bottom: 0pt;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-left: 36pt; background-color: #ffffff; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 12pt; font-family: Arial; color: #2d2d2d; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Our Scraping Cupping and Gua Sha Massager are composed of all three functions. It allows for Cupping, Hot Compression, and Scraping &mdash; all you could ever need, in one compact massager.</span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-left: 36pt; background-color: #ffffff; margin-top: 0pt; margin-bottom: 0pt;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; background-color: #ffffff; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 13pt; font-family: Arial; color: #2d2d2d; background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;4. Why Do You Need an Electric Scraping Massager?</span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; background-color: #ffffff; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 13pt; font-family: Arial; color: #2d2d2d; background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp