(7, 'Advanced Leather Repair Gel Kit', 20.00, 1.75, 18.25, 10, '17.50', 412731, '18-24,25-34,34-44,45-54,55-64', 1, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Advanced Leather Repair Gel Kit,Home,Gerden', 'Home & Gerden', '<p><strong>It quickly repairs burns, holes, rips, and gouges on leather surfaces with a long-lasting, flawless effect. It restores your cracked vinyl couches and car seats back to their pristine condition. Get professional-quality restoration without spending bucks on crazily expensive repair shops!</strong></p>\r\n<h2>Features:</h2>\r\n<p>Advanced Leather Repair Gel Refurbish burns, holes, rips, and gouges quickly and flawlessly without leaving a mark.<br />Extend Lifespan of Favorite Stuff Protect your favorite furniture or car seats. Repair any unexpected burns, holes, rips, etc., and restore the luster of leather for pristine condition.<br />Easy to Use Just apply the repair gel without using extra tool or skill<br />Durable Material.<br />Permanently adhere to the leather, never rip again. Keep.<br />Smooth &amp; Glossy Made of high-quality material which can offer full protection for the surface of leather &amp; prevent oxidation.<br />No Harm Chemicals.<br />No further damage to the surrounding leather.<br />The wide application apart from car devices can also be applied on any leather surface object like a jacket, shoe, bag, furniture, etc.</p>\r\n<h3><strong>Specifications:</strong></h3>\r\n<p><strong>Capacity: </strong>20ml<br /><strong>Color: </strong>Black, Blue, Chocolate Brown, Tan, Burgundy, Red, White, Yellow, Gray, Beige</p>\r\n<h4><strong>Package Includes:</strong></h4>\r\n<p>1 x Advanced Leather Repair Gel</p>\r\n<p>&nbsp;</p>', 'Available', 'trending_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-10 06:03:23', '2021-06-10 06:03:23', NULL, NULL),
(8, 'The Solar Torch', 40.00, 11.54, 28.41, 2200, '25388.00', 266689, '18-24,25-34,34-44', 1, 'Men,Baby', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Electronics,The Solar Torch', 'Home & Gerden', '<p><strong>This is not a toy, this throws out a flame-like none I\'ve seen other than work torches. Might be too powerful for candles, but for a fireplace and fire pit - this is the bong! Batman said it would light up the bat cave. I was not paid or anything, I\'m just impressed. Getting two more and maybe some for gifts to my manly man friends. Batman won\'t even let Robin use it.</strong></p>\r\n<p><strong>FEATURES:</strong></p>\r\n<p><strong>IGNITION PORT: </strong>Has a direct blue flam with windproof fire-breathing welding holder, strong firepower, and can light cigars.</p>\r\n<p><strong>IGNITION LOCK: </strong>Light and quick press even with a gentle hold. Very convenient.</p>\r\n<p><strong>CAGE GAS:</strong> The bottom is an inflatable device to ensure long-term use</p>\r\n<p><strong>&nbsp;BODY: </strong>The Zinc alloy creates an ergonomic design, fits the hand perfectly, and has an excellent grip.</p>\r\n<p><strong>Specifications:</strong></p>\r\n<p><strong>Material:</strong> metal</p>\r\n<p><strong>Color:</strong> black, walnut</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Package inclusions:</strong></p>\r\n<p>1 x jet butane torch lighter</p>', 'Available', 'untapped_product', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-10 06:11:40', '2021-06-10 06:11:40', NULL, NULL),
(9, 'Sticky Scratch', 37.00, 6.55, 30.45, 2000, '13100.00', 83261, '18-24,25-34,34-44,45-54', 2, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Sticky Scratch,Home,Gerden', 'Home & Gerden', '<p><strong>Tired of dogs and cats destroying your valuable furniture?</strong><br /><strong>Use our Sticky Scratch Protector for easy and unobtrusive protection today! Try our premium sticky scratch protectors today! These come in 12x18 inch sheets that can be cut to size and reused around your home!</strong></p>\r\n<h2><strong>Features:</strong></h2>\r\n<p><strong>TRAIN YOUR PET:</strong> Apply our premium protectors to the places your cat scratches the most. They will learn where they can and cannot scratch.<br /><strong>REDUCE STRESS: </strong>Stop stressing about constantly watching your animal, with the fear that they will ruin your new or favorite piece of furniture.&nbsp;<br /><strong>KEEP FURNITURE LONGER: </strong>Keep your furniture in perfect condition and enjoy your favorite spot in the house for longer.<br /><strong>UNNOTICEABLE PROTECTION:</strong> Our scratch protectors are 100% transparent so you can place them where your pets scratch the most.<br /><strong>EASY TO APPLY: </strong>Simply peel the sticky covering off and apply it to the places your cat scratches the most. Use the included tacks for extra stability.<br /><strong>REUSE AROUND THE HOUSE:</strong> Once they stop using the spot simply remove the protector and reapply as needed.&nbsp;<br /><strong>APPLY ANYWHERE:</strong> Our protectors can be placed on leather, fabric, polyester, or just about every material. Place them where they are needed most and remove them with ease.</p>\r\n<h3><strong>Specification:</strong></h3>\r\n<p><strong>Quantity:&nbsp;</strong> 4 Pcs<br /><strong>Main Material/s: </strong>PVC</p>\r\n<h4><strong>Available Sizes:</strong></h4>\r\n<p>S &mdash; 14 x 45 cm&nbsp;<br />M &mdash; 20 x 45 cm&nbsp;<br />L &mdash; 30 x 45 cm</p>', 'Available', '