(10, 'Cervical Traction Device', 260.00, 187.17, 72.83, 1, '187.17', 43844, '[\"18-24\",\"25-34\",\"34-44\",\"45-54\",\"55-64\"]', 1, '[\"Unisex\"]', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Cervical Traction Device,Health,Beauty', '[\"Health & Beauty\"]', '<p><strong>Are you looking for a neck traction device that can help alleviate discomfort in the neck and shoulders? Our Multifunctional Neck Traction Device uses medically validated treatment and proprietary technologies that relieve soreness, weakness and relax the muscles. The key advantage of the neck massager is that it successfully treats degenerated, bulging, or herniated cervical discs.</strong></p>\r\n<h2><strong>Features:</strong></h2>\r\n<p><strong>Comfortable - </strong>This neck massager has been carefully designed to offer maximum comfort, performance, and ease of use, making it easier for anyone to have a certified physiotherapy device at home.<br /><strong>Design -</strong> It is built according to the anatomical curvature of the shoulders and neck of the human body. The 26-degree elevation arc makes the device snugly suited to the neck. Hot compresses and low-frequency physiotherapy can relax the muscles, alleviating pain and discomfort.<br /><strong>Multifunctional -</strong> We have three rhythmic modes, comfortable relaxation mode, improved push-pull mode, active bone-and-bone mode, which can fulfill all requirements for various users.</p>\r\n<p><strong>Specifications:<br /></strong>Power: &le;12W<br />Current: &le;1 A<br />Weight: About 1.5kg<br />Pulse Width: 125-50, 0us<br />Working Voltage: 12VDC<br />Working Time: 15 minutes<br /><strong>Package Content:<br /></strong>1x Multifunctional Neck Traction Device</p>', 'Available', '[\"untapped_product\"]', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-10 06:26:51', '2021-06-24 07:28:39', NULL, NULL);
