(12, 'Electric Food Chopper', 29.00, 11.55, 17.45, 3869, '44686.95', 560486, '[\"18-24\",\"25-34\",\"34-44\",\"45-54\",\"55-64\"]', 2, '[\"Women\"]', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Electric Food Chopper,Home,Gerden', '[\"Home & Gerden\"]', '<p style=\"text-align: center;\"><strong>The most common accident in kitchens is cut. Specifically, However, having a tool specifically designed to slice through flesh moving up and down right next to your fingertips always poses a bit of danger.</strong></p>\r\n<p><strong>Features:</strong></p>\r\n<p><strong>Unique Design:</strong> Only need to press the button at the top to automatically stir, get rid of the trouble of hand-drawing. Features sharp stainless steel blades for fast and even chopping/mincing, comfort soft grip lid, anti-skid base, Make your kitchen time more efficient.<br /><strong>Great Kitchen Helper: </strong>Our electric food chopper is with 3 reinforced blades, it will not only help you chop garlic, ginger, peppers, vegetables, fruits, Saving time and effort.<br /><strong>Powerful Function: </strong>Powered by USB, rechargeable. Press the button on the top to automatically stir the food. The sharp blades of the garlic chopper are quick to chop garlic, seasoning, nuts, vegetables, meat, ice cubes, and more, perfect for small foods. You can use it for cooking, baby food supplements, smoothie drinks.<br /><strong>Premium Material: </strong>The stainless steel blade is durable, strong, and powerful for efficient cutting. The food-grade plastic in the cup is BPA-free and safe to hold food, robust and germ-free.<br /><strong>Mini and Portable: </strong>150ml capacity, unique interior wall design, fewer ingredients can be easily chopped, convenient for small and delicate needs. The Mini manual chopper has advantages of economy, practicability, compact volume, and portable.</p>\r\n<p><strong>Specifications:<br /></strong>Capacity: 150M<br />Product Material: Cutter Head 304 Stainless Steel, Cup Body PC, Machine head ABS<br />Power: 22W<br />Stirring Blade: Three stirring blade<br />Method Of Use: Fully Automatic<br />Function: Cutting vegetables, Minced meat, Stirring, Mixing<br /><strong>Package Included:<br /></strong>1*Garlic Chopper<br />1*USB Cable</p>\r\n<p>&nbsp;</p>', 'Available', '[\"untapped_product\"]', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-10 06:36:13', '2021-06-24 07:23:07', NULL, NULL),
(13, 'Mattress Pro', 60.00, 23.99, 35.96, 2329, '55872.71', 28229, '18-24,25-34', 1, 'Men,Baby', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Outdoor,Mattress Pro', 'Home & Gerden', '<p><strong>Are you literally tired from camping on chilly, rocky, or rough terrain? When you\'re outdoors, restorative rest is essential! Now, getting your beauty sleep while camping is possible with the Mattress Pro&trade;. Sleep like a baby on our 2.2-inch-thick camping mat and tackle the day to come! Hiking the great outdoors is tough. After a hiking day, most backpackers are tired enough to pass out face-first when they arrive at their setup spot. Luckily, we\'ve created the ultimate inflatable mattress for outdoor enthusiasts.</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Features:</strong></p>\r\n<p><strong>Extremely Durable:</strong><br />As hikers &amp; campers ourselves, we were sick and tired of having mats pop on us! This is why we made sure the mattress we created wasn\'t going to do so... We use durable dual-layered material for ultimate resistance.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Ultra Lightweight:<br /></strong>The typical outdoor mattress weighs 1-2kg! Ridiculous. With a finished product weight of only 500 grams, we made it our goal to minimize our mattress\'s weight as much as possible.</p>\r\n<p><strong>Super Compact:<br /></strong>One of our customer\'s favorite features of this mat is the fact that it is as small as a water bottle when it\'s folded and stored in its carrying bag. Nothing is worse than a bulky sleeping mattress swinging around on the side as you walk.</p>\r\n<p><strong>Maximum Comfort:<br /></strong>Do you suffer from backache and neck pain every time you go camping? We certainly did... This is why we tested and tested our mattress\'s comfort with thousands of people until it was made to be one of the most comfortable rated mattresses ever. With 144 insulated flexible air cells that contour to your body\'s exact shape, the expert design of this pad will help you achieve a comfortable night\'s sleep no matter where you are.</p>\r\n<p><strong>Cold Protection:<br /></strong>Your body absorbs the cold 10x faster from the ground than it does from surrounding cold air. So when camping, the last thing you want is a mattress that does this too. That is why we have an ergonomically designed, multi-layer system inside our mats to ensure absolutely minimal heat will be passed from you to the ground, achieving an R-value of 4.2.</p>\r\n<p><strong>Built-In Pillow:<br /></strong>The top of the mattress is padded in the shape of a pillow to provide a proper cushion for your head and neck, which is critical to your comfort and a night of good sleep.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Specifiation:</strong></p>\r\n<p><strong>Dimensions (L x W x T):</strong> 1900*580*50mm</p>\r\n<p><strong>Colors:</strong> Orange/Deep Blue/Sky blue/Green</p>\r\n<p><strong>Net weight:</strong> 0.555kg</p>\r\n<p><strong>Material:</strong> 20d nylon + TPU + patent gas nozzle (PGN)</p>\r\n<p><strong>Advantages:</strong> Quick inflating, comfortable, and moisture-proof</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Package includes:</strong></p>\r\n<p>1pcs* Inflatable Sleeping Pad.</p>', 'Available', 'facebook_ads', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-10 06:45:04', '2021-06-10 06:45:04', NULL, NULL),
(14, 'LED Light Tape', 16.00, 5.70, 10.30, 1845, '10499.40', 183561, '[\"18-24\",\"25-34\",\"34-44\",\"45-54\"]', 1, '[\"Unisex\"]', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'LED Light Tape,Home ,Gerden', '[\"Home & Gerden\"]', '<p><strong>These are excellent LED strip lights. They are simple to install, hold up well provided you stick them to a suitable surface, and have a bewildering array of colors and patterns. I suspect most people are going to pick a color and turn them up or down, on or off, but if you\'re looking for party room decor these are effective as well. The price is good, they are well made, and brighten up a room.</strong></p>\r\n<h2><strong>Features:</strong></h2>\r\n<p>Can be cut shorter according to your needs<br />Can attach multiple sets of the strips to make it longer<br />300 RGB (red, green, blue) LED bulbs<br />16 total colors: 3 solid colors, 13 mixed colors<br />Different modes, including 4 flashing modes<br />Can adjust brightness and speed<br />Sticks to surfaces with 3M adhesive tape<br />Can be placed anywhere<br />Easy to install and use<br />Plugs into any outlet<br />Waterproof surface so LED bulbs won\'t be damaged (Do not submerge in water)<br />LEDs use low power consumption<br />Lights keep a low temperature even when on for long periods of time<br />Includes a remote control</p>\r\n<h3><strong>Specifications:</strong></h3>\r\n<p><strong>LED Type: </strong>5050 SMD<br /><strong>Voltage: </strong>12V<br /><strong>Emit Color:</strong> RGB<br /><strong>Working Input Voltage: </strong>DC 12V<br /><strong>Drive Mode:</strong> Constant Voltage<br /><strong>Protection Rate: </strong>IP20<br /><strong>IR Remote Battery: </strong>CR2025 (not included)</p>\r\n<h4><strong>Package Includes:</strong></h4>\r\n<p>1 x RGB LED Strip<br />1 x IR Remote Control<br />1 x Power Adapter<br />1 x Connector</p>', 'Available', '[\"trending_product\"]', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-10 06:48:57', '2021-06-10 06:49:53', NULL, NULL),
(15, 'Intensive Stain Removal Whitening Toothpaste', 35.00, 7.77, 27.22, 398, '3092.46', 208614, '18-24,25-34,34-44,45-54,55-64', 2, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Health, Beauty,Intensive Stain Removal Whitening Toothpaste', 'Health & Beauty', '<p><strong>Our Intensive Stain Removal Whitening Toothpaste removes teeth stains, cavities, and bad breath effectively and flawlessly with 100% safe and natural ingredients. Featuring natural herb extracts and baking soda, the strong cleaning power of baking soda penetrates the enamel crevices and removes food particles, bacterial plaque, and deep stains without any harmful abrasives and chemicals like others. Great news for coffee, tea, or smoke lovers. Get visible whitening effect as well as full protection to your gums and teeth with a fresher breath!</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Features:</strong></p>\r\n<p><strong>Heavy-duty Cleaning &amp; Whitening Toothpaste: </strong>Instantly eliminate yellowish teeth, stains, tartar, and other substances.</p>\r\n<p><strong>Effective results:</strong> Get visible white teeth in seconds!</p>\r\n<p><strong>All Round Protection: </strong>Protects the teeth from cavities, plaque, and tooth decay.</p>\r\n<p><strong>Removes bad breath and mouth odors:</strong> Keeps your mouth fresh and clean!</p>\r\n<p><strong>Gentle on sensitive teeth and gums:</strong> Its special formulation is made to ensure delicate teeth won&rsquo;t suffer.</p>\r\n<p><strong>100% Safe &amp; Natural:</strong> Made of pure baking soda paste and herb extract</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Specification:</strong></p>\r\n<p><strong>Ingredients: </strong>Baking soda, natural herbal extracts</p>\r\n<p><strong>Flavor: </strong>Passion Fruit, Blueberry</p>\r\n<p><strong>Weight:</strong> 220g</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Package Include:&nbsp;<br /></strong>1X Intensive Stain Removal Whitening Toothpaste</p>', 'Available', 'trending_product', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-10 06:58:15', '2021-06-10 06:58:15', NULL, NULL),
(16, 'Tummy Time Mat', 30.00, 5.37, 24.63, 4922, '26431.14', 2397741, '18-24,25-34', 2, 'Baby', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Tummy Time Mat,Baby,Kids', 'Baby & Kids', '<p><strong>Tummy time is essential for developing strong head, neck, and shoulder muscles as well as defining certain motor skills. Fun Water Play Mat is the perfect tummy time activity with little foam fish inside.</strong></p>\r\n<h2><strong>Features:</strong></h2>\r\n<p>Tummy time activity center helps strengthen the baby\'s back, legs, arms, and neck.<br />Kids\' water play mat constructed from thickening PVC will not leak air or water.<br />Baby presses the water mat and moves the fish around, to promote hand-eye coordination.<br />A tummy time mat is great for sensory stimulation, motor skills, cognitive abilities, and social skills.<br />Simply fill the mat with water and inflate the edge with air, kids can have hours of tactile and visual fun.</p>\r\n<h3><strong>Specification:</strong></h3>\r\n<p><strong>Name:</strong> infants inflatable playmat<br /><strong>Size:</strong> 66x50cm / 26.0*19.7in<br /><strong>Material: </strong>0.3 PVC, general material or environmentally friendly 6P material (no phthalates, in line with European EN71 safety standards)<br /><strong>Valve: </strong>6P environmentally friendly non-toxic gas nozzles<br /><strong>Color: </strong>Conventional Color.</p>\r\n<h4><strong>Package Included:</strong></h4>\r\n<p>1 x Water Play Mat</p>', 'Available', 'trending_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-10 06:58:37', '2021-06-10 06:58:37', NULL, NULL),
(17, 'Wall Mounted CD Player', 62.00, 27.30, 34.70, 17, '464.10', 183911, '18-24,25-34,34-44,45-54', 1, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Wall Mounted CD Player,Home,Gerden', 'Home & Gerden', '<p><strong>Grab your discounted wall-mounted cd player wireless portable home audio boombox with remote control FM radio mp3 USB baby prenatal education while the store launch discount is on. This is absolutely a great gift!</strong></p>\r\n<h2><strong>Features:</strong></h2>\r\n<p><strong>LED screen display:</strong> 6 Colour status indicators, different display modes, corresponding to different Colour indicators.<br /><strong>A-B repeat function: </strong>a-b repeat function, let your child learn more knowledge is convenient and efficient, choose it, lie on the starting line.<br /><strong>Speaker function: </strong>AUX3.5mm audio input and output can be used as a player or as a speaker, and the sound rendering of the high-fidelity digital power amplifier chip is clear and natural.<br /><strong>Bluetooth function: </strong>Learn English with CD, enjoy the fun of music with Bluetooth and make Bluetooth music more fun.<br /><strong>Radio function: </strong>It can not only play CD-ROM, mobile phone Bluetooth but also use it as a radio.</p>\r\n<h3><strong>Specifications:</strong></h3>\r\n<p><strong>Radio frequency: </strong>87.5KHz-108.0MHz<br /><strong>Speaker Dimension: </strong>2x 1.77 inch<br /><strong>Speaker output: </strong>2x 3W<br /><strong>Power supply: </strong>AC100V-220V, 50HZ/60HZ<br /><strong>Switch Cable Length: </strong>110 inch<br /><strong>Product Dimension: </strong>7.4 x 7.4 x 1.5 inch</p>\r\n<h4><strong>Package Included:&nbsp;</strong></h4>\r\n<p>1 x Portable Bluetooth CD Player<br />1 x USB Cable&nbsp;<br />1 x US Plug<br />1 x Remote Control</p>', 'Available', 'trending_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-10 07:08:34', '2021-06-10 07:08:34', NULL, NULL),
(18, 'Cat Water Fountain', 25.00, 6.98, 18.01, 5, '34.90', 1392404, '18-24,25-34,34-44', 2, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Pet Accessories,Cat Water Fountain', 'Pet Accessories', '<p><strong>Get your kitty a fancy and functional kitty water bowl that stimulates their curiosity while supplying clean water. The luminous function makes it easy for your pet to drink at night. It includes different water flow effects, including waterfalls, springs, waterfalls + springs. The ultra-quiet pump mitigates noise.</strong></p>\r\n<p><strong>Features:</strong></p>\r\n<p><strong>Clean Water:&nbsp;<br /></strong>The unique replaceable design filter can effectively filtrate the hair, odor, and chlorine. Consequently, the fountain can give cleaner water to pets and reduce the risk of developing the illness. Charcoal filters help remove which absorbs odors and bad taste.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Design Pump:<br /></strong>The unique designed blue pump DR-DC160 is deployed with a customized suction cup to diminish the noise to a minimum. A high-quality impeller can guarantee durable products for use.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>High Quality:<br /></strong>Pet fountain is made of finely polished antibacterial PP plastic and Stainless Steel lid, eco-friendly, non-toxic, odorless, and durable. A simple quick-release structure is designed for easy removal and cleaning.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>2.4L Capacity:<br /></strong>No need to replenish the water frequently, and it can meet the drinking needs of cats, dogs, birds, and other pets of various sizes. No need to worry about your pets not getting enough fresh drinks when you go to work.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Visual:<br /></strong>Equipped with LED, which you can see the water level. When working, the LED is blue; LED is red when not working. The product does not work until the water level exceeds the pump. Powered by USB cable. The safe, hygienic, convenient top-shelf dishwasher is safe.</p>\r\n<p><strong><br />Specification:</strong></p>\r\n<p><strong>Type:</strong> Water Fountain</p>\r\n<p><strong>Material: </strong>PP plastic + Stainless Steel</p>\r\n<p><strong>Quantity:</strong> 1pc</p>\r\n<p><strong>Item Color: </strong>White and silver</p>\r\n<p><strong>Water Capacity:</strong> 2.4 liters (80 oz)</p>\r\n<p><strong>Input Voltage:</strong> 5V,1A</p>\r\n<p><strong>Power Consumption:</strong> 1.5W</p>\r\n<p><strong>Waterproof:</strong> IP68</p>\r\n<p><strong>Cable Length:</strong> 1.6M/5.2ft</p>\r\n<p><strong>Item Size:</strong> approx. L18.6cm x W18.6cm x H13.1cm/7.3*7.3*5.1&rdquo; (L*W*H)</p>\r\n<p><strong>Net Weight:</strong> 697g/24.6oz</p>\r\n<p><br /><strong>Package:<br /></strong>1 x Pet Water Fountain<br />1 x Charcoal Filter<br />1x USB cable<br />1 x English User Manual<br />1 x Package box</p>', 'Available', 'facebook_ads', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-10 07:19:15', '2021-06-10 07:19:15', NULL, NULL),
(19, 'Painter Pro', 30.00, 6.49, 23.51, 2133, '13843.17', 1204494, '18-24,25-34,34-44,45-54,55-64', 2, 'Men', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Painter Pro,Home,Gerden', 'Home & Gerden', '<p><strong>Clean-Cut Paint Edger technology will eliminate hours of tedious work required to tape and/or cut in by hand.</strong><br /><strong>Invented by a professional painter to help his crews cut in paint edges faster and more consistently, the Clean-Cut Paint Edger has become a time saver for professional painters and homeowners alike. It is the only paint edger to use the patented combination of roller, shield, and brush.</strong></p>\r\n<h2><strong>FEATURES:</strong></h2>\r\n<p><strong>TIME-SAVING -</strong> Greatly reduces the time spent applying masking tape.<br /><strong>EFFICIENT -</strong> Paints 10-20 times faster than a sash brush. Cuts in 5-8 feet per load and cuts in a band that is 4\" wide.<br /><strong>LESS WORK -</strong> Reduces the number of painters needed on a job by 50% or more.<br /><strong>SAVE MONEY - </strong>Pays for itself in labor savings on the first day on the job.<br /><strong>PRODUCES AN EXCELLENT WORK -</strong> Ensures that even painters with little or no experience can paint consistent, straight edges with no paint on the trim.</p>\r\n<h3><strong>SPECIFICATION:</strong></h3>\r\n<p><strong>DIY Supplies:</strong> Paint &amp; Decorating<br /><strong>Model Number: </strong>Roller brush</p>\r\n<h4><strong>PACKAGE INCLUDES:</strong></h4>\r\n<p>1* Clean-Cut Paint Edger<br />2* Rollers<br />2* Brushes</p>', 'Available', 'trending_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-10 07:23:08', '2021-06-10 07:23:08', NULL, NULL),
(20, 'Octopus Kids', 20.00, 0.36, 19.63, 655, '235.80', 318021, '18-24,25-34,34-44', 2, 'Baby', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Baby,Kids,Octopus Kids', 'Baby & Kids', '<p><strong>The unique flip design provides you with different visual and sensory experiences. This cute plush doll adopts a unique double-sided two-color design, which can be easily flipped into different colors and expressions.</strong></p>\r\n<p><strong><br />Features:</strong></p>\r\n<p>As seen on TikTok!</p>\r\n<p>TeeTurtle is the home of the original Reversible Octopus Plushie!</p>\r\n<p>&nbsp;Easy to flip inside out so you can show your mood to the world.</p>\r\n<p>These super soft toys are perfect for playing, collecting &amp; cuddling.</p>\r\n<p>A cute reversible plush Octopus with two different expressions.</p>\r\n<p><strong><br />SPECIFICATIONS:</strong></p>\r\n<p><br />Durable pp cotton material inside, soft and safe.</p>\r\n<p>Easy to clean the stains, washable, use a small amount of soap and water, dry naturally.</p>\r\n<p>New gift idea for this year\'s holiday!</p>\r\n<p><strong>Size About:</strong>&nbsp;7.87x7.87x3.93 inches (20*20*10cm).</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Package:</strong></p>\r\n<p>1 PCS Reversible Octopus Plush Toy,<br /><br /></p>', 'Available', 'trending_product', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-10 08:18:00', '2021-06-10 08:18:00', NULL, NULL),
(21, 'Dog Tooth Brush', 16.00, 5.56, 10.44, 1841, '10235.96', 442536, '18-24,25-34,34-44', 1, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Dog Tooth Brush,Pet,Pet Accessories', 'Pet Accessories', '<p><strong>&nbsp;Let your dogs brush their own teeth &amp; freshen their own breath! 80% of dogs face oral health issues by the age of 3. Long-lasting and designed for small and big powerful chewers, Canine Care Toothbrush is the only 2-in-1 dog dental chew toy that lets dogs take control of their own dental health every day. Comes in two versions, 1) Blue Classic chew and 2) Green extreme chew.</strong></p>\r\n<h2><strong>Features:&nbsp;</strong></h2>\r\n<p><strong>Material:&nbsp;</strong><br />NEW &amp; IMPROVED design made with Natural Rubber with anti-microbial properties to make it more durable.</p>\r\n<p><strong>The fact is:</strong><br />4 out of 5 dogs suffer from oral diseases by the age of 3! Gingivitis is the most common disease among dogs, and it leads to painful inflammation, bad breath, and can lead to other life-threatening illnesses. Please don\'t wait until your dog has oral health problems when they are easily preventable with daily care.</p>\r\n<p><strong>To Add Pet Toothpaste:</strong><br />Locate the pet toothpaste hole at the top of the toothbrush. Firmly press the pet toothpaste nozzle onto the fill hole and squeeze. Pet Toothpaste will fill into the reservoir and dispense as dogs chew! Did you know that?</p>\r\n<p><strong>Size:<br /></strong>&nbsp;Available in Small/Medium, &amp; Large to comfortably accommodate all sizes and breeds of dog (check the photo below).</p>\r\n<p><strong>DID YOU KNOW?<br /></strong>According to the American Veterinary Medical Association, 83% of dogs have oral health problems by the age of 3. That&rsquo;s not surprising &mdash; gums and teeth are a breeding ground for bacteria. Over time, this can lead to bad breath, receding gums, significant pain, and tooth loss. But it gets worse.</p>\r\n<h3><strong>HOW TO USE:</strong></h3>\r\n<p><strong>The toothpaste groove -</strong> You can squeeze the pet toothpaste into the top hole.<br /><strong>The arrangement as arc 5 rows brushing points -</strong> The scientific design can clean dog\'s teeth in all directions.<br /><strong>High-</strong>Density undulating particles on sides: these particles can completely grind away the plaque, tartar, and calculus which are hard-to-reach.<br /><strong>Holding base in dog paw -</strong> This base can help the dog hold the toothbrush firmly. It allows you to place food such as dog food in the brushing to improve mouthfeel.</p>\r\n<h3><strong>SPECIFICATIONS:</strong></h3>\r\n<p><strong>Size: </strong>S, M, and L<br /><strong>Color: </strong>Green or Blue</p>\r\n<h4>PACKAGE CONTENTS:</h4>\r\n<p>1 X Dog ToothBrush&nbsp;</p>', 'Available', 'trending_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-10 08:27:45', '2021-06-10 08:27:45', NULL, NULL),
(22, 'Magnetic Sculpture', 33.00, 3.88, 28.00, 500, '1940.00', 336515, '18-24,25-34,34-44', 2, 'Baby', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Baby,Kids,Magnetic Sculpture', 'Baby & Kids', '<p><strong>These DIY magnetic sticks and balls can create amazing building blocks that are useful for your brain training and stress relief.</strong></p>\r\n<p><strong><br />FEATURES:</strong></p>\r\n<p>It is full of creativity, exquisiteness, brightness, glossiness, and combination that can make you enjoy your time.</p>\r\n<p>It can help adults relieve stress and fidget, kill the boring time and relax your mind, as well as develop patience, intelligence, and thinking skills.</p>\r\n<p>It frees up your imagination and stimulates your inspiration. You can instantiate your imagination and inspiration through this magnetic stick and ball, and enjoy the sense of achievement by creating a variety of artworks.</p>\r\n<p><strong><br />SPECIFICATION:<br /></strong></p>\r\n<p><strong>Material: </strong>Metal</p>\r\n<p><strong>Color: </strong>silver colors</p>\r\n<p><strong>Steel Ball Size:</strong> 8mm</p>\r\n<p><strong>Magnetic Stick Size: </strong>24mm*4mm</p>\r\n<p><strong><br />NOTE：</strong></p>\r\n<p>Exercise young people\'s spatial thinking imagination, hands-on ability</p>\r\n<p>Adults used to decompress and relax from the boredom</p>\r\n<p>Older people use to exercise finger flexibility</p>\r\n<p>Perfect Gift For The Family.</p>\r\n<p><strong><br />Package Contents:</strong></p>\r\n<p>36pcs Magnetic Sticks + 27pcs Silver Balls + Delicate packing box + Manual</p>\r\n<p>72pcs Magnetic Sticks + 48pcs Silver Balls + Delicate packing box + Manual</p>\r\n<p>108pcs Magnetic Sticks + 68pcs Silver Balls + Delicate packing box + Manual</p>', 'Available', 'untapped_product', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-10 08:31:24', '2021-06-10 08:31:24', NULL, NULL),
(23, 'Car Vacuum Cleaner', 54.00, 21.73, 32.27, 12886, '280012.78', 1405224, '18-24,25-34,34-44,45-54', 2, 'Men', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Car Vacuum Cleaner,Car,Car Accessories', 'Car Accessories', '<p><strong>Sometimes it can be difficult to reach those spots on our cars that are filled with dust and debris. It can be quite annoying to fully clean your car but still seeing dust and dirt appearing from somewhere. Now it is possible to completely clean your car with this Cordless Portable Vacuum Cleaner for Cars! Using its own built-in battery, you can easily reach any spot in your car without a cord!</strong></p>\r\n<h2><strong>Features:</strong></h2>\r\n<p><strong>Strong Suction Power:</strong> It can generate a strong suction power of 6000 Pa and with the help of a Wet and Dry Vacuum Cleaner, it can easily absorb liquids such as animal hair, confetti, soot, and milk to achieve a perfect cleaning effect. Used for carpets, tables, sofas, keyboards, workbenches, car seats, etc.<br /><strong>50% smaller than other car vacuums:</strong> Our cordless handheld vacuum cleaner has a size of 36.8 &times; 6.5 &times; 6.5 cm and an ultra-lightweight of 0.88lb. It is 50% lighter than other handheld vacuum cleaners and very easy to transport. You can store it conveniently anywhere in the house and in the car. The ergonomic matte handle enables one-handed operation and does not put pressure on your wrist even after prolonged use, making cleaning easier and more comfortable.<br /><strong>Tiny dust removal 99.99%: </strong>The hand vacuum cleaner is equipped with a high-density HEPA filter system, with which 99.99% of tiny allergens and dust can be easily collected. Has good filter and dust removal effects and is more durable than conventional filters. Its HEAP filter can also be dismantled and cleaned repeatedly, which significantly reduces the cost of consumables. Meet the daily cleaning needs of you and your family.<br /><strong>Suitable for any gap in the car and at home: </strong>The package contains 3 nozzle accessories. The splitting tool can clean up the garbage in the narrow gap. And the brush nozzle is used for animal/human hair. Can help you thoroughly clean sofas, walls, stairs, and other hard-to-reach areas of dust. The built-in 2x2000mAh can be fully charged in just 2-3 hours. The running time is 25-30 minutes, which is sufficient for a comprehensive cleaning of the home environment.</p>\r\n<h3><strong>Specifications:</strong></h3>\r\n<p><strong>Power: </strong>120W<br /><strong>Voltage: </strong>7.4V<br /><strong>Battery: </strong>2 x 2000mAh<br /><strong>Charging time: </strong>about 3 hours<br /><strong>Continuous use time: </strong>about 25 minutes<br /><strong>Maximum speed:</strong> 30000rpm<br /><strong>Maximum suction:</strong> 6000pa</p>\r\n<h4><strong>Package Includes:</strong></h4>\r\n<p>1Pc * Wireless Car Vacuum Cleaner Portable</p>', 'Available', 'untapped_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-10 08:43:56', '2021-06-10 08:43:56', NULL, NULL);
