(24, 'Piano Educative Musical Carpet', 37.00, 10.81, 26.05, 1351, '14604.31', 8460355, '18-24,25-34,34-44', 1, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Baby,Kids,Piano Educative Musical Carpet', 'Baby & Kids', '<p><strong>Sing, dance, or play to your heart\'s content Skip and hop on the colorful keys to make some music!</strong></p>\r\n<p><strong>With a full 5 feet of touch-sensitive keys and a selection of 8 different instrumental sounds, you can play almost any song you like - if your feet are fast enough!</strong></p>\r\n<p><strong><br />Feature:&nbsp;</strong></p>\r\n<p>&nbsp;<strong>BABY ACTIVITY MAT:&nbsp;<br /></strong>17 Piano touch keyboard and 8 animal sounds, adjustable volume, build-speaker. Shut down in 2 minutes automatically to save power. 3 music modes, animal sounds, piano sounds, toddler music, this music floor mat keeps your child in fun mode for hours and also helps them train themselves with music knowledge.&nbsp;</p>\r\n<p><strong>EASY TO USE &amp; PORTABLE KEYBOARD MUSIC MAT:&nbsp;<br /></strong>Adopting intelligent electronic chips, it will enter a state of energy saving automatically after idle 2 minutes. Powered by 3 AA batteries (not included), just install the batteries then turn them on to play. This kids dance mat is foldable and easy to carry, saving space, you can enjoy electronic music life with your kids outdoors or indoors.<br /><br /><strong>COMFORTABLE &amp; SOFT KIDS KEYBOARD MAT:</strong>&nbsp;<br />Kids piano mat is made of premium non-woven fabric and PVC polyester, mat for babies to play with is environmentally friendly and durable, soft, and non-toxic. High-quality fabrics do not hurt kids\' feet and it is easy to clean. If piano music is dirty, wipe clean with a wet cloth.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>EDUCATIONAL MUSICAL MATS TOY:<br /></strong>Crawl, jump, kick, dance, identify numbers and learn! The piano play mat introduces kids to discover numbers, learn about animal sounds, train music knowledge with tunes and melodies as they play with fun! Great to develop your child\'s musical interest, improve hand and feet coordination skills, fosters creativity, and promote exercise at early ages.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>GREAT GIFT PACKING:<br /></strong>Our music mat is a great child-playing toy that lets your child express him or herself with this original fun toy! Music helps with child development, brainpower, memory, confidence, patience, social and fosters creativity! It is the best gift for a boy and girl, birthday, festival. If you have any questions, please contact us.</p>\r\n<p><strong><br />Specifications:</strong></p>\r\n<p><strong>8 Instrumental Sounds:</strong> Clarinet, Saxophone, Flute, Accordion, Piano, Violin, Guitar, Vibraphone<br /><strong>Non-slip layer:</strong> so you can move freely!<br /><strong>Two Sizes:</strong> Medium (58 x 23 inches) and Large (51 x 18 inches)<br /><strong>Durable Build:</strong> made from high-quality toxin-free material so it\'s made to last through many dance sessions.&nbsp;Makes for the Perfect Gift.</p>\r\n<p><strong>Package Include:</strong></p>\r\n<p>1x box<strong><br /></strong>User manually<br />One product</p>', 'Available', 'trending_product', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-10 09:16:56', '2021-06-10 09:16:56', NULL, NULL),
(25, 'Diamond Drill Bit Set', 20.00, 7.39, 12.58, 6142, '45389.38', 1264645, '18-24,25-34,34-44', 1, 'Men,Baby', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Home Improvement,Diamond Drill Bit Set', 'Home & Gerden', '<p><strong>These diamond drill bits are made of industrial-grade carbon steel with a nickel-plated coated body to resist corrosion. A thick diamond coating on the tops offers superior cutting strength for maximum drilling outcomes. Each diamond hole saw has a smooth and exact finish that lowers the incision resistance and drill pressure, increases the sharpness, and effectiveness of water lubrication. Excellent for making clean and precise holes on glass or ceramic and considerably extending drill bit life.</strong></p>\r\n<p><strong><br />Features:</strong></p>\r\n<p><strong>Industrial grade carbon steel:<br /></strong>Industrial grade carbon steel with a nickel-plated coated body to resist corrosion. Fine workmanship and super wear-resistant, sharp</p>\r\n<p><strong>High Quality:<br /></strong>High-Quality Drill Each hole is treated with smooth and accurate surface treatment, and the top of the hole is thickened to achieve excellent cutting strength.</p>\r\n<p><strong>10 Drill Bits:<br /></strong>6mm/0.23\", 8mm/0.31\", 10mm/0.39\", 12mm/0.47\", 14mm/0.55\", 16mm/0.62\", 18mm/0.7\", 22mm/0.86\", 26mm/1.02\", 32mm/1.26\"</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Wide Usage:<br /></strong>Wide Usage Used on Drill Glass, Wood, Tile Bottles, Blocks Jars, Ceramic, Slate Marble, Granite Light Stone, and other hard surfaces.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Attention:<br /></strong>Please keep adding water when the diamond drill bits are working on the glass or ceramics. low drill pressure and increased use of water lubrication will extend drill bit life.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>SPECIFICATIONS:<br /><br />Material: </strong>High-quality steel, diamond dust coating<br /><strong>Color:</strong> Silver<br /><strong>Size:</strong> 3 - 50mm&nbsp;- 3mm, 4mm, 5mm, 6mm, 8mm, 10mm, 12mm, 18mm, 32cm, 50mm</p>\r\n<p><strong>PACKAGE INCLUDES:<br /><br /></strong>1x Diamond Drill Bit Pro Set (10pcs)</p>', 'Available', 'facebook_ads', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-10 09:38:55', '2021-06-10 09:38:55', NULL, NULL),
(26, 'Stainless Steel Labor', 25.00, 10.49, 14.51, 182, '1909.18', 883475, '18-24,25-34,34-44', 2, 'Men,Baby', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Home Improvement,Stainless Steel Labor', 'Home & Gerden', '<p><strong>With a lifting capacity of up to 330 lb / 150 kg, the range of applications is virtually unlimited. The installation of doors, windows, and cabinets are obvious uses, but flooring and the construction of porches, decks, and frameworks are also perfect opportunities to use this ingenious tool. All this and much more can easily be done with controlled precision thanks to the unique construction of the Viking Arm handheld jack.&nbsp;</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Features:</strong></p>\r\n<p><strong>Durable Material:<br /></strong>Made of strong and high-strength steel material, this tile high regulator is very durable and reliable.<br /><br /><strong>Ergonomic Handle:&nbsp;<br /></strong>The handle is with the curve design, it is a very comfortable, easy to operate, practical construction tool.</p>\r\n<p><strong>Practical Tool:<br /></strong>With this tool, tiles are pushed, not lifted, to provide better tile adhesion and increase the speed at which tiles are laid. Portable: It is lightweight and portable, convenient for use in construction work.</p>\r\n<p><strong>Portable:&nbsp;<br /></strong>It is lightweight and portable, convenient for use in construction work.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Specifications:</strong></p>\r\n<p>Hardened stainless steel / aluminum</p>\r\n<p><strong>Capacity:</strong> up to 100 kg = 260 lb</p>\r\n<p><strong>Operation range (mm):</strong> 6-215</p>\r\n<p><strong>Standard base (mm): </strong>5 x 105 x 87</p>\r\n<p><strong>Optional base (mm):</strong> 3 x 77 x 62</p>\r\n<p>Mounting holes for safe operations</p>\r\n<p><strong>Weight:</strong> 1,4 kg = 3,0 lb</p>\r\n<p>Extensively tested by FIMTECH (Norway)</p>\r\n<p><strong><br />Package includes:<br /></strong>1x Stainless Steel Labor-Saving Height Regulator</p>', 'Available', 'facebook_ads', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-10 09:58:29', '2021-06-10 09:58:29', NULL, NULL),
(27, 'Tiny Tuna', 22.00, 4.06, 17.94, 6111, '24810.66', 57797, '[\"18-24\",\"25-34\",\"34-44\",\"45-54\",\"55-64\"]', 1, '[\"Unisex\"]', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Pet Accessories,Tiny Tuna', '[\"Pet Accessories\"]', '<p><strong>Treat your cat with the 1 rated cat toy of the year! The TinyTuna&trade; is the world\'s first Fish Kicker toy that moves on its own. It kicks just like a REAL fish when touched and stops itself when left alone.</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Features:</strong></p>\r\n<p><strong>REALISTIC FISH SIMULATION:<br /></strong>The TinyTuna not only looks like a real fish, but it also acts like a real fish as well. It will flop when touched and stay still when left alone.</p>\r\n<p><strong>MOTION-BASED SENSOR:<br /></strong>The TinyTuna will adjust its flopping slower or faster according to the motion around it. If it detects that it\'s being played with, it\'ll flop faster. If it detects no motion, it\'ll slow down and eventually stop. Saving energy for a more enjoyable playtime!</p>\r\n<p><strong>BUILT-IN RECHARGEABLE BATTERY:<br /></strong>TinyTuna comes with a USB charger and a built-in battery that lasts for days after a full charge. This would be enough time to entertain your cat and relieve the stress throughout the day.</p>\r\n<p><strong>REFILLABLE CATNIP POUCH:<br /></strong>The TinyTuna comes with a Cat Safe Velcro Pocket making it Easy to Refill with Catnip Over and Over Again!&nbsp;</p>\r\n<p><strong>DURABLE &amp; PET-SAFE MATERIAL:<br /></strong>TinyTuna is made of high-quality materials, so you don\'t have to worry about the safety and durability of the toy being scratched or bitten by the cat.</p>\r\n<p><strong><br />Specification:</strong></p>\r\n<p><strong>Material:</strong> Cotton + Plush+ Catnip<br /><strong>Batter:</strong> 320mAh &amp;accept USB charging<br /><strong>Size:</strong> 27cm in LengthMaterial：Cotton + Plush+ Catnip<br /><strong>Battery:</strong> 320mAh &amp;accept USB charging<br /><strong>Size:</strong> 27cm in Length</p>\r\n<p><strong>Package Includes:</strong></p>\r\n<p>1x Cat Wagging Fish Plush Toy<br />USB cable</p>', 'Available', '[\"trending_product\"]', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-10 10:19:02', '2021-06-10 11:04:25', NULL, NULL),
(28, 'Easy Silicone Egg Poacher', 20.00, 1.61, 18.39, 1026, '1651.86', 724639, '18-24,25-34,34-44,45-54', 1, 'Women', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Easy Silicone Egg Poacher,Kitchen & household,Kitchen,Home', 'Home & Gerden', '<p><strong>During cooking. The poacher stands on the pan and in the boiling water. protects the egg from the tumbling action of water while conducting the heat to poach the egg. The egg is evenly cooked. You can watch and decide how you want the egg.</strong><br /><strong>An easy-to-pick hole is on every side of the product helps to remove the poacher from the water. The ring stander design makes it steady on any kitchen surface. Works well on a stovetop and it is also suitable for microwave use.</strong></p>\r\n<h2><strong>FEATURES:</strong></h2>\r\n<p>Food Grade Silicone material - FDA approved - BPA FREE<br />Universal size fits small, medium, large, and extra-large eggs<br />Flexible<br />Easy to clean</p>\r\n<h3><strong>SPECIFICATIONS:</strong></h3>\r\n<p><strong>Material: </strong>Food grade silicone<br /><strong>Size: </strong>9 cm x 6.5 cm (3.54 \"x 2.55\")</p>\r\n<h4><strong>Package Included:</strong></h4>\r\n<p>2*Boiled egg bowl</p>', 'Available', 'trending_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-10 10:37:31', '2021-06-10 10:37:31', NULL, NULL),
(29, 'Automatic air inflator', 61.00, 32.37, 28.63, 25, '809.25', 525823, '18-24,25-34,34-44,45-54,55-64', 2, 'Men', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Automatic air inflator,Car Accessories,Car', 'Car Accessories', '<p><strong>Say goodbye to going to the gas station last minute to use their flimsy air compressor that never works with the Universal Portable Electric Air Compressor for car and bike tires.</strong><br /><strong>Worrying about your tires during long drives? This is the perfect product for you! The Electric Portable Air Compressor for Tires is a portable air pump and has a digital inflator for the tire. It is portable and easy to use.</strong></p>\r\n<h2><strong>FEATURES :</strong></h2>\r\n<p><strong>INTEGRATED DESIGN:</strong> It has a compact and sleek design, portable, and easy to store.<br /><strong>ADJUSTABLE AIR PRESSURE: </strong>LCD digital pressure gauge with backlight has 3 optional units, you can preset tire pressure to what the tire needs and test the tire pressure at any time.<br /><strong>AUTO STOP:</strong> The air pump will automatically stop inflating when the inflation reaches the preset value to avoid over-inflating.<br /><strong>LED LIGHTS: </strong>Bright LED flashlight has 8 LED light beads that can be controlled by the independent switch to provide you with convenience for emergency lighting at night.</p>\r\n<h3><strong>SPECIFICATIONS:</strong></h3>\r\n<p><strong>Color: </strong>grey, silver (optional)<br /><strong>Type:</strong> with battery, without battery&nbsp; (Here is the battery)<br /><strong>Car power input: </strong>12V 3A<br /><strong>Input voltage: </strong>5V/2A<br /><strong>Working current: </strong>1-5A<br /><strong>Maximum current:</strong> &le;5A<br /><strong>No-load current:</strong> &le;2A<br /><strong>Emergency lighting: </strong>8 hours of 10 hours<br /><strong>Working temperature: </strong>-20 &deg; C ~ 70 &deg; C<br /><strong>Item size:</strong> 250 * 55 * 45mm / 9.8 * 2.2 * 2.2in<br /><strong>Item weight:</strong> 600g / 1.3lb<br /><strong>Package size:</strong> 280 * 75 * 75mm / 11.0 * 3.0 * 3.0in<br /><strong>Package weight: </strong>750g / 1.7lb</p>\r\n<h4><strong>PACKAGE LIST:</strong></h4>\r\n<p>1 * Tire Inflator.</p>', 'Available', 'trending_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-10 10:48:16', '2021-06-10 10:48:16', NULL, NULL),
(30, 'The coolest bubble machine', 26.00, 7.11, 18.89, 708, '5033.88', 5115724, '[\"18-24\",\"25-34\"]', 1, '[\"Baby\"]', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'The coolest bubble machine,Baby & Kids,Home,Gerden,Baby', '[\"Baby & Kids\",\"Home & Gerden\"]', '<p><strong>Treat the kiddos to a bubbly surprise with ArtCreativity&rsquo;s mega fun bubble gun set. Perfect for a multi-kid household or thrilling kids at any party.</strong></p>\r\n<h2><strong>FEATURES :</strong></h2>\r\n<p><strong>Bubble, Bubble, and Bubble- </strong>8 bubble holes design! Cool golden Gatling look! As long as you press the button, a lot of bubbles will be ejected from 8 holes, far more than other bubble guns. Bring you a different experience！ Just put in 3 AA batteries (not included)<br /><strong>Bubble Water Solution- </strong>Due to logistics problems, bubble liquid may need to be adjusted by yourself.<br /><strong>Method- </strong>Two parts detergent, six parts water, and 1-4 parts glycerin. Glycerin is a hygroscopic liquid. It forms a weak chemical bond with water, which can slow down the disappearance of bubbles.<br /><strong>Wide Application-</strong> Our bubble machine is very suitable for indoor and outdoor activities, and can also be used as a party, birthday, or anniversary gift. Whether you plan to host a party for your kids or celebrate their birthdays, our bubble guns are the highlight of the party.<br /><strong>Preferred Material- </strong>Made of the preferred ABS material, it is durable and has strong safety performance. Not cause harm to the human body. The bubble machine is suitable for children to play and entertain.<br /><strong>2-in-1 Use- </strong>This bubble machine can be used as a summer fan with the bubblehead removed. 2-in-1 use makes you happier with it!</p>\r\n<h3><strong>SPECIFICATIONS:</strong></h3>\r\n<p><strong>Color:</strong> black/gold<br /><strong>Size:</strong> 20cm x 9cm x 7cm<br /><strong>Weight: </strong>300g</p>\r\n<h4><strong>PACKAGE INCLUDES:</strong></h4>\r\n<p>1*Bubble machine<br />1*bubble plate</p>', 'Available', '[\"untapped_product\"]', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-10 11:10:34', '2021-06-10 11:11:44', NULL, NULL),
