 scrub the back and body parts for maximum comfort. This length is suitable for different people, elderly, men, women.</p>\r\n<p><strong>Easy to Carry:<br /></strong>The silicone back scrubber can be folded which you can use at home or on holiday, business trips, you can make a comfortable spa for your skin anytime, anywhere scrubbing your skin with our exfoliating brush to promote blood circulation, reduce stress, and revitalize your body.</p>\r\n<p><strong>Make Skin Healthier:<br /></strong>Removing oil and residue can help reduce acne breakouts, improve skin texture, and make skin healthier.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Specification:</strong></p>\r\n<p><strong>Product:</strong> Long Silicone Bath Brush/Scrubber<br /><strong>Material: </strong>Silicone<br /><strong>Product Size:</strong> (LxW)62x11cm</p>\r\n<p><strong><br />Package Includes:</strong></p>\r\n<p>1x Silicone Bath Body Brush</p>', 'Available', 'trending_product', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-12 04:36:29', '2021-06-12 04:36:29', NULL, NULL);
