(36, 'Glass Dispenser Holder', 29.90, 6.16, 23.74, 2043, '12584.88', 366867, '[\"18-24\",\"25-34\",\"34-44\"]', 2, '[\"Men\",\"Women\",\"Baby\"]', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Kitchen, household,Glass Dispenser Holder', '[\"Home & Gerden\"]', '<p><strong>Having some friends over that like to take shots? Looking to fill up multiple shot glasses at one time? This six-shot glass holder and carrier will allow you to easily fill up to six shot glasses at once with your favorite beverage of choice and then carry them, all in one!</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Features:</strong></p>\r\n<p><strong>How it works:&nbsp;<br /></strong>How it works: You place your shot glasses under what I can only describe to you as an udder. Then you pour your drink of choice into the top. It dispenses that liquid gold to all the shot glasses below and boom, you have shots for six almost instantly. It even includes a carrier, so you can simply lift it up and bring them over to your friends.</p>\r\n<p><strong>Materials:<br /></strong>PLA is a 3D printing plastic made from corn-starch or sugar cane. It is 100% biodegradable, and non-toxic. 3D printed products made with PLA are durable, strong, and useful items that hold up to life.</p>\r\n<p><strong>Liquor pourer for 6 glasses:<br /></strong>Place your shot glasses under what I can only describe to you as an udder. You pour your alcohol of choice into the top. Then it dispenses that liquid gold to all the shot glasses below and boom, you have shots for six almost instantly. It even includes a carrier, so you can simply lift it up and bring them over to your friends.</p>\r\n<p><strong>An - Amazing Cause:<br /></strong>We\'re thrilled to support Direct Relief - An amazing non-profit organization that sets out to improve the health and lives of people affected by poverty.</p>\r\n<p>If you don\'t have a positive experience for any reason, we will do whatever it takes to make sure you are 10