(37, 'Drago hawk Tattoo Rotary Pen', 159.00, 85.18, 73.82, 6, '511.08', 1612162, '18-24,25-34,34-44', 2, 'Men,Women,Baby', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Home Improvement,Drago hawk Tattoo Rotary Pen', 'Home Improvement', '<p><strong>Mast Tour tattoo machine is our brand smallest machine that could be bagged very easily. This tattoo machine is made for traveling and needs to be placed easily by tattoo artists. LED light working. This tattoo machine frame part is separate from the grip. Clean the tattoo machine frame easily. And the grip is autoclavable. A seamless frame that protects the inside of the machine.</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Features:</strong></p>\r\n<p><strong>Mast Tour Max Tattoo Pen Machine:<br /></strong>Mast Tour Max Tattoo Pen Machine has 32mm grip bigger than Mast Tour, same with Mast Tour Pro machine motor, This machine has custom Mast coreless Germany motor, strong power, light sound, suit for precise line work, black and grey shading, solid color packing. Gives a possibility to pack faster, more quality, and less trauma.</p>\r\n<p><strong>peoples usually:<br /></strong>This machine is a perfect tool for tattoo artists. The rotary tattoo pen advanced gear system that smooth, soft, and quiet operation, Ideal healing results. Flexible and lightweight for every style Gently and smoothly transfers ink to the skin; suitable for all skin types.</p>\r\n<p><strong>The Needles Depth:<br /></strong>0-4.0mm. Stroke Length: 3.6mm. This tattoo machine rotary compatible with all power supplies has a start-up function and wireless power battery. Effortless to cover and protect efficient cartridge change and replacement.</p>\r\n<p><strong><br />Specifications:</strong></p>\r\n<p><strong>Operating voltage: </strong>5-13 V DC<br /><strong>Power Input:</strong> 15 VA<br /><strong>Stitch Frequency:</strong> 55-165 Hz<br /><strong>Stroke:</strong> 3.5mm<br /><strong>Needle Protrusion:</strong> 0 - 4.5mm<br /><strong>Connection: </strong>3.5mm jack plug<br /><strong>Propulsion: </strong>Precision DC Motor<br /><strong>Operating Mode:</strong> Continuous Operation<br /><strong>Dimensions: </strong>Diameter 54.4 / Length 123mm<br /><strong>Weight:</strong> 130g</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Package includes:</strong></p>\r\n<p>1x Mast Tour Max Pen Machine|<br />2x Mast U1 Battery<br />1x 20pcs/pack Cartridges<br />1x Bandage (Color Random)</p>', 'Available', 'facebook_ads', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-12 05:01:52', '2021-06-12 05:01:52', NULL, NULL),
(38, 'Electric Hydraulic Floor Jack', 219.98, 72.00, 147.98, 62, '4464.00', 1259362, '18-24,25-34,34-44,45-54,55-64', 1, 'Men', 'United States, Canada, Australia, Japan, Netherlends, Europe, Singapur', 'Car Accessories,Car,Electric', 'Car Accessories', '<p>A 5T electro-hydraulic jack can be used with a 12V car power socket. It can lift the car in less than 1 minute, with a wrench you can quickly remove the screws and change the tire. The simple and compact design of the tool kit is easy to pack with the included plastic box for easy transportation and storage. Jacks can meet a variety of needs, and together they constitute a practical tool necessary for outdoor emergencies. The structure is safe and stable. The LED light on the jack can be used as a flashlight.</p>\r\n<p><strong>FEATURE:</strong></p>\r\n<p>-Compact equipment stored in the car for emergency roadside tire replacement and repair.</p>\r\n<p>-An impact wrench can be used to quickly remove the tire</p>\r\n<p>-The jack contains an air pump to inflate the tires.</p>\r\n<p>-With a plastic storage box, easy to transport and store.</p>\r\n<p>-The LED light on the jack can be used as a flashlight.</p>\r\n<p>-A button controller with a sufficiently long line can be plugged into the car\'s 12-volt power outlet.</p>\r\n<p>-5T maximum capacity, lifting range 15cm to 45cm.</p>\r\n<p>-With a stable and safe structure, when the machine exceeds the height limit, the machine will stop working.</p>\r\n<p><strong>SPECIFICATIONS:</strong></p>\r\n<p><strong>Input Voltage:</strong> 12V DC<br /><strong>Max Current: </strong>13A<br /><strong>Rated Power: </strong>150W&nbsp;<br /><strong>Max Loading: </strong>11000 lb (5.0T)&nbsp;<br /><strong>Lifting Height Range: </strong>6.1 in. -17.7 in. (155mm-450mm)&nbsp;<br /><strong>Power Cord Length: </strong>13.1 ft. (4m)</p>\r\n<p><strong>PACKAGE INCLUDES:</strong></p>\r\n<p>1 * Battery Clamp Connecting Cable<br />1 * Safety Hammer<br />2 * Fuses<br />1 * Power Cable (13.1 Feet Long)