(39, 'Iron Robot Table Lamp', 119.99, 63.75, 56.24, 171, '10901.25', 1130199, '18-24,25-34,34-44,45-54,55-64', 2, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Electronics,Iron Robot Table Lamp', 'Electronics', '<p><strong>Lighten up your home with the help of a lost, confused, and iron-piped friend. It is an antique piece that adds a vintage, industrial touch to any home. This eye-catching mysterious robot also doubles as a stunning decorative lamp, lighting up and beautifying your home at the same time. It looks wonderful while it\'s on and off. Amaze your family, friends, and guests every time they come over.</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Features:</strong></p>\r\n<p><strong>Retro robot design table light:<br /></strong>The cool and unique vintage iron table lamp design adds more personality to your room. Eye-catching home decor.</p>\r\n<p><strong>Iron water pipe desk lamp:<br /></strong>Made of high-quality iron, spinning, cutting, polishing, grinding, painting, hand-made color, and other processes made of fine workmanship.</p>\r\n<p><strong>Specifications:</strong>&nbsp;<br />Fit for e26/e27 base. Recommended maximum bulb power: 60w. (bulb is not included). Eye-catching home decor.</p>\r\n<p><strong>Easy to install:&nbsp;<br /></strong>All mounting hardware is included in the package, no additional assemble process, convenient and partial. The light design will add a fashionable look while complementing your room\'s decor.</p>\r\n<p><strong>A place to use:&nbsp;<br /></strong>Ideal for use over kitchen bedroom island and more.Wide used in indoor lighting including living room, bedroom, dining room, reading room, loft, basement, library, cafe, bar, and so on. Great decoration for your room!</p>\r\n<p><strong><br />Specifications:</strong></p>\r\n<p>Made of galvanized iron material with a smooth metallic finish. It\'s resistant to rust and corrosion.<br />Fit for e26/e27 base bulbs<br />Bulb is included<br />Re