(43, 'Foldable Car Roof Rack', 28.97, 12.51, 16.46, 45, '562.95', 557161, '18-24,25-34,34-44', 2, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Car Accessories,Foldable Car Roof Rack', 'Car Accessories', '<p><strong>With this Multifunction Foldable Car Roof Rack Step, it&rsquo;s now easier than ever to pack luggage on a roof rack, wash the top of your vehicle, or access your roof for repairs. The many uses of this car step hook make it the ideal tool for traveling, and a variety of outdoor activities. It provides a comfortable platform for both feet and allows for a balanced standing position. It keeps your feet from slipping off pegs, especially in muddy and wet conditions. The rubber coating helps to prevent scratches or damage to your vehicle.</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Features:</strong></p>\r\n<p><strong>Easy Access to Car Roof:<br /></strong>car door foot pedal made of aviation aluminum alloy. Support up to 500 pounds, great for packing luggage, Surfboard, or other bulky items on car roof rack without any struggle as to make full use of in-car space, compatible with most kinds of car, such as SUV, Jeep or RV, etc. Vehicle rooftop foot pedal, a very useful travel tool.</p>\r\n<p><strong>Safety Hammer Design:<br /></strong>Well executed and safety window breakage function to boot! This Car foot pedal hook can be folded up to serve as an escape tool, it provides you with a powerful tool for survival in case of emergency.</p>\r\n<p><strong>Foldable and Portable:<br /></strong>The car foot pedal hook is foldable and easy to store, with less space occupied, which enables you to bring it anywhere.</p>\r\n<p><strong>Non-slip Design and PVE Soft Rubber:<br /></strong>Frosted surface provides solid and secure support for you standing on a car foot pedal folding ladder. With environmental protection PVE soft rubber, make sure to tape it to the edge of the car foot pedal that touches your car to prevent paint scratching.</p>\r\n<p><strong>Easy to Install:<br /></strong>Innovative design, no drilling required, just hooked around the latch pin of your vehicle&rsquo;s door well. Dimension (5.9*3.9*3.9 inches) is big enough to fit for all sizes of feet, strong bearing capacity any person can reach the rooftop of the car by stepping on this folding ladder, even a big guy.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Specifications:</strong></p>\r\n<p><strong>Material:</strong> The best quality aluminum Alloy<br /><strong>Max Load:</strong> 400 pounds and more<br /><strong>Weight:</strong> 250g<br /><strong>Color:</strong> black</p>\r\n<p><strong><br />Package Content:</strong></p>\r\n<p>1x Pedal<br />1x Manual<br />2x EVA plastic strip&nbsp;<br />1x Elvet bag<br />1x Aircraft box (plastic strip thickness 0.5cm)</p>', 'Available', 'untapped_product', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-12 05:37:52', '2021-06-12 05:37:52', NULL, NULL),
(44, 'Submersible Led Pool Lights', 39.95, 3.79, 36.16, 2114, '8012.06', 366867, '18-24,25-34,34-44', 1, 'Men,Baby', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Home Improvement,Submersible Led Pool Lights', 'Home Improvement', '<p><strong>No magic spell or a magic wand is needed now to transform your earthly event into a celestial fantasy, just a push of a button, and here you go! Multitudes of heavenly fairies, bunched together start to fly around, sprinkling their mystic glow and surreal feel into your party venue, creating a pure whimsical mood of festivity.</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Features:</strong></p>\r\n<p><strong>Newest submersible lights with magnets and suction cups:<br /></strong>Ip68 waterproof submersible lights with strong magnets and suction cups.</p>\r\n<p><strong>Max 200ft/61m rf remote range:<br /></strong>Our underwater lights with rf remote have a further and deeper remote range to 200ft/61m in the air, 16.4ft/5m in water.</p>\r\n<p><strong>11 led, 20 hours long display, more bright more durable:<br /></strong>Our waterproof pond lights have 13 premium led beads, it&rsquo;s 3 times more bright and vivid than other submersible lights which only have 10 leads.</p>\r\n<p><strong>16 colors, multi-options, dimmable pool light underwater:<br /></strong>Optimized 16 dynamic colors, multiple modes(flash, fade, smooth), increased 4 timer buttons (2h, 4h, 6h, 24h).</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Specifications:</strong></p>\r\n<p><strong>Waterproof:</strong> (ip68 LEDs)<br /><strong>Light battery: </strong>3 x aaa batteries (not included)<br /><strong>Led source: </strong>13pcs SMD super bright led chips<br />16 different static colors.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Package:</strong></p>\r\n<p>1x submersible led pool lights</p>', 'Available', 'untapped_product', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-12 05:47:39', '2021-06-12 05:47:39', NULL, NULL),
(45, 'Cat Harness With Leash', 24.32, 4.50, 19.82, 1068, '4806.00', 3108684, '18-24,25-34,34-44,45-54,55-64', 2, 'Unisex', 'United States, Canada, Australia, Japan, Netherlends, Europe, Singapur', 'Cat Harness With Leash,Cat Harness,Car Accessories', 'Car Accessories', '<p>This Cat Harness Made of high-quality soft mesh fabric, comfortable and breathable. Even in summer, it can keep your cat cool. The traction rope is a reflective strip effect.&nbsp; This time is different for different cats. Some cats may not be affected by the leash, but some cats need several hours or even days to adapt to the existence of a leash. The cat harness can flexibly adjust the comfort according to the cat\'s bust size to prevent the kitten from escaping. The simple snap design allows you to quickly put on and take off when walking the dog outdoors.</p>\r\n<p>The walk-in harness allows your pet to practice walking, hiking, training, outdoor recreation, etc. You can take your cat to explore nature carefreely.</p>\r\n<p><strong>FEATURES:</strong></p>\r\n<p>-Escape Proof Cat Harness.<br />-Kitten Safety Harness.<br />-Comfortable and Safe.<br />-Quality Assurance Service.<br />-Night Reflection.<br />-Cat Harness with Leash.</p>\r\n<p><strong>SPECIFICATIONS</strong>:</p>\r\n<p><strong>Material: </strong>Deerskin velvet.<br /><strong>Feature: </strong>Reflective.<br /><strong>Type: </strong>Cats.</p>\r\n<p><strong>PACKAGE LIST:<br /></strong>1x Pet Harness.<br />1x Leash</p>', 'Available', 'untapped_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-12 05:49:26', '2021-06-12 05:49:26', NULL, NULL),
(46, 'Multifunction Sofa Armrest Organizer Couch', 19.79, 7.59, 12.20, 390, '2960.10', 405109, '18-24,25-34,34-44,45-54,55-64', 2, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Home Improvement,Multifunction Sofa Armrest Organizer Couch', 'Home Improvement', '<p><strong>TV remote control holder, caddy, organizer holds TV remote controls, DVD Cable Box and other remote controls, reading glasses, with 6 pockets has a snack and drink tray top on the top side. Has a metal bracket clamp on the underside that can be adjusted to make the remote control holder sit snugly on the sofa arm. Ideas for men, women, seniors, teens, teenagers, kids, and children.</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Features:</strong></p>\r\n<p><strong>Easy to clean:<br /></strong>Made of durable Oxford Fabric, easy to clean up, and hand washable.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Multifunction:<br /></strong>5 pockets(3 at the front, one at the back, one at the top） of the armrest organizer are designed for your necessities. It supports tea or coffee cup drinks or any favorite snacks, you don&rsquo;t need to look for remote controls every now and then, just put the things you need in this organizer.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Convenient collection:<br /></strong>Foldable and easy to remove so you can store the couch armrest organizer caddy if you don&rsquo;t use it permanently.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Keep clean:<br /></strong>The remote storage couch organizer can neatly hold your smart TV remote controller, air conditioner remote, glasses, magazines, etc, To keep our home tidy and clean.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Specifications：</strong></p>\r\n<p><strong>Material: </strong>Oxford cloth<br /><strong>Quantity: </strong>1 pc<br /><strong>Color:</strong> Coffee/Grey/Black<br /><strong>Hanging Size:</strong> 30*18*18cm/11.79*7.07*7.07inch<br /><strong>Net weight:</strong> 390g/13.76oz</p>\r\n<p><strong><br />Package includes: