(47, 'Koana-Adjustable Led Floor Lamp', 139.99, 104.27, 35.72, 68, '7090.36', 8525526, '18-24,25-34,34-44,45-54,55-64', 1, 'Women', 'United States, Canada, Australia, Japan, Netherlends, Europe, Singapur', 'Koana-Adjustable Led Floor Lamp,Koana-Adjustable Led,Adjustable Led  Lamp', 'Home Improvement', '<p>To feel lost in aesthetics was a tough order for decorative lamps until now. Kona\'s smooth LED lights bring an immersive atmosphere to any room you put them in. Pick from one of the 16M colors using the remote control and set a vivid or quiet tone by changing the brightness. In a minimalistic fashion, Kona is thin, elegant, and discrete. Instead of shining directly, Kona spreads its lights on the walls to create a smooth atmosphere, bringing emotions into colors all around your room!</p>\r\n<p><strong>FEATURES:</strong></p>\r\n<p>-Set a vivid vibe- Kona creates a smooth atmosphere by charging the walls with luminous lighting in any tone you want!</p>\r\n<p>-Complete color control- Create your own color using the remote control. Choose how bright and in which color your night is going to be!</p>\r\n<p>-Decorative innovation- Kona takes a minimalistic approach other colorful lights haven&rsquo;t reached yet and brought simple elegance to your home.</p>\r\n<p><strong>PRODUCT DETAILS:</strong></p>\r\n<p><strong>Style: </strong>Modern<br /><strong>Light Source:</strong> LED Bulbs<br /><strong>Shade Type: </strong>Aluminum<br /><strong>Technics: </strong>Painted<br /><strong>Features: </strong>Corner floor lamp<br /><strong>Voltage: </strong>90-260V<br /><strong>Item Type:</strong> Corner Floor Lamp<br /><strong>Power Source: </strong>AC<br /><strong>Warranty:</strong> 1 year<br /><strong>Number of light sources:</strong> 1<br /><strong>Lighting Area: </strong>3-5square meters<br /><strong>Wattage: </strong>16-20W<br /><strong>Model Number: </strong>1125<br /><strong>Shade Direction: </strong>Up &amp; Down<br /><strong>Application: </strong>Bed Room/ Living area<br /><s