(49, 'Pipe Cleaner', 75.00, 0.01, 74.99, 11453, '114.53', 1382140, '18-24,25-34,34-44', 1, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Home Improvement,Pipe Cleaner', 'Home Improvement', '<p><strong>Hair clogging a drain is one of the most difficult challenges to solve as hair easily tangles and builds up over time.&nbsp; With the Spring Pipe Dredging Tool, you no longer have to worry about fixing a clogged pipe in your home. This is the easiest and fastest way of unclogging your drain without breaking your budget! Prevent clogs for good without too much expense! No need for any plumber or any other methods with our Spring Pipe Dredging Tool. Remove any clogs and debris easily.</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Features:</strong></p>\r\n<p><strong>Super flexible:&nbsp;<br /></strong>With flexible and bendable spring cable on the top and retractable claws on the bottom, the cleaner can grip any blockage tightly.</p>\r\n<p><strong>65cm long:<br /></strong>long enough to really go deep into the drain, remove any clog and debris, and flow the drain smoothly.</p>\r\n<p><strong>Harmless to drain:<br /></strong>powerful but not harmful to your drains, unlike toxic chemical drain cleaners.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Universal:<br /></strong>perfect for kitchen, bathroom, toilet, utility sinks, bathtubs, and shower drain cleaning, especially any narrow place and gap that is hard to reach.</p>\r\n<p>Just slide down the drain as far as possible, press the top of the handle, then pull it out, clean it and use it again. Produced in good ductility, toughness, and durability.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Specifications:</strong></p>\r\n<p><strong>Name: </strong>Pipe Cleaner<br /><strong>Material:</strong> PP + wire<br /><strong>Features:</strong> Good toughness, easy to bend, easy to use, useful, durable, home cleaning tool, hair catcher</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Package Includes:</strong></p>\r\n<p>2x Pipe Cleaners</p>\r\n<p>&nbsp;</p>', 'Available', 'facebook_ads', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-12 06:16:24', '2021-06-12 06:16:24', NULL, NULL),
(50, 'Electric Wine Opener', 30.36, 14.96, 15.40, 4754, '71119.84', 142757, '18-24,25-34,34-44,45-54,55-64', 2, 'Men', 'United States, Canada, Australia, Japan, Netherlends, Europe, Singapur', 'Electronice,Electric Wine,Electric Wine Opener', 'Electronics', '<p>Automatic Bottle Opener for Red Wine Foil Cutter Electric Red Wine Openers Jar Opener Kitchen Accessories Gadgets Bottle Opener.</p>\r\n<p><strong>FEATURES:</strong></p>\r\n<p>-Shining color and fashion appearance, for parties, weddings, and home use.</p>\r\n<p>-Open the wine in 6 - 8 seconds.</p>\r\n<p>-Compatible with rechargeable battery and 4*AA alkaline battery ( not included ).</p>\r\n<p>-Transparent corkscrew cover to watch the stopper out.</p>\r\n<p>-Food-grade screw, safe and durable.</p>\r\n<p>-Easy operating buttons to push and pull the cork.</p>\r\n<p>-Aluminum alloy housing and ABS transparent screw cover.</p>\r\n<p>-Less than 75dB low working noise.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>SPECIFICATIONS:</strong></p>\r\n<p>Power: 5W</p>\r\n<p>Rated voltage: 6V</p>\r\n<p>Material: ABS&nbsp;</p>\r\n<p>Size: 23*5cm</p>\r\n<p>Color: Black/Red</p>\r\n<p>&nbsp;</p>\r\n<p><strong>PACKAGE LIST:</strong></p>\r\n<p>1x Electric Wine Opener,<br />1 x Foil Cutter,<br />1 x English User Manual.<br /><br /></p>', 'Available', 'trending_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-12 06:20:48', '2021-06-12 06:20:48', NULL, NULL),
(51, 'Depilatory Laser Indolora Ipl', 82.99, 36.70, 46.29, 3709, '136120.30', 702194, '18-24,25-34,34-44', 1, 'Men,Women,Baby', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Health,Beauty,Depilatory Laser Indolora Ipl', 'Health & Beauty', '<p><strong>Grab your discounted laser epilator permanent Ipl hair removal painless electric while the store launch discount is on. Once we reach 300-unit sales, this is absolutely a great gift!</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Features:</strong></p>\r\n<p><strong>Permanent hair removal system:<br /></strong>Upgrade hair removal is using Ipl(intense pulsed light) technology, designed to help break the cycle of hair growth by targeting the hair root or follicle to help you achieve permanent hair removal and smooth skin. Due to the way of Ipl technology itself works, please note that it cannot be used on white, grey, blonde, or red hair and is not suitable for dark brown and darkest skin.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>5 setting light intensive &amp; 2 flash modes:<br /></strong>This Ipl hair removal has 5 adjustable energy levels and 2 modes to accommodate different skin sensitivities and treatment areas. Auto mode is suitable for large treatment areas, like leg, back, arm; manual mode is used for sensitive or smaller areas, like bikini lines, upper lip, and armpit.2-button design, easy to use and adjust energy levels and modes. And the large LCD display, you can clearly control the state when operating.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Upgraded 999,000 flashes ,safe &amp; economic:<br /></strong>Ipl hair removal device is with 999,000 flashes, enough to use 20-30 years. Twice longer usage than 500,000 flashes devices on the market. You can share it with the whole family and friends. Clinically proven, the Ipl hair removal system is 100% safe to use at home for women and men. You can get a beauty salon-level hair removal effect at home, and spend less money.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Painless &amp; faster treatments &amp; efficient:<br /></strong>In a large number of clinical conducted, the Ipl device can be used on both facial &amp; full-body, one treatment takes around 30 mins, and when energy is set to the most comfortable level, no woman rated the experience as painful. After 8-12 weeks, more than 90% of hair grows slowly and overall reduction.（ *note: the effect of hair removal varies with different hair colors and skin tones. Please be patient.）</p>\r\n<p>&nbsp;</p>\r\n<p><strong>No extra costs:<br /></strong>His hair removal device is equipped with razors and protective goggles. No additional purchase.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Specification:</strong></p>\r\n<p><strong>Origin:</strong> CN(origin)<br /><strong>Power type:</strong> electric<br /><strong>Material:</strong> quartz tube<br /><strong>Size:</strong> 900000 flashes<br /><strong>Model number:</strong> epilator<br /><strong>Use:</strong> bikini<br /><strong>Use:</strong> body<br /><strong>Use:</strong> face<br /><strong>Use:</strong> underarm<br /><strong>Levels of power: </strong>1-8 levels<br /><strong>Main function:</strong> hair removal<br /><strong>Additional function: </strong>skin rejuvenation /acne reduce<br /><strong>Wavelength:</strong> 470-1200mn<br /><strong>Energy: </strong>1.5-3.9j/cm2</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Package:</strong></p>\r\n<p>1x box</p>\r\n<p>&nbsp;</p>', 'Available', 'facebook_ads', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-12 06:29:03', '2021-06-12 06:29:03', NULL, NULL);
