(53, 'Clean Oral Ultrasonic Tooth Cleaner', 29.90, 8.63, 21.27, 2286, '19728.18', 688798, '[\"18-24\",\"25-34\",\"34-44\"]', 2, '[\"Unisex\"]', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Health ,Beauty,Clean Oral Ultrasonic Tooth Cleaner', '[\"Health & Beauty\"]', '<p><strong>Get a beautiful shining smile with our ultrasonic tooth cleaner easily and without going to the dentist. When plaque builds up over time it turns into tartar (calculus) requiring an expensive trip to the dentist, our device uses high-frequency vibration technology to remove plaque and tartar pain-free so you can save money on dentist visits.</strong></p>\r\n<p><strong><br />Features:</strong></p>\r\n<p><strong>Dental care with healthier gums:<br /></strong>Clean oral ultrasonic tooth cleaner can effectively separate dental plaque, dental calculus, and stains, removing hard tartar easily from the teeth preventing gum disease.</p>\r\n<p><strong>USB rechargeable:<br /></strong>The safe and fast charging way by USB. Charging once can be used about 200 times, traveling without worrying about power loss.</p>\r\n<p><strong>More flexible and safer for use:<br /></strong>5 grades of adjustable frequency to remove stubborn calculus, tartar, and teeth stain. Automatic outage after fully charged, auto-protective, and energy saving.</p>\r\n<p><strong>Using only the safest materials:<br /></strong>Food-grade silicone/pc/abs/304 stainless steel head, ipx6 level waterproof security system, and rechargeable ensure security and convenience ultrasonic electric tooth cleaner.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Portable design:<br /></strong>Electric dental calculus remover is convenient to have dental care at home, removing the attachment on teeth in time. The low-cost solution in comparison to the dentist and ideal to keep it handy in the bathroom or to take with you when you travel.</p>\r\n<p><strong>New vibration technology:<br /></strong>Ultrasonic technology, 12000 times per minute high-intensity frequency, effectively smashes the stubborn calculus, reducing the damages to the enamel and gum, which may be caused by manual dental tools.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Specification:</strong></p>\r\n<p><strong>Brand name:</strong> msg<br /><strong>Commodity quality certification:</strong> 3c<br /><strong>Commodity quality certification:</strong> CE<br /><strong>Size: </strong>190*30.5*20.5mm<br /><strong>Material:</strong> plastic + metal<br /><strong>Item type:</strong> electric toothbrush<br /><strong>Model number:</strong> portable electric sonic dental scaler<br /><strong>Age group: </strong>adults<br /><strong>Quantity:</strong> 1<br /><strong>Type:</strong> acoustic wave</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Package:</strong></p>\r\n<p>1x USB rechargeable<br />1x English box pack</p>', 'Available', '[\"trending_product\"]', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-12 06:41:12', '2021-06-12 06:42:10', NULL, NULL),
(54, 'Baby Bath Mat', 37.55, 12.58, 24.97, 19, '239.02', 2315374, '18-24,25-34,34-44,45-54,55-64', 2, 'Unisex', 'United States, Canada, Australia, Japan, Netherlends, Europe, Singapur', 'Baby and Kids,Baby Bath Mat,Baby  Mat', 'Baby & Kids', '<p>This Newborn Cushion Bath Support is excellent! For comfort and safe baby bathing, the anti-slide baby bath cushion fits all bathtubs and is suitable for babies from 0-1-year-old. The baby bath support is designed especially to help the baby feel comfortable in bath time. The soft, cushioned center gives your baby a &lsquo;skin to skin&rsquo; sensation that they won&rsquo;t feel against the hard material. Make bath time a pleasant, snug, and safe experience for you and your baby with the baby bath foam cushion. Easy to store and transport, ideal to travel: light, washable, and easy to dry, you can use the baby bath support right from birth.</p>\r\n<p><strong>FEATURES :</strong></p>\r\n<p>*A three-way buckle seat belt can firmly hold the floating pad to prevent drowning.</p>\r\n<p>*Skin-friendly material, nest mesh cloth, styrofoam particles, the baby is very safe to use.</p>\r\n<p>*EPS foam plastic closed-cell structure contains gas, which can provide strong buoyancy Baby lying down without sinking.</p>\r\n<p>*No angular design, imitating mother\'s warm uterus, comfortable wrapping, not crying.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>SPECIFICATIONS:</strong></p>\r\n<p><strong>Material: </strong>Cotton&nbsp;<br /><strong>Ammonia fabric: </strong>Sandwich mesh cloth<br /><strong>Filler: S</strong>tyrofoam EPS Particles<br /><strong>Size 1: </strong>56cm*40cm&nbsp;<br /><strong>Size 2: </strong>63*31*48CM<br /><strong>Color: </strong>Pink Blue Green<br /><strong>Age: </strong>0-1 years old</p>\r\n<p>&nbsp;</p>\r\n<p><strong>PACKAGE LIST:</strong><br />1* Baby Bath Mat(bathtub not included).</p>\r\n<p>&nbsp;</p>', 'Available', 'facebook_ads', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-12 06:45:56', '2021-06-12 06:45:56', NULL, NULL),
(55, 'Teeth Whitening Kit', 24.99, 0.01, 24.98, 3002, '30.02', 484032, '18-24,25-34,34-44', 1, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Health ,Beauty,Teeth Whitening Kit', 'Health & Beauty', '<p><strong>Our new revolutionary teeth whitening light uses light technology to help you achieve faster, longer-lasting results.</strong></p>\r\n<p><strong>The teeth whitening light illuminates a brilliant blue light as it gently warms up. It rapidly removes surface stains and also penetrates deep to lift out embedded stains.</strong></p>\r\n<p><strong>Your teeth can be white by tonight - and use as often as needed to get the results you want!</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Features:</strong></p>\r\n<p><strong>Professional whitening results:<br /></strong>With our special led light and premium formula, in as little as 7 days with just 30 minutes of treatment each day, you can experience a professional brighter and whiter smile that you\'ve been looking for, clearing up stains from coffee, tea, smoking cigarettes, aging, wine, and more.</p>\r\n<p><strong>Fast &amp; effective:<br /></strong>Brighten your teeth in just 7-10 days. The led light, that comes with this kit, boosts the power of the carbamide peroxide gel included so you can get a perfect smile even more quickly.</p>\r\n<p><strong>For sensitive teeth:<br /></strong>Our formula is made keeping in mind those with sensitive teeth. The whitening gel is gentle enough for gums and enamel, but still strong to get rid of dark stains. If you have sensitive teeth, don\'t let that stop you from whitening your teeth.</p>\r\n<p><strong>Comfortable fit:<br /></strong>The mouth tray is a universal fit. You even have the option to use this kit without the tray. Just simply apply the gel directly to your teeth with a cotton swab. Then insert the light in your mouth. So you can be sure to have a comfortable whitening experience.</p>\r\n<p><strong>Important:<br /></strong>Teeth whitening light works best when used along with the bright white smile pen. It activates the ingredients within the bright white smile pen and leaves you with a beautiful smile you\'ll be proud to show off!&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Specification:</strong></p>\r\n<p>5x led light-activated whitening technology</p>\r\n<p><strong>Removes stains:</strong> wine, coffee, soda, &amp; smoking</p>\r\n<p>Patented comfort mouth tray</p>\r\n<p>Results visible after only one treatment</p>\r\n<p>Manufactured in FDA registered facility</p>\r\n<p>100% customer satisfaction guarantee</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Package includes:</strong></p>\r\n<p>Activation light (batteries included)</p>\r\n<p>3ml whitening gel syringes (mint flavored)</p>\r\n<p>Desensitizing gel</p>\r\n<p>Mouth tray</p>\r\n<p>User manual</p>', 'Available', 'trending_product', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-12 06:50:43', '2021-06-12 06:50:43', NULL, NULL),
(56, 'Adjustable Foldable Non-slip Laptop Stand', 39.99, 9.09, 30.90, 1729, '15716.61', 271175, '18-24,25-34,34-44', 2, 'Men', 'United States, Canada, Australia, Japan, Netherlends, Europe, Singapur', 'Computer Accessories,slip Laptop Stand,Adjustable Foldable Non-slip Laptop Stand', 'Computer Accessories', '<p>Whether at home or in the office, make your workday more comfortable with the LappyLite Adjustable Laptop stand that effortlessly adjusts to suit your desired set-up. Boost your productivity with our LappyLite Foldable &amp; Portable Laptop Stand for desks which allows a comfortable work setting wherever you are. The genius design makes this laptop stand, light, portable, and a real game-changer. Easy to raise your laptop height to get the most comfortable viewing position to prevent back and neck pain.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>FEATURES :</strong></p>\r\n<p>*Function: Raises screen to eye level, helps improve posture over long hours of working at your computer.</p>\r\n<p>*Wide compatibility: Universal fit for most laptops, suitable for almost all PC models</p>\r\n<p>*Height adjustable: Adjustable laptop stand offers from 100mm to 160mm of lift, with height adjustment, you raise screen height to eye level for comfort and protection from injury.</p>\r\n<p>*Stable and durable: Made of reinforced material, durable and long-lasting.</p>\r\n<p>*Compact and foldable: A compact and light design is also collapsible, making this laptop stand ideal for business trips and corporate presentations.</p>\r\n<p>*Good gift: An inspiring and practical gift for designers and any laptop user.</p>\r\n<p>*Non-slip and stable: The laptop stand has a silicone pad, non-slip, firmly holding your device.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>SPECIFICATIONS:</strong></p>\r\n<p><strong>Material:</strong> Premium Aluminum<br /><strong>Support:</strong> Up to 15.6&rdquo; Laptop/Tablet<br /><strong>Loading Capacity</strong>: Up to 25 lbs weight support<br /><strong>Angle Adjustable:</strong> 15-45 Degree<br /><strong>Product Open Size: </strong>24.7 (L) x 18 (W) x 15 (H) cm<br /><strong>Product Fold Size:</strong> 24.7 (L) x 4.8 (W) x 0.8 (H) cm<br /><strong>Product Weight: </strong>200g</p>\r\n<p>&nbsp;</p>\r\n<p><strong>PACKAGE CONTENTS:</strong></p>\r\n<p>Foldable Laptop Stand &times; 1</p>\r\n<p>&nbsp;</p>', 'Available', 'facebook_ads', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-12 06:59:24', '2021-06-12 06:59:24', NULL, NULL),
(57, 'Body Slimming Massager', 56.65, 22.08, 34.57, 1799, '39721.92', 9655325, '[\"18-24\",\"25-34\",\"34-44\"]', 1, '[\"Men\",\"Women\",\"Baby\"]', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Health ,Beauty,Body Slimming Massager', '[\"Health & Beauty\"]', '<p><strong>This product is a beauty device that can be used for body, arms, and legs slimming, skin tightening, lymphatic drainage, detox. 5 functions include through EMS bionic current to remove extra fat at the waist and abdomen, arms, hip, and legs, ultrasonic whitening function to promote metabolism and excrete the melanin that accumulated in the skin, ultrasonic lead-in function to make the skincare products penetrate into the skin, which can benefit for absorption of nutrition, to promote blood circulation for tightening skin, and infrared function to eliminate body injures and activate histiocytes to prevent aging. So, what are you waiting for? Don&rsquo;t miss such a good chance.</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Features:</strong></p>\r\n<p><strong>How Amazing of this Multifunctional Fat Burn Machine?<br /></strong>Ultrasonic Cavitation includes 3 functions to help you burn fat, massage relaxes, firming skin. Not only can be used for body shaping but also can be used for face care, reduce double chin. You can enjoy your own beauty salon at home!</p>\r\n<p><strong>Fat Remover Machine:<br /></strong>Fat Remover Machine has 5 modes: tapping, massage, knead, scrapping, slim to relax, and exercise to reach body shaping. There is 5 intensity selection, Skin Tightening Massager can be used on the waist, hips, thighs, calves, and so on. Deep into the base of skin to promote fat burning in the body, accelerate circulation.</p>\r\n<p><strong>Body Slim Machine:<br /></strong>Body Slim Machine enhances skin texture, anti-wrinkle, helps fight fatty areas, and tightens. Quickly and effectively reduce and give relief from severe chronic back pains, other sorts of body aches. Burn Fat Machine is used in the body to reduce the swelling, helping to lift and tighten the skin, thinning the legs of the hip of the abdomen of the arm. Suitable for all skin types.</p>\r\n<p>This fȧt removėr mȧchine can NOT get ḣot and feel physicȧl vibrȧtion.</p>\r\n<p>The body shȧping massȧger will shut down automatically after 10 minutes;</p>\r\n<p>The fat-burning machine also can enhance your blood circulation and metabolism;</p>\r\n<p><strong>Performance:</strong></p>\r\n<p>Good performance and the heat loss of the part is low.</p>\r\n<p>Effective ultrasonic facial and body beautifying massager.</p>\r\n<p>EMS treatment for skin and body slimming. Skin rejuvenation infrared heat therapy device.</p>\r\n<p>Enhance skin texture, anti-wrinkle, helps fight fatty areas, tightens.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Specifications:</strong></p>\r\n<p><strong>Material:</strong> Metal<br /><strong>Power Source:</strong> Electric<br /><strong>Type:</strong> Face Washing Brush<br /><strong>Function:</strong> Skin Rejuvenation<br /><strong>Material:</strong> ABS + Stainless Steel<br /><strong>Length:</strong> approx. 19cm / 7.5inch<br /><strong>Type:</strong> Ultrasonic Massager</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Package Include:</strong></p>\r\n<p>1x Massager<br />1x set Electrode contact pad<br />1x Power Adapter<br />1x User Manual<br />1xPackage Box<br />Cannot ship to PO boxes.</p>', 'Available', '[\"facebook_ads\"]', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-12 07:03:02', '2021-06-12 07:07:25', NULL, NULL),
(58, 'Glasses', 59.95, 13.63, 46.32, 665, '9063.95', 797061, '18-24,25-34,34-44', 1, 'Unisex', 'United States, Canada, Australia, Japan, Netherlends, Europe, Singapur', 'Women\'s Fashion,Glasses', 'Women\'s Fashion', '<p>The revolutionary new sunglasses with built-in ActiveDim Technology. These unique lenses respond to changing lighting conditions almost instantly! Lenses automatically darken on bright light and lighten on low light. This effect is achieved by the photochromic lenses in our glasses.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>FEATURES :</strong></p>\r\n<p>**Photochromic: The lenses can change their color automatically under different weather conditions. The stronger the outdoor sunlight is, the darker the sunglasses will be.</p>\r\n<p>**UV400: The lenses can also block 100% harmful rays to better protect your eyes.</p>\r\n<p>**Polarized: Sunglasses are specialized eyewear designed to reduce glare from surfaces such as water, snow, and glass. Glare distorts the true color of objects and makes them harder to distinguish.</p>\r\n<p>**High Definition: Guarantees a clear vision at nights, sunny days, and cloudy days.</p>\r\n<p>**Indestructible Frame: Ultralight magnesium-aluminum frame, extreme durability while remaining stylish.</p>\r\n<p>**Comfortable to wear: Adjustable arms and silicone nose pads to fit all faces. Environmentally friendly material prevents allergy and gives you a comfortable wearing experience.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>SPECIFICATIONS:</strong></p>\r\n<p>Eyewear Type: Sunglasses;</p>\r\n<p>Item Type: Eyewear;</p>\r\n<p>Style: Semi-Rimless;</p>\r\n<p>Lenses Optical Attribute: Polarized;</p>\r\n<p>Lenses Optical Attribute: Photochromic;</p>\r\n<p>Lenses Optical Attribute: Anti-Reflective;</p>\r\n<p>Lenses Optical Attribute: UV400;</p>\r\n<p>Frame Material: Alloy;</p>\r\n<p>Gender: Men;</p>\r\n<p>Department Name: Adult;</p>\r\n<p>Lenses Material: Polaroid;</p>\r\n<p>Lens Height: 38mm;</p>\r\n<p>Lens Width: 68mm;</p>\r\n<p>Model Number: BS8177-D;</p>\r\n<p>Brand Name: LA VIE;</p>\r\n<p>Gender: Men,women sunglasses retro fashion;</p>\r\n<p>Intensity: TAC Polarized Photochromic;</p>\r\n<p>Lens color: grey Anti-Glare drivers sunglasses for men;</p>\r\n<p>Frame color: black grey brown silver;</p>\r\n<p>Lens: Polarized, Anti-Ultraviolet, Photochromic;</p>\r\n<p>Frame: aluminum-magnesium alloy Fashion Vintage Retro Style Sunglasses;</p>\r\n<p>Style: Driving, Party, Travel, Fishing, Outdoor activities Sunglasses;</p>\r\n<p>Lens material: TAC driving glasses transition lenses;</p>\r\n<p>Frame material: plastic night vision driver polarized sunglasses;</p>\r\n<p>Suitable for: Adult glasses for a driver driving fishing;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>PACKAGE LIST:</strong><br />1* Glasses Box</p>', 'Available', 'trending_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-12 07:13:30', '2021-06-12 07:13:30', NULL, NULL),
(59, 'Bark Remote Ultrasonic Harmless Anti-Barking Device', 12.97, 4.11, 8.86, 2600, '10686.00', 432972, '18-24,25-34,34-44', 1, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Pet Accessories,Bark Remote Ultrasonic Harmless Anti-Barking Device', 'Pet Accessories', '<p><strong>Dogs are indeed man&rsquo;s best friends, but sometimes they can get a bit territorial, start barking, and may even bite you. According to the center for disease and control, there are about 4.7 million dog bites every year in the u.S. The barkremote&trade; ultrasonic harmless anti-barking device is the single most effective and humane way possible solution to avoid these gruesome encounters. It works by emitting ultrasonic sound waves that only animals can hear.</strong></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Features:</strong></p>\r\n<p><strong>100% no-shock:<br /></strong>Unlike other solutions that shock our beloved furry friends, this emits ultrasonic shockwaves to stop dogs from barking and attacking you.</p>\r\n<p><strong>Protects you from wild dogs:<br /></strong>When canine dogs get territorial, it is innate to them to attack humans because they are not used to them. Our bark remote ultrasonic harmless anti-barking device drives away wild dogs and works as far as 50 ft. Away!</p>\r\n<p><strong>Corrects unwanted barking:<br /></strong>It works by producing a high-pitch sound that only dogs can hear. The sound distracts your furry friends and stops them from barking whether at home or on the go.</p>\r\n<p><strong>Perfect device for training your dogs:<br /></strong>Some dog trainers use our device to replace shock-collars for training. It has been reported to be twice as effective as using the harmful dog collar.</p>\r\n<p><strong>Portable &amp; easy to use:<br /></strong>The bark remote is a lightweight and portable handheld device that is great at home or on the go. It also comes with an adjustable wrist strap.</p>\r\n<p><strong>Safe and effective:&nbsp;<br /></strong>All of our pet products are carefully developed and tested by professional trainers to ensure safe and effective results. We have also tested it with most dog breeds and we are astounded by its success.</p>\r\n<p><strong>To stop/calm barking dogs:<br /></strong>Shift the gear to the dog repelling mode then press the beam button for 2 to 3 seconds.&nbsp;</p>\r\n<p><strong>To train dogs:<br /></strong>Give a verbal command. Shift the gear to dog training mode then press the beam button for 2 to 3 seconds.</p>\r\n<p><strong>To use the flashlight:</strong> <br />Shift the gear to lighting mode then keep pressing the beam button until it lights.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Specifications:&nbsp;</strong></p>\r\n<p><strong>Range: </strong>15ft<br /><strong>Frequency:</strong> 25 khz<br /><strong>&nbsp;Sound pressure:</strong> 130d<br /><strong>&nbsp;Battery: </strong>9 v battery (not included)<br />&nbsp;<strong>Size:</strong> 13 x 4 x 2.6cm</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Package includes:</strong></p>\r\n<p>1x bark remote ultrasonic harmless anti-barking device</p>', 'Available', 'facebook_ads', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-12 07:17:00', '2021-06-12 07:17:00', NULL, NULL),
(60, 'Orthel Semele\'s Orthopédiques Paired', 21.78, 2.12, 19.66, 171, '362.52', 9743824, '18-24,25-34,34-44', 2, 'Men,Women,Baby', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Home Improvement,Orthel Semele\'s Orthopédiques Paired', 'Home Improvement', '<p><strong>Orthopedic shoes are worn by people of all ages who suffer from poor foot mechanics because they are specifically designed to support the foot, ankle, and foot structure and mechanics.</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Features:</strong></p>\r\n<p>Soft, comfortable, shock absorption, suitable for sports shoes.</p>\r\n<p>The insole can be cut to fit your shoes most.</p>\r\n<p>Healthy insoles, healthy sports, healthy life.</p>\r\n<p>Specifically for people who suffer pain from plantar fasciitis in the heel.</p>\r\n<p>They have shock guard technology to provide immediate and all-day relief of pain from plantar fasciitis and can help reduce morning pain from plantar fasciitis.</p>\r\n<p>The orthopedic shoe pad is a prescription medical device that you wear inside your shoes to correct biomechanical foot issues such as problems with how you walk, stand, or run.</p>\r\n<p><strong><br />Specifications:</strong></p>\r\n<p><strong>Product: </strong>sport shoe pad.<br /><strong>Gender: </strong>unisex.<br /><strong>Material:</strong> silicone.<br /><strong>Color:</strong> as the picture shows.<br /><strong>Men size(250~280):</strong> suitable for eu 40-46 us 7-12 uk 6-11.<br /><strong>Women size(225~250):</strong> suitable for EU 35-40 us 4.5-8.5 UK 2-6.&nbsp;<br /><strong>Condition:</strong> 100% brand new.</p>\r\n<p><strong><br />Package included:</strong></p>\r\n<p>1x pair of shoe pads</p>', 'Available', 'trending_product', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-12 07:25:05', '2021-06-12 07:25:05', NULL, NULL),
(61, 'Little Lens Kids Digital Camera', 38.50, 3.60, 34.90, 111, '399.60', 1018567, '18-24,25-34,34-44', 2, 'Baby', 'United States, Canada, Australia, Japan, Netherlends, Europe, Singapur', 'Kids,Baby,Baby & Kids', 'Baby & Kids', '<p>Super mini size, suitable for children\'s small hands. Lovely cartoons and bright color design, it is a thoughtful gift for children and a magic camera. Children can take interesting photos and record videos easily with this digital camera. That opens up intelligence to cultivate children\'s observation and discover beauty.</p>\r\n<p><strong>FEATURES :</strong></p>\r\n<p>**High-definition pixels: The product has a 2-inch 1080P high-definition IPS screen, which can avoid hurting your children\'s vision, keep them away from TVs and smartphones, and stimulate their creativity and curiosity.&nbsp;</p>\r\n<p>**USB charging: The product has a built-in 850mAH rechargeable battery, which can shoot for 2-3 hours, supports up to 32GB of memory, can store more than 2000 photos, and can easily transfer photos or videos to mobile phones or computers via USB connection.</p>\r\n<p>**Appearance design: The product is specially designed for children, with a cute puppy appearance and a silicone shock-proof shell. Children can easily hang it on their necks and enjoy the fun of photography.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>SPECIFICATIONS:</strong></p>\r\n<p>Screen: 2inch IPS<br />12 Megapixels lens<br />Video Resolution: Full HD 1080P<br />Photo Resolution: 5000x4000<br />Frame rate: 30 fps<br />Charging Time: 2-3h<br />Recording Time: 3-6h<br />Expandable Memory Card slot: up to 32GB<br />Weight: 136g<br />Languages: English, French, Italian, German, Japanese, Korean, Czech, Russian, Thai.</p>\r\n<p><strong>PACKAGE INCLUDED:</strong></p>\r\n<p>1* Digital camera + 8GB memory card<br />1* USB charging cable<br />1* Card reader<br />1* Cartoon protective shell<br />1* Neck lanyard<br />1* User Manual</p>\r\n<p>&nbsp;</p>', 'Available', 'facebook_ads', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-12 07:28:59', '2021-06-12 07:28:59', NULL, NULL),
(62, 'Cat Nip', 20.62, 1.38, 19.24, 70, '96.60', 43497, '18-24,25-34,34-44', 2, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Car Accessories,Cat Nip', 'Car Accessories', '<p><strong>It\'s rich in catmint. Which helps cats to vomit their hair. Rich in deep-sea fish glue. Rich in protein. Vitamins. Calcium. Iron. And zinc. After licking. The cat will increase the amount of drinking water. Which is good for the urinary system. The product is spherical solid. Sugar content. Tasty and playful. You can stick it anywhere and cover it when you don\'t eat.</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Features:</strong></p>\r\n<p>The nutrients include catnip, which can be used to urge cat hair, and various trace elements, including fish glue</p>\r\n<p>By licking sugar, a cat can increase the amount of water it drinks.</p>\r\n<p>The sticker at the bottom allows you to place the ball anywhere, such as the floor, wall, or cat nest.</p>\r\n<p>There is a transparent cover that can be covered when you no longer use it, safety, and health.</p>\r\n<p>This interesting snack can help improve the cat\'s urinary system and eye nutrition.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Specifications:</strong></p>\r\n<p><strong>Ingredients: </strong>cat peppermint, fish gelatin, catnip.<br /><strong>Size:</strong> 1.57 x 0.79 x 0.39 inches.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Package included:</strong></p>\r\n<p>1x cat treat nutrition ball.</p>\r\n<p>&nbsp;</p>', 'Available', 'facebook_ads', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-12 07:33:15', '2021-06-12 07:33:15', NULL, NULL),
