(65, 'Bathing Paw', 35.00, 9.34, 25.66, 192, '1793.28', 546916, '18-24,25-34,34-44', 2, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Pet Accessories,Bathing Paw', 'Pet Accessories', '<p><strong>Give your dogs a spa experience every bath time with this multi-functional pet shower tool. This tool combines a sprayer and a scrubber which allows you to massage your pets while grooming them. Bathing and massage are hard to resist so your pets will surely enjoy bath time even more.</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Features:</strong></p>\r\n<p>The pet grooming tool combines a bath brush and water sprayer, making it easy to wash your lovely pets.</p>\r\n<p>The water will penetrate deeply into the pet dog\'s hair and the glove will clean it at the same time.&nbsp;</p>\r\n<p>Made of high-quality abs material and silicone, combination sprayer, and scrubber, all features can be used with a single hand.</p>\r\n<p>Unique bristles provide deep clean for your long or short-haired dogs and penetrate near the skin giving a gentle massage effect.</p>\r\n<p>Perfect water pressure and a soft brush will give pets a deep clean feeling. Suitable for cats.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Specifications:</strong></p>\r\n<p><strong>Material: </strong>abs and silicone<br /><strong>Length:</strong> 2.5m</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Package includes:</strong></p>\r\n<p>1x multi-functional pet shower tool.</p>', 'Available', 'untapped_product', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-12 08:36:56', '2021-06-12 08:36:56', NULL, NULL),
