(67, 'Led Selfie Ring Light With Phone Holder', 22.56, 6.66, 15.90, 6, '39.96', 502875, '18-24,25-34', 2, 'Men,Women,Baby', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Women\'s Fashion,Led Selfie Ring Light With Phone Holder', 'Women\'s Fashion', '<p><strong>You can finally get the perfect lighting you need to create amazing photos and videos anywhere hands-free with our flexible led ring light phone holder. This light is perfect for makeup artists, photographers, YouTubers, or any aspiring social media stars!</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Features:</strong></p>\r\n<p><strong>Hand-free: <br /></strong>Clamp-on table/desk/bed and rotate any angle to free your hands</p>\r\n<p><strong>3 light color:</strong> <br />White, warm yellow, warm yellow + white</p>\r\n<p><strong>10-level brightness:</strong> <br />optimize your lighting source as best</p>\r\n<p><strong>360 degree adjustable:</strong><br />easily rotate the swivel ball head for ideal viewing</p>\r\n<p><strong>Universal phone holder:</strong><br />works with all iPhone/Samsung smartphones up to 3.6inch wide</p>\r\n<p><strong>USB powered:</strong><br />no battery needed, a long USB cable (55inch) ensure sufficient reach from your USB charger</p>\r\n<p><strong>Multifunction:</strong><br />works both as photography ring light and table lamp, or even moonlights</p>\r\n<p><strong>Durable:</strong><br />quality strong material for longevity/stability</p>\r\n<p><strong>Rubber cushion clamp:</strong><br />anti-slip/anti-shock for stability and protects your desk or table. Great replacement for phone tripod</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Specifications:</strong></p>\r\n<p><strong>The total length of the bracket:</strong> 640mm<br /><strong>Lamp size:</strong> outside diameter 90mm<br /><strong>Line length:</strong> 1.45m<br /><strong>Led quantity: </strong>24 pcs<br /><strong>Led power:</strong> 6w<br /><strong>Power supply:</strong> USB 5v</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Package includes:</strong></p>\r\n<p>1x selfie ring light with cell phone holder</p>', 'Available', 'facebook_ads', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-12 08:47:01', '2021-06-12 08:47:01', NULL, NULL),
(68, 'Anti slip elevated double dog bowls', 44.95, 4.10, 40.85, 21, '86.10', 582552, '18-24,25-34,34-44,45-54', 1, 'Unisex', 'United States, Canada, Australia, Japan, Netherlends, Europe, Singapur', 'Pet Accessories,Pet', 'Pet Accessories', '<p>Often we don\'t think about our pet\'s digestion - But did you know that they can experience problems due to the way they eat? This Anti-Slip Dog Bowl features an adjustable height that can help improve digestion while reducing neck and muscle strain while they eat.</p>\r\n<p><strong>FEATURES :</strong></p>\r\n<p>**NON-TOXIC &amp; SAFE FEEDING: The bowls are made from stainless steel and the adjustable shelves from ABS plastic. This means this set is non-toxic and perfect for the daily feeding of your pet. The base of the adjustable bowl holder is equipped with silicone anti-slip mats, preventing it from slipping while your dog eats.</p>\r\n<p>**ELEVATED BOWL DESIGN: Adjusting the bowl height makes it much easier for your best friend to eat, improving digestion and reducing any strain on their neck and muscles. This is especially important for older pets, who may already suffer from problems such as arthritis.</p>\r\n<p>**HOLDS BOWLS SECURELY: The stainless steel bowls have a non-slip ring to hold them securely in place, so you won\'t need to worry about the bowls tipping or flipping - Everything will stay in place and clean.</p>\r\n<p>**DETACHABLE &amp; DISHWASHER SAFE: Ready to clean up? Easy! Simply remove the bowls and wash them in warm, soapy water, or place them in the dishwasher for a no-fuss clean.</p>\r\n<p><strong>SPECIFICATIONS:</strong></p>\r\n<p>Material: abs + stainless steel<br />Optional size: s, l<br />S size: app. 38x18. 5x20. 5cm/14. 96x7. 28x8. 07in<br />L size: app. 40x21x24. 5cm/15. 75x8. 27x9. 65in<br />Color: black<br />Quantity: 1 set<br /><br /></p>\r\n<p><strong>PACKAGE CONTENTS:</strong><br />1 set x pet elevated feeding bowl</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', 'Available', 'facebook_ads', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-12 08:55:05', '2021-06-12 08:55:05', NULL, NULL),
