(71, 'Flacherie', 49.95, 13.68, 36.27, 5732, '78413.76', 404978, '18-24,25-34,34-44', 1, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Electronics,Flacherie', 'Electronics', '<p><strong>Wouldn\'t you love to take every photo in a perfectly lit studio? The flasher studio lightbox lets you take perfect pictures no matter where you go!</strong></p>\r\n<p><strong>In today\'s digitally savvy world, regular smartphone photos simply won\'t do. What you need are clean, crisp, professional-looking catalog-style product photos!&nbsp;</strong></p>\r\n<p><strong>Introducing the flashy studio lightbox, designed for photography enthusiasts, online sellers, students, handcrafters, advertisers, and more!</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Features:&nbsp;</strong></p>\r\n<p>The instant gallery uses mini USB power. No local plug set needed, just connect to your own USB adapter (iPhone/android/... Charger), display &mdash; and shoot!</p>\r\n<p><strong>Easy to assemble:&nbsp; <br /></strong>Effective &amp; ergonomic design makes assembly a breeze you can literally build up a photo studio anywhere within 10 seconds!</p>\r\n<p><strong>Multiple angles:</strong> <br />Featuring two openings so you can take pictures from any angle.</p>\r\n<p><strong>No unflattering shadows:</strong> <br />Built with an led panel of bright white beads to eliminate unflattering shadows and reflections, no need for additional lighting!</p>\r\n<p><strong>Changeable backdrop:</strong> <br />Comes with 4 Eva backgrounds in varying colors and one black velvet background to suit your needs, perfect for photographing small products such as toys, jewelry, accessories, gadgets, and more!</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Available sizes:</strong></p>\r\n<p><strong>Small (24 x 24 x 24cm / 9.5\" x 9.5\" x 9.5\")</strong> - Small is a good size for smaller items like jewelry or accessories.&nbsp;</p>\r\n<p><strong>Medium (30 x 30 x 30cm / 11.8\" x 11.8\" x 11.8\")</strong> - Medium is a good option as it can cover a reasonable scope for size and placement options.</p>\r\n<p><strong>Large (40 x 40 x 40cm / 15.7\" x 15.7\" x 15.7\") </strong>- large is the recommended size and the best choice as it lets you showcase almost anything &mdash; a perfect solution for anyone needing a pro portfolio or eye-catching online shop window.</p>\r\n<p><strong>Flash bundle:<br /></strong> All 3 sizes packaged into one extraordinary deal &mdash; the ultimate photo studio setup that will level up every photo you take</p>\r\n<p><strong>Flash bundle + turntable:</strong> <br />All 3 sizes including the flashy turntable&nbsp; &mdash; designed for that are ready to take their product photography to the next level!&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Package includes:</strong></p>\r\n<p>1x flasher studio lightbox (including lights)<br />1x USB cable<br />1x carrying case<br />5x backgrounds (black, black velvet, white, red, and green)</p>', 'Available', 'trending_product', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-12 09:06:42', '2021-06-12 09:06:42', NULL, NULL),
