(73, 'Ducky Light Horn', 14.00, 1.99, 12.01, 602, '1197.98', 225495, '18-24,25-34,34-44', 2, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Outdoor,Ducky Light Horn', 'Outdoor', '<p><strong>Quack quack! Meet your newest bike light and horn - The \"Ducky\". Whether you commute to school, work, the gym, or just like a casual ride - The Ducky will be there with you every pedal of the way. Can be used for a wide range of activities: mountain biking, road biking, city commuting, hybrid bikes, kids bikes, as well as a regular flashlight. It installs in seconds &amp; fastens to absolutely any handlebar imaginable.</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Features:</strong></p>\r\n<p>Lightweight, durable, strong elastic, and will fit your bike handles perfectly.</p>\r\n<p>It also fits perfectly to any children\'s bike for its cute duck appearance &amp; provides a bike safety light.</p>\r\n<p>Fun squeaky honk when you squeeze it.</p>\r\n<p>The light function can be used as a steady light or a flash. Powered by two 2032 button batteries which are included.</p>\r\n<p>A great gift for children, adults, your friends, families, etc.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Specification:</strong></p>\r\n<p><strong>Style: </strong>White Star, Shark, Fire, Bear, Lucky Eight, Watermelon, Purple Star, Wing<br /><strong>Light Mode: </strong>Steady or Flash<br /><strong>Power:</strong> Two CR2032 button batteries which are included<br /><strong>Handlebar Length:</strong> 7-13cm</p>\r\n<p><strong>Package Contents:</strong></p>\r\n<p>1x The \"Ducky\" Light Horn (batteries included).</p>', 'Available', 'facebook_ads', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-12 09:25:17', '2021-06-12 09:25:17', NULL, NULL),
(74, 'Salange P52 Mini Projector', 130.00, 84.55, 45.45, 31, '2621.05', 142757, '18-24,25-34', 2, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Electronics,Salange P52 Mini Projector', 'Electronics', '<p><strong>Getting ready for movie night? It&rsquo;s time to upgrade your setups&mdash;with this home projector, all you need is an empty wall to have a private theater at home.</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Features:</strong></p>\r\n<p>Enjoy the cinematic experience&mdash;up to 120-inches:</p>\r\n<p>This projector can give practically any room a theater-like feel with its huge viewable screen size. Project a screen size of up to 120 inches to enjoy a viewing experience with cinema-like familiarity. It comes with built-in speakers, whether you&rsquo;re watching your favorite VMS, tv-series, concerts, tv shows, or sharing photos, you can now put your favorite media on a big screen in seconds.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Plug and play:<br /></strong>Connect your device such as laptops and phones into the HDMI/av port or play files from your MicroSD and USB flash drive, for a swift, effortless setup. Among the connectivity options is a 3.5mm aux-out to link with your headphones or external speakers to further enhance your sound. Plus, stay put on the couch by using the included remote control.</p>\r\n<p><strong>Easy streaming:<br /></strong>You can use Bluetooth to listen to anything your mobile phone or tablet can play. Play popular music services like Spotify, apple music, amazon music, and Deezer on your projector. With Bluetooth 4.0 transmission you can hook it up to your phone and use it as a Bluetooth speaker.</p>\r\n<p><strong>Aesthetically pleasing:<br /></strong>Say goodbye to heavy and bulky projectors. This projector is super lightweight, you can move it around easily. It makes your living space practical and aesthetically pleasing. The projector is an ideal projection device for use at your home. Next time you are getting ready for a binge-watch, find a wall in your home, order some pizza and just pull out this projector.</p>\r\n<p><strong>Extended connectivity:<br /></strong>This projector supports*: laptops, tablets, pcs, game consoles, tv boxes, iPhones, Ipads, android devices, and more!</p>\r\n<p><strong>Bright and clear:<br /></strong>Featuring a high-contrast optical engine with brightness rated at 2800 lumens, imagery is bright, vivid, and sharp with precise color tones. Display your movie in HD quality with 1280*720p physical resolution. Long lifetime up to 30,0000 hours!</p>\r\n<p><strong>The healthier choice for your eyes:<br /></strong>Projector screen is better for your eyes&mdash;reflected light is easier on your eyes, keeping your eyes comfortable without the added strain created by emitted light (TVs emit light). It produces much larger images, which put less strain on your eyes. Projector screens do not emit light. This helps to greatly reduce the level of light being captured by your eyes and, therefore, reduces stress levels on your optic nerve.</p>\r\n<p><strong>Important note:<br /></strong>To play youtube videos from your phone or tablet, an HDMI adapter or Chromecast is required to connect your phone to the projector. Please check if your phone supports the screen mirroring using an HDMI adapter.</p>\r\n<p>Due to Netflix restrictions, you cannot stream the video directly from your phone/tablet using a lightning/USB to HDMI adapter.</p>\r\n<p>Streaming service e.G. Netflix, you will need to connect the HDMI port on your laptop/pc/android/ps4/Xbox/Chromecast to the projector.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Specifications:</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Input: </strong>av/usb/hdmi/microsd</p>\r\n<p><strong>Output: </strong>3.5mm aux,headphone</p>\r\n<p><strong>Movie format:</strong> mpg, ts, av, mov, mkv, dat, mp4, vob, 3d support</p>\r\n<p><strong>Audio format: </strong>wma, lpcm, mp3, aac, m4a</p>\r\n<p><strong>Picture format:</strong> jpg, jpeg, png, bmp, mpo, gif</p>\r\n<p><strong>Power input:</strong> ac 100-240v, 50-60hz/50w</p>\r\n<p><strong>Power consumption: </strong>110w</p>\r\n<p><strong>Speaker:</strong> 3w x 2</p>\r\n<p><strong>Product size(lxwxh):</strong> 16.78*16.2*16.45 cm</p>\r\n<p><strong>Product weight: </strong>1.20kg</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Note:<br /></strong>An HDMI adapter is required to connect your phone to the projector. HDMI adapter is not included in the package and also checks if your phone can mirror the screen using HDMI.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Included box:</strong></p>\r\n<p>1 x projector, 1 x remote control, 1 x av cable, 1 x power cable,1 x hdmi cable</p>\r\n<p>(lightning/usb to hdmi adapter is not included)</p>', 'Available', 'trending_product', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-12 09:34:39', '2021-06-12 09:34:39', NULL, NULL),
(75, 'Orthopedic Bunion Corrector', 29.95, 1.73, 28.22, 9515, '16460.95', 185136, '18-24,25-34,34-44,45-54,55-64', 1, 'Unisex', 'United States, Canada, Australia, Japan, Netherlends, Europe, Singapur', 'Health & Beauty', 'Health & Beauty', '<p>This caddy is perfect for all your storage and organization needs and is a great addition to any home. Whether you are looking to organize your kitchen, your refrigerator, or your pantry. Simply place your spices, canned goods, cleaning supplies, favorite sauces, and beverages in the caddy for convenient storage. You can stack them to save space in cabinets and pantries. No more moving everything around to get what\'s in the back. Just give the Rotating Kitchen Storage Caddy a spin and easily see all your favorite products.</p>\r\n<p><strong>Features:</strong></p>\r\n<p><strong>Best bunion corrector &amp; pain relief kit:</strong></p>\r\n<p>Including hinge bunion splint (1 pair), toe strap (1 pcs)toe separators (3 pairs), providing 24 hrs pain relief and correcting your toe to normal alignment.</p>\r\n<p><strong>Realigns toes correctly:&nbsp;</strong></p>\r\n<p>This bunion kit helps fix overlapping toes, hammertoes, hallux valgus, crooked toes, and relieves toe pain. High-quality kit set made by durable &amp; comfortable material supporting long-time usage. One single size fits most men &amp; women\'s feet.</p>\r\n<p><strong>Daytime/outdoor:&nbsp;</strong></p>\r\n<p>Slip-on our toe separators in the daytime supporting whole day walking, standing &amp; pain relief. They can also be worn underneath socks or stockings.</p>\r\n<p><strong>Nighttime/home:&nbsp;</strong></p>\r\n<p>Wear our hinge bunion splint at nighttime to improve your big toe condition while sleeping. Our considerate design prevents the splint loosen &amp; relieves pain while sleeping.</p>\r\n<p><strong>Satisfaction guaranteed:&nbsp;</strong></p>\r\n<p>What we pursue is 100% customer satisfaction. We believe that some or all of these products will be suitable for you. If you are not satisfied with them, full purchase price refund within 30 days of your purchase for any reason.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Specifications:</strong></p>\r\n<p>Size: Bunion Corrector Kit<br />Brand: Conffill<br />Indications: Bunion</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Package Include:</strong></p>\r\n<p>Orthopedic Bunion Corrector.<br />User Manually</p>\r\n<p>&nbsp;</p>', 'Available', 'facebook_ads', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-12 09:39:24', '2021-06-12 09:39:24', NULL, NULL),
