rong>SPECIFICATIONS:</strong></p>\r\n<p>Material: ABS<br />Output: DC 5V,500mA<br />Battery Capacity: 750mAh<br />Power: Max 10W<br />Charging Time: 3.5 hours<br />Size: 165 * 45 * 46mm<br />Colors: White/Black</p>\r\n<p><strong>PACKAGE INCLUDES:</strong></p>\r\n<p>1 * EMS Beauty Instrument</p>\r\n<p>1 * USB Cable</p>\r\n<p>1 * English Manual</p>\r\n<p>&nbsp;</p>', 'Available', '[\"facebook_ads\"]', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-12 10:11:49', '2021-06-13 03:40:48', NULL, NULL);
