(77, 'Car Dent Removal Tool', 56.24, 45.83, 10.41, 7, '320.81', 816743, '18-24,25-34,34-44,45-54,55-64', 2, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Car Accessories,Car Dent Removal Tool', 'Car Accessories', '<p><strong>Compared with the traditional plate dent repair method our dent repair tools are a car body-friendly and easy-to-operate tool kit (repaired by two main steps: coating hot melts and screwing to pull out). In this way, the dent will be repaired efficiently without damaging the original paint of the car and you can also greatly save your time and cost of repairing.</strong></p>\r\n<p><strong><br />Features:</strong></p>\r\n<p><strong>Multifunctional: <br /></strong>Our dent puller tool was designed to work on a wide variety of different car models and structures. Plus, it can work on motorcycles as well! As long as the affected surface is flat and non-porous, this paintless dent repair tool will work.</p>\r\n<p><strong>Easy to use:</strong> <br />Using our suction cup dent puller is as simple as gluing the dent puller to the center of the dent and twisting the knob until the dent pops out. This should occur within a few seconds to a few minutes of use.</p>\r\n<p><strong>High quality:</strong> <br />Simply put, the dent removal tool was built tas, etc. Our car dent puller is made with high-quality aluminum and durable plastic and doesn\'t damage the asura race. Very sturdy for long time use.</p>\r\n<p><strong><br />Specifications:</strong></p>\r\n<p><strong>Slide hammer color:</strong> silver&nbsp;<br /><strong>Puller tabs color: </strong>blue</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Package includes:</strong></p>\r\n<p>18x PDR glue pulling tabs<br />1x 2 in 1 dent removal t bar tools</p>', 'Available', 'trending_product', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-12 10:27:00', '2021-06-12 10:27:00', NULL, NULL),
(84, 'Lemon Juice Sprayer', 11.97, 0.78, 11.19, 16, '12.48', 168138, '18-24,25-34,34-44,45-54,55-64', 2, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Kitchen ,household,Lemon Juice Sprayer', 'Kitchen & household', '<p><strong>Our juice spray allows you to spray fresh juice to add an extra punch to your dishes.&nbsp; The screw-like design can easily be inserted and secured inside the fruit and the juice fills the filter through the holes in the sprayer.&nbsp; This works great for lemons, limes, and tomatoes.</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Features:</strong></p>\r\n<p>Zesty spritz: sprays citrus juice onto your meals, adding a refreshing zesty flavor.&nbsp;</p>\r\n<p>No messy squeezing: directly accesses the juice inside the lemon, eliminating the need to messily squeeze it out.</p>\r\n<p>Freshness seal: acts as a cork that locks in the lemon&rsquo;s freshness while refrigerated, preserving it for longer.</p>\r\n<p>Easy screw &amp; spray: simply slice off the top of the lemon and screw in the sprayer. Enjoy spritzing zesty citrus onto your meals!</p>\r\n<p>Widely usable: suitable for use with various citrus fruits such as lemons, limes, oranges, grapefruits, and more.</p>\r\n<p>Food-grade material: durably made from high-quality, food-grade materials for safe, long-lasting use.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Specifications:</strong></p>\r\n<p><strong>Material:</strong> pp + tpr<br /><strong>Size: </strong>9.5 cm x 4.5 cm</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Package includes:</strong></p>\r\n<p>1x lemon juice sprayer</p>\r\n<p>&nbsp;</p>', 'Available', 'facebook_ads', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-13 04:12:31', '2021-06-13 04:12:31', NULL, NULL),
(85, 'Dessini Aluminum Double sided Non stick Grill', 106.18, 42.27, 63.91, 8, '338.16', 6885110, '18-24,25-34,34-44,45-54,55-64', 2, 'Women', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Dessini Aluminum Double sided Non stick Grill,Kitchen & household,Kitchen,Household', 'Kitchen & household', '<p><strong>Aside from grilling, the double-sided pan is also great for frying. Our Pan has two types of surfaces, one flat and the other curly. It can be cooked on both sides. The Skillet is made of an aluminum alloy with a non-stick coating so that your meals do not stick. It is durable and easy to clean. Suitable for all stoves, including gas, electric, halogen, or ceramic, but not for induction stoves.</strong></p>\r\n<h2><strong>FEATURES:</strong></h2>\r\n<p>For induction cookers and gas stoves.<br />Suitable for families, outdoors, parties, barbecues, making sandwiches.<br />Full body cast aluminum design for stability, durability, and reliability.<br />Good thermal conductivity, saving energy and time.<br />Double-sided pressure cooking makes the operation more practical.</p>\r\n<h3><strong>SPECIFICATIONS:</strong></h3>\r\n<p>Material: Aluminum Alloy<br />Color: Red<br />Diameter: about 32cm/28cm<br />Total size: 32*32*8.4cm/28*28*8.4cm</p>\r\n<h4><strong>PACKAGE INCLUDES:</strong></h4>\r\n<p>1 x Double Side Grill Fry Pan</p>', 'Available', 'trending_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-13 04:13:59', '2021-06-13 04:13:59', NULL, NULL),
(86, 'Lumbar Relief Back Stretcher', 34.99, 14.50, 20.49, 2071, '30029.50', 675978, '[\"18-24\",\"25-34\",\"34-44\",\"45-54\"]', 1, '[\"Unisex\"]', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Lumbar Relief Back Stretcher,Fitness', '[\"Fitness\"]', '<p><strong>Its anatomically shaped platform conforms to your spine and realigns your vertebrae &ndash; which helps improve your posture and relieve compression in your nerves and discs. Designed for all ages, it makes back stretching more manageable and safe, especially for those who experience chronic back pains.</strong><br /><strong>This back stretcher equipment is safe for all ages over 10, and it can be used as a preventive care device for your spine.</strong></p>\r\n<h2><strong>FEATURES:</strong></h2>\r\n<p><strong>RELIEVE MUSCLE PAIN AND STRESS: </strong>With our ergonomically designed self-massage, relieve chronic back pain and ease away stress.<br /><strong>LIGHTWEIGHT BUT STURDY: </strong>Made of premium quality ABS. Use it forever! Ideal for use at home, at the office chair, at the gym, in the car, or yoga mat.<br /><strong>PERFECT GIFT FOR YOURSELF AND YOUR LOVED ONES: </strong>Treat yourself by restoring the health of fatigued and tensioned muscle. Express your gratitude to your wife, husband, parents, friends, and teachers on Christmas, on a special day.<br /><strong>MULTIPURPOSE SELF MASSAGER FOR WHOLE BODY: </strong>Multi-Level Lumbar Support Stretcher Spinal, back massager, shoulder massager and a back massager for bed, back massager acupressure, back massager chair, back massager car, Lower Back Pain Relief Treatment Stretcher | Chronic Lumbar Support | Herniated Disc | Sciatica Nerve | Spinal Stenosis | Posture Corrector |<br /><strong>SAVE YOUR ELECTRICITY BILL:</strong> No power or battery required yet you can still enjoy adequate pressure with your own body weight.</p>\r\n<h3><strong>SPECIFICATIONS:</strong></h3>\r\n<p>Material: ABS/PP<br />Product size: 14.57-inch x 9.65 inch<br />Weight: 1.65lb</p>\r\n<h4><strong>PACKAGE INCLUDES:</strong></h4>\r\n<p>1 x Three Level Slot Base<br />1 x Acupuncture Points Curve<br />1 x Soft Sponge Strip</p>', 'Available', '[\"facebook_ads\"]', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-13 04:24:05', '2021-06-13 04:25:32', NULL, NULL),
(87, 'Unisex Heated Vest', 42.99, 26.61, 16.38, 134, '3565.74', 351156, '18-24,25-34,34-44,45-54,55-64', 2, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Garden Improvement,Unisex Heated Vest', 'Garden Improvement', '<p><strong>When people go out in the cold winter, they usually need to wear a thick coat and become very fat. However, with our ultra-lightweight warm vest, you can wear fewer clothes. Heated pads also help promote blood circulation and relieve muscle pain.</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Features:</strong></p>\r\n<p>1-minute fast heat, dispel cold, and keep you warm.</p>\r\n<p>With a mobile power storage pocket, easy travel.</p>\r\n<p>Set the temperature you want to respond to a variety of environments.</p>\r\n<p>A button to heating, three-stall temperature control, intelligent heating.</p>\r\n<p>Fabric 20d nylon plus waterproof treatment.</p>\r\n<p>Do not wring it by hand.</p>\r\n<p>General USB interface power supply, longer service life, anti-water splashing, and washable.</p>\r\n<p>The fashion is warm, comfortable, and breathable, and it\'s a good partner for your winter going out.</p>\r\n<p>The core heating technology has reached the international CE, EMC, RoHS, IP certification, and all testing certificates are complete.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Specifications:</strong></p>\r\n<p>Temperature shift(manual adjustment)</p>\r\n<p><strong>Warm:</strong> 45 ℃ (red light)</p>\r\n<p><strong>Comfort: </strong>35 ℃ (white light)</p>\r\n<p><strong>Energy-saving:</strong> 25 ℃ (blue light)</p>\r\n<p><strong>Style:</strong> long sleeve cotton coat</p>\r\n<p><strong>Material:</strong> polyester</p>\r\n<p><strong>Color: </strong>black, red</p>\r\n<p><strong>Size:</strong> m/l/xl/2xl/3xl/4xl</p>\r\n<p><strong>Power supply interface:</strong> USB</p>\r\n<p><strong>Function:</strong> keep warm, anti-water splashing, and prevent cold</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Package includes:</strong></p>\r\n<p>1x heated vest with USB cable</p>\r\n<p>1x user manual</p>', 'Available', 'untapped_product', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-13 04:25:10', '2021-06-13 04:25:10', NULL, NULL),
(88, 'Lumbar Decompression Belt', 119.99, 43.56, 76.43, 5, '217.80', 98353, '18-24,25-34,34-44,45-54,55-64', 2, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Health ,Beauty,Lumbar Decompression Belt', 'Health & Beauty', '<p><strong>This pain relief decompression belt is great for people with degenerative, herniated, or bulging discs. Decompression therapy helps reduce the pressure on the spinal discs and helps relieve the weight of the upper body off the lower back. Can also be worn while driving. Traction can also help relieve pressure and constriction of nearby nerves such as the sciatic nerve.&nbsp;</strong></p>\r\n<p><strong>Pain relief:&nbsp;</strong> this belt will help lift your lumbar and unload the weight of the lower back allowing the muscles to relax. Using traction, the belt expands vertically and reduces the burden around your lower back joints. It also helps to relax lumbar muscle spasm, strains, and pains. Relieves pain from degenerative disc disease, spinal stenosis, sciatica, spondylolysis, pain in the back, hip, thighs, legs, and feet caused by bulging discs and herniated discs.</p>\r\n<p><strong>High-quality material:</strong> the decompression belt is made with cotton and high-quality expanding rubber. It comes with a 1-year warranty and a 30-day satisfaction guarantee! We take pride in making sure you have the highest quality product for your money without the extra costs!&nbsp;</p>\r\n<p><strong>Suitable for many occasions:</strong> suitable for anyone(male and female) with lower sore back pain from handling kids, elderly care, and more. Can be used while walking, sitting, lying down, gardening, golfing, working, driving, etc.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Benefit:</strong></p>\r\n<p>Helps to relieve pressure off pinched nerves.</p>\r\n<p>The decompression belt helps decrease pressure on your back, stretches tight muscles, and decompresses the discs. Less pressure means less pain.</p>\r\n<p>The decompression belt helps hold your midsection together to help support and stabilize your spine and muscles. With such support, you will stand taller and straighter, because it helps stop you from slouching.</p>\r\n<p>Helps to reduce pain and pressure on pinched nerves.&nbsp; Improving nutrient flow on your spine. Aids in strengthening your core and back muscles.</p>\r\n<p>Inflatable back brace: the decompression pump-up back brace is not just a regular back support belt. This inflatable back brace when inflated, it increases in height by 4 inches (7.5 cm).</p>\r\n<p>Decrease the pressure of the lumbar through traction</p>\r\n<p>Great for people who suffer from lumbar back pain, sciatica nerve pain, arthritis, soft tissue damage.</p>\r\n<p><strong>Adjustable back belt:</strong></p>\r\n<p>The belt is suitable for a 29-49 inch waist, extension belt can be used according to individual needs.&nbsp;</p>\r\n<p>The hand pump to inflate it was much easier to use.</p>\r\n<p><strong>Golf compression belt uses:</strong></p>\r\n<p>Prolapsed lumbar intervertebral discs.</p>\r\n<p>Abnormal function of small joints of the lumbar vertebra.</p>\r\n<p>Hyperplasia of lumbar vertebra.</p>\r\n<p>Strenuous jobs requiring heavy lifting.</p>\r\n<p>Long time driving or sitting.</p>\r\n<p>Scoliosis and spondylolisthesis.</p>\r\n<p>Low back pain caused by obesity.</p>\r\n<p>Degenerative discs.</p>\r\n<p><strong>Enjoy anytime anywhere:</strong></p>\r\n<p>Can be used during activities, or while resting and relaxing, such as walking, sitting, lying down, gardening, golfing, working, driving, etc.</p>\r\n<p><strong>Design:</strong> designed to relieve pain and maintain proper posture.</p>\r\n<p>Hand pump for inflation: included is a hand pump to adjust air pressure manually.&nbsp;</p>\r\n<p>Waist size: comes with an extended belt, you can adjust the size to fit you well. Can fit 29 to 49-inch waists.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Specifications:</strong></p>\r\n<p><strong>Outer layer:</strong> PU(polyurethane)</p>\r\n<p><strong>Inner layer:</strong> cotton&nbsp;</p>\r\n<p><strong>The inner layer of air inflation:</strong> PU (special soft material)&nbsp;</p>\r\n<p><strong>Length of traction belt:</strong> 46.5 inch&nbsp;</p>\r\n<p><strong>Length of extension belt: </strong>9.6 inch</p>\r\n<p><strong>Width before inflation:</strong> 5 inch&nbsp;</p>\r\n<p><strong>Width after inflation: </strong>8 inch&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Notes:</strong></p>\r\n<p>Please measure your waist to ensure that this belt will fit. Fits waist sizes - min 29\" to max 49\"</p>\r\n<p>This belt cannot be immersed in water to wash it.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>&nbsp;Package includes:</strong></p>\r\n<p>1x decompression back belt</p>\r\n<p>1x hand air pump</p>\r\n<p>1x extension belt</p>\r\n<p>1x user manual</p>\r\n<p>1x storage bag</p>', 'Available', 'trending_product', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-13 04:36:27', '2021-06-13 04:36:27', NULL, NULL),
(89, 'Triangular Sink Drain Shelf', 15.97, 3.42, 12.55, 893, '3054.06', 135156, '18-24,25-34,34-44,45-54,55-64', 1, 'Women', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Triangular Sink Drain Shelf,Kitchen & household,Kitchen,Household', 'Kitchen & household', '<p><strong>Free up space around your kitchen countertop and sink area with the help of this Triangular Sink Drain Basket.</strong><br /><strong>With a compact triangular structure, this basket fits neatly most sinks and any corner. The extra space can be fully used for various purposes - Like a cleaning, tool shelf to hold dish soaps, sponges, scrubbers, and so on. Or as a fruit basket, it simply stores fruits and vegetables within easy reach. You can even temporarily collect fruit peels for easier disposal when peeling fruits.</strong><br /><strong>Applies suction cups to attach to surfaces without drilling or sticking. No damage to your countertop or bathroom!</strong></p>\r\n<h2><strong>FEATURES:</strong></h2>\r\n<p><strong>Multi-functional: </strong>Can be used as a cleaning tool shelf, fruit basket, drain rack, and temporary rack for convenient disposal of fruit peels.<br /><strong>Triangular Design: </strong>Fully make use of the sink corner and won\'t take up additional space inside the sink.<br /><strong>Strong Suction: </strong>Hang the drain shelf with a suction cup that provides strong load-bearing capacity. No drilling or sticking is required for installation.<br /><strong>Excellent Drainage:</strong> Engineered with dense hollows for quick drainage, preventing the accumulation of water and growth of bacteria.&nbsp;<br /><strong>Work on any flat surface:</strong> Strongly attach on surfaces including metal, ceramic tiles, marble stone, glass, and more.<br />Rust-proof, waterproof &amp; easy to clean.<br /><strong>Reusable: </strong>Able to remove and re-stick without residue.Wide Applications: Able to be hung in the bathroom, kitchen, and other tiles/ smooth wall.</p>\r\n<h3><strong>SPECIFICATIONS:</strong></h3>\r\n<p>Material: Food-grade plastic<br />Size: 26 x 14.2 x 10cm<br />Color: Blue Gray, Beige</p>\r\n<h4><strong>PACKAGE INCLUDES:</strong></h4>\r\n<p>1 x Triangular Sink Drain Shelf</p>', 'Available', 'trending_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-13 04:36:28', '2021-06-13 04:36:28', NULL, NULL),
(90, 'Multi-functional Pants Rack', 19.99, 5.93, 14.06, 8949, '53067.57', 202865, '18-24,25-34,34-44,45-54,55-64', 1, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Home Improvement,Multi-functional Pants Rack', 'Home Improvement', '<p><strong>Our multi-functional pants rack can solve all your questions, use them and only take up the space of one hanger!</strong></p>\r\n<p><strong>No need to iron your clothes! Always keep your clothes tidy! Compatible with all kinds of clothes. Perfect for hanging your jeans, pants, trousers, ties, scarves, etc. That makes it compact and organized.</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Features:</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Stylish and durable:</strong> our metallic pants rack is durable, rustproof, and stylish.</p>\r\n<p><strong>Space-saving design: </strong>the adjustable storage rack can be hung steadily with two hooks or it can be hung vertically, it can hold up to 5 pairs of pants at one time and it will make your closet tidier.</p>\r\n<p><strong>Anti-slip cap:</strong> with a cap at the end of every rod, the hanger will prevent your trousers from slipping off.</p>\r\n<p><strong>Adjustable rod:</strong> the rod can be pulled out easily, which makes changing your pants more convenient than ever.</p>\r\n<p>The multifunctional pants rack is suitable for hanging pants, trousers, ties, clothes, and scarves.</p>\r\n<p>Each hanger has five layers, effectively saving wardrobe space.</p>\r\n<p>Slidable clips can be utilized to hang different sizes of pants, skirts, casual pants, jeans, clothes or towels, etc.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Specifications:</strong></p>\r\n<p><strong>Color: </strong>white&amp;black</p>\r\n<p><strong>Size:</strong> 35*26*5cm</p>\r\n<p><strong>Material: </strong>stainless steel</p>\r\n<p><strong>Weight:</strong> 200g</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Package includes:</strong></p>\r\n<p>1x multi-functional pants rack.</p>', 'Available', 'untapped_product', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-13 04:44:06', '2021-06-13 04:44:06', NULL, NULL),
(91, 'Stainless Steel Deep Frying Pot', 62.99, 29.75, 33.24, 2496, '74256.00', 157879, '18-24,25-34,34-44,45-54,55-64', 1, 'Women', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Stainless Steel Deep Frying Pot,Kitchen & household,Kitchen,Household', 'Kitchen & household', '<p><strong>Do you indulge in some delicious crispy chicken from time to time? Does it not turn out as you wanted? That might be because you don&rsquo;t have the right utensil, which is why you need this Japanese Style Deep Frying Pot. Now you will be able to fry all those goodies without excess oil splatter and mess. Cook crispy delicious meals every time!</strong></p>\r\n<h2><strong>FEATURES:</strong></h2>\r\n<p><strong>Practical in Use:</strong> With the Mechanical Thermometer, you can make the oil temperature control more precise, Will not miss the good time for frying.Can be used to fry potatoes, chicken, and other fried foods. Great helper for the kitchen<br /><strong>Widely Applicable: </strong>The fryer is compatible with all types of fire sources, including the fire sources of a gas stove, induction cooker, electric stove.<br /><strong>Durable Stainless Steel: </strong>The fryer is made of stainless steel, durable, and features good insulation performance, which is very suitable for frying.<br /><strong>Safety And Easy For Cleaning: </strong>The fryer features the Japanese-style riveted curved handle, which is safe and firm in use, easy to clean, and store. The detachable wire rack can drain excess fat from food. The oil level on the fryer\'s body reminds you of the right amount of oil and you will not waste the cooking oil.</p>\r\n<h3><strong>SPECIFICATIONS:</strong></h3>\r\n<p><strong>Material:</strong> 304 stainless steel<br /><strong>Size: </strong>as shown in the picture(product parameters are measured manually, there may be some tolerance)<br /><strong>Pot diameter:</strong> 20.5cm/8.07in<br /><strong>Pot depth:</strong> 13.5cm/5.31in<br /><strong>Application: </strong>induction cooker and gas stove<br /><strong>Features: </strong>it has practicality such as fuel-saving, splash-proof, convenient oil filtering, and easy cleaning.</p>\r\n<h4><strong>PACKAGE INCLUDES:</strong></h4>\r\n<p>1 X Japanese Deep Frying Pot</p>', 'Available', 'trending_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-13 04:45:53', '2021-06-13 04:45:53', NULL, NULL),
(92, 'Pocket Charger Mini', 119.96, 30.70, 89.26, 111, '3407.70', 1161773, '18-24,25-34,34-44', 2, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Mobile Accessories,Pocket Charger Mini', 'Mobile Accessories', '<p><strong>This wireless magnetic charger simplifies the charging process. It includes attachments for iPhone, type c, and android, so it&rsquo;s suitable for all users. It is the perfect portable size for carrying around wherever you go.</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Features:</strong></p>\r\n<p>Keep that battery level up no matter where you go.</p>\r\n<p>Charge up to five phones with one set and without excessive clutter.</p>\r\n<p>Quickly and conveniently offer friends &amp; family their own charging pack.</p>\r\n<p>Just one portable pack with the assorted magnetic plugs is all you need to charge every phone in the house car or on the trail.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Package includes:</strong></p>\r\n<p>1x 5000 mah power bank base</p>\r\n<p>4x 1000 mah power bank fingers</p>\r\n<p>All connectors type-c/ micro USB/ iPhone</p>\r\n<p>1x magnetic cable.</p>\r\n<p>&nbsp;</p>', 'Available', 'untapped_product', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-13 04:50:10', '2021-06-13 04:50:10', NULL, NULL),
(93, 'Silicone Caulking Tools', 24.99, 4.19, 20.80, 1671, '7001.49', 1152728, '18-24,25-34,34-44,45-54,55-64', 1, 'Men', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Silicone Caulking Tools,Home Improvement,Home,Gerden', 'Home Improvement', '<p><strong>This 3 in 1 silicone/caulking remover is a must-have for any DIY enthusiast!&nbsp; The perfect tool to ensure a professional finish for your caulking and silicone projects.&nbsp; With its ergonomic handle and adjustable heads, it ensures an effortless job every time!</strong></p>\r\n<h2><strong>FEATURES:</strong></h2>\r\n<p><strong>HIGH QUALITY:</strong> Plastic fixed with Stainless Steel Remover. Durable and no thorns, waterproof and solvent-resistance<br /><strong>EASY TO USE CONVENIENT: </strong>Use the tool, save halftime to remove the dried caulk.<br /><strong>IDEAL TOOL: </strong>Ideal for corners, showers, windows. The smart dimension is applicable for interior and exterior caulking.<br /><strong>NO WASTE OF SEALANT:</strong> Excess sealant could be saved on a silicone pad.<br /><strong>SHARP ANGLE: </strong>Remover is applicable for dried caulk. The flat stainless steel won\'t scratch hard surfaces.</p>\r\n<p>&nbsp;</p>\r\n<h3><strong>SPECIFICATIONS:</strong></h3>\r\n<p><strong>Material: </strong>ABS Plastic + Metal</p>\r\n<h4><strong>PACKAGE INCLUDES:</strong></h4>\r\n<p>1 x Multi-Tool<br />5 x Plastic Heads (19cm X 3 cm)</p>', 'Available', 'facebook_ads', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-13 04:55:27', '2021-06-13 04:55:27', NULL, NULL),
(94, 'Rotating Makeup Organizer', 34.95, 19.72, 15.23, 1424, '28081.28', 734226, '18-24,25-34,34-44', 1, 'Men,Women,Baby', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Home Improvement,Rotating Makeup Organizer', 'Home Improvement', '<p><strong>No more rummaging through messy pouches or dark recesses of drawers to find your beauty or skincare essentials. With 360&deg; rotation, this cosmetics organizer lets you check out your supplies at one glance while minimizing tabletop clutter. Have a lot of knick-knacks to organize? The 4-tier carousel boasts a huge appetite that can accommodate 20 brushes, 30 bottles of skincare products, and 10 bottles of fragrances, among others. Easy installation in just minutes, this rotating organizer sports a clear acrylic material that blends seamlessly with any tabletop.</strong></p>\r\n<p><strong><br />Features:</strong></p>\r\n<p>Stack &lsquo;em up neatly: the rotating organizer features 4 trays that offer ample space for you to store your cosmetics and beauty essentials.</p>\r\n<p>Smooth 360&deg; rotation: supported by a broad, sturdy base, the organizer rotates 360&deg; to let you find what you need quickly.</p>\r\n<p>Clearly chic: the clear acrylic material of the organizer lets it blend effortlessly with any tabletop.</p>\r\n<p>Easy installation: no tool is ever required to quickly put together this rotating organizer.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Specifications:</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Material:</strong> clear acrylic</p>\r\n<p><strong>Dimensions: </strong>340mm x 225mm</p>\r\n<p><strong>Shape:</strong> round</p>\r\n<p><strong><br />Package includes:</strong></p>\r\n<p>2x support plates</p>\r\n<p>1x base plate</p>\r\n<p>1x top plate</p>\r\n<p>4x laminates</p>\r\n<p>16x rubber rings</p>\r\n<p>1x user manual</p>', 'Available', 'trending_product', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-13 04:58:14', '2021-06-13 04:58:14', NULL, NULL),
