1 x Manual</p>', 'Available', 'untapped_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-13 05:02:16', '2021-06-13 05:02:16', NULL, NULL),
(96, 'Magic Cosmetics Pouch', 19.95, 2.98, 16.97, 1207, '3596.86', 186923, '18-24,25-34,34-44', 1, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Bag\'s ,Shoes,Magic Cosmetics Pouch', 'Bag\'s & Shoes', '<p><strong>The ultimate travel must-have this expandable pouch can be opened to lay flat and closed into a pouch in just a second, so you can have your makeup, accessories, toiletries and even toys placed in this sack then pack up will be easy.</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Features:</strong></p>\r\n<p>See all your cosmetics at once.</p>\r\n<p>Clean up in seconds.</p>\r\n<p>No more digging and dumping in a traditional black hole makeup bag.</p>\r\n<p>Raised lip keeps make-up and brushes from rolling off the counter.</p>\r\n<p>Machine washable. Waterproof. Broken eyeshadow? Spilled foundation? No problem!</p>\r\n<p>Opens flat for full access; cinch the drawstring closure to seal and convert to a clutch.</p>\r\n<p>100% brand new and high quality.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Specifications:</strong></p>\r\n<p><strong>Material:</strong> polyester</p>\r\n<p><strong>Size:</strong> 56*56cm</p>\r\n<p><strong>Package includes:</strong></p>\r\n<p>1x makeup pouch</p>', 'Available', 'facebook_ads', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-13 05:07:20', '2021-06-13 05:07:20', NULL, NULL),
