(98, 'Tibetan Buddhist bracelet', 29.95, 13.35, 16.60, 119, '1588.65', 378846, '18-24,25-34,34-44', 2, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Jewellery,Tibetan Buddhist bracelet', 'Jewellery', '<p><strong>Available in two finishes- pure silver or 24k gold plated silver style, this simple ethnic Tibetan adjustable rope bracelet with its six-syllable mantra om mani Padme hum accent makes this bracelet very eye-catching. These six true words or syllables&nbsp; \'om mani Padme hum\' &ndash; is the most common mantra in Tibet.&nbsp; This mantra produces sound and vibration which allows you to feel at one with the universe. The mantra is considered to have high spiritual and creative power.</strong></p>\r\n<p><strong><br />Features:</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Lucky handmade Tibetan Buddhist bracelet:<br /></strong>Wear this lucky handmade Tibetan Buddhist bracelet and receive its blessing!</p>\r\n<p>This mantra bracelet is handmade by Tibetan Buddhist monks. It is also spiritually charged with the power of the six true words mantra, blessing its wearer good luck and all good things.</p>\r\n<p><strong>Six true words mantra:<br /></strong>The lucky knots in this bracelet are tied while Tibetan monks recite the six true words mantra, om mani Padme hum. This mantra is one of the most powerful mantras in the Buddhist tradition.</p>\r\n<p><strong>Wearing this handmade Tibetan bracelet may:</strong></p>\r\n<p>Bring good luck</p>\r\n<p>Attract all things good</p>\r\n<p>Protect you against negativity</p>\r\n<p>Help you achieve happiness<br /><br /><strong>Red string from Tibet:<br /></strong>In Buddhism tradition, a red string bracelet is the symbol of life force. A Tibetan monk blesses it with a powerful mantra to protect its wearer from misfortune. Wearing a red string from Tibet also serves as a good luck charm.</p>\r\n<p>This lucky handmade Buddhist bracelet is made with high-quality Tibetan rope. Embossed in gold and silver is the powerful six true words mantra. Wear this Tibetan mantra bracelet and receive its blessings!</p>\r\n<p><strong>Specification:</strong></p>\r\n<p><strong>Item Type:&nbsp;</strong> ethnic rope bracelet&nbsp; with pure silver/24k gold plated six-syllable mantra charm</p>\r\n<p><strong>Material:</strong> Tibetan rope strands&nbsp;</p>\r\n<p><strong>Metal: </strong>pure sterling silver s999 &amp; 24 k gold plated silver</p>\r\n<p><strong>Bracelet type:</strong> rope chain&nbsp;</p>\r\n<p><strong>Clasp style:</strong>&nbsp; adjustable/slide</p>\r\n<p><strong>Length:</strong> adjustable fit - 15 - 20 cm wrist sizes&nbsp; ( 5.90 inches - 7.87 inches )** if you have a larger wrist than 20cm, please contact us first, thanks</p>\r\n<p><strong>Metal colors:</strong> gold, silver</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Package includes:</strong></p>\r\n<p>1x Tibetan mantra lucky charm bracelet</p>', 'Available', 'facebook_ads', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-13 05:16:04', '2021-06-13 05:16:04', NULL, NULL),
