1*Waterproofing Agent.</p>', 'Available', 'facebook_ads', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-13 05:31:47', '2021-06-13 05:31:47', NULL, NULL),
(102, 'Magnetic Windshield Cover', 24.27, 4.40, 19.87, 12107, '53270.80', 8231750, '18-24,25-34,34-44,45-54,55-64', 1, 'Men,Baby', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Car Accessories,Magnetic Windshield Cover', 'Car Accessories', '<p><strong>Everyone knows how brutal the winter can be, not only to us but to our vehicles as well. The harsh cold of the winter can also cost a lot of time in the mornings while trying to brush all the snow off and scrape all the ice off the windows. Save yourself some time from the cold in the morning and use the magnetic windshield cover to help prevent ice and snow from building up on your windshield. It magnetically stays on so you don\'t need to worry about any damage to your vehicle and folds nicely to be put away after!</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Features:</strong></p>\r\n<p>Resistant to rain, frost, snow, UV rays, dust, can be used as snow shield cover in winter and windshield visor sunshade in summer as well, keep leaves on the cover in autumn.</p>\r\n<p>Fit most cars, minivans, and SUVs. The car windshield snow cover is easily folding for storage in the trunk or in the rear seats of your vehicle. Unlike other windshield covers, this model covers both the windshield and the wipers to prevent washer fluid from freezing and your wipers from getting stuck.</p>\r\n<p>6 powerful magnets on the top side to keep the exterior windshield snow cover in place even on windy days, and the two windproof straps on each side to help attach this cover firmly. Even the strongest winds are no match for this windshield snow covers magnetic grip!</p>\r\n<p>With its security flaps and ties, an auto windshield cover can be tucked into your car doors, ensuring that this front windshield cover can\'t be stolen easily. The flaps and powerful magnets make sure the cover stays in place perfectly. The lightweight windscreen cover is easily folding to store in your vehicles.</p>\r\n<p>Easy to install, two flaps on each side for you to shut in the car door, and a rearview mirror protector to loop around the rear mirror. No tool and an extra hand are required. Just cover it and fix the windshield cover with six powerful magnets, then shut the flaps indoors, tie the draw-string rear mirror cover.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Specifications:</strong></p>\r\n<p><strong>Applicable:</strong> universal</p>\r\n<p><strong>Size:</strong> 210cm * 125cm</p>\r\n<p><strong>Material:</strong> polyester fabric</p>\r\n<p><strong><br />Package includes:</strong></p>\r\n<p>1x windshield cover</p>\r\n<p>1x storage bag</p>', 'Available', 'trending_product', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-13 05:39:19', '2021-06-13 05:39:19', NULL, NULL),
(103, 'Elephant Plush Toy', 35.61, 8.56, 27.05, 402, '3441.12', 9293459, '18-24', 2, 'Baby', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Elephant Plush Toy,Baby & Kids,Kids', 'Baby & Kids', '<p><strong>The most versatile little elephant of all will soon become your little kitties\' best playmate.</strong><br /><strong>In addition to being absolutely chewable, this little elephant knows how to play music when you lean on its paw and knows how to play hide and seek with its ears when you lean on its second paw. Quickly adopt this adorable elephant which will surely make you think of a certain Dumbo.</strong></p>\r\n<h2><strong>FEATURES:</strong></h2>\r\n<p><strong>THE PERFECT GIFT - </strong>It is the perfect gift to give and receive for a baby shower, maternity visit, birthday or just to surprise a baby<br /><strong>SOOTHING - </strong>Bombo\'s soft voice and fun movements will bring hours of joy and comfort to every boy and girl. He dances and sings the best children\'s songs. Bombo is sure to amaze and entertain any child aged 0-6 and up!<br /><strong>PLAYS AND SINGS TOGETHER WITH YOUR CHILD - </strong>The interactive and musical Bombo is perfect for every baby. He likes to hide and dance to the music with his cute and soft ears!</p>\r\n<h3><strong>SPECIFICATIONS:</strong></h3>\r\n<p><strong>Modeling category:</strong> Animal<br /><strong>Animal Category: </strong>Elephant<br /><strong>Filling material:</strong> PP cotton<br /><strong>Plush classification:</strong> short plush<br /><strong>Function:</strong> Flash<br /><strong>Height: </strong>30cm</p>\r\n<h4><strong>PACKAGE INCLUDES:</strong></h4>\r\n<p>1 x Peekaboo Elephant Toy</p>', 'Available', 'untapped_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-13 05:41:07', '2021-06-13 05:41:07', NULL, NULL),
(104, 'Knife Onion Vegetable Cutter', 12.99, 0.01, 12.98, 5311, '53.11', 377933, '18-24,25-34,34-44', 1, 'Men,Women,Baby', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Kitchen ,household,Knife Onion Vegetable Cutter', 'Kitchen & household', '<p><strong>Thank you so much for picking. I believe it will be a pleasant shopping experience. As a responsible seller, I guarantee that the quality and indicators of our products are very suitable for recognition and trust. Please check the size and color list before ordering. If you are not sure about the size and color, please send us a message and we will help you.</strong></p>\r\n<p><strong><br />Features:</strong></p>\r\n<p><strong>Sturdy grip:</strong> provides comfort and the blade is a food-grade chopped onion that can be processed quickly and easily.</p>\r\n<p><strong>Stainless steel onion:</strong> good corrosion resistance, the onion cut with the onion is more neat, easy to use, and fast shred.</p>\r\n<p><strong>Simple and convenient:</strong> stainless steel onion oil cutting tool saves time and labor, and is a must and best tool for cutting the green onion.</p>\r\n<p><strong>Easy to clean:</strong> it is also easy to clean after use and lightweight, everyone can use it to cook.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Specifications:</strong></p>\r\n<p><strong>Size:</strong> 2.6*2.3*16cm</p>\r\n<p><strong>Weight:</strong> 30g</p>\r\n<p><strong>Material:</strong> high-quality stainless steel</p>\r\n<p><strong><br />Package includes:</strong></p>\r\n<p>1&times; stainless steel chopped green onion knife</p>', 'Available', 'facebook_ads', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-13 05:50:14', '2021-06-13 05:50:14', NULL, NULL),
(105, 'Portable Neck Fan', 35.99, 21.27, 14.72, 9, '191.43', 6715940, '[\"18-24\",\"25-34\",\"34-44\"]', 2, '[\"Unisex\"]', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Portable Neck Fan,Electronics', '[\"Health & Beauty\"]', '<p><strong>Do you get hot in the summer? Enough of the clamor and inconvenient nature of everyday walking? The Bladeless Mute Neckband Fan will assist you and encourage you to enjoy a cool summer! Keep cool anywhere &amp; anytime.</strong><br /><strong>Do you want to hang out in the summer but don\'t want to put up with the heat? Wear our Ingenious Neckband Fan to stay cool at all times, no matter where you are. Bid farewell to sweat and hello to summer!</strong><br /><br /></p>\r\n<h2><strong>Features:</strong></h2>\r\n<p>1. This neckband fan allows you to hang it around your neck to enjoy the cool wind hands-free.<br />2. 3-level wind speed adjustable; 48 surrounding air outlets for accurate cooling.<br />3. The fan with a built-in 1800mAh battery, can quickly charge and offer 6h working time.<br />4. Turbines on both sides gather wind to cool down quickly without getting your hair stuck.<br />5. Flexible arms allow you to adjust the wind angle at will.<br />6. Suitable for home, casual, shopping, camping, outdoor events, trips, hiking, etc.</p>\r\n<h3><strong>Operation Notes:</strong></h3>\r\n<p>1. In standby mode, single-click button to switch wind speed. At the highest wind speed, single-click button to shut down. Long press the button for 1.5s in any wind speed to turn off the fan.<br />2. When the fan is working, the indicator light flashes quickly, indicating that the power is about to be exhausted. Please charge the fan in time. After fully charged, the indicator light will be always-on.<br />3. For the first time you use it, pls charge it for more than 2 hours before use. If you do not use it for a long time, pls charge it once every three months to avoid battery damage.</p>\r\n<h3><strong>Specification:</strong></h3>\r\n<p><strong>Material: </strong>ABS + PC + Silicone<br /><strong>Color: </strong>White<br /><strong>Product Size: </strong>22x17x6cm<br /><strong>Voltage/Current: </strong>DC 5V 1A<br /><strong>Charging Interface: </strong>Type-C<br /><strong>Built-in Battery: </strong>1800mAh polymer battery<br /><strong>Charging Time: </strong>About 3h<br /><strong>Working Time:</strong> Up to 6h</p>\r\n<h4><strong>Note:</strong></h4>\r\n<p>Please allow a 1-3cm (0.4-1.18\") difference due to manual measurement and slight color variation for different display settings.<br />Thank you for your understanding, nice day!</p>\r\n<h4><strong>Package Includes:</strong></h4>\r\n<p>1 x Hands-free Mini Fan<br />1 x USB Cable<br />1 x User Manual</p>', 'Available', '[\"trending_product\"]', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-13 05:50:20', '2021-06-13 05:52:56', NULL, NULL);
