(106, 'Remote Control Induction Drone Quadcopter', 39.99, 31.79, 8.20, 0, '0.00', 9293697, '18-24', 2, 'Baby', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Baby ,Kids', 'Baby & Kids', '<p><strong>Zf04 RC mini quadcopter induction drone smartwatch remote sensing gesture aircraft ufo hand control drone altitude hold kids toys &amp; hobbies remote control toys RC helicopters.</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Features:</strong></p>\r\n<p>100% brand new and of high quality.</p>\r\n<p>Intelligent four-axis aircraft, using gravity induction control system.</p>\r\n<p>360 degrees infrared obstacle avoidance, stable flight.</p>\r\n<p>Open the switch, throw the drone into the air, it will perform a flight sense.</p>\r\n<p>Tilt the watch with your hand movements, enabling simultaneous control of the drone.</p>\r\n<p>360 degrees rolling photography, shot from various angles.</p>\r\n<p>Built-in barometer, set high accurately, intelligent suspension.</p>\r\n<p>The led lighting effect looks cool during the night.</p>\r\n<p>Simple operation, easy to learn.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Specifications:</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Color:</strong> yellow, red</p>\r\n<p><strong>Material:</strong> plastic</p>\r\n<p><strong>Size: </strong>about 17*17*4cm</p>\r\n<p><strong>Remote distance:</strong> about 50m</p>\r\n<p><strong>Battery:</strong> built-in 3.7v 500mah lithium battery（include）</p>\r\n<p><strong>Watch battery:</strong> built-in 3.7v 150mah lithium battery</p>\r\n<p><strong>Charging time: </strong>about 60min</p>\r\n<p><strong>Duration of flight:</strong> about 7min</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Package includes:</strong></p>\r\n<p>1*quadcopter</p>\r\n<p>1*2.4g remote control watch</p>\r\n<p>1*water drop remote controller</p>\r\n<p>2*blades</p>\r\n<p>1*screwdriver</p>\r\n<p>1*USB cable</p>\r\n<p>1*watch charging cable</p>', 'Available', 'untapped_product', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-13 05:58:37', '2021-06-13 05:58:37', NULL, NULL),
(107, 'Flexible Shaft Extension Bits', 19.99, 2.49, 17.50, 409, '1018.41', 484032, '18-24,25-34,34-44,45-54', 2, 'Men', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Flexible Shaft Extension Bits,Car Accessories', 'Garden Improvement,Car Accessories', '<p><strong>Ix or remove screws in inaccessible areas.</strong><br /><strong>This Flexible Shaft Extension Bits Set is perfect for small space operations, suitable for computer chassis, electrical cabinets, furniture, electrical appliances, and other places that normal screwdrivers can not work.</strong><br /><br /></p>\r\n<h2><strong>FEATURES:</strong></h2>\r\n<p>It can be bent, twisted, and rotated at many different angles. It can be drilled into a small space, in a variety of gaps, rather than your hand, flexible installation work. Let this flexible shaft extension help you solve more problems quickly.<br />The inner shaft has a wide range of rotation and high-quality stability. When the inside shaft rotates, the flexible black casing protects your hands from hurt and perfectly completes your work.<br />Easy Replacement. Compatible with Small wrench, Cordless Screwdriver, Pneumatic Screwdriver, Torque drill, Electric screwdriver. Flexible drill extension screwdriver with many application scenarios.<br />Exquisite craftsmanship, high-quality plastic, and metal materials combine to become a good quality assurance product.<br /><br /></p>\r\n<h3><strong>Specification:</strong></h3>\r\n<p><strong>Size: </strong>295mm<br /><strong>Material: </strong>chrome vanadium steel<br /><strong>Color: </strong>Black (as shown)<br /><strong>Types of screwdrivers:</strong> notched, cross, and plum<br /><strong>Notch:</strong> 4, 5, 6<br /><strong>Phillips: </strong>ph0, ph1, ph2, ph3<br /><strong>Plum: </strong>t15, t20, t25<br /><strong>Flexible shaft length:</strong> 270mm &plusmn; 3mm</p>\r\n<h4><strong>Package Content:</strong></h4>\r\n<p>Type 1 - Flexible Shaft<br />1 &times; Flexible Shaft. (295mm)<