(109, 'Floating Plant Pot', 124.95, 66.90, 58.05, 66, '4415.40', 1586008, '18-24,25-34,34-44,45-54,55-64', 2, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Floating Plant Pot,Home Improvement,Home', 'Home Improvement', '<p><strong>You can quickly sweep your finger between the plant pot and the oak wooden platform - or even give them a gentle spin to let the pot rotate. We created the Floating Plant Pot to introduce this experience at home or in the office where you can enjoy indoor plants but in a new way.</strong><br /><strong>You can enjoy this futuristic indoor plant pot either with air plants or artificial plants. This makes it the best indoor planter for modern home decoration.</strong><br /><br /></p>\r\n<h2><strong>Feature:</strong></h2>\r\n<p><strong>Lovely appearance: </strong>unique creative design, flower pots look like floating stars, very fashionable, very cute gifts suitable for friends and lovers.<br /><strong>Fun decoration: </strong>gardening method, suitable for decorating gardens, tables, bookshelves, dining tables, living rooms, main halls, and any place.<br /><strong>Lightweight: </strong>it is made of resin and natural materials, environmentally friendly, and safe. Lightweight and easy to remove.<br />With automatic induction and rotation technology, you can rotate the flowerpot at any time. This is definitely a novel and interesting gift.<br /><br /></p>\r\n<h2><strong>Specifications :</strong><br /><br /></h2>\r\n<p><strong>Bearing weight: </strong>300g miniature plants<br /><strong>Suspension distance: </strong>20mm<br /><strong>Base size:</strong> 13.4*13.4*2.8cm/5.3*5.3*1.1inch<br /><strong>Flower pot size: </strong>9*9*5cm/3.5*3.5*2inch<br /><strong>Packing size: </strong>17.8*17.8*12.4cm/7*7*4.9inch<br /><strong>Power supply: </strong>12V/, 1A<br /><strong>Weight:</strong> 1350g/set<br /><br /></p>\r\n<h4><strong>Package List:</strong></h4>\r\n<p>Base * 1<br />flowerpot * 1<br />power cord * 1<br />English manual * 1</p>', 'Available', 'untapped_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-13 06:17:28', '2021-06-13 06:17:28', NULL, NULL),
(110, 'Sands Outdoor Tea Set', 50.01, 27.93, 22.08, 51, '1424.43', 233486, '18-24,25-34,34-44,45-54,55-64', 2, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Sands Outdoor Tea Set,Kitchen & household,Household', 'Kitchen & household,Outdoor', '<p><strong>Take your camping gear to the next level with our Sands Outdoor Tea Set. This high-quality set is designed to be lightweight and easy to carry. Beautifully packaged in a hardcover set for optimal protection, it comes with everything that you need for a perfect outdoor tea experience. Available in two beautiful colors, grab yours today!</strong></p>\r\n<h2><strong>FEATURES:&nbsp;</strong></h2>\r\n<p><strong>Teapot craft:</strong> After being fired at a high temperature of 1250℃ to 1400℃, using a thousand years of Chinese pottery craftsmanship, Jingdezhen raw materials are used to create extraordinary quality.<br /><strong>Material: </strong>Made of durable high-quality ceramics, fine texture, hard and durable, beautiful, simple, and practical. No deformation, not easy to damage, durable, and easy to clean [unique design]<br /><strong>Special design:</strong> Chinese tea ceremony culture has a long history. It uses a simple and generous style, suitable for afternoon tea, family gatherings, or gatherings of friends.<br /><strong>Portable tea set:</strong> Chinese traditional porcelain handmade tea set, easy to carry.</p>\r\n<h3><strong>SPECIFICATIONS:&nbsp;</strong></h3>\r\n<p><strong>Material:</strong> Ceramics<br /><strong>Color:</strong> As shown<br /><strong>Size:&nbsp;</strong></p>\r\n<p><strong>Tea pot: </strong>11.8x7.1cm / 160ml<br /><strong>Tea cup: </strong>5.2x2.8cm / 50ml<br /><strong>Tea caddy: </strong>8.4x8cm / 230ml<br /><strong>Tea strainer:</strong> 7.3x4.7cm<br /><strong>Tea bag: </strong>22.7x8cm</p>\r\n<h4><strong>PACKAGE INCLUDES:</strong></h4>\r\n<p>1 * teapot<br />4 * cup<br />1 * Tea Canister<br />1 * Travel Bag</p>', 'Available', 'trending_product', 1, NUL