(111, 'Pet Hair Removal Massaging Shell Comb', 27.06, 2.33, 24.73, 1897, '4420.01', 389441, '18-24,25-34,34-44', 1, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Pet Accessories,Pet Hair Removal Massaging Shell Comb', 'Pet Accessories', '<p><strong>This curvy tip-designed brush is the brand new way to detangle your pets\' coats in a scratch-free and pain-free way!&nbsp;</strong></p>\r\n<p><strong>The pet hair removal massaging shell comb removes up to 95% of the dead hair of your pets and untangles them in just 10 minutes! Get rid of tangles, knots, shedding, and mats in the most gentle way possible!</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Features:</strong></p>\r\n<p>2-in-one gentle massage design - the 2-in-1 design massages your pets while loose fur at the same time!</p>\r\n<p>Promotes a healthy and shiny fur coat - perfect for all fur types! Regular brushing and massaging can help improve blood circulation and relax your pets\' minds while getting rid of the loose fur to give them a shiny coat!&nbsp;</p>\r\n<p>Safe and durable material - made of durable high-quality material for a lifetime of use.</p>\r\n<p>Safe for all kinds of pets - can be used on small and large cats, dogs, and other fun-loving pets!</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Specifications:</strong></p>\r\n<p><strong>Material: </strong>bpa &amp; non-toxic abs</p>\r\n<p><strong>Size: </strong>10cm/3.94\" x 9cm/3.54\" x 1.5cm/0.59\"</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Package includes:</strong></p>\r\n<p>1x pet hair removal massaging shell comb</p>', 'Available', 'trending_product', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-13 06:26:32', '2021-06-13 06:26:32', NULL, NULL),
(112, 'Outdoor Gas Camping Stove', 29.99, 3.50, 26.49, 2, '7.00', 2952129, '18-24,25-34,34-44,45-54', 2, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Outdoor Gas Camping Stove,Kitchen & household,Kitchen,Household', 'Kitchen & household,Outdoor', '<p><strong>There is no better feeling than devouring a flavor-filled meal after spending a long day in the wild. Our revolutionary Portable Backpacking Camping Stove was designed to make it easy to cook fancy and delicious meals outdoors. features a non-stick surface, making the cooking and cleaning process a simple walk in the park. In addition, the backpacking stove is super lightweight and tiny, making it extremely portable and easy to carry. Our camping gas stove can even fit in even the smallest compartments. The best part of all, the high-power portable camping stove provides extreme heat which can cook food within minutes. Our portable camping burner features easy flame intensity control and also prevents any type of burns to the user. Take the camping cooking stove on your next camping trip with you and cook your meals quickly and efficiently</strong>.</p>\r\n<h2><strong>FEATURES:</strong></h2>\r\n<p><strong>STURDY &amp; ERGONOMIC DESIGN: </strong>The small camping stove features extremely strong brackets which provide full stability to the pots and pans on the burner. In fact, the brackets on our single burner camp stove can handle a large amount of weight with ease.<br /><strong>PORTABLE: </strong>Our camping burner is extremely lightweight and convenient to carry. It weighs only about 10oz and can fit extremely tight spaces.<br /><strong>EASY TO COOK &amp; CLEAN: </strong>Traditional camping stoves often take ages to properly light up and cook the food. Cleaning the stove itself is another rough task. With our portable camping cooking stove, cooking &amp; cleaning can be done literally within minutes. To clean, simply wipe the camping gas stove with a wet paper towel.</p>\r\n<p><strong>HIGH QUALITY: </strong>Food sticking to the pan can cause serious issues in the wild and lead to potentially life-threatening situations. This portable camp stove is made from premium material designed to streamline the cooking experience and keep you focused on your wild adventure.</p>\r\n<h3><strong>SPECIFICATIONS:</strong></h3>\r\n<p><strong>Material:</strong> Stainless steel, copper, aluminum<br /><strong>Power: </strong>3000W<br /><strong>Gas consumption: </strong>50-100 g/h<br /><strong>Unfolded size: </strong>Approx. 17 * 7cm / 6.7 * 2.8in (D * H)<br /><strong>Stove weight: </strong>Approx. 238g / 8.4oz<br /><strong>Plastic box size: </strong>Approx. 12 * 8.5 * 7.5cm / 4.7 * 3.3 * 3.0in<br /><strong>Total weight:</strong> Approx. 290g / 10.2oz</p>\r\n<h4><strong>Packages Includes:&nbsp;</strong></h4>\r\n<p>2 Portable camping stoves</p>', 'Available', 'facebook_ads', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-13 06:35:25', '2021-06-13 06:35:25', NULL, NULL),
(113, 'Interactive Dog Food Treat Ball', 28.45, 7.98, 20.47, 1545, '12329.10', 224658, '[\"18-24\",\"25-34\",\"34-44\"]', 1, '[\"Unisex\"]', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Interactive Dog Food Treat Ball,Pet Accessories,Pet', '[\"Pet Accessories\"]', '<p><strong>The IQ Treat Interactive Dog Food Feeder is a fun rendition of a slow-feed bowl that promotes a healthy lifestyle for your pet. You can put a portion of your dog&rsquo;s meal in the ball, only allowing them to eat what is dispensed when the ball is rolled.</strong></p>\r\n<h2><strong>Features:</strong></h2>\r\n<p>The transparent storage tank allows your pets to see their fave food inside.<br />Reduces boredom and destructive behavior.<br />It can be filled with treats or kibble.<br />The internal special labyrinth structure.<br />Protecting snacks from crushing.<br />The interactive toy ball easily unscrews to add food or treats.<br />It can be set to the desired difficulty level using the ball&rsquo;s interior disc.<br />It has an adjustable leaking hole to slow down the speed of your pet eating.</p>\r\n<h3><strong>Specifications:</strong></h3>\r\n<p><strong>Material:</strong> ABS Plastic<br /><strong>Product Size: </strong>H: 4.6in W:3.9in<br /><strong>Color: </strong>Green<br /><strong>Bone shape: </strong>11*4.5cm for cats</p>\r\n<h4><strong>Package includes:</strong></h4>\r\n<p>1* Pet Iq Ball</p>', 'Available', '[\"untapped_product\"]', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-13 06:43:35', '2021-06-13 07:12:37', NULL, NULL),
