he skin, provide massager for the body, face, arms, legs, buttocks, and back, which can achieve the effect of a thin face.</p>\r\n<h3><strong>Specification:</strong></h3>\r\n<p><strong>Material:</strong> ABS<br /><strong>Power: </strong>USB rechargeable<br /><strong>Voltage:</strong> 3.7V<br /><strong>Power: </strong>2.5W<br /><strong>Battery Capacity: </strong>1000mAh<br /><strong>Charging Time:</strong> 2-3 hours<br /><strong>Massage Time:</strong> 10 minutes<br /><strong>Charging Indicator:</strong> red light is on when charging, blue light is on when fully charged<br /><strong>Default Working Time:</strong> automatically power off after 10 minutes of work<br /><strong>Product Size: </strong>182*52*23mm</p>\r\n<p>&nbsp;</p>\r\n<h3><strong>Note:</strong></h3>\r\n<p>It is recommended to use over-exposed skin after skin repair to avoid secondary damage.<br />It is recommended not to use people with severe purulent acne or obvious trauma on their faces.<br />It is recommended that patients with severe skin inflammation or particularly sensitive skin should not have any uncomfortable reactions before trying to use the device for one minute.<br />Be careful when using it on bleeding sites.<br />Patients with hearing aids, such as ear inflammation or hearing aids, should be used under the guidance of a doctor.<br />Patients with severe heart disease cannot use it.<br />Children under 12 cannot use it.</p>\r\n<h4><strong>Package Include:</strong></h4>\r\n<p>1 x Body<br />1 x Charging Cable<br />1X Controller<br />1 x Lifting Belt<br />1 x English Manual</p>', 'Available', '[\"trending_product\"]', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-13 07:26:01', '2021-06-13 08:22:38', NULL, NULL),
