(120, 'Alivio Fit Rechargeable Heated Knee', 69.99, 24.25, 45.74, 1180, '28615.00', 1261013, '18-24,25-34,34-44,45-54,55-64', 1, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Alivio Fit Rechargeable Heated Knee,Health & Beauty,Beauty', 'Health & Beauty', '<p><strong>The rechargeable Viktor Jurgen knee heated massager can provide a comfortable vibration massage to help reduce knee/joint pain, stiffness as well as swelling from your knees. The battery can last up to 2 hours, it&rsquo;s portable and convenient to wear for outdoor sports in winter or wear indoors for work or injury recovery.</strong></p>\r\n<h2><strong>FEATURES:</strong></h2>\r\n<p>Suitable for patients who have rheumatoid arthritis and other types of arthritis.<br />Effective for sports injury recovery during cold weather or promote blood circulation for healing.<br />Effectively protect your knee joints from low temperatures in the outdoor environment.</p>\r\n<h3><strong>SPECIFICATIONS:</strong></h3>\r\n<p><strong>&nbsp;Material: </strong>Breathable Neoprene Material.<br /><strong>&nbsp;3 heat settings:</strong> red-highest, white-medium, blue-lowest.<br /><strong>&nbsp;Size: </strong>59*21.8 cm.</p>\r\n<h4><strong>PACKAGE INCLUDES:</strong></h4>\r\n<p>1 x Knee Heating Pad.<br />1 x USB Cable (2M).<br />1 X US Plug (According to your order).</p>', 'Available', 'untapped_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-13 08:36:32', '2021-06-13 08:36:32', NULL, NULL),
