(122, 'Ultimate Carbon Kit', 60.95, 7.91, 53.04, 196, '1550.36', 131675, '[\"18-24\",\"25-34\",\"34-44\",\"45-54\",\"55-64\"]', 2, '[\"Unisex\"]', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Ultimate Carbon Kit,Health & Beauty,Beauty', '[\"Health & Beauty\"]', '<p><strong>This 100% Natural Charcoal Powder effectively whitens teeth by absorbing stains causing debris and bacteria. The activated organic charcoal whitening powder removes stains without toxic chemicals, promoting good oral health and preventing bad breath.</strong></p>\r\n<h2><strong>Features:</strong></h2>\r\n<p><strong>Whiter &amp; brighter: </strong>The teeth whitening powder removes stains of cigarettes, tobacco, coffee, tea, wine, etc., detoxifies your mouth, fights cavities, plaque, bacteria, gingivitis, and prevents tooth decay, strengthens enamel, improves gum health, and freshens breath. Higher efficiency than toothpaste, strips, kits, &amp; gels.<br /><strong>100% natural: </strong>The activated charcoal teeth whitening powder is made from natural organic ingredients from the purest sources and doesn\'t have any harsh chemicals. No fluoride and no artificial colors. Great for sensitive teeth and improves oral health.<br /><strong>Stunning results: </strong>Use twice a day, obvious changes come in after 2-3 days of treatments, results will vary depending upon usage via everyone\'s oral hygiene state.</p>\r\n<p><strong>How does it work:</strong></p>\r\n<p>Dip a slightly wet toothbrush into the activated charcoal powder.<br />Brush your teeth gently with the charcoal for 2 minutes.<br />Let the charcoal sit and absorb the toxins from your teeth for 2-3 minutes for optimal results.<br />Rinse your mouth with water and brush your teeth with bamboo or regular toothpaste to get rid of any charcoal residue. Use once or twice daily.</p>\r\n<h3><strong>Specifications:</strong></h3>\r\n<p><strong>Color:</strong> black<br /><strong>Capacity: </strong>30g<br /><strong>Main Ing