(123, 'Rechargeable Trims Shaver', 30.00, 18.37, 11.63, 381, '6998.97', 3286998, '18-24,25-34,34-44,45-54,55-64', 2, 'Men,Baby', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Health ,Beauty,Rechargeable Trims Shaver', 'Health & Beauty', '<p><strong>This product is a rechargeable shaver, and it\'s full body washable. This product has two sides heads, and an individually reflex action system can always get close to the facial contour to effectively shave the hair of any length and in any growing direction. Reasonable design &amp; the cooperation of two blades will bring a better shaving effect.</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Features:</strong></p>\r\n<p><strong>Exclusively foil shaver for man:</strong> adopt dual high-speed precision blades, this electric hair razor for man helps customize hair shaving on your face, beard, mustaches, arms, legs, armpits, and chest hair in minutes.&nbsp;</p>\r\n<p><strong>Safe, efficient, and painless:</strong> adopt hypoallergenic stainless-steel blades, gentle for all skin. Unlike the competition, this electric beard trimmer mustache shaver has no oil needed to maintain high-quality performance blades. Its 200 times high-speed high-frequency oscillation helps fastly and safely shave any unwanted hair to achieve results.&nbsp;</p>\r\n<p><strong>4 trimming guide combs:</strong> this man&rsquo;s electric razor is equipped with 4 trimming guide combs for customized trim hair length at 1mm/2mm/4mm/6mm. Trim thicker, coarse, and longer hair, for a customized trim length on the beard, mustaches, and body hair styling.&nbsp;</p>\r\n<p><strong>Wet and dry safe to shave:</strong> ipx7 waterproof it can be used on wet or dry skin anytime, anywhere. An anti-slip grip ensures easy shaving in or out of the shower. The detachable trimmer head design and long cleaning brush make this hair trimmer easy to clean. No more nicks, cuts, and irritation with this electric beard trimmer.&nbsp;</p>\r\n<p><strong>Cord