urce:</strong> LED<br /><strong>Voltage:</strong>100-240 V<br /><strong>Power:</strong>1 W<br /><strong>Material: </strong>ABS<br /><strong>Size: </strong>Diameter 108mm Thick 18mm<br /><strong>Weight: </strong>Single 105g</p>\r\n<h4><strong>Package included:</strong></h4>\r\n<p>1 * LED Light or<br />1 * Power (EU Plug)</p>', 'Available', 'facebook_ads', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-13 09:14:07', '2021-06-13 09:14:07', NULL, NULL),
