the edges more three-dimensional and stylish.<br /><strong>Waterproof and Dustproof: </strong>The entire organizer is encapsulated, the lids and drawers are dustproof and splash-proof, so your cosmetics and tools are absolutely dust-free, helping you to maintain everything inside clean.</p>\r\n<p>Its compact design is versatile and can be used in the bedroom, bathroom, dressing room, dorm room, on a vanity table, on the countertop, desktop, or anywhere. Organizing cosmetics has never been easier. Showcase your cosmetic collection in style with this modern makeup organizer.</p>\r\n<p><strong>LARGE STORAGE CAPACITY:</strong><br />With its large capacity, high transparent finish, stylish model, convenient use, you can organize all your makeup, perfume, and jewelry easily accessible! The 3-layer drawers provide plenty of storage space to store makeup tools, store earrings, necklaces, brooches, pendants, rings, and more in the drawers. Keep your makeup, lipstick, lip gloss, foundation, creams, and lotions easily visible with separate storage at the top.</p>\r\n<h3><strong>Characteristics:</strong></h3>\r\n<p>Large open space and three drawers<br />Space capsule design, rugged, water-resistant, and versatile design<br />Decorated with a transparent box, dustproof, and water-resistant cover, you no longer have to worry about wet or dirty cosmetics<br />Made of high-quality material, high-quality burst resistance protects from injury and damage</p>\r\n<p>&nbsp;</p>\r\n<h3><strong>Specifications:</strong></h3>\r\n<p>Material: plastic<br />Size: approx. 28 x 28 x 38 cm (L * W * H)<br />Style: Nordic</p>', 'Available', 'untapped_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-13 09:26:34', '2021-06-13 09:26:34', NULL, NULL),
(128, 'Automatic Compression Vacuum Pump', 47.77, 11.42, 36.35, 158, '1804.36', 274099, '18-24,25-34,34-44', 2, 'Men,Women,Baby', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Home Improvement,Automatic Compression Vacuum Pump', 'Home Improvement', '<p><strong>This mini automatic compression vacuum sealer is a compact and portable gadget that will be of great use at home and outdoor. Simply press the white button of an electronic pump and wait for a few seconds to vacuum out the air automatically, then the bag is sealed tightly. Moreover, its high-quality material is durable and eco-friendly. The automatic operation and multi-function will make your packing tasks much more user-friendly and comfortable.</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Features:</strong></p>\r\n<p><strong>Save time and space:&nbsp;<br /></strong>This automatic vacuum sealer pump is easier to operate and more efficient than manual pumps. Can save you unnecessary time and space.</p>\r\n<p><strong>USB charging:<br /></strong>Strong vacuum, imported motor, strong suction, low noise, low heat, automatic vacuum-sealed bag. The rechargeable USB port, complete charging within 3 hours.</p>\r\n<p><strong>Keep it fresh:<br /></strong>The unique suction technology creates an airtight environment for food preservation. It has been tested to be 5 times longer than other vacuum sealers to keep the food fresh.</p>\r\n<p><strong>Wide range of uses:<br /></strong>Vacuum sealers not only extend the life of solid and semi-solid foods but also can be used in vacuum clothing bags to keep the house clean and tidy.</p>\r\n<p><strong>Ideal gifts:<br /></strong>For food storage and travel compression bags, it is a good choice for home and travel and is an ideal gift for your friends and family.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Specifications:</strong></p>\r\n<p><strong>Body material: </strong>abs</p>\r\n<p><strong>Color:</strong> blue, pink</p>\r\n<p><strong>Pump size:</strong> 85 x 52 mm</p>\r\n<p><strong>Power: </strong>4.2v</p>\r\n<p><strong>Battery:</strong> 800mah (built-in)</p>\r\n<p><strong>Net weight:</strong> 300g</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Package includes:</strong></p>\r\n<p>Vacuum machine * 1</p>\r\n<p>Large bags&nbsp; 1</p>\r\n<p>Small bags 4</p>\r\n<p>&nbsp;</p>', 'Available', 'untapped_product', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-13 09:34:30', '2021-06-13 09:34:30', NULL, NULL);
