(129, '3 in 1 Small & Handy Multi-functional Skin Peeler & Vegetable Shredder', 19.99, 3.33, 16.66, 54, '179.82', 2424182, '18-24,25-34,34-44,45-54,55-64', 2, 'Women', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', '3 in 1 Small & Handy Multi-functional Skin Peeler & Vegetable Shredder,Kitchen & household,Vegetable Shredder,household,Kitchen', 'Kitchen & household', '<p><strong>Standard blade perfect for potatoes and carrots; soft skin blade can be used on tomatoes and kiwi, Julienne blade can be used on just about any fruit or vegetable for thin matchstick strips</strong><br /><strong>Peel or slice any type of vegetables or fruits the quickest and easiest way with the 3-in-1 Rotary Peeler. Using this 3-in-1 Rotary Peeler is pretty easy! Just press on the twist dial to rotate and select among the 3 stainless steel blades with 3 different functions.</strong></p>\r\n<h3><strong>3 DIFFERENT BLADES IN 1 DESIGN:</strong></h3>\r\n<p><strong>Standard Blade:</strong> Use peel vegetables or fruits like carrots, potatoes, cucumbers, apples, etc. with ease and avoid wasting much flesh off your vegetables.<br /><strong>Serrated Blade:</strong> Perfect for peeling soft-fleshed fruits or vegetables like tomatoes, kiwis, etc.<br /><strong>Julienne Blade: </strong>Easily turn your veggies into perfect, even slices for your dish ingredients or garnishing.</p>\r\n<h3><strong>STAINLESS STEEL BLADES:</strong></h3>\r\n<p>This trio peeler features dual stainless-steel swivel blades that can easily handle bumps and curves with ease without clogging or losing their edge.<br />three blades combined<br />The blade rotation design is hidden in the concave part, which is safe and easy to carry around.<br />It\'s easy to use, disassemble and clean for your convenience. Plus, it\'s rust-resistant, designed for long-lasting use.</p>\r\n<h3><strong>TIME-SAVING:</strong></h3>\r\n<p>Slice, peel, shred your preparation time in seconds saving you time, effort and energy. It also comes with a hook hole that you can use not just to hang on your shelves but also functions as a potato eye remover.</p>\r\n<h3><strong>SAFE, EASY, FUN &amp; CREATIVE:</strong></h3>\r\n<p>3 In 1 is a handy compact tool<br />installed with a Straight blade, Soft-fruit blade, and Julienne Blade that can be rotated whenever you need them<br />saves you the hassle of looking for the different blades for different vegetables or fruits.<br />simply switch between blades to peel different types of Fruits &amp; Vegetables</p>\r\n<p>&nbsp;</p>\r\n<h3><strong>PRODUCT SPECIFICATION:</strong></h3>\r\n<p><strong>Material: </strong>Plastic and Stainless Steel<br /><strong>Diameter:</strong> 9.3cm / 3.7\"<br /><strong>Height: </strong>2cm / 0.8\"</p>\r\n<h4><strong>Package Inclusion/s:</strong></h4>\r\n<p>1 x Rotary Peeler.</p>', 'Available', 'trending_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-13 09:40:07', '2021-06-13 09:40:07', NULL, NULL),
(130, 'Turbo Scrub Electric Cleaning Brush Adjustable', 59.99, 15.89, 44.10, 181, '2876.09', 364424, '18-24,25-34,34-44', 2, 'Men,Women,Baby', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Home Improvement,Turbo Scrub Electric Cleaning Brush Adjustable', 'Home Improvement', '<p><strong>Do you spend a lot of time cleaning in the bathroom and kitchen while hurting your back and knees? This turbo scrubber is the best spin scrubber. It makes cleaning easy, quick, and painless. It cuts through soap scums, mold, mildew, or any sort of stains without any effort and harsh abrasive chemicals. The high-torque scrubbing power does all the hard work for you. It comes with 3 different bristles to suit all your cleaning needs. With the extension arm, you prevent back, knee, and joint pain and make it easy to reach the most hard-to-reach spots. Use it with quick-dissolving cleaning tablets for best results.</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Features:</strong></p>\r\n<p>Fast and easy cleaning - the rotating brush spins away dirt with minimal effort and without harsh, abrasive chemicals.</p>\r\n<p>Perfect for people with joint, knee, and back pain - clean without bending or kneeling.</p>\r\n<p>Perfect for cleaning the kitchen, bathroom, garden, car, etc. Does not cause any scratches or marks.</p>\r\n<p>Reach the most hard-to-reach areas, corners, and crevices without any effort.</p>\r\n<p>Comes with 3 different brush heads to suit all your cleaning needs.</p>\r\n<p>For both indoor and outdoor use.</p>\r\n<p>Cut through soap scum, mildew, and grime.</p>\r\n<p>Waterproof - the water-proof seal design makes it safe to operate under wet conditions such as showers, tubs, sinks, etc.</p>\r\n<p>Cordless and rechargeable -&nbsp; more convenient and hassle-free.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Specification:</strong></p>\r\n<p>&nbsp;<strong>Charging time:</strong> 5 hours</p>\r\n<p><strong>Work time: </strong>about 60 minutes</p>\r\n<p><strong>Maximum length:</strong>&nbsp; 112cm / 41\"</p>\r\n<p><strong>Minimum length:</strong> 64cm / 25\"</p>\r\n<p><strong>Flat brush head diameter:</strong> 12.5cm / 4.92\"</p>\r\n<p><strong>Round brush head diameter:</strong> 11.5cm / 4.52\"</p>\r\n<p><strong>Cone brush head diameter:</strong> 5.5cm / 2.16\"</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Package includes:</strong></p>\r\n<p>1x electric scrubber&nbsp;</p>\r\n<p>1x ac adapter</p>\r\n<p>3x brush head</p>\r\n<p>1x ​user manual</p>', 'Available', 'trending_product', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-13 09:45:47', '2021-06-13 09:45:47', NULL, NULL),
(131, 'Multi Function Leather Bag For Macbook, Surface, Laptop', 109.95, 14.99, 94.96, 17, '254.83', 1240748, '18-24,25-34,34-44', 2, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Computer Accessories,Multi Function Leather Bag For Macbook, Surface, Laptop', 'Mobile Accessories', '<p><strong>Protect your online business&rsquo;s most valuable asset with this laptop bag that can transform into an ergonomic laptop stand and mouse pad. Slip it into this leather laptop sleeve and rest easy knowing that it&rsquo;ll be ready to go when you get to the coffee shop. When you get there, it turns into a laptop stand, making deep work a breeze. It also comes with a small pouch and a cord organizer. This 3 in 1 laptop bag set is going to be your new best friend!</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Features:</strong></p>\r\n<p><strong>Protection:<br /></strong>Durable outer vegan leather sleeves mean your laptop is safe and sound.</p>\r\n<p><strong>Laptop stand:<br /></strong>Transforms into a laptop stand-angle your computer for ideal ergonomics.</p>\r\n<p><strong>3 in 1:<br /></strong>Includes small pouch and cord organizers-</p>\r\n<p>-you need to make an impression at an important meeting</p>\r\n<p>-you have to take your laptop to-go</p>\r\n<p>-you&rsquo;re coworking at a fun location</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Specifications:</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Material:</strong> PU leather</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Product weight:&nbsp;</strong></p>\r\n<p>11/12 inch: 12.69 oz (0.36 kg)</p>\r\n<p>13/14 inch: 14.81 oz (0.42 kg)</p>\r\n<p>15 inch: 17.63 oz&nbsp; (0.5 kg)</p>\r\n<p><strong>Product size:</strong> available in 3 sizes - 11/12 inch, 13/14 inch, 15 inch</p>\r\n<p>11/12 inch: 12.79 in x 9.44 in (325 mm x 240 mm)</p>\r\n<p>13/14 inch: 13.77 in x 9.92 in (350 mm x 252 mm)</p>\r\n<p>15 inch: 15.35 in x 11.02 (390 mm x 280 mm)</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Package includes:</strong></p>\r\n<p>This style is not available in our traditional gift packaging due to the size of the item. Your item will instead arrive at your door securely packaged in a kraft box. Select styles include a fabric dust bag for storage.</p>\r\n<p>&nbsp;</p>', 'Available', 'untapped_product', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-13 11:03:34', '2021-06-13 11:03:34', NULL, NULL),
(132, 'Portable Hair Trimmer', 29.99, 4.16, 25.83, 295, '1227.20', 3251058, '[\"18-24\",\"25-34\",\"34-44\",\"45-54\",\"55-64\"]', 2, '[\"Men\"]', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Portable Hair Trimmer,Beauty,Man\'s Fashion', '[\"Health & Beauty\"]', '<p><strong>This 2 in 1 Male Shaver has a full-size blade that will help keep your beard or sideburns trim and neat. This electric micro trimmer is a head-to-toe full-body grooming system. You can also trim your frontal or back hairline, keeping your head clean and looking good. It will get the job done without causing injuries or irritating your delicate skin in any way. The switchblade trimmer also has a snap on the guide that stabilizes it and improves control.</strong></p>\r\n<h2><strong>Features:</strong></h2>\r\n<p><strong>The Easiest Trimming Of Your Life: </strong>This Portable Hair Trimmer is a compact and solid hair trimmer for easy and comfortable hair removal. This trimmer lets you trim your hair anytime, anywhere, for you to keep your professionally groomed look. With built-in light so that you can see clearly what you&rsquo;re doing. It comes in a handy slim design allowing you to carry it anywhere with no hassles.</p>\r\n<p><strong>Safe and gentle: </strong>A full-body grooming system and is built for the tough stuff. It is safe to touch even though it gets as close as a blade. That makes it easier for you to trim. Removes unwanted hair instantly and painlessly.<br />It comes in portable and cordless, making it easier for you to use and carry around. An angled trimmer for noses, ears, and eyebrows, can quickly and evenly trim your facial hair.</p>\r\n<p><strong>Crafted for convenience: </strong>The Portable Hair Trimmer is made with ABS, rubber, and stainless steel. With precision snap-on guides for superior control. It has two different ends, one for trimming nose hair, beards, sideburns, eyebrows, mustache, etc.; the other end for haircut. Each end is equipped with two different sizes of comb attachment (2mm/4mm, 6mm, 1.5mm, 2.0cm), suitable for you to take control of the length you want with your hair.</p>\r\n<p>With built-in light and powered by 2 x AAA batteries (not included). Packed in a box powerful enough for the tough stuff, but yet so gentle for the most sensitive skin.</p>\r\n<h3><strong>Specifications:</strong></h3>\r\n<p><strong>Material: </strong>ABS + Rubber + Stainless Steel<br /><strong>Power Supply:</strong> 2 x AAA battery (not included)<br /><strong>Color:</strong> Orange<br /><strong>Weight: </strong>86g<br /><strong>Size: </strong>17x2.5x4cm (Length x Width x Height)</p>\r\n<h4><strong>Package Content:</strong></h4>\r\n<p>1 Hair Trimmer<br />4 Comb Attachments<br />1 Protective Cap<br />1 Cleaning Brush<br />1 User Manual</p>', 'Available', '[\"trending_product\"]', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-14 04:02:18', '2021-06-14 04:58:25', NULL, NULL),
(133, 'Electric Hand Therapy Massager', 89.99, 55.49, 34.50, 382, '21197.18', 748242, '18-24,25-34,34-44', 2, 'Men,Women,Baby', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Health ,Beauty,Electric Hand Therapy Massager', 'Health & Beauty', '<p><strong>Have frequent strong handwork, and your wrist, finger muscle and joint get numb, stiff and sore, or even fingers deformed?</strong></p>\r\n<p><strong>The hand massager is the perfect solution to these problems! Intelligent air pressure, point massage, heat compressor, massage the pressure points around the palms and fingers. Great gift for people who use their hands more without relaxation such as computer workers, pianists, and housewives.</strong></p>\r\n<p><strong>The total hand massager squeezes away the stress and strain of daily life to give you a robust massage experience that\'s nothing like you\'ve ever tried before! The hand massager is designed to soothe and restore hands. Simply place your entire hand in the soft, cloth-lined chamber and turn it on. The built-in air pressure inflates and deflates to squeeze away aches and stress. At the same time, heat compression functions to care for your hand skin.</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Features:</strong></p>\r\n<p><strong>Smart auto-timer hand massager:</strong> adjustable air pressure (circulating from low to high) with optional heating compressor massage for 5 minutes duration(preset 5 mins timer, 10mins, and 15 mins manual optional). Manually operate related function buttons to switch between air pressure and hot compress modes.</p>\r\n<p>Wireless &amp; portable with lightness: the lightweight of 750g lets anyone do massage from anywhere. Provide maximum portability. It is suitable for home, office, and traveling to wireless use.</p>\r\n<p><strong>Best gift for you, your friends, and your family:</strong> every day just spares 10-20 minutes to wear it after a tiring day using your hand, the massage will stimulate the hand nerves and help blood circulation of your hand, palm and finger to improve chilly finger in winter.</p>\r\n<p>Beautiful your hand in a long round in long-term use, it also makes your hand skin tender and beautifies your hands.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Specifications:</strong></p>\r\n<p><strong>Product name:</strong> hand massager</p>\r\n<p><strong>Product size:</strong> 21x17.8x10.4cm</p>\r\n<p><strong>Product color: </strong>white</p>\r\n<p><strong>Product weight: </strong>750g</p>\r\n<p><strong>Rated voltage:</strong> 110-220v</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Product list:</strong></p>\r\n<p>1x hand massager</p>', 'Available', 'facebook_ads', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-14 04:20:04', '2021-06-14 04:20:04', NULL, NULL),
(135, 'Halo Head Massager', 79.99, 38.72, 41.27, 722, '27955.84', 956932, '18-24,25-34,34-44', 2, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Health ,Beauty,Halo Head Massager', 'Health & Beauty', '<p><strong>Are you looking for a head massager that can be used anywhere wirelessly? Our waterproof electric head massager relieves tension and provides maximum comfort while you\'re in the office, at home, or even in your car.</strong></p>\r\n<p><strong><br />Features:</strong></p>\r\n<p>Powered by a USB port, very convenient. With a convenient rechargeable base.</p>\r\n<p>Waterproof, both wet and dry.</p>\r\n<p>3d three-dimensional massage, multi-directional rotation massage. 2 speeds selection, and bi-directional rotation.</p>\r\n<p>Rotatable massage 4pcs of comb with hairdressing can better clean dirt and eliminate fatigue.</p>\r\n<p>Promote blood circulation, increase the vitality of the scalp vitality and hair.</p>\r\n<p>Promotes hair growth by increasing blood flow to the scalp.</p>\r\n<p>The ergonomic handle design makes it more comfortable to handle</p>\r\n<p>Can effectively help you relieve stress, give you comprehensive health. It relieves stress and tightness with a tight, continuous pressure massage.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Specifications:</strong></p>\r\n<p><strong>Material:</strong> abs+silicone</p>\r\n<p><strong>Color: </strong>white</p>\r\n<p><strong>Body area:</strong> head &amp; neck massager</p>\r\n<p><strong>Massage head:</strong> 4 head&nbsp;</p>\r\n<p><strong>Input:</strong> 5v</p>\r\n<p><strong>Output: </strong>3.7v</p>\r\n<p><strong>Power:</strong> 5w</p>\r\n<p><strong>Working time: </strong>2 hours</p>\r\n<p><strong>Battery type: </strong>high capacity li-ion battery, USB rechargeable</p>\r\n<p><strong>Waterproof:</strong> ipx7</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Package includes:</strong></p>\r\n<p>1x electric scalp massager</p>\r\n<p>1x USB cable</p>\r\n<p>1x base</p>\r\n<p>1x English manual</p>', 'Available', 'trending_product', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-14 04:29:36', '2021-06-14 04:29:36', NULL, NULL),
(136, 'Silicone Kitchen Sponge', 24.99, 2.37, 22.62, 509, '1206.33', 360392, '18-24,25-34,34-44,45-54,55-64', 2, 'Women', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Silicone Kitchen Sponge,Kitchen & household,Kitchen,household', 'Kitchen & household', '<p><strong>Behold the germ-free, antibacterial and hygienic alternative to your regular, smelly sponges. Made of premium food-grade silicone that doesn\'t break or tear, so you can stop worrying about purchasing a new sponge every other week.&nbsp; Not only does it save time, money, and the environment, it also brings powerful cleaning results!</strong></p>\r\n<h2><strong>Features:</strong></h2>\r\n<p><strong>2 Types Of Scrubbing Bristles: </strong>Contains two different types of scrubbing bristles (one on each side), including short bristles for stubborn messes and longer bristles for delicate dishes.<br /><strong>Nylon Scraper:&nbsp;</strong>The toughest messes are no match for the sturdy scraper, for those super-tough, burnt-on messes that just won&rsquo;t soak away, use the nylon scraper on the end for enough toughness to handle the stains.<br /><strong>Squeegee:&nbsp;</strong>When you have a flat, smooth surface you need to clean, just reach for the squeegee. With a flat, stiff but soft edge that will wipe away spills and liquids. It\'s a great add-on for cleaning plates, countertops, or sinks.<br /><strong>Built-In Soap Dispenser: </strong>Inside the Red-Kitchen Silicone Sponge is a cavity that you can fill with washing-up liquid soap which is then dispensed through the surface to the right where you need it. Now, with a constant supply of suds, you can wash dishes from pots and pans to plates, cups, and cutlery- even glasses.<br /><strong>Odorless &amp; Anti-Bacteria: </strong>Constructed with food-grade silicone that never absorbs water, which means that no dirty water can sit and smell up your kitchen. Whenever you feel like it&rsquo;s time to wash your sponge, you can easily throw it in the dishwasher or boiling water to disinfect the sponge.&nbsp;<br /><strong>Durable &amp; Non -Porous: </strong>Made of premium food-grade silicone, which is BPA-free, FDA-approved, and LFGB standard. The sponge will not break or tear no matter how much you bend it. Specifically built to last for a very long time.</p>\r\n<h3><strong>Specification:</strong></h3>\r\n<p><strong>Material: </strong>Silicone<br /><strong>Color: </strong>Yellow &amp; black<br /><strong>Size:</strong> 17 x 7.5 x 2.6 cm<br /><strong>Weight: </strong>96 g</p>\r\n<h4><strong>Package Include:</strong></h4>\r\n<p>1pc x 3 in 1 Silicone Cleaning Sponge</p>', 'Available', 'untapped_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-14 04:35:55', '2021-06-14 04:35:55', NULL, NULL),
