 '2021-06-14 04:46:00', NULL, NULL),
(139, 'Pet Dog Toothbrush Toy', 29.99, 4.78, 25.21, 233, '1113.74', 209231, '18-24,25-34,34-44', 2, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Pet Dog Toothbrush Toy,Pet Accessories,Pet', 'Pet Accessories', '<p><strong>This pet toy can let the pet brush his teeth, make his mouth healthy and clean, remove the bad breath and clean his mouth. It is made of environment-friendly food-grade plastic, which is healthier to use. Bite-resistant, soft material, will make your pet\'s gums feel comfortable. A variety of colors to choose from, dogs will love it!</strong></p>\r\n<h2><strong>Features:</strong></h2>\r\n<p><strong>Tooth cleaning: </strong>The dog toothbrush is designed with 360-degree wave chewing gum. Effectively clean pet teeth, reduce plaque and calculus and maintain oral cavity health.<br />Safe material with a sweet taste. Made of 100% non-toxic natural rubber. The chew toy for dogs is infused with the scent of fresh mint. So it will attract dogs to play and chew on it. Great gift toy for small and medium dogs.</p>\r\n<p><strong>Large capacity candy bar: </strong>This candy dispenser ball allows you to put in a lot of snacks/sweets inside. Your dog will love to play with it to retrieve delicious treats. It will keep your dog busy.<br /><strong>Iq interactive toy: </strong>Comes with a sturdy string that can be used as a training ball. Improve the relationship with pets.<br /><strong>Easy to clean: </strong>The chewing ball is extremely easy to clean. You just need to rinse it off with water. We suggest cleaning it before and after the dogs chew it.</p>\r\n<h3><strong>Specifications:</strong></h3>\r\n<p><strong>Material: </strong>Fdatpr rubber&nbsp;<br /><strong>Size: </strong>4.52 x 2.24 inches<br /><strong>Weight: </strong>3.5 oz</p>\r\n<h4><strong>Package:</strong></h4>\r\n<p>1 x&nbsp; Dog Toothbrush Toy (with rope)</p>', 'Available', 'facebook_ads', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-14