(144, 'Sky Projection Lamp', 29.99, 14.50, 15.49, 79, '1145.50', 9293601, '18-24,25-34,34-44', 2, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Sky Projection Lamp,Home Improvement,Electronics', 'Home Improvement,Electronics', '<p><strong>It can be used as a projector or night light. Remove the slide and adjust the light mode, it can be turned into a desk night lamp, to accompany you to study or accompany your child to sleep. With 3 lighting colors (Blue, White, Warm White), and 3 light brightness adjustments, for your option with your preference to adjust the most appropriate brightness.</strong></p>\r\n<h2><strong>Features:</strong></h2>\r\n<p><strong>Illuminate your ENTIRE room with the moon, stars, and animal pattern: </strong>If you press the rotation button, these lights will be 360 degrees clockwise, it looks like they are walking on the wall!<br /><strong>6 Different Films, switch lighting effects at will:</strong> The starry night light projects Magical Universe, Ocean Undersea, Rotating Trojan, Happy Birthday and Rose Garden, Lucky Deer around a room, thereby transforming the room into a relaxing environment at night. It gives your kids and wife comfort and a feeling of relaxation at night while allowing you to enjoy a romantic moment with your partner.<br /><strong>Night Light For Kids, wife: </strong>Remove the inner cover and put back the outer cover, a desk lamp it will be. Can select a single light or multiple color Modes help to develop a kid&rsquo;s imagination and creativity. Furthermore, it is great for new moms to use when breastfeeding at night.<br /><strong>The Perfect Gifts: </strong>The night&nbsp;light projector is perfect for decorating parties, holidays, weddings, rooms, and other occasions. It is a great gift for your sweethearts, babies, families, and friends.<br /><strong>Bright Star Projector: </strong>Your child will be mesmerized by the rotation stars and moon. Luminous and colorful LED lights create a calm ambiance in your child\'s room, giving them a good sleep at night.</p>\r\n<h3><strong>Specifications:</strong></h3>\r\n<p><strong>Product material:</strong> ABS+PP<br /><strong>Expression style: </strong>Cute, Rabbit<br /><strong>Product style: </strong>Music box<br /><strong>Rated voltage: </strong>DC5V 1A<br /><strong>Lamp beads power: </strong>4W (3&times;1.3W/LED module)<br /><strong>Battery capacity:</strong> 1200mAh</p>\r\n<h4><strong>Package includes:</strong></h4>\r\n<p>1*Projection lamp<br />1*charging cable<br />1*Instruction</p>', 'Available', 'untapped_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-14 05:10:42', '2021-06-14 05:10:42', NULL, NULL),
(145, 'Universal Metal Extension Wrench and Turn Joint', 34.98, 9.91, 25.07, 8779, '86999.89', 9231552, '18-24,25-34,34-44', 1, 'Men,Baby', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Car Accessories,Universal Metal Extension Wrench and Turn Joint', 'Car Accessories', '<p><strong>Say goodbye to endless struggle, and feeling that twinge of frustration creeping up your back from hours of getting nowhere! This wrench extender will reach even the most stubborn bolts.</strong></p>\r\n<p><strong>BoltReacher wrench extension will make sure you never go 1-click at a time with your socket set again. The extension wrench keeps your hands and knuckles away from hot objects or tight spaces making that awkward nut or bolt easy to remove.</strong></p>\r\n<p><strong>Extend your reach up to 8 inches. Allows your ratchet enough swing for a smooth workflow. Knuckle saver and time saver. Turns nuts and bolts with ZERO degrees of arc. Quickly loosen bolts and nuts at awkward angles.</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>FEATURES:</strong></p>\r\n<p><strong>Reach Any Spot: </strong>This allows you to reach hard-to-access nuts and bolts in tight spots that didn\'t work before with full swing to increase efficiency. Turn nuts and bolts with ZERO degrees of arc.</p>\r\n<p>Extend your reach up to 10&rdquo; inches.</p>\r\n<p><strong>Screw-In &amp; Out: </strong>This can be used to loosen/ tighten the nut and remove/ tighten the screw.</p>\r\n<p><strong>1 to 1 Gear Ratio:</strong> Equipped with 1:1 chrome vanadium gears and used with a variety of adapters.</p>\r\n<p>Drive the wrench from either side.</p>\r\n<p><strong>Works with Drills:</strong> Attach your drill or impact gun to get the job done even quicker.</p>\r\n<p><strong>Wide Applications:</strong> Ideal for automotive, tractors, amphibious UTVs, machines, etc.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>SPECIFICATIONS:</strong></p>\r\n<p><strong>Size: </strong>3/8\" to 1/4\", 3/8\" to 3/8\"</p>\r\n<p>&nbsp;</p>\r\n<p><strong>PACKAGE INCLUDES:</strong></p>\r\n<p>1 x Extension Wrench</p>\r\n<p>2x Adapters</p>\r\n<p>&nbsp;</p>', 'Available', 'trending_product', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-14 05:17:00', '2021-06-14 05:17:00', NULL, NULL),
(146, 'Foldable Baby Bed With Mosquito Net', 123.95, 25.21, 98.74, 327, '8243.67', 6942823, '18-24', 2, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Baby ,Kids,Foldable Baby Bed With Mosquito Net', 'Baby & Kids', '<p><strong>As a parent, we understand the joys our little ones bring us, the priceless moments that simply cannot be replaced and traded for by anything else! We also understand how precious time becomes and how important simplicity is when our families begin to grow. In growing our own family, we have learned that time is irreplaceable and is something that can\'t be missed when our babies and toddlers are growing so quickly.</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>FEATURES:</strong></p>\r\n<p><strong>Safety materials:</strong> Our baby mosquito tent beds use certified non-toxic, lead-free materials that are safe for babies.</p>\r\n<p><strong>Save space:</strong> This baby tent can be folded up, very compact, easy to put into the backpack and carry along.</p>\r\n<p><strong>Convenient for all occasions:</strong> Such as a park, beach, football match, or just using it in the living room for daily use, it is very convenient!</p>\r\n<p><strong>Automatically expand the tent: </strong>It can open and fold in a few seconds, and the two-way zipper can quickly and easily put the baby into the tent.</p>\r\n<p><strong>Safe environment:</strong> Provide a virus-free environment, while keeping ventilation, so that babies will be protected from mosquitoes and strong sunlight, no insects or mosquitoes can fly in, mosquito nets can effectively protect babies.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>SPECIFICATIONS:</strong></p>\r\n<p><strong>Item Type:</strong> Baby Portable Backpack Bed</p>\r\n<p><strong>Material(bed): </strong>Cotton</p>\r\n<p><strong>Material (backpacker):</strong> Flax</p>\r\n<p><strong>Material(toy):</strong> ABS Eco-friendly Plastic</p>\r\n<p><strong>Color: </strong>Red, Blue, Grey, Pink, Green</p>\r\n<p><strong>Age: </strong>0-1-year-old&nbsp;</p>\r\n<p><strong>Occasion:</strong> All Occasions</p>\r\n<p><strong>Pattern: </strong>Solid</p>\r\n<p><strong>Size(bag): </strong>45 x 12 x 40cm/17.72\" x 4.72\" x 15.75\"</p>\r\n<p><strong>Size(unfolding):</strong> 95 x 45cm/37.40\" x 17.72\"</p>\r\n<p>&nbsp;</p>\r\n<p><strong>PACKAGE INCLUDES:</strong></p>\r\n<p>1*baby bed</p>\r\n<p>1*mosquito nets</p>\r\n<p>1*mattress</p>\r\n<p>2*free gifts</p>\r\n<p>&nbsp;</p>', 'Available', 'untapped_product', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-14 05:24:21', '2021-06-14 05:24:21', NULL, NULL),
(147, 'Cartoon Cat LED Night Light', 44.95, 9.50, 35.45, 2506, '23807.00', 601204, '18-24,25-34,34-44', 1, 'Women', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Cartoon Cat LED Night Light,Electronics', 'Electronics', '<p><strong>If your child likes to have some light as they go off to sleep, the Silicone LED Cute Cartoon Night Light is a playful, practical option. The cute cartoon has a touch sensor and washable, soft-touch surface. It emits a colorful light with a 7-colors changing mode, and can easily be recharged when running low on battery. The night light is especially suited for children who are scared of the dark, offering a soft, warm light as they nod off to sleep. The lamp comes with a charging cable and LED bulbs included. Give this cute cartoon night light to your children, they will absolutely love it</strong></p>\r\n<h2><strong>FEATURES:</strong></h2>\r\n<p><strong>Adorable appearance:&nbsp;</strong>The shape is designed to be adorable cats. Keep you in a good mood with the soft lighting.<br /><strong>Color-changing lamp:</strong>&nbsp;The 7 colors can change in order to form a gradually changing color. Through the soft silicone surface, the light looks soft and warm. Create a comfortable and relaxing atmosphere.<br /><strong>Durable:&nbsp;</strong>Service time up to 15 hours after fully charged. Being your constant companion all night long.<br /><strong>Portable size:&nbsp;</strong>Easy to carry and set on the table.</p>\r\n<h3><strong>PRODUCT SPECIFICATIONS:</strong></h3>\r\n<p><strong>Battery Type: </strong>LITHIUM-ION<br /><strong>Light Source: </strong>LED Bulbs<br /><strong>Voltage:</strong> 5V<br /><strong>Power Source: </strong>DC<br /><strong>Wattage:</strong> 0-5W<br /><strong>Power source: </strong>AAA Battery / 1200mAh Li-ion battery<br /><strong>USB Type Charging: </strong>DC5V USB Charging<br /><strong>Material: </strong>ABS+Silicon<br /><strong>Controlling:</strong> Touch &amp; Switch on/off</p>\r\n<h4><strong>Package Contents:</strong></h4>\r\n<p>&nbsp;1x Silicone LED Lamp,<br />&nbsp;1x Micro USB Charging Cable</p>', 'Available', 'facebook_ads', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-14 05:25:18', '2021-06-14 05:25:18', NULL, NULL),
(148, 'Mini Folding Portable Iron', 61.99, 24.00, 37.99, 35, '840.00', 1948877, '18-24,25-34,34-44', 2, 'Men,Women,Baby', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Electronics,Mini Folding Portable Iron', 'Electronics', '<p><strong>With this revolutionary folding iron, you can iron your clothes anywhere you want. It has a flat shape that folds up to around the size of a palm and only weighs 0.81 pounds. For the big sections of the fabric, all you have to do is stretch out the sides of the iron. For small areas like pockets and collars, clip the iron\'s edges. This iron is suitable for all fabrics, including cotton, wool, denim, linen, and silk, thanks to its six temperature settings.</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Features:</strong></p>\r\n<p><strong>Comfort grip design and compact design:</strong> the comfort grip design makes you grip easily and comfortably. And compact design can make it fold together perfectly so that it can make your storage and traveling a breeze.</p>\r\n<p><strong>6 heat settings:</strong> press the power button to cycle through to the desired heat setting including linen, denim, cotton, wool, silk, and polyester.</p>\r\n<p><strong>Flip-out wings:</strong> flip-out wings for traditional ironing when you need more than just a touch-up. Ironing is quick and easy with the flip-out wings.</p>\r\n<p><strong>Non-stick plates:</strong> dual non-stick heating plates glide smoothly across all fabrics. No bunching, staining, or burning.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Specifications:</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Power (w):</strong> 60w</p>\r\n<p><strong>Voltage (v):</strong> 240v</p>\r\n<p><strong>Model number:</strong> folding portable iron compact</p>\r\n<p><strong>Material:</strong> stainless steel base plate</p>\r\n<p><strong>Controlling mode:</strong> digital timer control</p>\r\n<p><strong>Cord length (m): </strong>about 80cm</p>\r\n<p><strong>Gear selection:</strong> &gt;three gears</p>\r\n<p><strong>Style:</strong> wire iron</p>\r\n<p><strong>Certification:</strong> CE</p>\r\n<p><strong>Type:</strong> travel iron</p>\r\n<p><strong>Item:</strong> foldable iron compact touchup</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Package includes:</strong></p>\r\n<p>X1 folding portable iron compact touchup</p>', 'Available', 'facebook_ads', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-14 05:33:11', '2021-06-14 05:33:11', NULL, NULL),
(149, 'Brax Hardware Corner Clamp Kit', 24.95, 2.02, 22.93, 1146, '2314.92', 268199, '18-24,25-34,34-44,45-54,55-64', 1, 'Men', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Brax Hardware Corner Clamp Kit,Home Improvement,Home,Garden', 'Home Improvement', '<p><strong>Equip your toolkit with this Home Builder\'s 90&deg; Right Angle Clamp! It holds corners securely so you can align Screw or glue boards together in a perfect square! Keeps your joints and corners aligned. Quickly and easily hold boards and frames together at an angle of 90&deg;. Assemble shelves, small cupboards, frames, or furniture that has a solid and anti-skid finish. Make your job easy and fast with just one hand! This frees your second hand to focus on your workpiece. This is made with strong and durable ABS but light to hold in hand comfortably. for extended periods of time. Save labor time and reduce surface workload.</strong></p>\r\n<h2><strong>Features:</strong></h2>\r\n<p>Drill and tighten the two steps in one operation.<br />Not only for the 90-degree angle but also for the 45 degrees saw.<br />When tightening or bonding the board at an angle of 90&deg;, fix the auxiliary device for the corner and T-connection.<br />It is suitable for woodworking, cabinet, and furniture repair connection, photo frame reinforcement, wooden DIY project, etc.</p>\r\n<h3><strong>PRODUCT SPECIFICATION:</strong></h3>\r\n<p><strong>Color: </strong>Orange + Black<br /><strong>Clamping range: </strong>5-22mm, 10-22mm<br /><strong>Total Length: </strong>78mm / 3.1in<br /><strong>Maximum width:</strong> 85mm / 3.3in<br /><strong>Maximum height:</strong> 51mm / 2.0in</p>\r\n<h4><strong>Notes:</strong></h4>\r\n<p>1. Manual measuring, please allow 1 ~ 3mm error, thank you.<br />2. Due to the difference between different monitors, the picture may not reflect the actual color of the item. We guarantee the style is the same as shown in the picture.</p>\r\n<h4><strong>Package Inclusion/s:&nbsp;</strong></h4>\r\n<p>1 pack Home Builder\'s 90&deg; Right Angle Clamp includes 4pcs.</p>', 'Available', 'trending_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-14 05:39:12', '2021-06-14 05:39:12', NULL, NULL),
(150, '6-in-1 Multi Functional Opener', 19.78, 2.85, 16.93, 2326, '6629.10', 194887, '18-24,25-34,34-44', 1, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Kitchen ,household,6-in-1 Multi Functional Opener', 'Kitchen & household', '<p><strong>Every home needs one of these 6 in 1 multi-function bottle openers! It can open 6 different types of lids/seals -&nbsp; bottle caps, bottle tops, jar lids, safety seals, food bags and pull tabs all in one simple step. Useful for picnics or camping trips - no more struggling with stubborn seals, saving you time and strength. Its simple design means it won\'t take up too much room, and also features an easy-grip handle -perfect for children, the elderly, or anyone with a hand injury.</strong></p>\r\n<p><strong><br />Features:</strong></p>\r\n<p><strong>Easy to use:&nbsp;</strong> open bottles, jars, and seals easily! Even with weak hands due to arthritis/stroke/injury or just from really tight packaging, this will get the job done!</p>\r\n<p><strong>Freedom &amp; independence: </strong>no need to rely on others or ask for assistance just to open a jar or bottle! You can do it yourself!&nbsp;</p>\r\n<p><strong>Less pain:</strong> no more hurting your fingers or breaking a fingernail just to open a can of soda or a medicine bottle! Easy-grip and ergonomic!</p>\r\n<p><strong>Dishwasher safe: </strong>makes cleanup fast and easy!&nbsp;</p>\r\n<p><strong>Portable: </strong>not just for the kitchen or home bar! Bring it on camping trips, road trips, or picnics! Or keep one in your car! Or office pantry!</p>\r\n<p><strong>All in one:</strong> save space! No need to bring 6 different tools with 6 different functions! This opener does it all!</p>\r\n<p><strong><br />Specifications:</strong></p>\r\n<p><strong>Material:</strong> pp + tpr + 2cr12 alloy stainless steel</p>\r\n<p><strong>Size: </strong>14.4 x 6.5 x 2.4cm / 5.67 x 2.6 x 0.94in</p>\r\n<p><strong>Weight:</strong> 109g / 0.24 lbs</p>\r\n<p><strong><br />Package includes:</strong></p>\r\n<p>1x jar opener</p>', 'Available', 'trending_product', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-14 05:42:05', '2021-06-14 05:42:05', NULL, NULL),
(151, 'Child Magnetic Drawer & Cabinet Locks', 39.95, 9.42, 30.53, 5122, '48249.24', 6806566, '18-24', 1, 'Baby', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Home Improvement,Child Magnetic Drawer & Cabinet Locks', 'Home Improvement', '<p><strong>If you have a baby or a young child, you know that cabinets and drawers are a lurking danger. We present you with Magnetic Baby Safety Locksets, allowing you to have peace of mind while your children explore your home.</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>FEATURES:</strong></p>\r\n<p><strong>20 LOCKS + 2 KEYS: </strong>Baby Child Safety Magnetic Cabinet Locks Work Both for Drawers and all Cabinets. Improved Locks Extra Stronger Magnetic enough to keep a house cat or toddler out.Child Proofing Locks with Magnet key control. 3M Adhesive for Cabinets &amp; Drawers - No Tools, No drill, No holes</p>\r\n<p><strong>WORKS FOR ALL CABINETS AND DRAWERS:</strong> Extra Stronger Locks work on Max 2 inches cabinets door and work on all cabinets and drawers door for Childproof. Use them in the kitchen, bathroom, pantry room, storage area, and bedroom. They\"ll even work for a 30 lbs determined dog who gets into the cabinets!</p>\r\n<p><strong>INVISIBLE FROM OUTSIDE:</strong> Upgraded Locks install inside cabinets or drawers, completely concealed from children and guests, making your home more appealing, while also providing ideal child protection.</p>\r\n<p><strong>KEEP YOUR BABY SAFE:</strong> The magnetic baby safety lock is to keep your curious little kids away from drawers and cupboards filled with dangerous tools or chemicals, allowing you to have peace of mind while your children explore your home. Easy to install. Peel and stick.</p>\r\n<p>100% Money-Back in 90 days! 12-month Warranty!</p>\r\n<p>&nbsp;</p>\r\n<p><strong>SPECIFICATIONS:</strong></p>\r\n<p><strong>Brand:</strong> 365 park</p>\r\n<p><strong>Color:</strong> White-A</p>\r\n<p><strong>Manufacturer:</strong> 365 park</p>\r\n<p><stro