(152, 'Portable Lantern Lamp', 42.45, 17.23, 25.22, 307, '5289.61', 7338746, '18-24,25-34,34-44,45-54', 2, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Portable Lantern Lamp,Electronics', 'Electronics', '<p><strong>Create your own style with 4 modes: table lamp, night lamp, flashlight, or portable lantern. No matter if it\'s for the bedside, desk, or your next outdoor adventure, it looks great as a reading lamp or hanging lantern! Multipurpose: Portable lantern night light is cute and practical, portable and awesome. It can be used t as a reading lamp or hanging lantern! The perfect appearance makes it the decoration for the house, the party, the garden.</strong></p>\r\n<h2><strong>FEATURES:</strong></h2>\r\n<p><strong>Portable Led Lantern Lamp for Table:&nbsp;</strong>It can fold as a flashlight and irradiate from one side only with focused light. While it can expand fully like a lantern with a 360-degree angle adjustable.<br /><strong>Multi-function and Smart Lantern Lamp:</strong>&nbsp;Can use it as a desk lamp, bedside lamp, flashlight by folding or unfolding, and the wooden handle can rotate as the holder, like the handle, as the hanger.<br /><strong>Level 3 brightness adjustable:&nbsp;</strong>3 Dimmable Brightness by Sensitive Touching with a warm white light color, the touching is beside the charging port, tap it softly and change the brightness.<br /><strong>USB charging:&nbsp;</strong>1200 mAh lithium battery and DC 5V USB charging port, long-life led bulbs, no need to replace the bulb.<br /><strong>High quality:&nbsp;</strong>The Material and Nice Appearance as Decoration Lamp. Made of PC+ABS+WOOD+ Iron plating.</p>\r\n<h3><strong>Specification:</strong></h3>\r\n<p><strong>Type:</strong> Folding Led Lamp;<br /><strong>Quantity: </strong>1pc<br /><strong>Color: </strong>White;<br /><strong>Material: </strong>ABS+PC+ wood + iron plating;<br /><strong>Battery: </strong>1200 mAh lithium battery;<br /><strong>Power:</strong> USB charging;&nbsp;<br /><strong>Brightness adjustable:</strong> Level 3 brightness adjustable;<br /><strong>Lamp Status: </strong>142&times;37&times;194mm/<br /><strong>Lantern night light status:</strong> 142&times;120&times;248mm/;<br /><strong>Net Weight: </strong>300g/10.6oz</p>\r\n<h4><strong>Package Includes:</strong></h4>\r\n<p>1* Folding Led Lamp<br />1* USB Cable</p>', 'Available', 'untapped_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-14 05:48:33', '2021-06-14 05:48:33', NULL, NULL),
(153, 'Power Scrubber Brush Set', 19.95, 2.61, 17.34, 1499, '3912.39', 364424, '18-24,25-34,34-44', 1, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Home Improvement,Power Scrubber Brush Set', 'Home Improvement', '<p><strong>We&rsquo;ve helped people around the world by scrubbing and cleaning different surfaces effectively with our powerful drill brush set for more than 7 years. Our power scrubber drill brush cleaning kit is responsibly made with care from the highest quality materials for machines on earth. That\'s why you can purchase this drill brush set from us with reassurance. We are proud of our drill brush attachment and we always put our efforts to ensure our customers feel satisfied with our products in environmentally cleaning.</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>FEATURES:</strong></p>\r\n<p><strong>EFFORTLESS, POWERFUL CLEANING:</strong> This one-of-a-kind drill brush attachment powerfully scrubs away excess dirt, dust, and filth! Never worry about wasting time and energy from the demanding effort it takes to manually scrub your home surfaces. *Drill not included.</p>\r\n<p><strong>USE ANYWHERE:</strong> Whether you want to scrub your bathroom or your floor, this amazing tool is your cleaning solution! This set has been expertly designed to clean bathroom surfaces, grout, upholstery, wheels, tile, shower, toilet, kitchen, bathtub, and carpet, etc. The extended reach attachment allows you to get into tight spaces and hard-to-reach areas for a thorough clean. Nylon bristles will not scratch your bathtub and shower tile surfaces.</p>\r\n<p><strong>ULTIMATE COMPATIBILITY: </strong>The three different-sized brush heads allow you to easily scrub those hard-to-reach or large surfaces. Truly a perfect way to make every nook and cranny of your house absolutely spotless! The brushes fit into almost all cordless drills including Dewalt, BLACK+DECKER, Bosch, and Makita, etc.</p>\r\n<p><strong>QUICK CHANGE SHAFTS:</stron