(154, 'USB Phone Charger Lamp', 72.02, 16.89, 55.13, 52, '878.28', 401834, '18-24,25-34,34-44,45-54', 2, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'USB Phone Charger Lamp,Mobile Accessories', 'Mobile Accessories', '<p><strong>This Multi-Port USB Charger Mushroom Night Lamp is equipped with 5 USB charging ports, can charge 5 devices at the same time, like mobile phones, MP3, MP4, camera, iPod, iPhone series, and other electronic equipment. The 5 slots on the base perfectly arrange your devices. Meanwhile, it comes with a mushroom LED light with a 6000K color temperature which comforts your eyes, can be a bedside lamp and reading lamp. A great tool for home and office use.</strong></p>\r\n<h2><strong>FEATURES:</strong></h2>\r\n<p>QUALCOMM QUICK CHARGE 3.0 Charging Station speeds up to 4 times faster than a conventional USB charger. All 5 ports are equipped with a Smart IC chipset, which automatically detects and delivers the charging current for connected devices. Charger Fast, Live More.<br />SPACE SAVING USB Wall Charger with 1*QC 3.0 port and 2*5V/2.1A + 2*5V/1A ports, no need for an extra charging adapter or power strip. Multiple devices organizer keeps all your cell phones, tablets, remotes in one spot, no more cluttered cables and mess.<br />MULTIPLE PROTECTION CE/FCC/ROHS certified, built-in over current, over-voltage, and short circuit protection, ensuring the delivery of steady power output to each device, provide a safe and quick charging.<br />DURABLE &amp; STURDY Made of high strength and high-temperature resistant PC material, fireproof, and utility. Ideal for home, office, dormitory, and other indoor use.</p>\r\n<h4><strong>NOTE:</strong></h4>\r\n<p>To enable quick charging, you must use OEM or other safety-certified USB cables, inferior cables are not recommended.<br />Non-water-proof function, this charger is only for indoor use, please don&rsquo;t expose it to rain or snow, keep it dry in order to achieve a real effect.</p>\r\n<h3><strong>SPECIFICATIONS:</strong></h3>\r\n<p><strong>Color:</strong> White<br /><strong>Material: </strong>High-quality PC<br /><strong>Weight: </strong>580g / 20.46oz<br /><strong>Maximum Current:</strong> 2.1A<br /><strong>Input:</strong> AC 100-240V 50/60HZ 1.5A<br /><strong>Output:</strong> DC5V 11A 55W<br /><strong>Lamp Parameter:</strong> 3.5W/0.7A<br /><strong>Product Dimensions: </strong>0.87*5.16*3.94 inch<br /><strong>Package Dimensions:</strong> 9.37*4.53*5.75 inch<br /><strong>Cable length: </strong>1.5m<br /><strong>Safety certification:</strong> CE/FCC/HoRS</p>\r\n<h4><strong>Package Includes:</strong></h4>\r\n<p>1 x MULTI PORTS USB CHARGER,<br />1 x USB cable<br />1 x&nbsp; Led Lamp<br />1 x 1.2m Power Cable<br />1 x&nbsp; Base</p>', 'Available', 'facebook_ads', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-14 06:00:23', '2021-06-14 06:00:23', NULL, NULL),
