 Sheikh', '2021-06-14 06:13:12', '2021-06-14 06:13:12', NULL, NULL),
(157, 'LED Nail Lamp', 39.99, 12.50, 27.49, 119, '1487.50', 287381, '18-24,25-34,34-44,45-54', 2, 'Women', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'LED Nail Lamp,Health & Beauty,Beauty,Women\'s Fashion', 'Women\'s Fashion,Health & Beauty', '<p><strong>Our UV LED nail lamp can cure different types of Gel nail polish in seconds and provides you classy, long-lasting nails. Our Nail Dryer is compact in size, easy to set up, and suitable for manicures and pedicures, which makes it a perfect choice for both professional and home use. It is equipped with 12 LED lights, an LCD display, sensor lights, and three preset timer buttons so that you will never have to visit expensive salons again.</strong></p>\r\n<h2><strong>FEATURES:</strong></h2>\r\n<p><strong>Versatile:</strong>&nbsp;Now flaunt your amazing nail art with a Dryer. It can be used to cure both LED and UV polishes. From LED gel, UV gel to builder gel, and acrylic gel, it can dry and cure your nails efficiently.<br /><strong>Save Time:&nbsp;</strong>Providing an exceptional experience and ensures your nail polish dries promptly and neatly. It features a wide opening and can be used for both manicure and pedicure.<br /><strong>Motion Sensor Light:&nbsp;</strong>Its motion sensor lights automatically turn on when you slide your foot or hand into the opening.<br /><strong>Portable And USB powered:&nbsp;</strong>Compact size and lightweight design make our nail dryer perfect for carrying on the go. It can be charged using any USB power bank, adapter, or other USB devices, ensuring a hassle-free experience.</p>\r\n<h3><strong>SPECIFICATION:</strong></h3>\r\n<p><strong>Rated input:</strong> 100-240VAC 50/60Hz 1A<br /><strong>Rated output: </strong>DC24V/3A<br /><strong>Dimensions: </strong>12 x 8.5 x 4.3 Inches</p>\r\n<h4><strong>PACKAGE INCLUSION:</strong></h4>\r\n<p>1 x Gel Polish Nail Dryer<br />1 x US Plug<br />1 x User Manual</p>', 'Available', 'trending_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-14 06:15:48', '2021-06-14 06:15:48', NULL, NULL),
