(161, 'Retractable Folding Stool', 49.99, 22.03, 27.96, 2958, '65164.74', 337443, '18-24,25-34,34-44,45-54', 1, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Retractable Folding Stool,Garden Improvement,Garden', 'Garden Improvement', '<p><strong>With this retractable stool. you\'ll no longer have to go through all those pains just to enjoy the beauty that is around you. This super portable stool collapses down to practically nothing. so you can take it anywhere. Make the best of your rest during your outdoor adventures and get your hands on this cool Outdoor Retractable Folding Chair.</strong></p>\r\n<h2><strong>FEATURES:</strong></h2>\r\n<p><strong>Portable &amp; Lightweight:&nbsp;</strong>This folding stool is super convenient. It opens and folds up in a split second with only one hand.<br /><strong>Best Quality &amp; Bearing Capacity:&nbsp;</strong>Made of high-strength nylon ABS. Heavy-duty materials for long-lasting durability. The internal structural design is unique which makes the stool extra strong and safe and can effortlessly hold up to 330 lb!<br /><strong>Durable and sturdy: </strong>Because this Outdoor Retractable Folding Chair is made out of a hundred percent quality materials, it is an absolute guarantee that it is durable and long-lasting.<br /><strong>Convenient and easy to carry:&nbsp;</strong>This Outdoor Retractable Folding Chair is very easy to set up and is way easier to carry around, it conveniently folds up and can be carried as a sling bag so you\'d have a comfy place to sit everywhere you go.<br /><strong>Multipurpose:</strong>&nbsp;This product features making the stool great for multipurpose uses i.e. bathroom, kitchen, office, garden, travel, camping, fishing, outdoor and more.</p>\r\n<h3><strong>SPECIFICATIONS:</strong></h3>\r\n<p><strong>Product Size: </strong>17.9*10 ins (unfold) / 2.36*10 ins (fold)<br /><strong>Product Weight: </strong>2.75 lbs<br /><strong>Bearing Range:</strong> 0-286 lbs</