(162, 'Portable Smart Phone Shaver', 35.99, 5.60, 30.39, 3, '16.80', 935431, '18-24,25-34,34-44', 2, 'Men,Baby', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Health ,Beauty,Portable Smart Phone Shaver', 'Health & Beauty', '<p><strong>&nbsp;A mobile phone or power bank can supply power to it directly, no more bothered the electric shaver out of power. An electric razor is plug-and-play, help you fast solve the beard problem. It\'s ideal for travel, driving, and business activity with its automatic worldwide voltage, you can bring the portable travel shaver anywhere. Magnetic suction, Unique features, 360-degree closing technology, instant disassembly, prevent beard from falling out and easy to clean. Precision blade technology and double ring plate net can be used to protect the skin from scratches.</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>FEATURES:</strong></p>\r\n<p><strong>1. Plug and Play:&nbsp;<br /></strong>Electric Shaver is 1.2-1.8W, low power consumption, doesn&rsquo;t damage the phone battery, no need to download driver, APP, charging, support global use, electric razor with two power supply interfaces that the one could connect with OTG enabled USB Type-C interfaces, another one is support for charger and power bank device.</p>\r\n<p><strong>2. Safety &amp; Practical:&nbsp;<br /></strong>Travel shaver with precision blade technology and double-ring net that can be adapted to the contours of the face, neck, and even the lower jaw. Rounded edges move smoothly over the skin, don\'t force press it on the face to reduce irritation, and provide a comfortable close-fitting shave.</p>\r\n<p><strong>3. Magnetic Suction &amp; Easy Cleaning:&nbsp;<br /></strong>Shaver for men combines magnetic suction technology with a self-priming design that provides 360-degree anastomosis between the cutter head and the shaver body,</p>\r\n<p><strong>4. Best Electric Shaver for Men:<br /></strong>A portable electric shaver has a stylish personality and rich technological elements. It\'s the best creative gift for father, husband, boyfriend, brothers, or male friends.&nbsp;</p>\r\n<p><strong>5.User-friendly:&nbsp;<br /></strong>Plug and play, convenient and fast. This electric shaver is a 90&deg; bend design that fits snugly into the phone. Plugin the phone without downloading any driver to use, no need to charge and no power consumption, use 10 minutes power consumption is less than 1%.It is compatible with Type-C, Micro, and USB+Micro interfaces.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>SPECIFICATION:</strong></p>\r\n<p><strong>Material:</strong> metal razor head</p>\r\n<p><strong>Compatibility:</strong> iPhone/Android / Type C</p>\r\n<p><strong>Cleaning:</strong> brush clean, razor headwater cleaning</p>\r\n<p><strong>Color:</strong>&nbsp; Dark Blue / Light Blue / Black</p>\r\n<p>&nbsp;</p>\r\n<p><strong>PACKAGE INCLUDE:&nbsp;</strong></p>\r\n<p>Portable Mini-USB Electric Shave x 1</p>', 'Available', 'untapped_product', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-14 06:45:24', '2021-06-14 06:45:24', NULL, NULL),
(163, 'Next Gen Nail Polish Remover', 62.95, 27.51, 35.44, 334, '9188.34', 546508, '18-24,25-34,34-44', 2, 'Men,Women,Baby', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Health,Beauty,Next Gen Nail Polish Remover', 'Health & Beauty', '<p><strong>Do you love gel nails but you\'re tired of damaging your nails to remove them? With the Innovative Gel Nail Polish Remover, there\'s no more scraping, picking, filing, or damage!</strong></p>\r\n<p><strong>It works with semi-permanent nail polish like Shellac, gel manicure (UV or LED), Acrylic, and regular polish and is a more effective and time-efficient way to remove gel polish.</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Features:</strong></p>\r\n<p><strong>Time Saver:<br /></strong>Saves you time from chipping away nail polish one by one. Do five fingernails at a time, saving you so much time. Turn your frustration of cleaning your nails into fun! The Combination of Heat and Water Vapor Helps Soften the Gel Nail Polish. It is an Automatic Device and it Will Shut Down When the Fixed Time is Up.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Completely Safe:<br /></strong>Penetrates the gel deeply and gets all the gel off without even coming in contact with the nail polish remover. This means you can clean off your nails without worrying about any skin damage.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Better Nail Health:<br /></strong>The temperature is just right where it removes all of the gel and nail polish without damaging your cuticles. Offering better protection and overall healthier nails.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Remove all types of polish:<br /></strong>Remove all types of polish including Nail Polish, Acrylic Nails, Shellac, and More. Great for These People Who Needs Removal of Polish Gel and Professional People.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Specification:</strong></p>\r\n<p><strong>Type:</strong> Nail Polish Clean Machine&nbsp;</p>\r\n<p><strong>Material:</strong> ABS, metal&nbsp;</p>\r\n<p><strong>Power: </strong>30W&nbsp;</p>\r\n<p><strong>Input:</strong> AC 100-240V 60 / 50Hz 3A</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Package Include:</strong></p>\r\n<p>Main Machine 1</p>\r\n<p>Power Cord</p>\r\n<p>Adapter</p>\r\n<p>Manual Box</p>', 'Available', 'trending_product', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-14 08:19:14', '2021-06-14 08:19:14', NULL, NULL);
