(164, 'Measurement Tool', 29.13, 3.19, 25.94, 49, '156.31', 1422343, '18-24,25-34,34-44,45-54', 2, 'Men', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Measurement Tool,Garden Improvement,Home Improvement', 'Home Improvement,Garden Improvement', '<p><strong>Multi-functional Infrared Laser Level Ruler Horizontal Meter Tape Scale Measure Instrument.</strong><br /><strong>This is your perfect multipurpose handy tool for carpentry projects! Sometimes it is hard to carry around all of your necessary tools and gadgets to run a&nbsp; project. But our Multipurpose Laser Measuring Tool includes various functions that will make your life easier. Perfect alignment and level the first time. Hang paintings, shelves, and take care of countless other home projects with ease. No more fumbling between the tape measure and the laser level.&nbsp;</strong></p>\r\n<h2><strong>Feature:</strong></h2>\r\n<p>Hang shelves and cabinets, tiles, and picture frames with accuracy.<br />projects horizontal or vertical laser light beam.<br />Locking 8-foot measuring tape.<br />Standard and metric rulers.<br />Ideal For Any Job That Requires A Straight Line Or Accurate Measurement.<br />Use this Multipurpose Laser Level for hanging pictures, installing shelving, laying flooring, hanging wallpaper, and more.<br />The laser light has an on/off power switch.<br />Laser max output:&nbsp; less than 0.5mW.<br />Powered by 3*AG13 button cell battery (included).</p>\r\n<h3><strong>Specification:</strong></h3>\r\n<p><strong>Model: </strong>Laser pro03<br /><strong>Material: </strong>ABS plastic<br /><strong>Color: </strong>black<br /><strong>Product specification: </strong>H:60mm W:2.5mm L:190mm<br /><strong>Laser wavelength:</strong> 650nm-680nm<br /><strong>Power: </strong>AG13 battery<br /><strong>Accuracy:</strong> 0.01<br /><strong>Measurement range: </strong>indoor within 6 m/19.68 ft</p>\r\n<h4><strong>Package Included:</strong></h4>\r\n<p>1 x Level Laser measure tool<br />3 x AG 13 Button-Cells</p>', 'Available', 'trending_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-14 08:26:56', '2021-06-14 08:26:56', NULL, NULL),
