(166, 'Winter Platinum', 39.99, 3.11, 36.88, 177, '550.47', 769659, '18-24,25-34,34-44,45-54,55-64', 2, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Winter Platinum,Home Improvement', 'Home Improvement', '<p><strong>Perfect gift for bookworms. An elegant tool to transform the way you read. Works with any book size and type: Fits everything from hardcover and paperback books to journals and cookbooks. This Anchor works with any book size, without damaging your book&rsquo;s spine and gives you the best experience. Motivate you to read more and make your reading more enjoyable: In this modern world where people are interrupted by electronic devices, it is always great to sit back and enjoy a book. Our mission is to make reading more relaxed and enjoyable through elegant and functional design.</strong></p>\r\n<h2><strong>Features:</strong></h2>\r\n<p>Plated with precious metals like 14K gold.<br />Keeps your book or journal open &amp; flat.<br />Removes the need to push books open with your thumb.<br />Doesn\'t damage your book\'s spine.<br />Made for heavy novels, notebooks &amp; cookbooks.<br />Perfect for note-taking &amp; multi-tasking.</p>\r\n<h3><strong>Specification:</strong></h3>\r\n<p><strong>Color: </strong>white platinum<br /><strong>Materials: </strong>medical grade 316L stainless steel<br /><strong>Dimensions: </strong>1\"H x 3.5\"L x 1.6\"W<br />Elegant tool<br />Polished surface<br />Anchor design</p>\r\n<h4><strong>Package Include:</strong></h4>\r\n<p>Page Anchor (White Platinum)<br />Microfiber Cloth<br />Microfiber Pouch<br />Introductory Card</p>', 'Available', 'untapped_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-14 08:37:21', '2021-06-14 08:37:21', NULL, NULL),
(167, 'Professional Nozzle Set', 19.48, 1.93, 17.55, 6, '11.58', 3535554, '18-24,25-34,34-44,45-54', 2, 'Women', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Professional Nozzle Set,Home Improvement ,Home', 'Home Improvement', '<p><strong>Create beautiful and unique icing patterns with the Nozzle Set Cupcake Tool. The set comes with a piping bag to fill up your favorite flavor and make 12 different icing designs. The product is made in the USA and shipped from the USA. You don\'t have to wait for long. A lovely gift for your wife, girlfriend, loved one, best friend, mom, or a special treat just for yourself.</strong></p>\r\n<h2>Features:</h2>\r\n<p>Premium Cream Icing Piping Nozzles: Made of high-quality stainless steel, safe and harmless. There are 36 pcs tips in the set for you to make three different cream flowers.<br />Convenient To Use: Just fill the cream in the icing bag, squeeze, and then the flower will come into shape from the nozzle tip.<br />Easy To Clean And Reuse: All the tools are made of high-quality material for safe use. Can be cleaned easily with water and detergent. Then air-dry them for the next time.<br />Great Gift For Your Families Friends: If they like to make desserts by themselves, this 42 pcs set will be a wonderful gift for them.<br />In a wide range of use: cake, bakery, tray mats, party, etc.</p>\r\n<h3><strong>Specifications:</strong></h3>\r\n<p><strong>Material: </strong>stainless steel<br /><strong>Color: </strong>Silver<br /><strong>Quantity: </strong>36 icing nozzles<br /><br /></p>\r\n<h4><strong>Package includes:</strong></h4>\r\n<p>12 pieces of nozzles<br />1 Piping bag</p>\r\n<p>1 Converter</p>\r\n<p>&nbsp;</p>', 'Available', 'facebook_ads', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-14 08:45:29', '2021-06-14 08:45:29', NULL, NULL),
(168, 'Beard Straightener Brush & Hair Straightening Brush', 29.97, 12.98, 16.99, 1252, '16250.96', 1224848, '18-24,25-34,34-44', 1, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Beauty Hair,Beard Straightener Brush & Hair Straightening Brush', 'Beauty Hair', '<p><strong>This Hair Straightening Styler is a hair styling tool that will both comb and straighten your hair, along with curling the ends, if you desire that style.</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Features:</strong></p>\r\n<p><strong>HEALTHY SILKY HAIR:<br /></strong>A straightening brush gives you a lively and bouncy effect, does not completely press down your hair, rather than a flat burnt look, and leaves your hair easy to manage. Just brush your hair once and dull hair into gorgeous shiny and sleek looking.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>TIME SAVER &amp; ANTI SCALD:<br /></strong>60s PTC heating technology, with 23 pcs of special heating materials, heated up in a minute, save your time! The heating elements between the teeth prevent your scalp from getting burnt, worry-free from burning your scalp &amp; hands.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>6 LEVELS &amp; AUTO-OFF:<br /></strong>6 levels of temperature from 265℉ to 395℉, suit for all hair types: thin, fine, bleached, wavy, or curled. With liquid crystal display, control and monitor temperatures easily, auto-off after 1 hour, even more, secure when you forgot to turn it off.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Anion Hair Care:<br /></strong>A Straightener brush with nano anions released from the heating plate forms a protective layer of your hair, which helps protect your hair from dryness and frizziness, less hair loss, less hair breakage.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>SUITABLE FOR TRAVELING:<br /></strong>With a small size that saves space when you are on a trip, 360 anti-winding cable gets you to hold the device at any angle for the best straightening results.</p>\r\n<p>&nbsp;</p>\r\n<p><str