(169, 'Adjustable Dumbbell And Barbell', 239.95, 118.32, 121.63, 2, '236.64', 4729568, '18-24,25-34,34-44,45-54', 2, 'Men', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Adjustable Dumbbell And Barbell,Fitness', 'Fitness', '<p><strong>The PowerDyne Adjustable Dumbbell Set includes 2 dumbbells: the essential heavy-duty weight equipment to sculpt and tone muscles throughout the body. Increase your strength with 2 sets of 10 adjustable iron weight plates that increment from 5lbs up to 80lbs each. Securely lift a total of 160lbs with no-slip grip handles. To increase the dumbbell weight, unlock, adjust the pin boxes, align to the desired weight, then secure back into place. The compact design features 2 sturdy and secure 18x9x9inch storage trays.</strong></p>\r\n<h2><strong>FEATURES:</strong></h2>\r\n<p><strong>DUMBBELL BARBELL IN ONE: </strong>This set of weights comes in three of the four sizes: 3.3lb, 4.4lb, 5.5lb--four of each weight. It can be assembled into two single dumbbells or a barbell through connecting rods.<br /><strong>SOLID &amp; EYE-CATCHING DESIGN: </strong>Embossed /frosted weight plates, black paint finish preventing rust and corrosion. Yellow TPU protection provides grip and security.<br /><strong>ADJUSTABLE WEIGHT: </strong>Dumbbell sets utilize a spinlock collar, easily adjust the weight by adding or removing weight plates to the bar. The screws that hold the weights on are secure which can ensure dumbbells will not loosen during use.<br /><strong>SAVE MONEY &amp; SPACE:</strong> Easy to use and don\'t require much space for storage, suitable for home gyms and fitness enthusiasts.<br /><strong>HEALTHY AND FITNESS: </strong>Helps train and strengthen your body at home or gym. Great gifts for everyone. Professional after-sales service.<br /><strong>WARRANTY:</strong> We provide a 1-Year warranty on the dumbbell.</p>\r\n<h3><strong>Specification：</strong></h3>\r\n<h4><strong>22LBS Included:</strong></h4>\r\n<p>2 x 13.78in