(171, 'Saturn Lamp', 34.01, 16.93, 17.08, 35, '592.55', 444362, '18-24,25-34,34-44', 2, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Home Improvement,Saturn Lamp', 'Home Improvement', '<p><strong>Mask in Saturn Light whenever you feel like it with our 3D Moon lamp. This lamp literally puts the moon in the palm of your hands, manufactured by 3D printing techniques to resemble a real Saturn. Inspired by the moon, this rechargeable night light will bring more delight and content into your life.&nbsp;</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Features:</strong></p>\r\n<p><strong>REMOTE CONTROL &amp; TOUCH CONTROL:<br /></strong>It is an exciting experience to operate the moon lamp with just one touch or by remote control. The coolest thing about this lamp is that it will change colors every time it is gently tapped. Your kids will totally love it!</p>\r\n<p><strong>ADVANCED DECORATION LIGHT:<br /></strong>Displayed on a wooden stand, this lamp is a brilliant way to accentuate a courtyard, dinner table, pathways, and parties, bringing you a mysterious and romantic atmosphere. With 16 lovely color modes for remote control and 7 fascinating color modes for touch control, this lamp changes color easily just by tapping the surface.</p>\r\n<p><strong>RECHARGEABLE:<br /></strong> Recharge your moon night light with the provided USB charging cable. Connects to any micro-USB adapter (not included).</p>\r\n<p><strong>BEAUTIFULLY DESIGNED:<br /></strong>Using innovative 3D printing technology, every crater and mark has been carefully designed to reflect the moon\'s surface.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Specification:</strong></p>\r\n<p><strong>Voltage: </strong>5V</p>\r\n<p><strong>Lamp Colors Available:</strong> 2 Color Touch or 16 Color Change</p>\r\n<p><strong>Color Change:</strong> Touch Sensor on the base or Remote</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Package Include:</strong></p>\r\n<p>1x Saturn Night Light</p>\r\n<p>1x Remote</p