ICATIONS:</strong></h3>\r\n<p><strong>Weight: </strong>1.6 ounces.<br /><strong>Dimensions:</strong> 4.3 x 2.4 x 2.4 inches.<br /><strong>Colors: </strong>Red, Blue, Green.</p>\r\n<h4><strong>How To Use:</strong></h4>\r\n<p>Pull up and fix the sharpener to any flat surface.<br />Pull down the grip to lock the sharpener via the suction pad.<br />Place the knife on the sharpener at the base of the handle and slowly draw back the knife 3-5 times.<br />Pull back the grip when done.</p>\r\n<h4><strong>PACKAGE INCLUDES:</strong></h4>\r\n<p>1 x Suction Blade Sharpener</p>', 'Available', 'facebook_ads', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-14 09:21:03', '2021-06-14 09:21:03', NULL, NULL),
