(180, 'Hand Electric Drill Drive Self Priming Water Transfer Pump', 45.06, 9.06, 36.00, 716, '6486.96', 3434893, '18-24,25-34,34-44,45-54,55-64', 2, 'Men,Women,Baby', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Home Improvement,Hand Electric Drill Drive Self Priming Water Transfer Pump', 'Home Improvement', '<p><strong>This self-priming drill pump is designed to work with a corded or cordless drill .fits most electric drills; Converts virtually any drill into a high-capacity pump capable of emptying sinks .aquariums .pool skimmers and much more.</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>FEATURES:</strong></p>\r\n<p>Exquisite workmanship, small size, lightweight.Easy to install and simple to use. No batteries needed.</p>\r\n<p>High flow, the flow rate is 1800 (m&sup3;/h), stable performance, and high efficiency.</p>\r\n<p>Fit all drill chucks, you can get a pump with an electric drill.</p>\r\n<p>Exquisite workmanship, anti-corrosion, and wear resistance.</p>\r\n<p>Compact design, convenient to carry and storage.</p>\r\n<p>Ideal for transferring light liquids, such as freshwater, seawater, oil, dilute organic solvents, insecticides, and liquid fertilizers.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>SPECIFICATIONS:</strong></p>\r\n<p><strong>Color:</strong> black</p>\r\n<p><strong>Material:</strong> plastic.</p>\r\n<p><strong>Size: </strong>125 x 70 x 62mm / 4.9 x 2.8 x 2.5inch.</p>\r\n<p><strong>Pump Shank:</strong> Hex Shank.</p>\r\n<p><strong>Water Flow Rate: </strong>1.2(m&sup3;/h).</p>\r\n<p>&nbsp;</p>\r\n<p><strong>PACKAGE INCLUDES:</strong></p>\r\n<p>1x Drill Pump</p>\r\n<p>2 x Hose Clamp</p>\r\n<p>2 x Screw</p>\r\n<p>2 x Shelf</p>', 'Available', 'facebook_ads', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-14 09:59:39', '2021-06-14 09:59:39', NULL, NULL),
(181, 'Math Match Game Board Toys', 46.99, 15.59, 31.40, 376, '5861.84', 680648, '18-24', 2, 'Baby', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Baby ,Kids,Math Match Game Board Toys', 'Baby & Kids', '<p><strong>Start monkeying around with Monkey Balance, a fun and interactive game for kids to learn simple addition and subtraction! Simply grab a card and put the correct quantity of Monkeys on one side of the scale, and the corresponding number on the other side to balance the scale!</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>FEATURES:</strong></p>\r\n<p><strong>Cool Math Game:</strong> This game teaches basic counting and beginning math skills and encourages retention through stimulating multi-level math games.</p>\r\n<p><strong>Interactive Learning:</strong> Monkey Balance is perfect for children ages 3 and up and is the ideal teaching tool for parents, families, and teachers looking to encourage and reinforce multi-dimensional learning at home, school, nursery, and during tutoring sessions.</p>\r\n<p><strong>Easy Set</strong>-up + Instructions: Monkey Balance has everything kids and families need to start playing and having hours of math and counting fun! This STEAM game is easy to assemble and easy to learn&mdash;so children and families can start playing instantly.</p>\r\n<p><strong>Kid + Family Fun: </strong>This 65-piece toy set includes: 19 monkeys, numbers 1&ndash;10, 30 double-sided cards, monkey scale, base, 2 scale pans, and an easy-to-read instruction leaflet.</p>\r\n<p><strong>Engaging + Educational Play:</strong> Get toddlers and young kids on the counting and mathematics fast track! Monkey Balance improves memory, encourages interactive play, and helps develop fine motor skills. Cute graphics and colorful designs are eye-catching for the whole family! Monkey Balance also makes a great gift for young girls, boys, and families!</p>\r\n<p>&nbsp;</p>\r\n<p><strong>SPECIFICATIONS:</strong></p>\r\n<p><strong>Brand Name:</strong> LUCERNE</p>\r\n<p><strong>Material:</strong> Plastic</p>\r\n<p><strong>Warning: </strong>None</p>\r\n<p><strong>Model Number:</strong> 9268SAO</p>\r\n<p><strong>Age Range:</strong> &gt; 3 years old</p>\r\n<p><strong>Gender: </strong>Unisex</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>PACKAGE INCLUDES:</strong></p>\r\n<p>1x Balance</p>\r\n<p>2x Balance Pans</p>\r\n<p>30x Double-Sided Cards</p>\r\n<p>1-10 Numbers</p>\r\n<p>19x Puppies Figurines</p>\r\n<p>Easy-to-read instructions</p>', 'Available', 'untapped_product', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-14 10:13:13', '2021-06-14 10:13:13', NULL, NULL),
(186, 'Hand Chain Saw', 29.99, 8.30, 21.69, 1378, '11437.40', 106731, '18-24,25-34,34-44', 1, 'Men', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Garden Improvement,Hand Chain Saw', 'Garden Improvement', '<p><strong>Take Outdoor Survival Hand Zipper Saw with you. Flexible bi-directional motion increases cutting speed. Hard saw blades can pass through branches, thick logs, or entire trees. Helps you quickly cut and collect wood such as bonfires. Comes with a small belt loop pouch, perfect for outdoor activities.</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>FEATURES:</strong></p>\r\n<p><strong>3X FASTER IN CUTTING: </strong>A razor-sharp cutting blade on every single link. The best pocket chainsaw will cut through wood with ease, reducing the amount of time and effort that you need in cutting down a branch.</p>\r\n<p><strong>PORTABLE SURVIVAL CHAINSAW: </strong>Features bi-directional self-cleaning style cutting teeth, made of industrial-grade heat-treated steel, that easily tears through the wood while cutting on both strokes. 103 cm in total length, the chainsaw is 65 cm in length.</p>\r\n<p><strong>IMPROVED DESIGN:</strong> A narrow chain with a two-way chain can stage wood quickly, weighs less than 1/2 pound, and fits in your pocket, but faster than traditional sawing wood! More than 30 flexible unbound blades.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>SPECIFICATIONS:</strong></p>\r\n<p><strong>Type:</strong> Chain Saw</p>\r\n<p><strong>Material:</strong> 65 Manganese Steel + Nylon Thick Handle</p>\r\n<p><strong>Serrated Length: </strong>65cm/24.59\" (Approx.)</p>\r\n<p><strong>Total Length:</strong> 103cm/40.55\" (Approx.)</p>\r\n<p>&nbsp;</p>\r\n<p><strong>PACKAGE INCLUDES:</strong></p>\r\n<p>1x Mini Pocket Chain Saw</p>\r\n<p>1x Belt Pouch Bag</p>\r\n<p>&nbsp;</p>', 'Available', 'facebook_ads', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-14 11:05:27', '2021-06-14 11:05:27', NULL, NULL),
(190, 'Non-Slip Double Cat Bowl', 29.95, 5.69, 24.26, 68, '386.92', 1074235, '18-24,25-34,34-44', 2, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Pet Accessories,Non-Slip Double Cat Bowl', 'Pet Accessories', '<p><strong>This Non-Slip Double Cat Bowl is an easy-access-shaped bowl that makes it easier for pets to get their food. Bowls are placed on a raised and titled stand so that the food bowl can be placed higher off the ground. Your pet no longer has to eat while bending its neck or waist. It reduces the uncomfortable positions that they may eat in. We recommend this to pets that may struggle with illness after illness or surgery. After they finish eating, it is easy to conveniently remove the bowls and clean the stand. This pet bowl is suitable for small dogs and cats.</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Features：</strong></p>\r\n<p>15&deg;C slant design can protect a cat\'s Cervical spine</p>\r\n<p>Bowls and stand base can be separated. It is easy to ​clean.</p>\r\n<p>it can be for drink or food. Your cats will love it.</p>\r\n<p>The clear bowls are removable and easy to take it out to wash</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Highlights:</strong></p>\r\n<p><strong>Material:</strong> Quality ABS material</p>\r\n<p><strong>Double Bowls Design:</strong> Max capacity of each bowl - 70g food/250 ml water</p>\r\n<p><strong>15 Degrees Tilt:</strong> Protects the pet\'s cervical spine and neck</p>\r\n<p><strong>Raised Stand:</strong> Easy eating, lowers stress and pressure to your pet\'s joints and stomach</p>\r\n<p><strong>Removable:</strong> The clear bowls are removable and easy to take it out to wash</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Specification:</strong></p>\r\n<p><strong>Item Type:</strong> Bowls</p>\r\n<p><strong>Origin:</strong> CN(Origin)</p>\r\n<p><strong>Volume:</strong> 500g</p>\r\n<p><strong>Applicable Dog Breed:</strong> Universal</p>\r\n<p><strong>Type:</strong> Dogs</p>\r\n<p><strong>Material:</strong> Plastic</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Package includes:</strong></p>\r\n<p>1x Box</p>\r\n<p>&nbsp;</p>', 'Available', 'untapped_product', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-15 05:56:00', '2021-06-15 05:56:00', NULL, NULL);
