(191, 'Foldable Multi-Function Chopping Board', 34.95, 12.98, 21.97, 30, '389.40', 2510255, '18-24,25-34,34-44', 2, 'Men,Women,Baby', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Kitchen ,household,Foldable Multi-Function Chopping Board', 'Kitchen & household', '<p><strong>Cooking just got more convenient! The Foldable Multi-Function Chopping Board puts several of your cooking needs together into one easy-to-use tool. Foldable Chopping Board can be used as a cutting board after folding or vegetable washing basket and drain basket after opening. Integrated plug and drainer, simply twist plug to drain water. This innovative and lightweight bucket is designed for easy storage and carrying that can be expanded and collapsed to 1/3 (less than 1.5 inches) of its original height for compact storage. It has never been so fun and easy to cook for you and your family. Made of food-grade premium, durable, and not easily deformed. Safe and easy to clean, remains in place on any smooth surface. Dishwasher safe and stain resistant to preserve hygiene.</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Features:</strong></p>\r\n<p><strong>Multifunctional:</strong> 3 in 1 kitchen gadget that can be used as a Cutting Board, Vegetable Washing basket, and Drain Basket. Designed over the sink or tabletop.</p>\r\n<p><strong>Collapsible &amp; Portable:</strong> Designed for easy storage when not in use. Folding it will save space in your kitchen.</p>\r\n<p><strong>Evacuation:</strong> Its one-click evacuation system will allow you to evacuate the water used for cleaning your food in a few seconds by filtering the larger pieces.</p>\r\n<p><strong>Draining System:</strong> Strain fruit and vegetables, washing tube, drainer sink, and storage basket. Ideal for ice and drinks at the beach.</p>\r\n<p><strong>Non-Slip Design:</strong> at the bottom can keep the dishpan steady and firmly, the contoured ergonomic handles make pick-up easy for scraping ingredients into a pot