(193, 'Innovative Waste Bin', 30.93, 11.74, 19.19, 458, '5376.92', 4933567, '18-24,25-34,34-44', 2, 'Men,Women,Baby', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Home Improvement,Innovative Waste Bin', 'Home Improvement', '<p>Innovative Folding Car Trash Can Organizer Auto Accessories Car Trash Can Garbage Hanging Dustbin Car-styling Interior Storage Dispose of all your garbage and compost with this Folding Trash Can. You can clip this on the side of your cabinets for easy access. Once you\'re done cutting produce, you can slide it right into the garbage. The garbage folds so it does not take up a lot of space on the side of your cabinet. Tired to bend down the body for the trash under the sink? Do you love a neat and efficient kitchen? Innovative Waste Bin is essential to have in your kitchen. It will make your meal preparation times quick and the cleaning after a breeze. Just press and pull, save space when folding. When you are cooking fresh food, slicing, and dicing things, you don\'t need to open and close the cabinet door constantly with your wet hands, compared to the trash bin under the sink.</p>\r\n<p><strong>Hanging Design:<br /></strong>As the trash can is hung over the cabinet door, you can accurately &amp; quickly throw garbage into the trash can when you cut vegetables.</p>\r\n<p>&nbsp;<strong>High Quality:<br /></strong>Thicken material, non-toxic, durable, super bearing, durable for use. Easy to open and close, just press and pull, save space when folding.</p>\r\n<p><strong>Capacity:</strong> 9l / 2.4 gallon</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Features:</strong></p>\r\n<p>High-quality engineering plastics, resistant to impact and deformation.</p>\r\n<p>PET material expansion belt, high resilience, and longer service life.</p>\r\n<p>Multi-functional use can be used to make storage boxes and trash cans, place drinks, fruit cigarettes, change, and garbage.</p>\r\n<p>The folding function does not occupy the volume, the volum