(194, 'Intelligent Soap Foam Dispenser', 28.57, 11.99, 16.58, 101, '1210.99', 6313892, '18-24,25-34,34-44,45-54,55-64', 2, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Home Improvement,Intelligent Soap Foam Dispenser', 'Home Improvement', '<p>Smart liquid soap dispenser, foam delivery, fully automatic foaming.</p>\r\n<p>Simple and delicate, with biological design, high capacity, and low consumption.</p>\r\n<p>Fully automatic inductive foam soap machine, professional hand sanitizer, and more sanitary.</p>\r\n<p>Three-speed foaming, suitable for all kinds of scenes, diligent and economical.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Features:</strong></p>\r\n<p><strong>No Contact, More Hygienic:</strong> Wash hands with foam to clean more thoroughly. Near-field infrared sensing, bubble out in 0.25 seconds. Let The Children Fall in Love with Washing Their Hands</p>\r\n<p>&nbsp;</p>\r\n<p><strong>The Benefits of Foam Hand Washing:</strong> Compared with soap and liquid hand sanitizer, the foam is smooth and delicate. The large contact area and the honeycomb-like structure make it easier to absorb dirt and remove dirt, while also reducing the chance of cross-infection.</p>\r\n<p><strong>Adjustable Bubble Volume:</strong> Easy to Switch Freely adjust the amount of foam, it is recommended to use 1 gear</p>\r\n<p><strong>Frosted Translucent Liquid Storage Bottle: </strong>Blue bottom bottle, clear and clean, the remaining liquid is clear at a glance</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Small Body, Big Design: </strong>Classic and simple design, it looks good everywhere</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Instructions:</strong></p>\r\n<p>Unscrew the product counterclockwise</p>\r\n<p>Insert 4 AA batteries</p>\r\n<p>Fill the liquid bottle with a foaming hand sanitizer</p>\r\n<p>Click to turn on the sensor function</p>\r\n<p>Gear adjustment keys, any adjustment from one to three gears</p>\r\n<p><strong><br />Specification:</strong></p>\r\n<p><stron