iters. artists for graduation gifts or prizes. birthday present. back to school or travel supplies.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>SPECIFICATIONS:</strong></p>\r\n<p><strong>Material:</strong> PU+Corduroy; cloth</p>\r\n<p><strong>Size:</strong> approx. 19cm*7.5cm*12.5cm</p>\r\n<p><strong>Color:</strong> green. purple. pink. yellow. blue. white. gray. brown. black</p>\r\n<p>&nbsp;</p>\r\n<p><strong>PACKAGE INCLUDES:</strong></p>\r\n<p>1x Standing Stationery Pencil Holder</p>', 'Available', 'untapped_product', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-15 06:52:25', '2021-06-15 06:52:25', NULL, NULL),
(196, 'Claw Care Device', 44.89, 15.88, 29.01, 19, '301.72', 1191193, '18-24,25-34,34-44', 2, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Pet Accessories,Claw Care Device', 'Pet Accessories', '<p><strong>Now clip your furry buddies\' nails without scaring ​them off with Proof&trade;. This is an exclusively designed nail grinding device that gently removes thin layers of excess nails with a grinding head. This silent and automatic nail trimmer can be used safely on dogs and cats which gives a professional finish to their nails. It offers a safer, convenient, and comfortable grooming experience for your dog in the comfort of your home. Now, take care of your fur baby while keeping them safe and comfy with this ultra-quiet painless nail clipper, Broof&trade;.</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Features:</strong></p>\r\n<p><strong>​Comfortable Grooming at Home: </strong>No matter how experienced your dog groomer is, unknown faces always terrify your fur baby and make them extremely uncomfortable which often ends up in accidental cuts and scrapes. With this pet nail trimmer, you can grind your pet&rsquo;s nails at home on your own while they sit comfortably with you.</p>\r\n<p><strong>Safe For Your Pet:</strong> No more worries about overcutting or accidental injuries to your pets. Unlike nail clippers, this pet grooming tool is incredibly compact, quiet, lightweight, and painless which keeps your pet stress-free. The grinding head is covered with a stationary bushing allowing you to avoid cutting into the quick.</p>\r\n<p><strong>Ultra Quiet and Powerful:</strong> The Proof&trade; is equipped with low vibration and a quiet yet powerful motor that makes nail care a hassle-free and comfortable experience for you and your beloved pet. Its precision filing gently removes a thin layer of the nail, keeping its paws safe and nails groomed.</p>\r\n<p><strong>USB Charging:</strong> This cordless dog nail clipper can be easily charged using any portable charger, adapter, laptop, etc via USB port. This eliminates the need to replace batteries every now and then.</p>\r\n<p><strong>Detachable Grinder:</strong> Easy Cleaning: Keep Broof&trade; ready for another trimming session. Simply remove the grinder, clean it with any towel or tissue and use it again for your other pets. Enjoy mess-free cleaning every time.&nbsp;</p>\r\n<p><strong>Your Pet\'s Best Friend: </strong>This nail trimmer is suitable for cats,&nbsp; dogs, rabbits, guinea pigs, hamsters, birds, etc. It is equipped with 3 ports, small, medium, large for different nail sizes. Simply select the opening as per your pet&rsquo;s nail size and get going.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Specification:</strong></p>\r\n<p><strong>Charge time:</strong> 2 hours</p>\r\n<p><strong>Run time: </strong>Up to 4 hours</p>\r\n<p><strong>Charging mode:</strong> USB charging</p>\r\n<p><strong>Battery: </strong>Built-in battery</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Package Include:</strong></p>\r\n<p>1x Broof&trade;</p>\r\n<p>1x USB Charge Cable</p>\r\n<p>1x User Manual</p>', 'Available', 'trending_product', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-15 07:02:07', '2021-06-15 07:02:07', NULL, NULL),
(197, 'Powerhouse Pilates Bar', 54.99, 4.99, 50.00, 14, '69.86', 698328, '[\"18-24\",\"25-34\",\"34-44\"]', 2, '[\"Unisex\"]', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Fitness,Powerhouse Pilates Bar', '[\"Fitness\"]', '<p><strong>Create your very own Pilates workout at home. The Pilates Bar is ideal for carrying out a range of movements that you would be able to do with a traditional pilates reformer. The stretchy cables allow you to feel the resistance, while the bar provides stability for your movements. Foam hand grips are easy and comfortable to hold on to or wedge your feet into. Use it in the comfort of your home and carry it with you on your travels.</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Features:</strong></p>\r\n<p><strong>EXERCISE CAN BE FUN:</strong> Have a relaxing and enjoyable workout experience with this amazing Pilates Bar. The Serene Yoga Bar adds excitement and color to your daily workout routine with its fun design. Whether you\'re a beginner or an expert, this kit is for you. The bar with exercise resistance bands will help you build the muscles of the buttocks, legs, waist, arms, and aims to increase flexibility, agility, and immunity.</p>\r\n<p><strong>CONVENIENTLY PORTABLE: </strong>The Serenely Pilates Stick features an ultra-lightweight Non Installation design which makes the bar portable so you can work out at home, in the office, traveling, anywhere indoor/outdoor with no hassle of the door jam and tie-down installs. The bar weighs under 3 pounds and disassembles easily so you can store it or take it with you wherever you go. Enjoy this space-saving exercise bar anywhere anytime!</p>\r\n<p><strong>GREAT FOR EVERYONE:</strong> Our Pilates Bar provides a good workout for men and women, at beginner, professional, or elite fitness levels. The Non-slip handles are made of wear-resistant, durable and comfortable foam for long-lasting elasticity and shock absorption. The foot loops are made of sweat-absorbed material, preventing slip during exercise. a good workout for men and women, at beginner, professional, or elite fitness levels</p>\r\n<p><strong>DURABLE AND ELASTIC:</strong> The Serenely Pilates Bar is made of high-quality materials and is latex, eco-friendly, with no smell, and has strong durability and excellent resilience. Great for yoga stretching exercises, resistance band workouts, low impact prevents injury. Perform dozens of gym-quality exercises practically anywhere with the simple snap-together bar and an easy-quick-to-adjust resistance band to customize your Yoga, Pilates, stretching, or toning workouts.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Specifications:</strong></p>\r\n<p><strong>Length:</strong> 91cm / 35.83 \"(rod), 85cm / 33.46\" (rope)</p>\r\n<p><strong>Size:</strong> 910mm * 70mm * 70mm / 35.83 * 2.76 * 2.76 \"</p>\r\n<p><strong>Net weight:</strong> 670g</p>\r\n<p><strong>Gross weight:</strong> 800g</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Package Includes:</strong></p>\r\n<p>x1 Gym Workout Stick</p>', 'Available', '[\"untapped_product\"]', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-15 07:11:39', '2021-06-15 07:27:04', NULL, NULL),
