gent. do not soak for a long time. otherwise, the wrap on the cup may fall off . please understand this situation before washing</p>', 'Available', 'trending_product', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-15 07:38:41', '2021-06-15 07:38:41', NULL, NULL),
(199, 'Brush For Healthy Hair', 15.95, 2.99, 12.96, 1646, '4921.54', 414626, '18-24,25-34,34-44,45-54,55-64', 1, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Beauty Hair,Brush For Healthy Hair', 'Beauty Hair', '<p><strong>Good shampoos for our hair are usually quite costly, so when we use them we want to make sure we are getting our money&rsquo;s worth, right? Massaging shampoo long and deep into the hair is crucial, but our hands often do as good a job as we think. With our SoothingScalp Massager, you can now get a deep penetrating lather of shampoo into your hair and scalp and finally, make those expensive products work! While it massages and exfoliates your scalp, the Silicone Comb works on lathering up your shampoo and getting it spread nice and deep all over your hair for a better and more comprehensive hair wash. With its ergonomic grip and fun color options, it will be the most relaxing part of your shower and one you&rsquo;ll look forward to each time.</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Features:</strong></p>\r\n<p><strong>Uniquely Designed</strong> - the thick, yet soft brush teeth of the comb create a relaxing massage effect that will also help increase blood flow to the scalp, for added health benefits.&nbsp;</p>\r\n<p><strong>Soft Silicone Material</strong> - no scratching or pain will occur on your delicate scalp. The soft silicone teeth are flexible and aim to please, not hurt.</p>\r\n<p><strong>Easy To Rinse</strong> - rinsing the comb clean is a quick and simple process. Simply face it up to the shower nozzle and watch leftover shampoo and other residue wash down the drain.</p>\r\n<p><strong>Multi-Purpose</strong> - while designed for shampoo and scalp massage, the silicone comb works great as a body massager too! Loosen up your tight muscles and tissues wherever you like.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Specification:</strong></p>\r\n<p><strong>Material:</strong> silicone + thickened PVC&nbsp;&nbsp