ours use for one charge.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Specifications:</strong></p>\r\n<p><strong>Material: </strong>PC + Silica Gel</p>\r\n<p><strong>Size:</strong> 13.8x14.2cm/5.43x5.59in</p>\r\n<p><strong>Battery Capacity: </strong>1600 mAh</p>\r\n<p><strong>Input Standard: </strong>DC / 5V DC</p>\r\n<p><strong>Maximum Power: </strong>5W</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Package Includes:</strong></p>\r\n<p>1x Neck Massager,&nbsp;</p>\r\n<p>1x USB Cable,&nbsp;</p>\r\n<p>1x Remote Control,</p>\r\n<p>1x User Manual</p>', 'Available', 'facebook_ads', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-15 09:46:06', '2021-06-15 09:46:06', NULL, NULL),
(203, 'REUSABLE SILICONE CLEANING AND SCRUBBING GLOVES PAIR', 13.70, 3.30, 10.40, 286, '943.80', 2114274, '18-24,25-34,34-44', 2, 'Men,Women,Baby', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Kitchen ,household,REUSABLE SILICONE CLEANING AND SCRUBBING GLOVES PAIR', 'Kitchen & household', '<p><strong>Made with high-quality food-grade silicone, these gloves are the perfect cleaning tool. They are cold and heat resistant and can handle temperatures up to -60 degrees Celsius to 230 degrees Celsius. They can be used for kitchens, bathrooms, bedrooms, pet care, and washing cars. The palm and finger areas of the gloves are covered in thick silicone bristles which quickly wash away stains and provide a firm grip. The bristles reach into small crevices and cracks to provide a reliable scrub. These gloves maintain excellent elasticity and resilience and can be used for a longer duration without being torn.</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Features:</strong></p>\r\n<p><strong>QUALITY: </strong>unlike typical low-durable rubber gloves out there, these gloves can be used semi-permanently.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>NON-SLIP GLOVES: </strong>palm with powerful grip bristles, finger joints with anti-skid rugged texture, the gloves wherever provides a strong grip force to hold heavy things or wet objects without slides and drops.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>DURABLE &amp; EASY TO BE CLEAN:</strong> high-quality silicone material, features high-temperature resistance up to 260 degrees, easy to clean, can be boiled, UV disinfected, also can enter into the microwave environment. Nevertheless, this glove can still maintain strong due to its superiority&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>MULTI-PURPOSE:</strong> ideally used for dishwashing, vegetable or fruit washing, kitchen cleaning, household cleaning, ceramic wall cleaning, window cleaning, car washing, pet hair washing, etc</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Specifications:</strong></p>\r\n<p><strong>Size: </strong>30.5 x 16cm / 12 x 6.2 inches (one-size fits all for most)</p>\r\n<p><strong>Material:</strong> 100% Food Grade Silicone</p>\r\n<p><strong>Package Includes:</strong> 1 x 2 in 1 Silicone Dish Scrubber Gloves</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Package Included:</strong></p>\r\n<p>Magic Silicone Dishwashing Gloves (1 Pcs)</p>', 'Available', 'facebook_ads', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-15 10:06:13', '2021-06-15 10:06:13', NULL, NULL),
(204, 'Under Cabinet Hanger Rack', 16.99, 3.36, 13.63, 1325, '4452.00', 561544, '18-24,25-34,34-44,45-54,55-64', 2, 'Men,Women,Baby', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Kitchen ,household,Under Cabinet Hanger Rack', 'Kitchen & household', '<p><strong>The Under Cabinet Hanger Rack offers a convenient way to hang cups, cookware, towels, gloves, or anything you want to hang under the cabinet, the shelf, or any other entrance channel. Our under cabinet rack is so easy to install. Simply slide the rack over a cabinet or shelf and it is all set up. No complicated installation needed, totally nail-free. The rack was designed specifically to fit any standard shelf and offers six robust hooks that hold up to 20kg (44lbs) for your kitchen essentials.</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Features:</strong></p>\r\n<p><strong>Space Saver:<br /></strong>The under-cabinet racks make use of the unused space in your home. Ensure your kitchen utensils are organized and coordinated.&nbsp;</p>\r\n<p><strong>Robust &amp; Sturdy:<br /></strong>Sturdy steel constructed, these racks can hold up to 20 kg (44 lbs), enough to hold cups, cookware, pliers, and other items.</p>\r\n<p><strong>Easy to Install:<br /></strong>Simply slide in the rack over a cabinet, with the curved ends that are locked on the cabinet.&nbsp;</p>\r\n<p><strong>Multi-Use:<br /></strong>Our hangers can hold spoons, towels, gloves, etc., or things you want to hang in the kitchen, bathroom, or other places.&nbsp;</p>\r\n<p><strong>Creative Design:<br /></strong>Comes in two colors and a stylish design to match your kitchen interior.</p>\r\n<p><strong>Easy to Install:&nbsp;<br /></strong>The cabinet hanger rack is easy to install. Just slide the rack in over a cabinet or shelf until the center of the rack reaches the shelf.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Product Specifications:</strong></p>\r\n<p><strong>Type:</strong> Kitchen Hanger Hook</p>\r\n<p><strong>Material:</stron