n optimal 42&deg;F to target acne more effectively. This temperature is also safe for the skin, avoiding burns or uncomfortable heat.<br /><strong>92% Saw Results:<br /></strong>92% of people with acne and scars saw skin improvements within 4 weeks of use.</p>\r\n<p><strong>Portable &amp; Practical:<br /></strong>Small and lightweight - it is convenient for weekend trips and long vacations. Apply nightly to target spots and see fast results.</p>\r\n<p><strong>Dermatologist Approved:<br /></strong>Approved by dermatologists and the FDA as a treatment for acne, scars, and marks.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Product Specification:<br /></strong><strong>Color: </strong>White<br /><strong>Material:</strong> ABS<br /><strong>Size: </strong>5.3\" x 0.74\" x 0.74\"<br /><strong>Power Source: </strong>1x AA Batteries ( Not Included )</p>\r\n<p><strong>Package Includes:<br /></strong>1x Blue Light Laser Pen<br />1x User Manual<br />1x Warranty Card</p>\r\n<p>&nbsp;</p>', 'Available', 'facebook_ads', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-16 05:19:47', '2021-06-16 05:19:47', NULL, NULL),
