(223, 'Baby Support Pillow', 24.95, 7.17, 17.78, 211, '1512.87', 1344197, '18-24', 2, 'Baby', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Baby ,Kids,Baby Support Pillow', 'Baby & Kids', '<p><strong>When your baby is dozing off in the car, their fragile small head often moves and tumbles into various uncomfortable positions. It is crucial to place some support on your baby\'s head in order to avoid a painful position. A comfortable and soft baby head pillow that gently supports and protects your baby\'s fragile head and neck is the perfect solution! A great gift to your children and friends with babies! The U-Shaped Baby Neck Pillow offers great comfort for your baby and it guarantees a long-lasting sleep for your little one. Not only that, but it also provides you with relaxation knowing that your kid is sleeping in a comfortable position avoiding any type of pain.&nbsp;</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Special Features:</strong></p>\r\n<p>It offers great protection for your baby thanks to the soft material of the pillow</p>\r\n<p>Made with soft fabric and 100% organic cotton, this pillow guarantees maximum comfort for your little one.&nbsp;</p>\r\n<p>Best designed for babies between 0 and 3 years old. The most vulnerable ages for them.</p>\r\n<p>Protects baby\'s head when in the stroller or car seat</p>\r\n<p>U shaped design - designed to best support the 0-1-year-old baby growth stages, it provides maximum protection for the child\'s head and neck</p>\r\n<p>These baby pillows for sleeping are made of soft fabric and 100% organic cotton, supporting your baby\'s head and neck in ultimate comfort.</p>\r\n<p>Machine washable, the whole pillow can be washed in the machine((30&deg;C / 86&deg;F)</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Specifications:</strong></p>\r\n<p><strong>Product Name:</strong> baby head protection stereotype pillow cervical pillow safety seat pillow anti-head baby pillow</p>\r\n<p><strong>Size: </strong>25*23cm</p>\r\n<p><strong>Material:</strong> peach transfer</p>\r\n<p><strong>Weight:</strong> 75 grams</p>\r\n<p><strong>Style: </strong>Comet, fox, colorful, stars, circle</p>\r\n<p><strong>Fabric: </strong>Pure cotton</p>\r\n<p><strong>Suitable season: </strong>summer, spring, winter, autumn</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Package Content:</strong></p>\r\n<p>1 x U-shaped pillow</p>', 'Available', 'facebook_ads', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-16 10:24:05', '2021-06-16 10:24:05', NULL, NULL),
(224, 'Smile Veneer', 27.49, 1.18, 26.31, 443, '522.74', 837462, '18-24,25-34,34-44', 2, 'Men,Women,Baby', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Health ,Beauty,Smile Veneer', 'Health & Beauty', '<p><strong>Bad teeth? Want to get a natural smile instantly? Restore your confidence and back your smile with snap-on veneers. It has been designed to disguise crooked, stained, missing, and gapped teeth. Conforms perfectly to your mouth whether you are a man or woman. It\'s safe and easy to use. Moreover, these veneers help you with all your dental needs. It looks like a natural set of teeth. Upgrade your smile today. </strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>FEATURES:</strong></p>\r\n<p><strong>Look flawless</strong> - achieve the smile of your dreams with an easy smile.</p>\r\n<p><strong>High quality</strong> - crafted from a custom mold to disguise crooked, stained, and missing teeth.</p>\r\n<p><strong>Save money</strong> - braces are the only alternative, but they are expensive</p>\r\n<p><strong>You deserve this</strong> - you deserve to look your best!</p>\r\n<p><strong>Impress your friends and family</strong> - they will not recognize you with this life-changing device.</p>\r\n<p><strong>Medical grade</strong> - FDA approved, safe, and comfortable to keep in your mouth all day long.</p>\r\n<p><strong>Long-lasting</strong> - easy smile is crafted from high-quality materials that will not need to be frequently replaced.</p>\r\n<p><strong>Free delivery</strong> - we won\'t charge you for standard delivery, we care about our customers and don\'t think you should have to pay for your product to be delivered.</p>\r\n<p><strong>Good morals</strong> - we are a company with great ethics, we treat and pay our staff fairly and give all of our customers our respect &amp; appreciation. Deciding to go with us means you\'re supporting a small independent company with a heart of gold.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Specifications:</strong></p>\r\n<p><strong>Material: </strong>ECO-Friendly PP, Medical Grade Glue</p>\r\n<p><strong>Size:</strong> One Size Fits All</p>\r\n<p><strong>Net Weight:</strong> 10g</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Package Includes:</strong></p>\r\n<p>SmartSmile&trade; Snap On Perfect Smile Veneers (Upper And Lower)</p>', 'Available', 'facebook_ads', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-16 10:35:51', '2021-06-16 10:35:51', NULL, NULL),
(225, 'Labor Saving Arm', 39.99, 12.22, 27.77, 184, '2248.48', 4729568, '18-24,25-34,34-44,45-54,55-64', 2, 'Men', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Garden Improvement,Labor Saving Arm', 'Garden Improvement', '<p><strong>With a lifting capacity of up to 330 lb / 120 kg, the range of applications is virtually unlimited. The installation of doors, windows, and cabinets are obvious uses, but flooring and the construction of porches, decks, and frameworks are also perfect opportunities to use this ingenious tool. All this and much more can easily be done with controlled precision thanks to the unique construction of the Viking Arm handheld jack. Made in Norway.</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>FEATURES:</strong></p>\r\n<p>Innovative universal tool</p>\r\n<p>Lift, press, tighten with precision and control</p>\r\n<p>Impressive capacity for a compact hand tool</p>\r\n<p>Patented technical solutions</p>\r\n<p>May substitute multiple &ldquo;traditional&rdquo; tools</p>\r\n<p>Inspires creativity, secures quality and safety</p>\r\n<p>Increases productivity, saves time and money</p>\r\n<p>Sturdy and durable construction</p>\r\n<p>Components of highest quality</p>\r\n<p>Designed and manufactured in Norway</p>\r\n<p>&nbsp;</p>\r\n<p><strong>SPECIFICATIONS:</strong></p>\r\n<p>Hardened stainless steel/aluminum</p>\r\n<p><strong>Capacity: </strong>up to 120 kg / 330 lb</p>\r\n<p><strong>Operation range (mm): </strong>5-115</p>\r\n<p><strong>Standard base (mm):</strong> 5 x 105 x 87</p>\r\n<p><strong>Optional base (mm): </strong>3 x 77 x 62</p>\r\n<p>Mounting holes for safe operations</p>\r\n<p><strong>Weight:</strong> 0.45KG</p>\r\n<p>Extensively tested by FINTECH (Norway)</p>\r\n<p>&nbsp;</p>\r\n<p><strong>PACKAGE INCLUDE:</strong></p>\r\n<p>1x Perfect box</p>', 'Available', 'untapped_product', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-16 10:45:03', '2021-06-16 10:45:03', NULL, NULL),
(226, 'Banana Hair Clip Double-sided', 18.26, 0.01, 18.25, 1948, '19.48', 546508, '[\"18-24\",\"25-34\",\"34-44\"]', 1, '[\"Unisex\"]', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Beauty Hair,Banana Hair Clip Double-sided', '[\"Health & Beauty\"]', '<p>No pressure to avoid long-lasting hair damage.</p>\r\n<p>No pain. so you can wear the clip all day without a headache.</p>\r\n<p>Instantly get volume without lapel pins, teasing, or sprays.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>FEATURES:</strong></p>\r\n<p><strong>Flexible French banana clip clincher:</strong>&nbsp;ponytail manufacturer without hairline mark; classic staple comb handle; hair clips for women; ponytail holder for thin or thick hair.</p>\r\n<p><strong>Fashionable non-slip hairpin holder for creating hairstyles:</strong> make a high or low ponytail with no hair puffiness; a cutting tool for hair; ideal for medium-length medium to long hair; wide jaws for curling pins.</p>\r\n<p><strong>Multi-usage for dark brown. dark or light hair color brunette blondes redheads:</strong> for adults with curly wavy straight. curly fine hair; flexible grip for clip-in wig extensions; safe grip accessory for girls.</p>\r\n<p><strong>It\'s simple. casual hair tool for active lifestyle yoga in the shower room:</strong> Hairdressing for work. school. office or parties; use for makeup application. washing the face or applying a face mask.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>SPECIFICATIONS:</strong></p>\r\n<p><strong>Size:</strong> 8*7 cm (20) / 12.5*8 cm (30)</p>\r\n<p><strong>Color:</strong> black . blue . beige . pink</p>\r\n<p>&nbsp;</p>\r\n<p><strong>NOTES:</strong></p>\r\n<p>Please pay more attention to the size reference before paying for your order.</p>\r\n<p>Please allow slight measurement deviations due to manual measurement.</p>\r\n<p>Due to the different monitor and light effects. The actual color of the item might be slightly different from the color shown in the pictures.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>PACKAGE INCLUDED:</p>\r\n<p>1 * Vintage Banana Hair Clip</p>', 'Available', '[\"facebook_ads\"]', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-16 11:07:43', '2021-06-16 11:21:10', NULL, NULL),
(227, 'Wax Warmer Machine', 69.99, 20.10, 49.89, 674, '13547.40', 1222949, '18-24,25-34,34-44', 1, 'Men,Women,Baby', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Health ,Beauty,Wax Warmer Machine', 'Health & Beauty', '<p><strong>Tired of spending money at beauty salons or frequently shaving through razors to get rid of unwanted hair? What if you could do depilation in the comfort of your home? With the Honey Wax Kit at hand, the depilation won\'t be an issue anymore.</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Features:</strong></p>\r\n<p><strong>SAVE TIME AND MONEY:</strong> No more costly trips to see a professional, and no more awkwardness with a beautician you don&rsquo;t know. Save time, money, and stress with this quick and easy-to-use wax warmer hair removal waxing kit.</p>\r\n<p><strong>SIMPLE TO USE:</strong> Our waxing kit is simple to use, even for first-timers. Simply melt the wax beans in the wax warmer, spread them onto your skin, and peel them away.</p>\r\n<p><strong>PROFESSIONAL RESULTS:</strong> Our set provides stripless and hassle-free home self-waxing, with spa-grade results.</p>\r\n<p><strong>SPECIAL WAX BEANS:</strong> your experience will be less painful compared to traditional depilation methods due to the blend of different hard waxes 100% natural, meant to be smoother, more gentle, and less painful than waxing strips!</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Specifications:</strong></p>\r\n<p><strong>Material:</strong> ABS + Aluminum</p>\r\n<p><strong>Capacity:</strong> 500ml</p>\r\n<p><strong>Maximum temperature:</strong> 120&deg;/248&deg;</p>\r\n<p><strong>Color:</strong> White</p>\r\n<p><strong>AC input: </strong>100-240V 50/60hz</p>\r\n<p><strong>Power:</strong> 100W</p>\r\n<p><strong>Working Time:</strong> 10-15 minutes</p>\r\n<p><strong>Size:</strong> 157*157*145mm</p>\r\n<p><strong>Plug:</strong> US/EU/UK/AU</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Easy to Clean:</strong></p>\r\n<p>Please keep the heater in a working state and the wax melting&nbsp;</p>\r\n<p>Pour few drops of color free oil or fragrance&nbsp;&nbsp;</p>\r\n<p>Clean with stick and paper towel&nbsp;</p>\r\n<p>Wipe the sides or rim of the wax pot</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Honey Wax&trade; Kit Package List :</strong></p>\r\n<p>1x Wax Heater</p>\r\n<p>1x Power Cable(US/ EU/ UK/ AU plug available)</p>\r\n<p>1x Outer Pot</p>\r\n<p>1x Cover</p>\r\n<p>4x 100g Bags of Wax Beans</p>\r\n<p>20x Wax Sticks</p>\r\n<p>1x User Manual</p>', 'Available', 'trending_product', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-16 11:15:31', '2021-06-16 11:15:31', NULL, NULL),
(231, 'Storage box', 21.91, 9.03, 12.88, 1836, '16579.08', 3535554, '18-24,25-34,34-44,45-54', 1, 'Women', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Kitchen & household,Kitchen', 'Kitchen & household', '<p>Again disorganized and unsorted in the kitchen? It doesn\'t have to be. The storage box from Bake N \'Cook with the unique 4 in 1 concept offers the all-in-one solution. You can now keep your food dry, safe, and perfectly organized.</p>\r\n<p><strong>Features:</strong></p>\r\n<p><strong>Easy cleaning:<br /></strong>The storage box is dishwasher safe and easy to clean thanks to the removable lid.&nbsp;<br /><strong>Versatile:<br /></strong>You can perfectly store flour, sugar, rice, nuts, muesli, or coffee.<br /><strong>Odor-free and durable:<br /></strong>The selected material makes the storage box a loyal companion for a long time.</p>\r\n<p>From now on you can enjoy generous space in its most practical form. At the same time, save yourself a lot of time and nerves and keep your kitchen sorted and organized like never before.</p>\r\n<p><strong>Specifications:</strong></p>\r\n<p><strong>Style: </strong>New Classical/Post-modern<br /><strong>Material: </strong>Plastic<br /><strong>Name:</strong> Kitchen plastic food storage box<br /><strong>Size: </strong>About 1500/2000/2500/3000ml<br /><strong>Purpose: </strong>Storage box, Storage Kitchen tool<br /><strong>&nbsp;Color:</strong> Transparent<br /><strong>&nbsp;Size: </strong>1500/2000/2500/3000ml</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Package Include:<br /></strong>1pc x Food Storage box</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', 'Available', 'facebook_ads', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-20 04:25:42', '2021-06-20 04:25:42', NULL, NULL);
