(232, 'Ice Gripper Spike Anti-Skid', 14.97, 7.01, 7.96, 174, '1219.74', 667044, '18-24,25-34,34-44', 2, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Bag\'s & Shoes,Bag,Shoes', 'Bag\'s & Shoes', '<p><strong>Description:</strong></p>\r\n<p>Want to enjoy your time during winter and avoid getting hurt by slippery icy surfaces. Put on 10 Studs Ice Gripper Spike Anti-Skid over your shoes and stay safe on the icy ground.10 Studs Ice Gripper Spike Anti-Skid helps you to keep still in winter. You&rsquo;ll be able to walk and even run on ice without slipping on the ground. There are 10 steel anti-slip studs on each foot to keep you safe. And the bands are made of stretchable elastic which fits well over different sizes and styles of shoes. It also allows you to put on and off your footwear easily. Its high quality that maintains its optimal performance under -40 &deg;C</p>\r\n<p>&nbsp;</p>\r\n<p><strong>FEATURES:</strong></p>\r\n<p><strong>10 Anti-Skid Studs:<br /></strong>Provide secure grips on snow and icy surfaces.<br /><strong>Durable Materials:<br /></strong>Made of durable rubber and steel studs, which maintain its best performance under -40 &deg;C!<br /><strong>Stretchable Elastic:<br /></strong>High-quality stretch rubber, which fits in everyone\'s shoes! Our products are not only suitable for men or women but also easy to wear over your shoes!&nbsp;<br /><strong>Easy to Use &amp; Carry:<br /></strong>Fits well over your footwear. You can easily take them on and off. They\'re able to be rolled up to fit in your bag, or even your pockets.<br /><strong>Suitable for Different Shoes:<br /></strong>They\'re super stretchable and available from size S to XL, which fits in sneakers, boots, and more! You can definitely enjoy your outdoor time in winter!</p>\r\n<p><strong>SPECIFICATIONS:<br /></strong><strong>Materials: </strong>Rubber, steel<br /><strong>Colour:</strong> black<br /><strong>Size: </strong>S/ M/ L/ XL</p>\r\n<p><strong>PACKAGE INCLUDES:<br /></strong>1 pair x 10 Studs Ice Gripper Spike Anti-Skid</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', 'Available', 'trending_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-20 04:43:40', '2021-06-20 04:43:40', NULL, NULL),
