(234, 'Color Changing Swim Trunks', 32.66, 7.46, 25.20, 197, '1469.62', 546508, '18-24,25-34,34-44,45-54', 2, 'Men', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Man\'s Fashion,Fashion', 'Man\'s Fashion', '<p><strong>Description:</strong></p>\r\n<p>All eyes will be on you at the beach this summer. Make their head turn with these incredible Color Changing Beach Shorts!</p>\r\n<p>&nbsp;</p>\r\n<p><strong>How does it work?</strong></p>\r\n<p>These swim shorts change color as soon as they come in contact with cold water. The swim shorts respond to temperature changes. Warm temperatures keep them the original color. Water is usually cool so it causes the special material to change.<br />Once you step into cool water see the magical color change!<br />Watch the color change in seconds. This will be your best beachwear this summer</p>\r\n<p>Quick-dry fabric! Don&rsquo;t worry about drying these shorts dry quickly and easily. You don&rsquo;t have to worry about staying wet.<br />Great for Day Parties, Beaches, Vacations, Pools Get yours today! Make heads turn and start conversations!</p>\r\n<p>This trunk-style swimsuit features an elastic waistband with drawstring for a flexible yet secure fit, keeps you moving from the moment you step out the door. The pants&rsquo; colors are changeable when they touch the water. An essential item for a hot summer day, elegant and stylish</p>\r\n<p>&nbsp;</p>\r\n<p><strong>&nbsp;Features:</strong></p>\r\n<p><strong>Funny Temperature Sensitive Color Changing:<br /></strong>The color will change according to different temperatures. When you go to a warm inside room, the color will change to a warm color, when you touch the cold water, it will change to another color! Enjoy your pool party time and show off your funny pants!</p>\r\n<p><strong>Swim Trunks Design for Men:<br /></strong>Above Knee is comfortable for you to move; drawstring elastic waist helps it to hold tight when you are having fun above the water; also have two side pockets and the mesh lining makes it more comfortable to wear.</p>\r\n<p><strong>Quick-drying:<br /></strong>Made of high-quality fiber mixture, soft, comfortable, and easy to carry. Adjustable drawstring waistband for maximum comfort and fit, it is perfect totally for swimming, surfing, taking a dip, relaxing in the sun, beach, or pool play.</p>\r\n<p><strong>Indoor and Outdoor Use:<br /></strong>This short trunk is soft and breathable enough for both beachwear and more activities. Such as swimming, running, workout, sports, or just daily wear in summer, sports, vacation, and daily life. A great gift for yourself or someone special.</p>\r\n<p><strong>Avoid Embarrassment of Getting Wet:<br /></strong>Double-layer fabric, allowing for both comfort and flexibility, is not easy to stick on the body when wet, to avoid the embarrassment of getting wet.</p>\r\n<p><strong>Specification:</strong></p>\r\n<p><strong>Condition: </strong>100% Brand New<br /><strong>Material: </strong>Polyester<br /><strong>Optional Size:</strong> S, M, L, XL, 2XL, 3XL<br /><strong>Color: </strong>Green, Blue, Yellow, Pink</p>\r\n<p><strong>Package List</strong>:<br />1 xSwim Trunk Short</p>\r\n<p>&nbsp;</p>', 'Available', 'trending_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-20 05:11:18', '2021-06-20 05:11:18', NULL, NULL),
(235, 'Foot Polisher', 34.99, 13.71, 21.28, 2985, '40924.35', 268823, '18-24,25-34,34-44,45-54', 1, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Health & Beauty,Health', 'Health & Beauty', '<p><strong>Description:</strong></p>\r\n<p>Make your skin softer and healthier!<br />Do you have troubled skin? No matter what you do it seems like you can never get rid of dead and hard skin on your feet? Now you can forget about all of your troubles! Your new electric callus remover feels safe with new advanced pressure-sensitive technology that won\'t harm your skin in any way! Take care of your foot wrinkles and troublesome calluses! You can give your skin a makeover at home! Micro mineral crystals on this callus remover will leave your skin glowy and healthy! Forget about skin cuts, any irritation, and pain during callus removal! Protect your skin and give it gentle yet adjuvant exfoliation! Everything that you need in one place for healthy feet skin! Save your time with your new effective and fast callus remover! You will enjoy this product even if you have extremely sensitive skin! Forget about the powdery mess many other removers make! This remover has a built-in vacuum! Feel confident with your beautiful smooth skin! Don\'t ever feel embarrassed going barefoot again! Have perfectly pedicured feet in only a few minutes!<span style=\"white-space: pre;\"> </span>&nbsp;<br />&nbsp; Feel confident about your feet again!</p>\r\n<p>Calluses are hard, painful areas of skin that often develop on the feet in response to pressure or friction.<br />They happen when the skin tries to protect an underlying area from injury, pressure or rubbing. Neither is dangerous, but they can cause irritation. This is why the foot file plays a big role in a pedicure.<br />Other foot files leave behind huge messes. But electric callus file is the only motorized callus remover with unique derma-vac technology that sucks up those dead skin shavings WHILE you use it.</p>\r\n<p><strong>Perfect feet pedicure:</strong> Take care of yourself and your skin easily at home! Now you can give your feet full spa treatment! Feel proud and confident about your smooth skin!<br /><strong>Extremely effective:</strong> Get rid of hard, rough, dead skin. Forget about tough calluses, dry skin, cracked skin, thick skin, and wrinkles! Give yourself a professional exfoliation and keep your feet healthy!<br /><strong>Tough and durable: </strong>Save your money on an extremely durable callus remover! It\'s tougher than metal files, scrubbers, greater, and pumice stone. Micro mineral crystals will return a natural glow to your skin and a built-in vacuum will suck up all the mess!<br /><strong>Safe for use:</strong> Forget about any irritations, skin cuts, or painful callus removals! Your skin will be perfectly safe and smoother than ever! The safety switch will prevent the remover from accidentally switching on! Even the most sensitive skin can be taken care of! Make your life easier and feel good about yourself again!</p>\r\n<p><strong>FEATURES:</strong></p>\r\n<p>**MESS-FREE: Callus eliminator uses a built-in vacuum that buffs away and sucks up dead skin at the same time</p>\r\n<p>**HIGH-POWER HOME PEDICURE TOOLS: Callus eliminator micro-abrasion head rotates at 2000 rpm for high power and maximum comfort.</p>\r\n<p>**RECHARGEABLE BATTERY: Perfect for getting soft, sexy feet at home, at the office, in the car, or anywhere else you go.</p>\r\n<p>**INSTANT RESULTS: Instantly removes dry, dead skin and uncomfortable calluses from heels, soles, toes, and hands.</p>\r\n<p>**PEDICURE-WORTHY FEET, WITHOUT THE SALON: With this Foot File and Callus Remover, you\'ll no longer have to suffer dry, cracked heels in-between visits. Now you can have pedicure-worthy feet whenever you want.</p>\r\n<p>&nbsp;</p>\r\n<p>BEAUTIFUL SKIN WITHOUT DAMAGE: A regular foot file grates and damages skin, causing pain and discomfort. This foot file callus remover removes uncomfortable calluses and smooths cracked heels without damaging your feet!</p>\r\n<p><strong>Specifications:</strong></p>\r\n<p><strong>Material:</strong> Plastics<br /><strong>Size: </strong>75*155*75mm/6.89*6.1*2.95\"</p>\r\n<p><strong>Package Includes:<br /></strong>1 X Foot File<br />2 X Grinding Heads<br />1 X USB Charging Line<br />1 X Brush<br />1 X User Manual<br />1 X Sponge Ring</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', 'Available', 'untapped_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-20 05:29:20', '2021-06-20 05:29:20', NULL, NULL),
(236, 'Cool Mouse Led Table Lamp', 39.95, 11.00, 28.95, 3526, '38786.00', 384546, '18-24,25-34,34-44,45-54', 1, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Electronics, Led Table Lamp,Cool Mouse Led Table Lamp', 'Electronics', '<p>Our Mouse Table Lamp is definitely not your ordinary table lamp because it is also a decorative piece that can liven up your interior decor. Place it on your study table, shelf, or bedside table to brighten up and create a relaxing mood with the warm LED light.</p>\r\n<p><strong>Features:</strong></p>\r\n<p><strong>3 styles:<br /></strong>Sitting mouse and running and standing mouse light resin table lamp for you to choose.</p>\r\n<p><strong>Plug-in wall light:<br /></strong>Simple on / off switch easy to control, just one on / off switch on the power cord, enjoy a simple desk lamp.</p>\r\n<p><strong>Elegant appearance:<br /></strong>Made of high-end resin, the elegant appearance of this contemporary lamp elevates the aesthetics of your home.</p>\r\n<p><strong>Convenient side table lamp:<br /></strong>The desk and table lamp have a convenient on / off switch on the power cord that makes it easy to turn it on and off without having to get up and flip a wall switch. It\'s also lightweight and sits nicely on side tables to provide light without taking up too much space.</p>\r\n<p><strong>Occasion:<br /></strong>This modern table lamp is ideal for bedroom, living room, baby room, office, yoga studio, nursery, dresser, coffee table, college dorm, coffee shop, bookshelf in your library or study.</p>\r\n<p><strong>Specifications:</strong></p>\r\n<p><strong>Standing: </strong>11.2x5.8x10.2cm / 4.4x2.3x4in<br /><strong>Creeping: </strong>13.2x5.8x6.9cm / 5.2x2.3x2.7in<br /><strong>Looking Up:</strong> 11.8x5.8x10.2cm / 4.6x2.3x4in</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Package Include:</strong></p>\r\n<p>1x Mouse Lamp<br />1x E12 Light Bulb<br />1x Plug (you will receive the correct one for the destination country of your order) with Power Switch</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', 'Available', 'facebook_ads', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-20 05:41:25', '2021-06-20 05:41:25', NULL, NULL),
(237, 'Small Portable Outdoor Wireless Bluetooth Speaker with FM Radio', 119.00, 83.82, 35.18, 2, '167.64', 619437, '18-24,25-34,34-44,45-54', 2, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Electronics', 'Electronics', '<p>Are you interested in customizing this product with your logo as an executive gift or for a corporate event? We&rsquo;re here to help! Contact us for a custom quote where we offer a variety of different decoration options to suit your needs.</p>\r\n<p><strong>Features:</strong></p>\r\n<p><strong>Mini &amp; portable Bluetooth and FM radio speaker:<br /></strong>Designed and crafted with the consideration of convenience and aesthetics, each portable metal series comes with a unique carrying case that allows ease of mobility.</p>\r\n<p><strong>Bluetooth and FM radio 8-10 hour:&nbsp;<br /></strong>The built-in lithium-ion rechargeable battery guarantees up to 8-10 hours of playtime. Recharge in just 2-3 hours with included micro USB cable.</p>\r\n<p><strong>Bluetooth 4.0 technology:<br /></strong>Compatible with all Bluetooth-enabled devices. Instantly connect to your smartphone or tablet from up to 33 ft/10m away. Speaker automatically reconnects to the last device used.</p>\r\n<p><strong>FM radio:<br /></strong>Speaker picks up FM radio stations local to your location. Tune the dial to listen to your favorites!</p>\r\n<p><strong>Superior sound quality:<br /></strong>Winner of the 2017 cues innovation awards, this pocket speaker is extremely loud with crisp sound and strong deep bass, powered by a 5w full-bodied stereo realized through a high-performance driver and a unique enhanced bass.</p>\r\n<p><strong>Durable and ultra-compact:<br /></strong>The rosewood duffle portable radio speaker is crafted with highly durable wood, has a compact size of 3.7 x 2.83 x 2.21 inches, and comes with a travel pouch, so you can easily fit in your bag or carry it with you and enjoy your music wherever you are.</p>\r\n<p><strong>Retro design and elegance:<br /></strong>The whole body of this portable Bluetooth speaker is made to be the perfect retro vintage look for home d&eacute;cor. Designed to look like a 1964 radio, the wood will bring out all the nostalgia.&nbsp;</p>\r\n<p><strong>Specifications:</strong></p>\r\n<p><strong>Product Dimensions:</strong> 3.46 * 2.56 * 2.2 in<br /><strong>Speaker: </strong>40mm / 1.57 in neodymium iron boron, full frequency<br /><strong>Battery: </strong>Rechargeable lithium-polymer battery (3.7V/1000mAh)<br /><strong>Net Weight:</strong> 0.94 lb<br /><strong>Battery Life:</strong> 8-10 hours at &lt;70% volume capacity<br /><strong>Frequency Range: </strong>87-108 MHz<br /><strong>SNR:</strong> &gt; 60db<br /><strong>Distortion: </strong>&le; 0.5%<br /><strong>Bluetooth Version:</strong> 4.0<br /><strong>Bluetooth Frequency Range: </strong>5m&le;distance&le;10m / 16.4ft&le; distance&le; 32.8ft<br /><strong>Bluetooth Connection Distance:</strong> 2402 MHz to 2480 MHz</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Package Include:<br /></strong>Carrying Case<br />OTR Rosewood Bluetooth speaker radio<br />Detachable antenna<br />Stickers<br />Postcards<br />Warranty card<br />Catalog<br />User manual<br />Aux cable&nbsp;<br />Charging cable</p>\r\n<p>&nbsp;</p>', 'Available', 'trending_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-20 06:04:27', '2021-06-20 06:04:27', NULL, NULL),
(238, 'Vacuum packing machine', 54.75, 33.60, 21.15, 477, '16027.20', 154205, '18-24,25-34,34-44,45-54', 2, 'Women', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Kitchen & household', 'Kitchen & household', '<p>We know that food waste is always a big issue for you. One of the worst enemies of food is air, there are a ton of other elements mixed with air which bring harmful substances resulting in perishable food. So you need an \"Electric Vacuum Food Sealer Packaging Machine\" to make sure that your food or non-food items are in a place where air cannot be accessed for keeping fresher.</p>\r\n<p><strong>Features:</strong></p>\r\n<p><strong>Reduce cost and keep food fresh:<br /></strong>By using a white dolphin vacuum sealer for food storage, you can avoid wasting food due to oxidation, exposure to odors, and rotting.</p>\r\n<p><strong>Multi-functional buttons:<br /></strong>Short press the button to vacuum and seal the bag. Long press the button to vacuum and seal thicker bags.</p>\r\n<p><strong>Sealing food:<br /></strong>Vacuum and seal dry food and moist food. Liquid food is only suitable for sealing, not vacuuming.</p>\r\n<p><strong>Work with refrigerator:<br /></strong>After vacuuming, food in the refrigerator can be effectively prevented from dehydration, chapping, odor, and deterioration.</p>\r\n<p><strong>Specifications:</strong></p>\r\n<p><strong>Rated voltage: </strong>100V/220V AC<br /><strong>Rated frequency: </strong>220V/50Hz 110V/60Hz<br /><strong>Rated power: </strong>80W<br /><strong>Sealing time: </strong>6~15 seconds<br /><strong>Vacuum Pressure: </strong>-60 kPa<br /><strong>Dimension:</strong> 350*82*60mm<br /><strong>Weight:</strong> 570g(exclude power code)<br /><strong>Sealing length: </strong>&lt;=290mm</p>\r\n<p><strong>Package Include:</strong></p>\r\n<p>1 * Food Vacuum Sealer<br />10 * Bags (Size : 5 pcs 12*20cm, 5pcs 20*25cm)<br />1 * English Manual</p>\r\n<p>&nbsp;</p>', 'Available', 'untapped_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-20 06:14:05', '2021-06-20 06:14:05', NULL, NULL),
(239, 'AirCoolCube 3 IN 1 air conditioner', 114.37, 22.60, 91.77, 740, '16724.00', 1333717, '18-24,25-34,34-44,45-54,55-64', 1, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Home Improvement,Home', 'Home Improvement', '<p><strong>Product Description:</strong></p>\r\n<p>Arctic air uses the principle of evaporative cooling to help with cooling, simply explained when sucking hot air through the water surface. Some of the hot air will be sucked out by water. And some of the water that gets hot will turn into low-temperature vapor as well. The result is that the air temperature will drop. And there is an increase in the amount of water vapor in the air.&nbsp;</p>\r\n<p><strong>Features:</strong></p>\r\n<p>-Using evaporation technology, it can transform daily cold water into cool, clean air through a special filter, which will allow you to relax and stay cool on hot nights.</p>\r\n<p>-Cool and humidify for better air and allow you to create your own personal climate.</p>\r\n<p>-This powerful function can run up to 8 hours at a time and draws warm air out of the room through its evaporative water filter, thus filling any space in the cool, clean, and comfortable air.</p>\r\n<p>-Just fill it with water, plug it into any standard wall outlet or USB port and enjoy!</p>\r\n<p><strong>Specifications:</strong></p>\r\n<p><strong>Size: </strong>6.61&rdquo;x6.54&rdquo;x6.97&rdquo;<br /><strong>Wind speed:</strong> 3 modes (high / medium / low)&nbsp;<br /><strong>Power supply:</strong> USB<br /><strong>Spray time: </strong>8 hours</p>\r\n<p><strong>Package Include:<br /></strong>1 * Personal Air cooler,&nbsp;<br />1 * USB cable,<br />1 * User manual.<br /><br /></p>', 'Available', 'facebook_ads', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-20 06:24:29', '2021-06-20 06:24:29', NULL, NULL),
