(241, 'Baby Flowerpot', 23.99, 6.66, 17.33, 19, '126.54', 9202615, '18-24,25-34,34-44,45-54', 2, 'Women', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Home Improvement,Home', 'Home Improvement', '<p>This adorable baby Groot flower pot planter can also be used as a pen holder or as a quirky decor item in your home, garden, patio, car, or office space. It is made of PVC material and comes with a hole at the bottom of the flowerpot to drain excess water if used as a planter.</p>\r\n<p>This cute flower pot is a statement piece and will get a lot of eyeballs wherever you place it. Perfect for succulents or flowers it can be used in homes, offices, or even in classrooms.</p>\r\n<p><strong>Features:</strong></p>\r\n<p><strong>100 satisfaction service:<br /></strong>Any problems, we will do our best to meet your satisfaction.</p>\r\n<p><strong>Perfect design:<br /></strong>The bottom of the hollow is more stable, and there is a small hole under the flowerpot so that the extra water in the flowerpot will leak out in time. When used as a pen holder, the hole design hides on the bottom, and would not affect the appearance of a groot pen pot.</p>\r\n<p><strong>Tree man flowerpot function:<br /></strong>Suitable for tiny plants, for instance, succulent, cactus. Perfect to organize your pens, cards, and small utensils, make your space tidier. The grayish-brown color is not easy to get dirty, you can collect it forever!</p>\r\n<p><strong>A nice present:<br /></strong>This is a good gift for anyone! Great for home, office, garden, etc. Perfect for gifts including housewarming, holiday gifts, housewarming gifts &amp; more for co-workers, friends, family.</p>\r\n<p><strong>Specifications:</strong></p>\r\n<p><strong>Material:</strong> PLASTIC<br /><strong>Plastic Type:</strong> PVC<br /><strong>Used With: </strong>Flower/Green Plant<br /><strong>Finishing: </strong>Hand Carved<br /><strong>Type: </strong>Flowerpot</p>\r\n<p><strong>Package Include:<br /><