(246, 'DIY Sucker Bird Nest', 42.99, 9.37, 33.62, 3, '28.11', 106557, '18-24,25-34,34-44,45-54', 2, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Home Improvement,Home', 'Home Improvement', '<p>Birdhouse for Small Birds Outdoor Plastic BirdHouse with Suction Cups for Home Window Amazing close-up views of your favorite wild birds! Kids and pets also love to watch the birds sitting inches away from their faces. Translucent sticker, easy to observe the bird\'s nest from the inside without disturbing the bird. Give birds a sweet home and observe them in their natural habitat.</p>\r\n<p><span id=\"docs-internal-guid-3f47c379-7fff-a8cd-f6af-3fbe0c7beb51\"></span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 16pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Features:</span></p>\r\n<p>This birdhouse with 3pcs powerful suction cups can be easily and securely mounted on the window without the tool required.</p>\r\n<p>One-way mirror sticker design allows you to clearly observe birds without disturbing the nest.</p>\r\n<p>Allows you and your family to sit down and observe birds feeding and nesting.</p>\r\n<p>Made of quality plastic material, weather-resistant, and long-lasting to use.</p>\r\n<p>Classic imitation wooden house design withstanding rod on the front for birds to perch.</p>\r\n<p><strong>Best Gift for Birds:<br /></strong>See colorful wild birds from up close. Just sit in your house and have fun discovering wild birds. Suitable for finch, cardinals, woodpecker, jay, bluejay, robin, goldfinches, and hundreds of other bird varieties!!</p>\r\n<p><strong>Perfect Decoration:<br /></strong>Classic imitated wooden house design and innovative stick design, convenient for birds to rest while bringing a touch of difference to your home.</p>\r\n<p><strong>Much Entertainment:<br /></strong>It provides instant entertainment for you or your family and children, you just sit down and enjoy the feeding and nesting of birds in the natural environment.</p>\r\n<p><strong>Easy to Assemble and Mount:<br /></strong>Securely attached to the outside of the window or patio door with weather-resistant suction cups. Easy to assemble and mount. Perfect size for typical backyard bird species. Keeps Birdwatchers of all ages captivated year-round.</p>\r\n<p><strong>Specification:</strong></p>\r\n<p><strong>Item Type: </strong>Outdoor Bird House<br /><strong>Material:</strong> ABS + PS + PVC<br /><strong>Color: </strong>As Shown<br /><strong>Total Height:</strong> 8.58in<br /><strong>Bottom Size:</strong> 5.51x3.94in<br /><strong>Hose Diameter: </strong>1.25in</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Package Includes:<br /></strong>1 x Bird Nest</p>', 'Available', 'untapped_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-20 06:45:13', '2021-06-20 06:45:13', NULL, NULL),
(247, 'Miracle Acupuncture Pen', 40.00, 6.58, 33.42, 777, '5112.66', 309837, '18-24,25-34,34-44,45-54', 1, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Health & Beauty,Health', 'Health & Beauty', '<p>Do you want to instantly treat your body pains with acupuncture but are afraid of being punctured by needles?<br />Well, fear no more and try the therapy instead! Our revolutionary pen provides a painless, acupuncture-type stimulation using an electric pulse to relieve stress, promote healthy blood circulation, firm aging skin, and help drastically reduce muscle pain!<br />ThermaPen is the original acupuncture pen. Start living a pain-free life and treat all types of chronic physical aches such as sports injuries, headaches, muscle, joint, and back pains, all in the comfort of your own home! Or, if you simply want unlimited massages, this pen will be the best companion throughout your day.</p>\r\n<p><strong>FEATURES:&nbsp;</strong></p>\r\n<p>-Four massage heads to quickly and effectively give relief to all sorts of body aches.</p>\r\n<p>-Enhances skin texture, anti-wrinkle, helps fight fatty areas, tightens skin.</p>\r\n<p>-9 adjustable intensity levels to fit your needs.</p>\r\n<p>-No side effects, unlike medicated painkillers &amp; drugs.</p>\r\n<p>-Lightweight, convenient to carry, and easy to use.</p>\r\n<p>-Comes with a guide containing over 40 secret trigger points on your body hand-picked by our acupuncture professionals (limited time bonus)</p>\r\n<p>&nbsp;</p>\r\n<p><strong>SPECIFICATIONS:&nbsp;</strong></p>\r\n<p><strong>Battery Powered: </strong>1 x AA battery (not included)</p>\r\n<p><strong>Size: </strong>18.3cm /7.25\" (Approx.)</p>\r\n<p>&nbsp;</p>\r\n<p><strong>PACKAGE INCLUDES:</strong></p>\r\n<p>TheraPen&trade; Electric Acupuncture Pen</p>\r\n<p>Advanced guide (limited time bonus)</p>\r\n<p>Four massage heads</p>\r\n<p>Manual</p>\r\n<p>Box</p>\r\n<p>&nbsp;</p>', 'Available', 'facebook_ads', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-20 07:01:24', '2021-06-20 07:01:24', NULL, NULL),
