(Included)<br />Works with 4 \"C\" Batteries (Not Included) OR Uses USB Cable (Included)</p>\r\n<p><strong>Package Include:</strong></p>\r\n<p>This toy gun shooting targets game includes 1 target shooting gallery<br />&nbsp;2 foam dart guns<br />10 foam balls targets<br />10 foam darts<br />&nbsp;1 USB Charging Cable<br />5 Catapult bird&nbsp;<br />compatible Nerf gun accessories.<br /><br /></p>', 'Available', 'trending_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-20 07:16:20', '2021-06-20 07:16:20', NULL, NULL);
