(249, 'Electric Peeler', 42.74, 9.75, 32.99, 422, '4114.50', 3796656, '18-24,25-34,34-44,45-54', 2, 'Women', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Kitchen & household,Kitchen', 'Kitchen & household', '<p><strong>Product Description:<br /></strong>Can you imagine how cool it is to peel fruits, vegetables, everything automatically? With this in mind we seek to bring this solution to your problems, this device is helping many housewives and professionals in their kitchens. With agility and practicality, without causing waste and a lot of dirt.</p>\r\n<p><strong>Features:</strong></p>\r\n<p><strong>&nbsp;gift for the home kitchen:<br /></strong>1 gift-free crinkle cutting (fruit and vegetable wavy chopper knife, safe potato cutter onion cutter french fry ) and 2 replacement blades. One mounted on the machine, the other two in the bottom of the base. Fruit peeling machine, electric potato and apple peeler, multifunctional automatic kitchen small household appliances. Powered by 4 aa batteries.</p>\r\n<p><strong>Easy to use and safe design:<br /></strong>One button design, just gently pressed, starts peeling automatically. The movable fixed needle can adapt to different vegetable &amp; fruit heights. No need to hold the vegetable during peeling, safe to hands!</p>\r\n<p><strong>Suitable for many kinds of fruits &amp; vegetables:<br /></strong>The robotized arm can adjust the thickness and automatic balance in the peeling process, keeping thickness uniformly. It can peel potatoes, sweet potatoes, tomatoes, zucchini, apples, pears, oranges, lemons, persimmon, mango, kiwi, cucumber, radish, papaya, and some other smooth hard fruits and vegetables.</p>\r\n<p><strong>Sharp stainless steel blade and non-slip base:&nbsp;<br /></strong>Carefully select high-quality stainless steel blades, peel fruits and vegetables faster. A potato can be peeled within 10 seconds. It just pares the skin without wasting any of the nutritious parts. Durable abs plastic non-slip base keep steady on the desk or other working place</p>\r\n<p>An amazing peeling machine that peels away potato, vegetables, and fruit skins in one fast easy motion! It takes the fast and efficient traditional design of your favorite kitchen tool and speeds it up. An indispensable kitchen tool.</p>\r\n<p><strong>Specifications:</strong></p>\r\n<p>Type: Fruit &amp; Vegetable Tools<br />color: white, black<br />weight: 0.9kg<br />size: 28.5*15.5*15.0CM<br />model number: fruit vegetable tools<br />use: kitchen accessories<br />function: cutter</p>\r\n<p><strong>Package Include:</strong></p>\r\n<p>1x Electric Fruit Peeler Peeler<br />1x Dual Voltage Power Supply</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', 'Available', 'untapped_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-20 07:39:07', '2021-06-20 07:39:07', NULL, NULL),
(250, 'Multi-Function Mini Car Emergency Tool', 29.99, 4.99, 25.00, 7, '34.93', 8166551, '18-24,25-34,34-44,45-54', 2, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Car Accessories, Car Emergency Tool,Multi-Function Mini Car', 'Car Accessories', '<p>A car emergency tool is specifically designed for an emergency dangerous situation. Generally, there are two main functions in which these excellent car escape tools are beneficial &ndash; one for cutting the seat belt and the other for breaking off the side window.</p>\r\n<p><strong>Features:</strong></p>\r\n<p><strong>Great for making day projects:<br /></strong>Helps create attractive decorative edging that gives a unique finish to every workpiece like furniture and decorations.</p>\r\n<p><strong>Long-lasting:<br /></strong>The fully hardened steel shank provides ultimate durability.</p>\r\n<p><strong>Precise, clean cuts:<br /></strong>Its high hook and shear angles allow cutters to slice smoothly into stock producing clean, splinter-free cuts.</p>\r\n<p><strong>Time-saving:<br /></strong>Guaranteed to save both your time and energy when doing home improvement or store construction.</p>\r\n<p><strong>Versatile:<br /></strong>Suitable for solid wood, particleboard, miff, plywood, etc.</p>\r\n<p><strong>Wide application:<br /></strong>Great for making a wood drawer, window, cupboard, or other woodworking projects.</p>\r\n<p><strong>Superior quality:<br /></strong>Made of high-quality materials with heat-resistant Teflon coating to prevent building-up of sawdust, resin, and pitch.</p>\r\n<p><strong>Excellent gift idea:<br /></strong>This makes a wonderful gift for every woodworking enthusiast because it is very easy to operate.</p>\r\n<p><strong>Specifications:<br />Body material: </strong>Solid hardened steel<br /><strong>Blade material: </strong>Industrial-grade micro grain carbide<br /><strong>Feature: </strong>Anti-kickback design<br /><strong>Shank size:</strong> 1/4 inch,1/2 inch<br /><strong>Cutting diameter: </strong>1-3/8 inch (34 mm)<br /><strong>Shank Length: </strong>1-1/4 inch (32 mm)<br /><strong>Overall length:</strong> 2 inches (51 mm)<br /><strong>Processing board thickness: </strong>95 - 165 mm</p>\r\n<p><strong>Package includes:<br /></strong>1 x 45-Degree Lock Miter Router Bit</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', 'Available', 'facebook_ads', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-20 09:09:20', '2021-06-20 09:09:20', NULL, NULL),
(251, 'Home Cotton Sugar Candy Floss Maker', 68.59, 32.25, 36.34, 1525, '49181.25', 6300588, '18-24,25-34,34-44,45-54', 1, 'Women', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Kitchen & household,Kitchen', 'Kitchen & household', '<p>Make your own cotton candy anytime you want with the Electric DIY Mini Cotton Candy Machine!</p>\r\n<p><strong>Product Features:</strong></p>\r\n<p>**Works by spinning sugar into fluffy cotton candy</p>\r\n<p>**Has a three-layer heating technology: When the machine begins to heat up, the central head starts to spin and push liquid, melted sugar through its tiny openings. The second the melted sugar pours out into the top of the machine, it cools down and re-solidifies, thus turning into yummy cotton candy.</p>\r\n<p>**Ideal for birthday parties, barbecues, family gatherings, and more!</p>\r\n<p>**Kids and adults will both enjoy the delicious candy floss</p>\r\n<p>**The sugar table is non-stick and easy to clean</p>\r\n<p>**Portable and mini-sized so you can bring it along with you</p>\r\n<p>**Extremely easy to use: Just pour in cotton candy sugar</p>\r\n<p><strong>Specifications:<br /></strong>Power (W): 500w<br />Capacity: 2 cups to fill the candy floss bowl<br />Colors: Blue, Pink, White<br />Material: Stainless Steel<br />Voltage: 110V, 220V<br />Product Weight: 1.3kg</p>\r\n<p><strong>Package Includes:&nbsp;</strong></p>\r\n<p>1x Mini Cotton Candy Maker</p>\r\n<p>&nbsp;</p>', 'Available', 'trending_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-20 09:19:38', '2021-06-20 09:19:38', NULL, NULL),
