(255, 'Automatic Foldable Fishing Trap', 29.99, 8.06, 21.93, 206, '1660.36', 680157, '18-24,25-34,34-44,45-54,55-64', 1, 'Men', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Garden Improvement,Garden', 'Garden Improvement', '<p>Folding Portable Automatic Fishing Trap Fishing Net Fish Minnow Shrimp Crab Baits Cast Mesh Trap<br />The multi-magic fishing trap is multi-function and a good assistant to fishing enthusiasts. Well constructed the nylon and mesh are sturdy and reinforced with steel bars and brackets. The Magic Fishing Trap with maze design, using fish like drill holes habits, fish easily into hard out</p>\r\n<p><strong>FEATURES:</strong></p>\r\n<p><strong>Easy to use:<br /></strong>Automatic telescopic fishing shrimp trap, convenient and simple, no need to install, easy to use. Just pull the string on the top and the net will be automatically opened</p>\r\n<p><strong>High quality:<br /></strong>Fishing net trap with 360&deg; design, the mesh made of high precision nylon, less damage and more fish</p>\r\n<p><strong>Foldable:<br /></strong>Made out of elastic material, it can be folded in small size, lightweight, and portable</p>\r\n<p><strong>Durable:<br /></strong>Quality and durable steel wire support, button device-the net folding when pressed</p>\r\n<p><strong>Compatibility:<br /></strong>The net trap is suitable for saltwater and freshwater, great for catching crayfish, smelt, crab, lobster, minnows, shrimp, and crawfish</p>\r\n<p><strong>Specifications:</strong></p>\r\n<p>One mesh side is 87 cm long (34 inch.)<br />Package weight 0.3 kg (11 oz.)<br />6 holes</p>\r\n<p><br /><strong>Package includes:</strong></p>\r\n<p>1 x Magic Fishing Trap</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', 'Available', 'facebook_ads', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-20 10:42:05', '2021-06-20 10:42:05', NULL, NULL),
(257, 'Snuffle Bowl Mat', 59.95, 11.08, 48.87, 176, '1950.08', 307960, '18-24,25-34,34-44,45-54', 2, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Pet Accessories,Pet', 'Pet Accessories', '<p>Give your Pet an interactive coursework exercise while slow feeding!<br />Give your dog\'s nose a treat with this fabric work-to-eat toy! The Sniff Bowl stimulates a pet\'s foraging instinct and satisfies your pet&rsquo;s senses. It puts your dog&rsquo;s nose and brain to work by mimicking the hunt for food in nature. Sniff Bowl works by hiding dry food or treats in the blades of the felt grass to keep your furbaby occupied and entertained at mealtime while ensuring slow feeding. You can use it as a round bowl or it can be spread flat to turn into a circular mat.</p>\r\n<p><strong>FEATURES:</strong></p>\r\n<p><strong>Interactive Puzzle Toy -</strong> It can be used as an interactive puzzle toy that exercises their sense of smell. Simply hide food and let your pet find it with their sniffing power.</p>\r\n<p><strong>Healthy Slow Feeding -</strong> Make certain that your dog eats in a slower, and healthier fashion. Slower eating facilitates better digestion and better overall health.</p>\r\n<p><strong>Keep Pets Active and Happy -</strong> Keep your furry friend occupied, happy, and away from boredom by letting them play and find their favorite treat.</p>\r\n<p><strong>Durable and Pet Safe Material </strong>- Made of super soft polar fleece, non-toxic and safe. Suitable for any breed of cats and dogs.</p>\r\n<p><strong>Easy to Clean -</strong> Made of specially-treated material, the main fabric is felt cloth, environmentally friendly, and machine washable</p>\r\n<p><strong>Non-Slip Design - </strong>The bottom is a non-slip cloth that effectively holds the mat and prevents the dog from moving the mat.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Specification:<br /></strong>&nbsp;48x48x8cm or 18.89x18.89x3.14&Prime;</p>\r\n<p><strong>Package Content:<br /></strong>1*Round Pet Snuffle Bowl</p>', 'Available', 'untapped_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-20 11:02:20', '2021-06-20 11:02:20', NULL, NULL),
(259, 'Food Preservation Tray', 29.95, 7.15, 22.80, 173, '1236.95', 374141, '18-24,25-34,34-44', 2, 'Women', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Kitchen & household,Kitchen,house', 'Kitchen & household', '<p>Food Preservation Tray is Made of high-quality stretch film with great resistance to penetration and compression for a perfect seal. This Reusable Tray is your perfect kitchen accessory for storing food. Food Fresh Storage is a washable and reusable design, applicable for dishwashers.<br />Magic Elastic Film Buckle Tray protects the environment and the health of your family. The Creative Stackable Food Preservation Tray fits for preserving fishes, meats, vegetables, fruits, cheeses, appetizers, etc. Vacuum Preservation Tray is ideal for any food, including raw meat, fish, nuts, bread, fruits, vegetables, cooked meals, and more. The Plastic Preservation Tray makes it easy to seal food, keeping your food fresh for a long time. The Kitchen Food Storage Container Set is Lightweight and stackable. A Seal Storage Container can keep fresh food for a long time. Stackable Food Tray allows you to stack multiple trays to save space, convenient to carry. Elastic Tray is Suitable for parties, picnics, barbecues, camping, and all other occasions where you need a tray to store food.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Features:</strong></p>\r\n<p><strong>Keep Food Fresh Longer: </strong>The food preservation tray seals food tightly with an elastic film seal on top that vacuum seals around the food.&nbsp;</p>\r\n<p><strong>Save Money on Plastic Wrap:</strong> The food tray is a money-saving and eco-friendly replacement for plastic wrap. No more buying plastic wrap and throwing it out after just one use.&nbsp;</p>\r\n<p><strong>Stackable and Space-Saving Design: </strong>The food sealing trays are great for use in the fridge and pantry with a stackable design. The trays are thin and take up less space than plastic containers.</p>\r\n<p><strong>Great for All Types of Food:</strong> The food trays preserve fresh fruit, vegetables, meats, cheese, leftover meals, and more. Preserve food for days longer than with plastic wrap.&nbsp;</p>\r\n<p><strong>High Quality, Reusable Material:</strong> The food sealing trays are made of plastic film and eco-friendly PP. The trays are reusable and are dishwasher safe</p>\r\n<p><strong>Specifications:</strong></p>\r\n<p><strong>Use: </strong>Food<br /><strong>Type: </strong>Storage Trays<br /><strong>Feature:</strong> Eco-Friendly<br /><strong>Material: </strong>Plastic<br /><strong>Style:</strong> Modern<br /><strong>Type: </strong>Storage Trays<br /><strong>Size: </strong>30x20cm</p>\r\n<p><strong>Package Includes:<br /></strong>1x Creative Stackable Food Preservation Tray</p>\r\n<p>&nbsp;</p>', 'Available', 'facebook_ads', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-21 05:15:35', '2021-06-21 05:15:35', NULL, NULL),
(260, 'Cat caves', 54.69, 42.75, 11.94, 5, '213.75', 9202796, '18-24,25-34,34-44,45-54', 2, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Pet Accessories,Cat caves', 'Pet Accessories', '<p>Our artisan Cat Cave Beds are the perfect addition to your home, creating a welcoming place for feline friends and little critters! Our special pets are our world, which is why every Cat Cave Bed we offer is ethically made with soft organic Merino Wool by artisans in Kathmandu, Nepal. Featuring stunning hand-dyed swirls of natural felt in shades of light gray, gray, and white, this beautiful design is like adding another piece of art to your collection! The natural lanolin in the wool will keep your pet smelling fresh while providing a natural repellent for odors and increased self-grooming!</p>\r\n<p><strong>Features:</strong></p>\r\n<p>*Pet Size of 20lbs and smaller</p>\r\n<p>*Easily cleaned with warm water</p>\r\n<p>*Natural properties of wool keep your pet groomed &amp; fresh</p>\r\n<p>*100% Organic Merino Wool</p>\r\n<p>*Size: 7.5&rdquo; Opening x 10.5&rdquo; Height&rdquo; x 19 Width</p>\r\n<p>*Sizing may vary slightly due to the nature of handmade items</p>\r\n<p>*Openings can be easily enlarged by snipping the opening by &frac12;&rdquo; increments with scissors.</p>\r\n<p>*100% Organic Merino Wool Imported from New Zealand</p>\r\n<p>*\"Green\" Dyed with Plant-Based Applications</p>\r\n<p>*Each Cat Cave is Wet Felted by Hand</p>\r\n<p>*Fair Trade Partnership in Kathmandu, Nepal</p>\r\n<p>*Crafted with Love for You and Your Cats!</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Specifications:&nbsp; &nbsp; &nbsp;</strong></p>\r\n<p><strong>Brand</strong>:Haussimple Wool</p>\r\n<p><strong>Shape:</strong> Round &amp; Oval</p>\r\n<p><strong>Package:</strong></p>\r\n<p>1*River Stone Cat Cave</p>\r\n<p>&nbsp;</p>', 'Available', 'trending_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-21 05:24:54', '2021-06-21 05:24:54', NULL, NULL);
