(262, 'The Jellyfish Aquarium Lamp', 69.99, 17.68, 52.31, 390, '6895.20', 751098, '18-24', 1, 'Baby', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Electronics, Aquarium Lamp,The Jellyfish', 'Electronics', '<p>OCEAN\'S PULSATION FROM THE COMFORT OF YOUR HOME Our Jellyfish Aquarium features 5 LED color options: Red, Green, Blue, Purple, and Pink. Pick the color that matches your home\'s personality, or let the auto color-switching function do the magic for you! Create a \"Peace of Mind\" atmosphere by switching the Aquarium on. Even the most energetic kids will not be able to resist its calming atmosphere! Simply add distilled or tap cold water into the tank, put the jellyfish in, plug it into a USB port or insert 3 AA batteries, and press the ON button. The motor inside the tank will move the jellyfish around in silence. High-quality packaging will make it an even better gift, perfect for birthdays, holidays, and parties. Available in 3 sizes: Small - 9 inches (23cm) , Medium - 12 inches (30cm) and Large - 14 inches (36cm)</p>\r\n<p><strong>WHY DO YOU NEED IT?</strong></p>\r\n<p>Elevate your house decor - Pick the color that matches your home\'s personality, or let the auto color-switching function do the magic for you!</p>\r\n<p>Reduce anxiety &amp; stress - Its quiet movement and ambiance will help you relax and forget about daily stress and routine.</p>\r\n<p>Easy to set up - Within 2 minutes your Jellyfish Aquarium will be set up and ready to provide a realistic deep-sea experience.</p>\r\n<p><strong>HOW DOES IT WORK?</strong></p>\r\n<p>The Aquarium uses LED lights, water, and a motor that allows the silicone jellyfish to look almost life-like. The lamp\'s outer shell is Acrylic and not glass, so it will not shatter if dropped. The LED colors can be set to one color or to a multi-color changing mode.</p>\r\n<p>This product imitates the effect design of volcanic eruption, adopts LED lighting, and the small balls in the water tank will continuously flow in, which is very ornamental and placed in the living room, office, and other places. At the same time, it is also a bedside night light, a table lamp, and an atmosphere adjustment lamp. It is also a good gift for children and friends.</p>\r\n<p><strong>Features:</strong></p>\r\n<p><strong>What you will get:</strong></p>\r\n<p>2 jellyfish: The silicone jellyfish swim and move around in the water just like real fish.</p>\r\n<p>Acrylic LED panel: The waterproof LED panel on the base of the device emits green light which provides a multi-colored glow in the lamp.</p>\r\n<p>Easy operation: Simply pour water into the lamp, add some glycerin for an added effect, and put the jellyfish in it one by one before turning it on.</p>\r\n<p>USB connector cable: The jellyfish lamp is powered by a USB port cable. Included with the package.</p>\r\n<p>Use as: An adornment in the house, as a soothing table piece in the office to drive away from the tension of the work, or give as a gift to your loved ones.</p>\r\n<p>Suitable for: Both kids and adults. Kids and adults enjoy looking at the realistic movement of the jellyfish.&nbsp;&nbsp;</p>\r\n<p>Dimensions: 4.1 x 4.1 x 11.1 inches</p>\r\n<p>Acrylic LED panel</p>\r\n<p>2 silicone jellyfish mimic a realistic sea movement</p>\r\n<p>Jellyfish change different colors</p>\r\n<p>USB power connector cable</p>\r\n<p>Use as an adornment or a soothing feature</p>\r\n<p><strong>Specifications:</strong></p>\r\n<p>Power mode: three A batteries or USB cable (without battery)</p>\r\n<p>Interface type: USB</p>\r\n<p>Lighting: LED color changing light</p>\r\n<p>Product size: 105 * 105 * 280 (mm)</p>\r\n<p>Gross weight: 0.45kg</p>\r\n<p><strong>Package Content:</strong></p>\r\n<p>1 x Product color box packaging</p>\r\n<p>1 x USB charging cable</p>\r\n<p>1 x Jellyfish lamp</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', 'Available', 'untapped_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-21 05:50:17', '2021-06-21 05:50:17', NULL, NULL),
(263, 'Balance Colander', 74.54, 12.78, 61.76, 7, '89.46', 396915, '18-24,25-34,34-44,45-54', 2, 'Women', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Kitchen & household,Kitchen', 'Kitchen & household', '<p><strong>Product Description:</strong></p>\r\n<p>BalanceColander |Equilibrium| reduces the amount of water needed to wash your fruits and vegetables by 60% &ndash; all while removing twice as many contaminants! You will never have to worry about items in the sink again because this design saves you time and frustration. This colander has a very well-considered hole slots pattern that allows to drain the excess water fast and simple. It is made from high-quality polypropylene which is a nonharmful material to dine from and has a special spin system that uses the force of gravity to speed up all kitchen tasks.</p>\r\n<p><strong>Features:</strong></p>\r\n<p>-a variety of uses: can be used as a drain pan, washing fruits and vegetables is very convenient and very time-saving</p>\r\n<p>-fine water filter hole: ultra-fine filter hole design, even distribution, fast water filtration, convenient and fast</p>\r\n<p>-thick edge arc design: thick edge arc design grip feel comfortable and durable, very textured, more convenient to use</p>\r\n<p>-the interior is smooth: rice sieve uses food-grade pp raw materials to make the interior smooth and non-hairy, easy to clean, and healthy</p>\r\n<p>-drain design: strip shape drain hole, moderate size</p>\r\n<p>-safe, healthy, and environmentally friendly: high-quality pp material manufacturing, safe and harmless, use with confidence</p>\r\n<p><strong>Specification:</strong></p>\r\n<p><strong>Material:</strong> PP<br /><strong>Product Category: </strong>Fruit and Vegetable Basket<br /><strong>Style:</strong> a simple style<br /><strong>Uses: </strong>home storage, daily small debris, cleaning fruits and vegetables</p>\r\n<p><strong>Package Content</strong></p>\r\n<p>1* Washing basket</p>\r\n<p>&nbsp;</p>', 'Available', 'facebook_ads', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-21 05:58:36', '2021-06-21 05:58:36', NULL, NULL),
(264, 'Musical Dinosaur LED Race Toy', 39.99, 15.40, 24.59, 387, '5959.80', 6374189, '18-24', 1, 'Baby', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Baby & Kids,Baby', 'Baby & Kids', '<p>This adorable Musical Dinosaur LED Race Toy comes with one large dinosaur (9-inch tall), and three cute mini dinosaurs ready to climb up to the top and slide down over and over again. A simple on/off switch controls the movement of the toy playset. Cheerful music plays as these dinosaurs make their way to the peak of the mountain. Oh, the large dinosaur also makes a roaring sound. This is a durable easy-to-assemble plastic playset. Added details include colorful flags posted at curbs, a welcome sign at the starting line, and a picture of excited contestants along the outside of the base. Gather the whole family around this delightful toy to see whose participant finishes first. This activity is recommended for children over 3 years of age due to the small parts.</p>\r\n<p><strong>Features:</strong></p>\r\n<p>Cheerful music, roaring dinosaur sound, and LED lights</p>\r\n<p>Comes with three mini dinosaurs and one large dinosaur (9-inch tall)</p>\r\n<p>A colorful race track with vibrant colors</p>\r\n<p>Perfect Christmas gift for any dinosaur lover</p>\r\n<p>On/off switch controls the movement</p>\r\n<p>USB and/or battery-powered</p>\r\n<p><strong>Specifications:</strong></p>\r\n<p>Material: ABS Plastic<br />Size: 24 x 18 x 37 cm / 9.44\" x 7.08\" x 14.56\" (H x L x W)<br />Power: USB and/or 3 x AA batteries (not included)<br />Age: 3 and above</p>\r\n<p><strong>Package Includes:</strong></p>\r\n<p>1 x Musical Dinosaur LED Race Toy<br />1 x Box<br />1 x USB Cable</p>\r\n<p>&nbsp;</p>', 'Available', 'trending_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-21 06:08:02', '2021-06-21 06:08:02', NULL, NULL),
