(266, '0 - 6 Years Old Baby Potty', 69.99, 24.53, 45.46, 2363, '57964.39', 4092458, '18-24', 1, 'Baby', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Baby & Kids,Baby, Old Baby Potty', 'Baby & Kids', '<p><strong>Product Description:</strong></p>\r\n<p>Ever wondered why toilet training for babies is hard?<br />Babies are not interested in dull design. In their world, only colorful and cute designs can get their attention and bring smiles to their faces. But there is more. Did you see some babies easily fall off from the potty before? They are scared, frightened, or worse getting hurt. They don\'t want to cry again because of falling off their beloved potty. And you know babies are not strong adults. They are weaker and easily get hurt. We saw this before and so redesigned the potty to be cute and 100% protection for the baby.No no more bad experiences in toilet training and No more tears from them. Why not just let them love it? It takes time to train your baby but it will set a significant milestone for both you and your baby.AND one chance only for this moment in your baby\'s lifetime. They grow up then it\'s gone.</p>\r\n<p><strong>Features:</strong></p>\r\n<p><strong>Suitable Size for Baby &ndash;</strong> Unlike ordinary toilets that are too high and large for 0-6 years old children which are not safe and require extra parent caring, this potty size suits right for them, making babies able to use it themselves and setting parents free.&nbsp;</p>\r\n<p><strong>Attractive and Comfortable seat &ndash;</strong> With cute artistic patterns and colors, it makes the potty attractive to the baby. The seat has a soft cushion attached making it comfortable when your baby sits on it. Only when the baby loves it then will they go for it themselves.</p>\r\n<p><strong>Safe design &ndash;&nbsp; </strong>Safety is a top concern here so the potty has a firm and reliable rubber pad in the potty legs, making it anti-slip. There are two handles, not just for easy carrying, but more importantly, allow the baby to hold them. Prevent the baby from falling off. The back is strongly attached to protect the baby\'s spine.</p>\r\n<p><strong>Easy Cleaning &ndash;</strong> We would like to make parents\' lives easier, avoiding the trouble of cleaning. The partition design makes cleaning convenient, especially when you have a garbage bag attached to it. It\'s easy to detach and throw the garbage bag away.</p>\r\n<p><strong>Specifications:</strong></p>\r\n<p><strong>Material: </strong>Plastic<br /><strong>Color: </strong>Pink/Green/Blue</p>\r\n<p><strong>Package Includes:<br /></strong>1 * CutePotty&trade; - 0 - 6 years old Baby Pott</p>\r\n<p>&nbsp;</p>', 'Available', 'untapped_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-21 06:33:49', '2021-06-21 06:33:49', NULL, NULL),
(267, 'Digital Measuring Spoon', 19.99, 1.27, 18.72, 1980, '2514.60', 443057, '18-24,25-34,34-44,45-54', 1, 'Women', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Kitchen & household,Kitchen,House', 'Kitchen & household', '<p>Just scoop your ingredients into the Digital Measuring Spoon and it will quickly and accurately display the weight on its built-in LCD display. This digital weighing spoon cannot be missing in your kitchen. Use high-precision sensors to correctly weigh your food. Supports 4 different units of measure. It is ideal for using and weighing sugar, milk, margarine, cream, or any liquid or solid ingredient you can imagine. The spoon is completely removable, so you can easily wash it.&nbsp;&nbsp;</p>\r\n<p><strong>Features:</strong></p>\r\n<p>Digital spoon scale with LCD display</p>\r\n<p>Balance adjustment function ensures your precise measurement</p>\r\n<p>High precision sensor, Ingredients ranging from 1g to 500g with 0.1-gram readability.</p>\r\n<p>Hold function to freeze the readings on the LCD</p>\r\n<p>Makes cooking preparation faster and easier. Durable enough for daily use</p>\r\n<p>Ideal tool to weigh butter, flour, cream, tea, or spices during cooking or baking.</p>\r\n<p>The scale will automatically switch off when it is in non-use condition in order to save power</p>\r\n<p><strong>Specifications</strong></p>\r\n<p>Material: ABS Plastic<br />Size: 228mm x 55mm x 23mm (9\" x 2.2\" x 0.9\")<br />Display: LCD<br />Maximum Weight: 500g/0.1g<br />Accuracy Resolution: 0.1g,0.01oz<br />Powered by :1 X CR2032 battery (not included)</p>\r\n<p><strong>Package Includes:<br /></strong>1 x Digital Measuring Spoon</p>\r\n<p>&nbsp;</p>', 'Available', 'facebook_ads', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-21 06:45:16', '2021-06-21 06:45:16', NULL, NULL),
(268, 'Thermal Socks, Maximum Comfort', 20.70, 0.83, 19.87, 3, '2.49', 9200737, '18-24,25-34,34-44', 2, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Health & Beauty,Health,Beauty', 'Health & Beauty', '<p>Do you need socks that can help to keep your feet warm?&nbsp; Are you looking to do some outdoor activities and worry that you will have to come in early because of cold feet?&nbsp; With these socks, you will never have to end your outdoor trip early again. These socks are made of materials that not only keep your feet warm but are soft and comfortable.&nbsp; They are moisture resistant so they help to keep your feet dry, even when they get hot in your boots.&nbsp; If you choose to do outdoor activities, these socks can keep your feet warm even in the harshest sports weather, so ski, hike and explore in your dry and comfortable socks.</p>\r\n<p><strong>Features:</strong></p>\r\n<p>Helps to repel moisture to keep your feet dry in all conditions.<br />Light and comfortable.<br />Keep your feet dry in all conditions, inside or outside.<br />Made with aerospace fabric technology.<br />Can be worn with any type of shoes.<br />Easy to clean, washing machine safe.<br />Dryers are safe.<br />Made of cotton and strong threads.<br />Comes in black.</p>\r\n<p><strong>Specification:<br /></strong><strong>Type: </strong>Sock<br /><strong>Gender:</strong> unisex<br /><strong>Material: </strong>Aluminized fiber<br /><strong>Color:</strong> Black<br /><strong>Size: </strong>39x9cm/15.35x 3.54 inch</p>\r\n<p><strong>Package Include:<br /></strong>3 pairs of 35&ordm;F Below Ultimate Comfort Socks</p>\r\n<p>&nbsp;</p>', 'Available', 'trending_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-21 07:01:09', '2021-06-21 07:01:09', NULL, NULL),
(269, 'Wix Lit', 34.95, 5.04, 29.91, 230, '1159.20', 5185441, '18-24,25-34,34-44,45-54,55-64', 1, 'Men', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Mobile Accessories,Mobile', 'Mobile Accessories', '<p>Next time you lose your lighter and are craving a smoke, don&rsquo;t rush to the store to buy a lighter just grab your phone.3-in-1 functionality - mobile kickstand/finger ring grip, electric lighter &amp; magnetic car mounting. The ergonomic design of the kickstand makes a great finger grip on a crowded bus to prevent your phone from slipping through your hands. It&rsquo;s also a great solution to place your phone on your office desk and enjoy watching a video or making a video call. It can be attached to any magnetic mounting device. We recommend the Magnetic Car Mount for...It requires no gas and is non-combustible. There is no flame, only a tungsten coil that can only be activated if the kickstand is pulled out and the spring-loaded cover is pulled down. Whether you\'re outside in the wind or having cocktails in a bar, the Wix Lit provides you with environmentally friendly, flameless light.</p>\r\n<p><strong>Features:</strong></p>\r\n<p>Multifunction: 2 in 1 design, the item can be used as a lighter and phone bracket stand.</p>\r\n<p>Windproof and flameless: The lighter can work well on rainy days and windy. Perfect for outdoor activities.</p>\r\n<p>Material: Made of zinc alloy, compact, lightweight, and durable</p>\r\n<p>Application: Lighters can be easily ignited cigarettes, candles, paper, and more.</p>\r\n<p>USB chargeable: It is rechargeable, you can charge the lighter with the included USB cable through the computer, phone, power bank, and more.</p>\r\n<p>Easy to install: You just attach it to the back of the phone with the adhesive glue, no damage to your device. Easy to remove, no residues left.</p>\r\n<p>Economic: No need to refuel, save your money, and energy-saving.</p>\r\n<p>Easy to use: Safe to operate, the coil heats up when sliding opening the cover.</p>\r\n<p><strong>Specification:</strong></p>\r\n<p><strong>Color: </strong>black/blue/multicolor/brown/matte black</p>\r\n<p><strong>Size: </strong>65*35*6mm</p>\r\n<p><strong>Material: </strong>zinc alloy</p>\r\n<p><strong>Weight:</strong> 45g</p>\r\n<p><strong>Package includes:</strong></p>\r\n<p>1 * lighter</p>\r\n<p>1* USB cable</p>\r\n<p><strong>Notes:</strong></p>\r\n<p>Please allow 1-3mm differences due to manual measurement, thank you for your understanding!</p>\r\n<p>Due to the difference between different monitors, please understand that the picture may not reflect the actual color of the item.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', 'Available', 'untapped_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-21 07:15:09', '2021-06-21 07:15:09', NULL, NULL),
(270, 'Electronic Rolling Ruler', 44.99, 16.49, 28.50, 272, '4485.28', 2432010, '18-24,25-34,34-44,45-54', 1, 'Women', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Electronics,Electronic Rolling,Electronic Rolling Ruler', 'Electronics', '<p>The size unit can be switched at will. Carry it at any time, long standby USB charging.</p>\r\n<p><strong>FEATURES:&nbsp;</strong></p>\r\n<p><strong>COMPACT DESIGN: </strong>with a very small size 53 * 15MM (diameter * thickness) and 3 simple buttons, you can manage this electronic measuring device easily in one hand.</p>\r\n<p><strong>FEATURES: </strong>99 meters long-distance measurement, accuracy up to +/- 2 mm; addition and subtraction available; max store 10 units of history data.</p>\r\n<p><strong>LONG BATTERY LIFE: </strong>Built-in 200mAh lithium battery, fully charged, can measure 3000 meters at a time, achieving 200 days of continuous standby.</p>\r\n<p><strong>BACKLIT LCD AND VOLUME SETTING: </strong>Large backlight screen provides users with better visibility in low-light or no-light working conditions. Volume setting allows users to adjust the volume freely which is suitable for use in libraries, classrooms, and other quiet places. (This laser measure is designed to be used on a dimly lit area or indoor job sites. To use it outdoors, make sure that it is not in direct sunlight)</p>\r\n<p><strong>WIDE APPLICATION:</strong> Straight measurement, circular measurement, arbitrary curve measurement, irregular surface measurement, cylindrical diameter measurement.Able to switch units, easily cover your various measurement needs.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>SPECIFICATIONS:&nbsp;</strong></p>\r\n<p><strong>Shell material: </strong>aluminum alloy + silicone</p>\r\n<p><strong>Screen: </strong>1.8 inch VA LCD screen (white text on black background)</p>\r\n<p><strong>Shell process: </strong>fine polishing + matte blasting</p>\r\n<p><strong>Screen cover: </strong>4H super hard plexiglass</p>\r\n<p><strong>Size: </strong>53 * 15MM (diameter * thickness)</p>\r\n<p><strong>Accuracy: </strong>&plusmn; 0.5%, support step-less adjustment</p>\r\n<p><strong>Backlight time: </strong>30-180 seconds</p>\r\n<p><strong>Buzzer:</strong> on / off</p>\r\n<p><strong>Battery: </strong>200mAh 0.74wh</p>\r\n<p><strong>Charging interface: </strong>Type-C&nbsp;</p>\r\n<p><strong>PACKAGE INCLUDES:</strong></p>\r\n<p>1&nbsp; Electronic Ruler.<br />1 type c charging cable.</p>\r\n<p>&nbsp;</p>', 'Available', 'facebook_ads', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-21 09:22:13', '2021-06-21 09:22:13', NULL, NULL),
(271, 'Vintage Zodiac 12 Constellations Music Box With LED Lights', 69.95, 38.52, 31.43, 146, '5623.92', 754580, '18-24,25-34,34-44,45-54', 2, 'Women', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Home Improvement,Home', 'Home Improvement', '<p>Grab your Discounted Bronze Zodiac 12 Signs Music Box Retro 12 Constellation Musical Boxes Sun God Gift Box for Girls Valentine\'s Day Birthday Gifts while the store LAUNCH DISCOUNT is on. This is absolutely a great gift! ORDER NOW because these are FLYING off our shelves!&nbsp; Bronze Zodiac 12 Signs Music Box Retro 12 Constellation Musical Boxes Sun God Gift Box for Girls Valentine\'s Day Birthday Gifts. Vintage Zodiac Luminous Music Box with LED Lights Birthday Valentine\'s Day Gift.</p>\r\n<p><strong>FEATURES:&nbsp;</strong></p>\r\n<p>Vintage and retro design, perfect for kids and adults.</p>\r\n<p>It plays a clear melody Castle in The Sky.</p>\r\n<p>Sturdy material, beautiful design, lovely craftsmanship- perfect for any music box collector.</p>\r\n<p>Colorful LED lights will twinkle along with the music. Besides, The Goddess will rotate with music.</p>\r\n<p>Suitable for any occasions: birthdays, parties, Valentine\'s Day, Christmas, graduations, Mother\'s day or a birthday gift, girlfriend gifts, thanks to gifts, etc.</p>\r\n<p>Made of high-quality synthetic resin with metal movement, environmentally friendly, and durable.</p>\r\n<p><strong>SPECIFICATIONS:&nbsp;</strong></p>\r\n<p>Condition: 100% Brand new</p>\r\n<p>Material: Synthetic resin</p>\r\n<p>Size: Approx.10*12cm / 3.94*4.72in</p>\r\n<p>Music: Castle in the sky</p>\r\n<p>Package Weight: Approx.800g</p>\r\n<p>Color: As Shows in Pictures</p>\r\n<p>Battery: 10* LR44 Button Battery (Not included)</p>\r\n<p><strong>PACKAGE INCLUDES:<br /></strong>1* Musical Box (Not included in the battery).</p>\r\n<p>&nbsp;</p>', 'Available', 'trending_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-21 09:30:46', '2021-06-