(276, 'Painless Spots Removal Pen', 35.00, 7.49, 27.51, 5786, '43337.14', 9180880, '18-24,25-34,34-44,45-54', 1, 'Women', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Health & Beauty,health', 'Health & Beauty', '<p>Remove all spots &amp; moles on your body instantly and painlessly! - Restore your youthful skin without breaking the bank at the clinic! Integrated with advanced plasma technology to break down dark spots. Perfect for any dark spots such as moles, warts, skin tags, acne scars, and so on!</p>\r\n<p><strong>FEATURES:&nbsp;</strong></p>\r\n<p>Instant Result: Remove all unpleasant dark spots instantly without pain.</p>\r\n<p>Painless: Easy to use, no harm or pain in the removal process.</p>\r\n<p>Affordable: A cheaper and easier alternative to getting expensive laser treatments at beauty clinics.</p>\r\n<p>Non-Contact: Emits a tiny electrical arc to the skin to avoid bleeding, burning, or any side effect.</p>\r\n<p>Safe &amp; Effective: FDA-approved plasma technology ensures no pain and side effects.</p>\r\n<p><strong>SPECIFICATIONS:&nbsp;</strong></p>\r\n<p><strong>Main Color:</strong> white<br /><strong>&nbsp;Size: </strong>18*4*4cm<br /><strong>Target Area:</strong> Face / Body<br /><strong>Skin Type: </strong>All Skin Types</p>\r\n<p><strong>PACKAGE INCLUDES:</strong></p>\r\n<p>1x Painless Spots Removal Pen.<br />1x Charging Cable.</p>\r\n<p>&nbsp;</p>', 'Available', 'trending_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-21 10:29:08', '2021-06-21 10:29:08', NULL, NULL),
(277, 'Hot Dog Pet Bed', 57.95, 6.27, 51.68, 122, '764.94', 190535, '18-24,25-34,34-44,45-54', 2, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Pet Accessories, Pet Bed,Hot Dog Pet Bed', 'Pet Accessories', '<p>Is your pup getting bored of their plain ol\' dog bed? This unique dog bed will surely brighten things up! Made of 100% cotton, making it super comfortable for your pup to fall asleep in. Ketchup and Mustard not included!&nbsp;</p>\r\n<p><strong>FEATURES:&nbsp;</strong></p>\r\n<p><strong>KEEP THEM COMFORTABLE: </strong>Warm and comfy bed for pets in small sizes, such as puppy, cat, kitty, do. Super soft plush surface and cotton filling offer ultra-comfortable care for your pets and will keep your pet puppy and kitten cozy to prevent coldness.<br /><strong>DURABLE:</strong> Elaborate stitching ensures its durability and sturdiness.<br /><strong>AESTHETIC: </strong>Creative adorable bear&rsquo;s paw design adds extra color and fun to your house and also makes it easier to attract the pets to sleep on or play with.<br /><strong>PORTABLE: </strong>Lightweight and portable design make it perfect to place this pet cave bed on couches, chairs, beds, floors, sofas, car seats, etc.<br /><strong>COZY GIFT:</strong> Perfect pet house for your pets to curl up for a comfortable snooze.<br /><strong>MAXIMUM WARMTH: </strong>Extreme soft plush and cotton-padded cushions provide maximum warmth and coziness for your pet.<br /><strong>EASY TO MAINTAIN: </strong>Easy to clean and care for, simply throw it in a washing machine for quick washing and drying.</p>\r\n<p><strong>SPECIFICATIONS:&nbsp;<br /></strong><strong>Material: </strong>Cloth and Fiber<br /><strong>Suit For</strong>: Small/Middle/Large/Huge Pets<br />S-53cmX45cmX25cm(20.9X17.71X9.8chin)<br />L-75cmX52cmX25cm(29.5cmX20.5X9.8chin)</p>\r\n<p><strong>PACKAGE INCLUDES:<br /></strong>1 X Cushion Pet Hot Dog.</p>\r\n<p>&nbsp;</p>', 'Available', 'untapped_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-21 10:41:49', '2021-06-21 10:41:49', NULL, NULL),
(280, 'Ultrasonic Washing Machine Dishwasher', 39.95, 6.11, 33.84, 756, '4619.16', 283190, '18-24,25-34,34-44,45-54,55-64', 2, 'Men,Women', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Ultrasonic Washing Machine Dishwasher,Home Improvement', 'Home Improvement', '<p>The mini washer is ideal for children\'s clothing, underwear, socks, towels, and more. In addition to cleaning clothes, it is also great for cleaning jewelry, glasses, fruits, and more.</p>\r\n<p>ANYTIME ANYWHERE AS YOU GO -- Our washing machine adopts integrated design, mini style, which doesn\'t take large space. A convenient and small dishwashing machine for cleaning the dishes after dinner or cooking. Easily sits on countertops or tabletop requiring less space.<br /><br />STAIN REMOVING DEGREASING EMULSIFICATION PEELING -- Four-stage cycle cleaning, high-frequency vibration cavitation, and high-pressure waves, accelerate the dispersion and emulsification and peeling of liquids and stains to achieve cleanliness.</p>\r\n<p>WORKING PRINCIPLE -- The acoustic energy carried by the super vibration wave is a cavitation phenomenon in the liquid, which will generate a large number of pressure explosive microscale bubbles. The air bubbles burst rapidly to generate shock waves, and the surface of the dishes is constantly brushed. These gaps can cause stubborn dirt to crack, emulsify and peel. As a result, cleaning is achieved.</p>\r\n<p><strong>FEATURES:<br /></strong>Cleaner: This powerful dishwasher has four-stage cycle cleaning, high-frequency vibration cavitation, and high-pressure waves, which can accelerate the dispersion and emulsification, and peeling of liquids and stains to achieve better cleanliness.</p>\r\n<p>Multi-functional: It can be used in glasses, jewelry, fruits, vegetables, and so on, powerful</p>\r\n<p>Oxidation Bubble: High-pressure water sprays water in the air, thousands of bubbles burst in the water, producing oxidized bubbles, accelerating the dish stains.</p>\r\n<p>Portable Widely Use: This mini dishwasher is lightweight and compact, easy to carry, suitable for home, business trips, travel, camping.</p>\r\n<p><strong>SPECIFICATIONS:<br /></strong>Power: 800W or less</p>\r\n<p>Color classification: B automatic cycle, A section 4 file adjustment version</p>\r\n<p>Main material: ABS</p>\r\n<p>Power: USB</p>\r\n<p>Input voltage: DC5V</p>\r\n<p>Output voltage: DC10V</p>\r\n<p>Speed: 200 RPM</p>\r\n<p>Output power: 6 W</p>\r\n<p>Size: 90x90x40mm / 3.54x3.54 x inches</p>\r\n<p><strong>PACKAGE INCLUDES:</strong></p>\r\n<p>1x variant</p>', 'Available', 'facebook_ads', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-21 11:08:02', '2021-06-21 11:08:02', NULL, NULL),
(282, 'Colorful Butterfly Windchime Solar Lights', 19.99, 13.08, 6.91, 52, '680.16', 124264, '18-24,25-34,34-44,45-54,55-64', 2, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Home Improvement,Home', 'Home Improvement', '<p>Vivid butterflies fly in your garden during the day and Romantic light decorates your garden at night. This will be your dream garden designer, no need for artificial electricity, just need to hang it where you want to.</p>\r\n<p><strong>Features:</strong></p>\r\n<p><strong>Solar Power Wind Chime:<br /></strong>Charging in the daytime and automatically lights up at night</p>\r\n<p><strong>Beautiful Design:<br /></strong>Solar Butterfly Decorative Lights adds a charming display of light and whimsy to your porch or yard, making your outdoor settings as livable, enjoyable, and charming as any room in your home.</p>\r\n<p><strong>Color-Changing:<br /></strong>7 colors changing LED bulbs illuminating the crystals at night, calmly and softly changing from one color to the next.</p>\r\n<p><strong>Outdoor Decor:<br /></strong>Hook to easily hang from trees, fences, patio, garden, lawn, other features. The LED bulb remains cool to the touch at all times, providing safe lighting that doesn\'t burn or heat up.&nbsp;</p>\r\n<p><strong>Specifications:</strong></p>\r\n<p><strong>Switch: </strong>ON/OFF (Under the panel)</p>\r\n<p><strong>Charging time: </strong>6-8 hour in a direct sunlight environment</p>\r\n<p><strong>Working Time: </strong>6-8h if fully charged</p>\r\n<p><strong>Material: </strong>Glass and plastic</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Package Include:</strong></p>\r\n<p>1x box</p>\r\n<p>User manually<br />Solar-Powered Butterfly Lights</p>\r\n<p>&nbsp;</p>', 'Available', 'trending_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-22 04:35:58', '2021-06-22 04:35:58', NULL, NULL),
(283, 'Outward Hound Nina Ottosson Dog Casino Interactive Dog Toy', 40.80, 24.60, 16.20, 34, '836.40', 168048, '18-24,25-34,34-44,45-54,55-64', 2, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Pet Accessories, Dog Toy,Pet and Dog Toy', 'Pet Accessories', '<p>This Outward Hound Nina Ottosson Dog Casino is a smart option for pet parents and dog trainers looking to engage and excite their dogs. Opposed to typical treat feeding toys, the Dog Casino is filled with obstacles and new features that keep dogs playing happily.</p>\r\n<p><strong>Features:</strong></p>\r\n<p><strong>NO REMOVABLE PARTS:<br /></strong>This dog game has built-in play pieces that don&rsquo;t come out when your dog plays with it.</p>\r\n<p><strong>TWIST IT:&nbsp;<br /></strong>Unique to the Nina Ottosson Dog Casino dog game are the locking bone pieces. If your dog is good at solving puzzles, introduce them to a new challenge by simply twisting the bones on top to lock the drawers.</p>\r\n<p><strong>LEVEL 3 CHALLENGE:&nbsp;<br /></strong>Nina Ottosson Dog Games and puzzles are great for dogs of all ages, breeds, and sizes. This level 3 dog game is especially recommended for more challenging play but can be used with dogs of all play levels.</p>\r\n<p><strong>HOW TO PLAY:<br /></strong>With bones in the unlocked position, open drawers, and drop in treats or kibble. Close drawers and lock bones. Let the games begin! Place the game on the floor and encourage your pet to seek treats. Dogs are smarter than you think. Sometimes we just need to teach them! Leave bones unlocked and a drawer or two open to gain your dog\'s interest.</p>\r\n<p><strong>FROZEN PUZZLE:&nbsp;<br /></strong>Mix some canned/wet dog food or raw food with water, pour some of the mixtures in the hollows, or place a small piece of sausage or a tasty treat in each of the hollows, pour a little water, put the game in the freezer and let it set. Perfect for energetic dogs, hot weather, or just extended fun.</p>\r\n<p><strong>PLAY TOGETHER:&nbsp;<br /></strong>Nina Ottosson Dog Puzzle Games focus on challenging your dog&rsquo;s brain. Supervise when playing, and don\'t let the dog chew on the toy. Teach your dog how to use the puzzle, play, and have fun together. Put away until next time.</p>\r\n<p><strong>EASY TO CLEAN:&nbsp;<br /></strong>To wash your dog&rsquo;s Dog Casino, simply remove all treats/kibble and hand wash with warm soapy water, rinse clean and dry. Fill again for more fun!</p>\r\n<p><strong>Specifications:</strong></p>\r\n<p><strong>Size: </strong>31,5 x 26 cm,<br /><strong>&nbsp;height </strong>4,5 cm. / 13,78 x 11,81 in,</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Package Include:</strong></p>\r\n<p>1x box</p>\r\n<p>User Manually</p>\r\n<p>1x&nbsp; Outward Hound Nina Ottosson Dog Casino Interactive Dog Toy.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', 'Available', 'facebook_ads', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-22 04:45:26', '2021-06-22 04:45:26', NULL, NULL),
(285, '\"TRADITIONAL TIBETAN SINGING BOWL \"', 29.97, 13.19, 16.78, 28, '369.32', 203155, '18-24,25-34,34-44,45-54,55-64', 2, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Home Improvement,Home', 'Home Improvement', '<p>All our singing bowls are handcrafted locally in Nepal. Crafted traditionally with 7 metals, these bowls are consistent and very easy to use and offer beautiful frequencies when played in rotation and struck. Every bowl is engraved with an amazing handwritten mantra. Each bowl is individually checked for standard and predominant note range consistent with rotational use. Bowls include a wooden hammer as pictured.</p>\r\n<p><strong>Features:</strong></p>\r\n<p><strong>Complete authentic Tibetan bowl set:&nbsp;&nbsp;<br /></strong>antique light brown 4\" singing bowl, new easy-play leather pencil-grip striker, new hand-sewn non-dampening pillow. 100% handcrafted by local Nepalese artisans. Designed easy to play to enjoy its calming and soothing sounds right away!</p>\r\n<p><strong>Feel relaxed or get your money back. No questions asked:&nbsp;</strong><br />Nick Warren from amazon.Com says \" it is a very powerful thing. Within the first minute of using it, I felt like this is a life-changing thing to have. You can\'t understand how amazing this is until you hold it and use it yourself!\" Deborah Capers says it is \" very calming and pretty. This is a great piece of stress relief!\"</p>\r\n<p><strong>Beginner-friendly comes with free guides:</strong><br />whether or not you\'ve played a singing bowl before, with the free eBooks you\'ll be playing in no time!&nbsp;</p>\r\n<p><strong>Ideal size for on the go mindfulness:&nbsp;</strong><br />an ideal 4\" size ensures that your bowl will be a constant spiritual companion. Bring to yoga classes, meditation groups, or the office. Fits in your (or your child\'s) hand, yet sings with pure, layered tones that rival much larger bowls.</p>\r\n<p><strong>Hand inspected and tested for sound quality &amp; appearance:&nbsp;</strong><br />your singing bowl designs are exclusive- and are etched on the bowls, not painted. Each bowl is hand-inspected for sound quality before shipping by our singing bowl experts. Carefully packaged in a clean, safe environment. Heal and relax or your money back.</p>\r\n<p><strong>Specifications:</strong></p>\r\n<p>Item: Tibetan Singing Bowl</p>\r\n<p>Inner Diameter: 8cm/ 9cm/ 9.5cm/ 10.5cm/12.5cm/14.5cm/18cm</p>\r\n<p>Material: Metal Bowl + Wooden hammer</p>\r\n<p>Theme: Buddhism, Meditation, Mindfulness, Wellness, Chakra</p>\r\n<p>Regional Origin: Kathmandu, Nepal&nbsp; &nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Package Includes:</strong></p>\r\n<p>1x Singing Bowl, 1x Hand Hammer</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', 'Available', 'untapped_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-22 05:00:24', '2021-06-22 05:00:24', NULL, NULL),
(286, 'Magic Mandala Flower Basket toy', 9.98, 0.01, 9.97, 294, '2.94', 628576, '18-24,25-34,34-44,45-54', 1, 'Women', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Home Improvement,Home', 'Home Improvement', '<p>It is not only a mindfulness toy but also a beautiful work of art. After transformation, you can place it on your table or shelf as a unique decoration, making your space more lively. It is an open-ended toy that both kids and grown-ups will definitely enjoy playing with!</p>\r\n<p><strong>Features:</strong></p>\r\n<p><strong>Infinite 3d mandalas:<br /></strong>This is a 3d mandala toy filled with a variety of geometric shapes. You will be surprised at its flexibility to form countless different shapes. Let the mandala flower basket dance in your hands!</p>\r\n<p><strong>Stress reliever:<br /></strong>Mandalas can be a form of art therapy, allowing you to reduce anxiety, tension, and stress. Gives you a feeling of calmness and helps with concentration.</p>\r\n<p><strong>For all ages:<br /></strong>It is an inspiring and open-ended toy that will grow with you, encouraging creativity and exploration. Both kids and grown-ups will definitely enjoy it.</p>\r\n<p><strong>Unique home decorations:<br /></strong>Add a unique and handmade touch to your home decorations! It has a slight metallic shine and rainbow-like colors, making your space playful and lively.</p>\r\n<p><strong>Premium quality:<br /></strong>Decorated with colorful beads and made of mild steel &mdash; this mandala toy is safe, beautiful, shiny, and high quality.</p>\r\n<p><strong>Specifications:<br /></strong><strong>Material:&nbsp;</strong> Stainless steel&nbsp;<br /><strong>Diameter:&nbsp;</strong> 9.5 cm<br /><strong>Colors:&nbsp;</strong> Random from Gold, Silver, Black, Green, Purple, Yellow, Blue, etc.</p>\r\n<p><strong>Package List:<br /></strong>1x box<br />Magic Mandala Flower Basket toy</p>\r\n<p>&nbsp;</p>', 'Available', 'facebook_ads', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-22 05:10:46', '2021-06-22 05:10:46', NULL, NULL),
(287, '360 Degree Car Dashboard Phone Holder', 19.99, 1.99, 18.00, 314, '624.86', 504121, '18-24,25-34,34-44,45-54', 1, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Car Accessories, Car Dashboard Phone Holder,360 Degree Car Dashboard', 'Car Accessories', '<p>360 Degree Car Dashboard Phone Holder does not affect the driving sight. It holds smartphones right above the dashboard by a simple clip, which can move left and right on the dashboard. It ensures a clear front driving view without obscuring any viewpoint. Absolutely 100% driving safety guarantee.</p>\r\n<p><strong>FEATURES:&nbsp;</strong></p>\r\n<p>**The fully 360-degree rotating car phone holder gives you the best view, and can adjust the display angle of the mobile phone screen, and rotates left and right without restriction.</p>\r\n<p>**Direct view of the car phone holder does not affect the driving line of sight, mobile phone calls are hands-free, easy to pick up, safe and convenient.</p>\r\n<p>**The silicone pad of the arm protects the outer casing of the mobile phone and can adjust the display angle of the mobile phone screen.<br />Leopard shape is very cool and can be used as a stand or as an ornament.</p>\r\n<p><strong>SPECIFICATIONS:&nbsp;</strong></p>\r\n<p><strong>Material</strong>: ABS<br /><strong>Package Size: </strong>5.9*3.1*3.1 in<br /><strong>Color: </strong>black, silver, golden</p>\r\n<p><strong>PACKAGE INCLUDES:</strong></p>\r\n<p>1 * 360 Degree Car Dashboard Phone Holder.</p>\r\n<p>&nbsp;</p>', 'Available', 'trending_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-22 05:20:01', '2021-06-22 05:20:01', NULL, NULL);
