(288, 'Keyboard Cleaning Brush', 17.95, 8.27, 9.68, 1547, '12793.69', 3185739, '18-24,25-34,34-44,45-54', 1, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Computer Accessories,Comuuter', 'Computer Accessories', '<p>This tool is specifically designed to keep dust and gunk out of your keyboard and off of your monitor. The brush is made with premium nylon material that doesn\'t scratch your monitor\'s screen and gets right in between the keys of your keyboard. The nylon brush material picks up dust flawlessly making cleaning an easy process. It also comes with a keycap remover for those with a mechanical keyboard.</p>\r\n<p><strong>Features:</strong></p>\r\n<p><strong>Soft Premium Dust Brush:<br /></strong>Doesn\'t scratch or damage the keyboard or monitor.</p>\r\n<p><strong>Double Soft Rubber Cap:</strong><br />Two concealed soft rubber tips for cleaning deep, hard-to-reach spots.</p>\r\n<p><strong>Keycap Remover:<br /></strong>The brush comes with its own keycap remover for mechanical keyboards that stay with the brush so you don\'t ever lose it.</p>\r\n<p><strong>Specifications:<br /></strong><strong>Type: </strong>cleaning brush<br /><strong>Application: </strong>DISK<br /><strong>Application: </strong>Keyboard<br /><strong>Application:</strong> Hardware<br /><strong>Application:</strong> Screen<br /><strong>Model Number: </strong>HAGG1201<br /><strong>Color: </strong>Black-red<br /><strong>Material:</strong> Nylon+ABS<br /><strong>Product Name:</strong> Hagibis Keyboard Cleaning B<br /><strong>S: </strong>147mm x 80mm x 28<br /><strong>F:</strong> 4in1 Multi-function</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Package Include:</p>\r\n<p>&nbsp;</p>\r\n<p>1x box</p>\r\n<p>&nbsp;</p>', 'Available', 'facebook_ads', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-22 05:29:48', '2021-06-22 05:29:48', NULL, NULL),
(289, 'New Levitating Lamp', 125.95, 59.99, 65.96, 108, '6478.92', 6222551, '18-24,25-34,34-44,45-54', 1, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Home Improvement,Home', 'Home Improvement', '<p>Give any space a touch of modernity and class with the Evercare collective leviathan lamp. Combining functionality and style the lamp not only comes standard with a wireless charging base but its premium and high-quality materials are beautifully handcrafted with longevity in mind. Make any room stand out with this piece to impress even the highest of standards.</p>\r\n<p><strong>Features:</strong></p>\r\n<p><strong>Floating in mid-air freely:<br /></strong>without any support or contact, use the magnetic levitation technique.</p>\r\n<p><strong>Wireless power transmission:<br /></strong>bulb powered through the air via induction, lights controlled by the touch button: on/off on the wooden base.</p>\r\n<p><strong>Power safety:<br /></strong>gazer overcomes drop technical difficulties, the bulb is caught immediately once power off.</p>\r\n<p><strong>Attractive and decorative lamp:<br /></strong>a cool concept. Very fancy and unique decorations for your home, office, conference room, auditorium, canteen, and guesthouse, have unique visual effects.</p>\r\n<p><strong>Perfect gift:<br /></strong>great gifts for lovers, friends, parents, kids at Christmas, birthdays, holidays, wedding, anniversary and business, add to cart -image when they receive and open the box, it will bring them much surprise!</p>\r\n<p><strong>Specifications:</strong></p>\r\n<p><strong>Material:</strong> glass + wood + stainless steel<br /><strong>Size: </strong>160*110*375mm<br /><strong>Bulb size: </strong>70*130mm<br /><strong>Rated voltage:</strong> 12v<br /><strong>Rated power</strong>: 2w<br /><strong>Plug type:</strong> us plug</p>\r\n<p><strong>Package Include:</strong></p>\r\n<p>1 x magnetic levitating light bulb<br />1 x holder base (wood, stainless steel)<br />1 x power adapter<br />1 x user manual</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', 'Available', 'trending_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-22 05:41:30', '2021-06-22 05:41:30', NULL, NULL),
(290, 'MULTI FUNCTION SELFIE STICK', 49.99, 16.28, 33.71, 274, '4460.72', 2432010, '18-24,25-34,34-44,45-54', 1, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Mobile Accessories,Mobile', 'Mobile Accessories', '<p>This All In One Smart Wireless Bluetooth Selfie Stick is easy to adjust the angles. Free transform on horizontal or vertical with rearview mirror mode. Fit for all smart cell phones with Bluetooth functions like iPhone 5/6/7/8, iPhone 5s/6s/7plus/8 plus/X, Samsung, Huawei, and so on.</p>\r\n<p><strong>FEATURES:</strong></p>\r\n<p>It\'s an ideal partner for your family reunion, friends gathering, graduation, company party, travel, and so on.&nbsp;</p>\r\n<p>You can connect your phone and selfie stick with Bluetooth, no more wire connection, easy to control.</p>\r\n<p>Left and right rotation in 360 degrees.</p>\r\n<p>Easy to adjust the angles.</p>\r\n<p>Made of high-quality material.</p>\r\n<p><strong>SPECIFICATIONS:</strong></p>\r\n<p><strong>Power supply:</strong> 3 x AAA batteries (Not Included).<br /><strong>Material: </strong>Aluminum alloy, silicone, plastic.<br /><strong>Application: </strong>IOS 4.0+ / Android 2.3+.<br /><strong>Length: </strong>23-98cm (adjustable).&nbsp;<br /><strong>Weight: </strong>200g.<br /><strong>Color:</strong> Black.</p>\r\n<p><strong>PACKAGE INCLUDES:<br /></strong>1 x All In One Smart Wireless Bluetooth Selfie Stick.</p>\r\n<p>&nbsp;</p>', 'Available', 'untapped_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-22 05:52:08', '2021-06-22 05:52:08', NULL, NULL),
