(293, 'Wristband Hand Dispenser', 15.82, 5.46, 10.36, 16, '87.36', 9204028, '18-24,25-34,34-44,45-54', 2, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Health & Beauty,Health,Beauty', 'Health & Beauty', '<p>Our Wristband Hand Dispenser provides an external view of a dispenser bracelet that dispenses liquids. Ideal for everyone, for those who travel, work in health care, and just about anyone else.</p>\r\n<p><strong>Features:</strong></p>\r\n<p><strong>Safety and healthy:<br /></strong>Made of flexible, durable, and smooth-to-the-touch skin. Fill with your liquid of choice and press to dispense at your leisure.</p>\r\n<p><strong>One size fits all:<br /></strong>Suitable for everyone, especially for kids. It&rsquo;s wide enough to accommodate most product spouts. Wash with soap, warm water, and refill.</p>\r\n<p><strong>Easy to refill:<br /></strong>Holds up to 6ml of liquids and is easy to refill. Washable, re-wearable, and comes with two caps, one for loose liquids and the other for liquid gels.</p>\r\n<p><strong>Multifunctional:<br /></strong>Wear this anytime, anywhere. Perfectly suitable for school, overtime, travel, workplace. It can be filled with sunscreen, creams to ensure safety.</p>\r\n<p><strong>Perfect choice:<br /></strong>Makes the perfect gift for yourself and loved ones. It&rsquo;s a visual reminder to wash your hands frequently, eliminating cross-contamination of personal items.</p>\r\n<p><strong>Specifications:</strong></p>\r\n<p><strong>Material: </strong>Silicone TPU (Thermoplastic Polyurethane).<br /><strong>Size: </strong>6.3 inches to 9.5 inches.<br /><strong>Color: </strong>yellow, purple, green, black, pink, blue.</p>\r\n<p><strong>Package Include:<br /></strong>1/3 * Wristband Hand Dispenser</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', 'Available', 'untapped_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-22 06:33:35', '2021-06-22 06:33:35', NULL, NULL),
(294, 'LED STRIP RGB LIGHTS', 29.99, 3.53, 26.46, 36, '127.08', 6567076, '18-24,25-34,34-44,45-54', 2, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Home Improvement,Home', 'Home Improvement', '<p>Don&rsquo;t just color your space, control it! The New Ocean Galaxy Light&trade; LED Strip gives you the freedom and flexibility to choose from a variety of colors and program your own custom settings.</p>\r\n<p><strong>Features:</strong></p>\r\n<p><strong>App control &amp; music mode:</strong></p>\r\n<p>Bluetooth led strip lights built-in high sensitivity microphone and automatically pick up sound. Colors change automatically based on the music beats and ambient sound. With so many static and dynamic color modes can be chosen, like flashing, breathing, strobe, gradient, cool, etc. You can also DIY your unique colors, it can create a romantic, gorgeous, interesting, magical atmosphere for your party.</p>\r\n<p><strong>Multiple application led strips:</strong></p>\r\n<p>Different colors are free to choose. You can use our led strip light to decorate your dining room, bedroom, kitchen, porch, tv, corner, bar, meeting room. Especially suitable for holidays and events like Halloween, Christmas, and more activities. It is an ideal gift for your family and friends.</p>\r\n<p><strong>Easier and safer to use:</strong></p>\r\n<p>Color-changing lights have low voltage short-circuit protection and very low heat. Safe and touchable, long life of over 50,000 hours. It can be a flexible installation on a clean, flat and dry surface. Light strips can be cut between every 3 leds, so you can adjust led lights to the right length.</p>\r\n<p><strong>Quality after-sales service:</strong></p>\r\n<p>Please read the user manual carefully before using light strips. If you have any dissatisfaction about our lights strip, please feel free to contact us any time. We will reply to you within 24 hours by email.</p>\r\n<p><strong>Specifications:</strong></p>\r\n<p