(295, 'Exfoliating Foot Masks', 22.83, 2.08, 20.75, 8707, '18110.56', 585573, '18-24,25-34,34-44,45-54', 1, 'Women', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Health & Beauty,Health,Beauty', 'Health & Beauty', '<p>Do you have rough, Callous feet? Do you want to have that silky, smooth feeling, and your feet looking Brand new!! This ensured Exfoliating Foot mask product will leave your feet looking Smooth, Lucious, and Feeling fresh!</p>\r\n<p><strong>Features:</strong></p>\r\n<p><strong>Looking to get rid of dry, cracked skin on your feet?:<br /></strong>We all should take foot care more seriously as our foot bears a lot of pressure and has an alternative impact; hence, it is easier to have skin damaged like flaking, peeling, and calluses. So if you don\'t have the time or patience for regular pedicures, you can still give your feet the baby-soft feel of a salon treatment at home with this fantastic deep hydration lavender foot peeling mask! It deeply penetrates the skin to effectively add a dose of hydration to your tired and dried feet. The mask provides gentle exfoliation which removes dry patches and calluses painlessly and nourishes them to keep dead skin buildup at bay.</p>\r\n<p><strong>Highlights, softer &amp; smoother feet:<br /></strong>Exfoliates and deeply hydrates which leave your feet softer and smoother.</p>\r\n<p><strong>Deeply moisturize skin:&nbsp;<br /></strong>The mask is not only a great exfoliant, but it also moisturizes and nourishes your feet to health.</p>\r\n<p><strong>Pain-free:<br /></strong>Several days after the application, the dead skin will start peeling off on its own to reveal radiant &amp; plump skin underneath without any pain or discomfort.</p>\r\n<p><strong>Easy to use:<br /></strong>Simply put on the booties and let the product work. It is a long-term solution to cracked heels and dry feet.</p>\r\n<p><strong>Safety guaranteed:<br /></strong>Contains all-natural ingredients and botanical extracts that are safe to use.</p>\r\n<p><strong>Highly efficient:<br /></strong>Softens even the toughest, scaliest skin in just 1 - 2 weeks.</p>\r\n<p><strong>Convenient:&nbsp;<br /></strong>Fast and easy in-home treatment to use around your schedule.</p>\r\n<p><strong>Practical:&nbsp;</strong></p>\r\n<p>This foot care treatment is more cost-effective than going to the salon how to use: After cleaning and drying the feet, take out the foot masks and cut along the dotted lines put the foot masks on, press the masks closely against your feet to soak up more essence &amp; use the provided tape to secure booties it is recommended to wear regular socks over the foot masks to keep the mask close to the skin after about 60-90 minutes, take off the foot masks and rinse feet before wiping dry for better results, soak feet in warm water after 48 hours of applying the masks the outer layer of dead skin will naturally start falling off from your feet after 3-7 days in 1-2 weeks, the dead skin will fall off completely, leaving you with hydrated.</p>\r\n<p><strong>Specifications:<br /></strong><strong>Brand name</strong>: Efero<br /><strong>Type: </strong>Foot mask<br /><strong>Model number: </strong>Foot mask<br /><strong>Net wt:</strong> 35g<br /><strong>Ingredient:</strong> Water, lavender extract, other,<br /><strong>Use: </strong>foot<br /><strong>Country/Region of Manufacture: </strong>China<br /><strong>Certification: </strong>Jazz<br /><strong>Exfoliating foot mask: </strong>Mask for legs<br /><strong>Feet exfoliator: </strong>Remove dead skin<br /><strong>Skin type:</strong> Fit all skin type<br /><strong>Quantity:</strong> 6pcs=3pair<br /><strong>Effect: </strong>Repair, moisturizing, whitening</p>\r\n<p><strong>Package:<br /></strong>1x box</p>', 'Available', 'trending_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-22 07:03:41', '2021-06-22 07:03:41', NULL, NULL),
(296, 'Hair Removal Spray', 23.89, 2.47, 21.42, 1136, '2805.92', 1637890, '18-24,25-34,34-44,45-54,55-64', 1, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Health & Beauty,Health,Beauty', 'Health & Beauty', '<p>Our Natural Permanent Hair Removal Spray is a true money and time saver for you to get rid of unwanted body hair in a pain-free way in minutes, which saves you from annoying shaving, tweezing, or waxing all the time. With its hypo-allergenic and hydrating depilatory formula, it is targeted to effectively eliminate hair on all body parts, as well as moisturizing your skin. Simply spray and wipe, it gives your skin a hairless, smooth, and nourished finish with no irritations.&nbsp;</p>\r\n<p><strong>FEATURES:</strong></p>\r\n<p><strong>Fast and Effective Hair Removal: </strong>Easy spray and application that provides easy removal of unwanted hair in a few simple steps with visible results within 10 minutes.</p>\r\n<p><strong>Natural Hair Regrowth Suppression: </strong>Remove the nutrients from the hair follicle naturally to inhibit hair regrowth rather than damaging hair follicles like laser treatment.</p>\r\n<p><strong>Long-lasting effect: </strong>Penetrates deeply to dissolve hair closer to the root than shaving; possible anti-hair growth result after 6 weeks when used as directed.</p>\r\n<p><strong>Safe &amp; Hypo-allergenic: </strong>No harm, no irritation, and red itchy skin caused by shaving or waxing.</p>\r\n<p><strong>Soft, Supple &amp; Smooth Finish: </strong>Dissolves unwanted hair and stubborn stubble down to its very core.</p>\r\n<p><strong>100% Pain-Free: </strong>Removes hair without leaving bumps, irritated skin, and inconvenience out of shaving and waxing. Makes the whole process of removing hair smooth and inexpensive.</p>\r\n<p><strong>Widely Applicable: </strong>Can be applied to underarms, chest hairs, legs and arms hair, bikini area, and many more.</p>\r\n<p><strong>Time &amp; money-saving: </strong>No more expensive permanent hair removal therapy at a beauty salon.</p>\r\n<p><strong>SPECIFICATIONS:<br /></strong><strong>Weight:</strong> 35g<br /><strong>Net Weight:</strong> 30ml<br /><strong>Shelf life</strong>: 3 years<br /><strong>Size: </strong>10.6*2.7*2.7cm</p>\r\n<p><strong>PACKAGE INCLUDES:</strong></p>\r\n<p>&nbsp;1pc x Natural Permanent Hair Removal Spray</p>\r\n<p>&nbsp;</p>', 'Available', 'trending_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-22 07:14:40', '2021-06-22 07:14:40', NULL, NULL),
