atable car mattress are straightforward thanks to the waterproof surface. Once deflated, the airbed can be folded into small sizes and easily stored in the trunk of the car. The carry bag is included to fold and store when not in use.&nbsp;<br /><strong>Multiple uses:</strong> Not only is the air bed suitable for taking a rest on the back seat, but it can also be turned around, and the auxiliary airbag at the bottom meant to fill the gap between the seats becomes a comfortable backrest.</p>\r\n<h3><strong>Specifications:&nbsp;</strong></h3>\r\n<p>Material: High-quality PVC flocking material<br />Size: 54 x 33 inch / 137 x 85 cm<br />Mattress thickness: 2 inch / 5 cm.</p>\r\n<h4><strong>Package Include:</strong></h4>\r\n<p>1x Car Inflatable Bed.<br />2x Patch.<br />2x Pillow.<br />1x Air Compressor.</p>', 'Available', 'trending_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-22 08:46:46', '2021-06-22 08:46:46', NULL, NULL),
