(327, 'Premium Seat Cushion for Back Pain', 59.95, 31.04, 28.91, 464, '14402.56', 616221, '18-24,25-34,34-44,45-54,55-64', 2, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Home Improvement,Premium Seat Cushion for Back Pain', 'Home Improvement', '<p><strong>Sitting for long periods puts enormous pressure on our lower back &amp; spine. Say goodbye to aches and discover ultimate sitting comfort with the CloudCushion.</strong></p>\r\n<p><strong>Features:<br /></strong>Improve blood flow:<br />Conforms to your body shape and pressure on critical areas is alleviated, blood flow to the legs and feet is improved significantly.</p>\r\n<p>Correct posture:&nbsp;<br />Cives your lower back and spine optimal support, promoting healthy posture, and preventing aches.&nbsp;</p>\r\n<p>Premium quality:&nbsp;<br />Made with medical-grade gel to retain the original shape and to offer maximum comfort.</p>\r\n<p>Ergonomic design:<br />Honeycomb design keeps the cushion cool and breathable without compromising comfort. No more seat sweat!<br />Great for office, driving- perfect for home, office, &amp; vehicle use. Each cushion includes a black protective cover. Fits nearly all chair pads (16.5\" x 13.5\").</p>\r\n<p>Satisfaction guaranteed:&nbsp;<br />If anything is wrong with your order, you can quickly contact our helpful customer support team to get a refund.</p>\r\n<p>High demand:<br />Most orders arrive in 7 to 13 business days.</p>\r\n<p><strong>Specifications:<br /></strong>Weight: 1050g<br />Material: Ultra-flex polymer<br />Cushion Color: Blue<br />Cloth Material: Polyester fiber<br />Cloth Color: Black<br />Size:&nbsp; 42 * 35 * 4cm&nbsp;</p>\r\n<p><strong>Package Include:</strong></p>\r\n<p>1x Premium Seat Cushions</p>\r\n<p>1x Free Washable Covers</p>', 'Available', 'facebook_ads', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-23 04:59:52', '2021-06-23 04:59:52', NULL, NULL),
(328, 'Electric Salt and Pepper Grinder', 37.99, 13.04, 24.95, 76, '991.04', 144809, '18-24,25-34,34-44,45-54,55-64', 1, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Kitchen & household,Kitchen', 'Kitchen & household', '<p>Electric Automatic Mill Pepper and Salt Grinder LED Light Pepper Spice Grain Mills Porcelain Grinding Core Mill for Kitchen.</p>\r\n<p><strong>FEATURES:</strong></p>\r\n<p><strong>PROFESSIONAL QUALITY: </strong>Our commercial battery-operated salt and pepper shakers have been built with the highest quality materials possible. Each stainless steel casing has been hand-inspected before reaching your door; the ceramic mill has unmatched power and can be adjusted to fit every need even the hardest cracked black pepper or pink Himalayan sea salt doesn\'t stand a chance!</p>\r\n<p><strong>ADJUSTABLE COARSENESS:</strong> these premium refillable grinders can be adjusted by simply twisting the bottom of the grinder itself; The grind ranges from a small ultra-fine grind all the way to a large coarse mill; black, white and even cracked pepper can be made into any size you want; the easy to use seasoning container makes for quick refills and hassle-free changes; once the batteries are in you have all the control in the world (batteries are not included);&nbsp;</p>\r\n<p><strong>LED LIGHT</strong>: these electrical salt and pepper mills come with a bright LED light on the bottom; when you press the grinder the light automatically turns on so you can see what you are seasoning; this makes these grinders ideal even in low light conditions; the battery-powered lights stay on the whole time you are grinding; this also helps for easy one-hand operation eliminating the need to bend over in order to see your dish;&nbsp;</p>\r\n<p><strong>UPGRADED CERAMIC GRINDER: </strong>with our newly upgraded ceramic grinding unit you can crush any spice with ease; Pink Himalayan Sea Salt, Black Peppercorns, White Peppercorns, Celtic Salt, and many more will mill as smooth as can be; this grinder is a premium machine that can be used in industrial kitchens as well as your home. Never worry about not being able to grind anything again!</p>\r\n<p><strong>SPECIFICATIONS:</strong></p>\r\n<p><strong>Type: </strong>Mills<br /><strong>Mills Type: </strong>Salt &amp; Pepper Mills<br /><strong>Material:</strong> Metal<br /><strong>Metal Type: </strong>Stainless Steel<br /><strong>Model Number: </strong>LPM061521<br /><strong>Certification: </strong>CE / EU,CQI,LFGB,SGS<br /><strong>Feature:</strong> Eco-Friendly,</p>\r\n<p><strong>PACKAGE INCLUDES:<br /></strong>1*Pepper Spice Grain Mills<br />2*Pepper Spice Grain Mills<br />1*Stainless steel manual pepper grinder</p>', 'Available', 'facebook_ads', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-23 05:02:19', '2021-06-23 05:02:19', NULL, NULL),
(329, 'Relieve Pain', 36.57, 11.50, 25.07, 3735, '42952.50', 1334243, '18-24,25-34,34-44', 1, 'Men,Women,Baby', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Health ,Beauty,Relieve Pain', 'Health & Beauty', '<p><strong>The World God alignment leg pillow is the world\'s first orthopedic memory foam leg cushion that provides side sleepers comfort to properly align your spine, stabilize your hips and cushion your knees while you sleep to ease pain in your back, hips, legs, and knees.</strong></p>\r\n<p><strong>Features:</strong></p>\r\n<p>Slow rebound memory foam:<br />It has better soft touch and skin-friendliness than ordinary sponges, good resilience, and long service life. When you use our memory foam leg pillows, the pillow will support your legs and knees, the body pressure will be evenly distributed, and the comfort will be greatly improved.</p>\r\n<p>Multi-position use:&nbsp;<br />When sleeping on the side, place the pillow between your knees or legs to keep your knees and legs at an ideal distance, align your legs, relieve pressure on the knee joints, hips, and spine, and adjust the spine to a natural curve it is an ideal pillow for people sleeping on the side, lower back pain, and knee pain. It can also be used as a knee pad during pregnancy or after recovery.</p>\r\n<p>Ergonomic design, elastic straps:&nbsp;<br />This knee pad sleep pillow is the latest upgraded version. It adds a widened elastic strap design to fit the legs better, so that the leg pillow is not easy to slip off, and the middle is hollow. The shape design allows the leg pillow to ventilate and dissipate a wide area, which will not be stuffy during use, allowing you to sleep well all night.</p>\r\n<p>Detachable zipper jacket:&nbsp;<br />The material of the zipper jacket is very soft, good air permeability, will not feel sultry, detachable, and machine washable for recycling, but the memory foam core is not washable and can be placed in a cool place for ventilation.</p>\r\n<p>Rest assured:&nbsp;<br />Our desire is to provide you with the best products and services. If you have any questions about your purchase, please contact us by email in time, we can provide a full refund or replace it with a new product.</p>\r\n<p><strong>Specifications:</strong></p>\r\n<p>100% brand new and high quality!</p>\r\n<p>Color: many</p>\r\n<p>Size:&nbsp; 9 1/2\" x 10\" x 5 1/2\".</p>\r\n<p><strong>Package Include:</strong></p>\r\n<p>1x Legs &amp; Knee Support Wedge.</p>', 'Available', 'trending_product', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-23 05:08:15', '2021-06-23 05:08:15', NULL, NULL),
(330, 'Bluetooth Music Table Lamp', 35.00, 18.48, 16.52, 1, '18.48', 8232698, '18-24,25-34,34-44,45-54', 2, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Electronics', 'Electronics', '<p>This portable Bluetooth speaker and table lamp will be an instant family favorite!&nbsp; Perfect for game nights, study sessions, desk lamps, and bedside lights.&nbsp; Choose the Ivory or the black to complement your room.&nbsp; This light has it all.</p>\r\n<p><strong>Features:</strong></p>\r\n<p>Soft lighting.</p>\r\n<p>Tap to turn the light on or off.</p>\r\n<p>Touch to adjust the brightness of the light.</p>\r\n<p>Supports DC 5 V or USB power supply</p>\r\n<p>Built-in lithium battery, rechargeable</p>\r\n<p>Suitable for all audio products to play sound, such as Mp3, Mp4, computer, mobile phone and so on.</p>\r\n<p>Wireless Bluetooth playback.</p>\r\n<p>Durable ABS plastic and stainless steel metal hooks.</p>\r\n<p>Touch energy-saving LED lights, suitable for bedroom design night lights.</p>\r\n<p>Stereo and unique form factor design. Stylish, innovative, and high-quality audio.</p>\r\n<p>Plug and play, no need to drive. Suitable for all music players or wireless Bluetooth devices.</p>\r\n<p>When playing music, there is a colorful light below the chandelier that will follow the rhythm of the music.</p>\r\n<p>Touch the metal ring to turn the desk light on or off. Continuously touch for more than 3 seconds to adjust the brightness of the light.</p>\r\n<p><strong>Specifications:</strong></p>\r\n<p><strong>Name: </strong>Multi-function music table lamp</p>\r\n<p><strong>light Color:</strong> White</p>\r\n<p><strong>Material:</strong> Plastic</p>\r\n<p><strong>Switch type:</strong> Touch</p>\r\n<p><strong>Color:</strong> classical black/ivory white</p>\r\n<p><strong>Power supply: </strong>5VDC /USB</p>\r\n<p><strong>Charging time: </strong>2 hours</p>\r\n<p><strong>Battery: </strong>Built-in Lithium battery</p>\r\n<p><strong>Link method: </strong>Bluetooth connection / 3.5mm audio cable connection</p>\r\n<p><strong>Package:<br /></strong>1x box</p>', 'Available', 'trending_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-23 05:14:22', '2021-06-23 05:14:22', NULL, NULL),
(331, 'Bicycle Storage Rack', 24.99, 5.55, 19.44, 1290, '7159.50', 818394, '18-24,25-34,34-44', 2, 'Men', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Bike Accessories,Bicycle Storage Rack', 'Bike Accessories', '<p><strong>As a bike lover, you will definitely worry about the parking of bicycles. But now, we have produced a creative bicycle parking buckle, which can perfectly solve the problem of bicycle parking. Let parking also become a fashion.</strong></p>\r\n<p><strong>Features:</strong></p>\r\n<p>Save most parking space possible:<br />Break the limits to park a bike anywhere! Store bikes near the wall with an almost invisible club.</p>\r\n<p>World&rsquo;s smallest bike storage tool:<br />With a space-saving bicycle rack, it stores vehicles easily no matter how cramped space is!</p>\r\n<p>Easy to use:<br />Just push &amp; pull the bike for parking! Hold firmly &amp; smoothly near the wall.</p>\r\n<p>Accurate &amp; firm fit:<br />U shape roller holds your road or mountain bike tire steadily.</p>\r\n<p>Organize neatly:<br />Hang keychain or helmet with corner design.</p>\r\n<p><strong>Specifications:</strong></p>\r\n<p>Colour: Blue / Green / Black / Orange</p>\r\n<p>Material: ABS</p>\r\n<p>Mountain bike (big size): 8cm*7.5cm*4cm / 3.14 inch*2.95inch*1.57inch</p>\r\n<p>Road bike (small size): 4cm*4cm*2cm / 1.57inch*1.57inch*0.78inch.</p>\r\n<p><strong>Package Include:</strong></p>\r\n<p>1x Bicycle Rack Storage</p>', 'Available', 'facebook_ads', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-23 05:16:18', '2021-06-23 05:16:18', NULL, NULL),
(332, 'All-round Sleep Pillow', 39.99, 10.58, 29.41, 359, '3798.22', 3355871, '18-24,25-34,34-44,45-54,55-64', 2, 'Men,Women,Baby', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Health ,Beauty,All-round Sleep Pillow', 'Health & Beauty', '<p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 12pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Does that uncomfortable pillow keep you up all night? You fold it, flip it, and fluff it, but it\'s never quite right, not anymore. Now there\'s an All-round Sleep Pillow, a thick pillow that\'s shaped like a small handful of eggs with a groove for your head in the center, which is so comfortable and supportive.</span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 15pt; font-family: Montserrat,sans-serif; color: #000000; background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\"><br />Features:&nbsp;</span></p>\r\n<ul style=\"margin-top: 0; margin-bottom: 0; padding-inline-start: 48px;\">\r\n<li dir=\"ltr\" style=\"list-style-type: disc; font-size: 12pt; font-family: Montserrat,sans-serif; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre;\" aria-level=\"1\">\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;\" role=\"presentation\"><span style=\"font-size: 12pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Soft and Comfortable Auxiliary Pillow:</span><span style=\"font-size: 12pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\"> With All-round Sleep Pillow, you\'ll be more likely to feel as if you\'ve set it down on a soft cloud of comfortable material that can support your head, neck, and shoulders throughout the night.</span></p>\r\n</li>\r\n</ul>\r\n<ul style=\"margin-top: 0; margin-bottom: 0; padding-inline-start: 48px;\">\r\n<li dir=\"ltr\" style=\"list-style-type: disc; font-size: 12pt; font-family: Montserrat,sans-serif; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre;\" aria-level=\"1\">\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;\" role=\"presentation\"><span style=\"font-size: 12pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Supportive Egg Groove Design: </span><span style=\"font-size: 12pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">This resulted in the groove in the center it holds and supports your head and neck at an ideal height for sleep. Meanwhile, the higher curves that surround this groove will help keep your head and neck in this ideal position so they don\'t wiggle about and become stiff or sore.</span></p>\r\n</li>\r\n</ul>\r\n<ul style=\"margin-top: 0; margin-bottom: 0; padding-inline-start: 48px;\">\r\n<li dir=\"ltr\" style=\"list-style-type: disc; font-size: 12pt; font-family: Montserrat,sans-serif; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre;\" aria-level=\"1\">\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;\" role=\"presentation\"><span style=\"font-size: 12pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Breathable to Have A Cool and Dry Sleep: </span><span style=\"font-size: 12pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">This Sleep Pillow is so well-ventilated that it won\'t make you hot and sweaty while you sleep. You may not feel the urgent need to hurry to the shower and wash off excess sweat if that\'s something you normally do.</span></p>\r\n</li>\r\n</ul>\r\n<ul style=\"margin-top: 0; margin-bottom: 0; padding-inline-start: 48px;\">\r\n<li dir=\"ltr\" style=\"list-style-type: disc; font-size: 12pt; font-family: Montserrat,sans-serif; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre;\" aria-level=\"1\">\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;\" role=\"presentation\"><span style=\"font-size: 12pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Fits Any Sleeping Position:</span><span style=\"font-size: 12pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\"> It\'s not necessary that you stay on your back, as the pillow will accommodate side sleepers and stomach sleepers, too. After you\'ve laid down and chosen your sleeping position, the pillow will begin to gently conform to the shape of your head and upper body.</span><span style=\"font-family: Arial; font-size: 12pt; white-space: pre-wrap;\">&nbsp;</span></p>\r\n</li>\r\n</ul>\r\n<ul style=\"margin-top: 0; margin-bottom: 0; padding-inline-start: 48px;\">\r\n<li dir=\"ltr\" style=\"list-style-type: disc; font-size: 12pt; font-family: Montserrat,sans-serif; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre;\" aria-level=\"1\">\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;\" role=\"presentation\"><span style=\"font-size: 12pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Lie Down For Sound Sleep: </span><span style=\"font-size: 12pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">All-round Sleep Pillow will cradle and support your head and neck by evenly dispersing the weight of those body parts throughout your entire pillow. For virtually all sleepers, this will enhance your comfort level as you sleep, and thereby help you sleep soundly.<br /><br /></span></p>\r\n</li>\r\n</ul>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 13.999999999999998pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">