(333, 'Professional Mini Pottery Wheel', 50.97, 21.42, 29.55, 80, '1713.60', 2841493, '18-24,25-34,34-44,45-54,55-64', 1, 'Women', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Home Improvement,Home', 'Home Improvement', '<p>The Professional Mini Pottery Wheel is beautiful in appearance, gorgeous in color, and small in size, which is an excellent gift for children. Ceramic art can enrich children\'s imagination and develop their appreciation of artistic beauty. The Professional Mini Pottery Wheel adopts a high-quality material turntable that never rusts. The speed is stable so you can work easily. It is equipped with a high-quality motor and the wheel rotates smoothly with 0-1500r/min rotating speed. It is suitable for school ceramic teaching, pottery barn, DIY shop, or home use to meet the majority of professional or amateur ceramic enthusiasts.</p>\r\n<p><strong>FEATURES:</strong></p>\r\n<p><strong>【 HIGH-QUALITY MATERIAL】</strong>This Mini pottery machine adopts a high-quality mental turntable and never rusts. The speed is stable and you can easily draw large pieces of work. And the application of a leakage protection switch at the bottom of the machine can guarantee you a pleasant ceramic experience</p>\r\n<p><strong>【STRONG MOTOR &amp; LOW NOISE】</strong>Adopt a high-quality motor, and the wheel rotates smoothly. 0-1500r/min rotating speed, less than 60dB, low noise. Adjustable speed, humanized operation, practical and convenient</p>\r\n<p><strong>【ADVANTAGES】</strong>The Electric Pottery Wheel DIY Machine has adjustable speed, low noise, safe, reliable operation, and energy saving</p>\r\n<p><strong>【COMBINING ART &amp; MINI SIZE】</strong>Beautiful appearance, Brilliant colors make your mood more enjoyable. The Ceramic wheel machine body spray treatment, compact structure, small footprint, good mud shielding, easy operation</p>\r\n<p><strong>【WIDE APPLICATION】:</strong> This Pottery Wheel Machine is suitable for school ceramic teaching, pottery barn, DIY shop or home use, to meet the majority of professional, amateur ceramic enthusiasts</p>\r\n<p><strong>Specification:<br /></strong>Material: Metal<br />Weight: 205g<br />Rated Current: 2A<br />Rated Voltage: DC12V<br />Rotary Speed: 0-1500 RPM<br />Rotary Wheel Diameter: 6cm/2.4inch<br />Rotary Wheel Thickness: 0.7cm/0.3inch<br />Machine Body Size: 8.6*8.6cm</p>\r\n<p><strong>Package list:<br /></strong>1 x Electric Pottery Wheel Machine<br />1 x Turntable<br />1 x DC power adapter</p>', 'Available', 'untapped_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-23 05:24:16', '2021-06-23 05:24:16', NULL, NULL),
(334, 'Multifunctional Telescopic Mop', 45.99, 12.42, 33.57, 180, '2235.60', 1005202, '18-24,25-34,34-44,45-54,55-64', 2, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Home Improvement,Multifunctional Telescopic Mop', 'Home Improvement', '<p><strong>The multifunctional retractable mop makes cleaning faster and easier. Adjustable length, two mop heads of different materials. The 360 rotating design makes cleaning corners easier.</strong></p>\r\n<p><strong>Features:</strong></p>\r\n<p>Deepen the concave:&nbsp;<br />The dustpan bucket adopts a deepened concave design, and the convex bucket mouth can better lock the dust swept in.</p>\r\n<p>Dense brush, durable:&nbsp;<br />The bristles are soft and dense and do not damage the surface and collect dust more thoroughly.</p>\r\n<p>Hanging hole design:<br />Hang up when not in use without taking up space.</p>\r\n<p>Non-slip handle design:&nbsp;<br />Prevent slippage caused by touching the water. Tough mop wire tough soft and not easy to wear, not easy to leak dust, toughness, and not easy to deform</p>\r\n<p><strong>Specification:</strong></p>\r\n<p>Material: Stainless steel, fiber cloth</p>\r\n<p>Size: 110cm/160cm/270cm optional</p>\r\n<p><strong>package includes:</strong></p>\r\n<p>1x Handle</p>\r\n<p>1x&nbsp; Scraper</p>\r\n<p>2 x mop head</p>', 'Available', 'untapped_product', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-23 05:31:04', '2021-06-23 05:31:04', NULL, NULL),
(335, 'Reusable Fly Trap', 34.95, 9.04, 25.91, 46, '415.84', 8161071, '18-24,25-34,34-44,45-54,55-64', 2, 'Men', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Home Improvement,Home', 'Home Improvement', '<p>Description:</p>\r\n<p>Flies aren\'t just harmless, they can spread skin diseases to your horse and even lay eggs on its face! And that\'s why we created the Ranch Fly Trap. The proven most effective way to instantly start reducing the number of flies in any area. You\'ll be able to relax all summer knowing your Horse is taken care of and isn\'t being constantly irritated by flies. Instructions for use: In spring and autumn, hang it in a place with plenty of sunshine. In summer, hang it in a place where the sun can\'t reach(protected from light). When you hang it, add some sugar, grapes, salted fish, dried shrimps, and fish. Hang it 1 meter from the ground. This clever fly trap lures pests in and keeps them out of your space and it\'s so easy to use! Simply unpack and assemble the trap, add some food for bait and hang it up in an open area. This Portable Non-toxic Fly Mosquito Trap features high-quality iron wire and gauze mesh construction. It\'s environmentally friendly, durable, and reusable.</p>\r\n<p><strong>Features:</strong></p>\r\n<p>&nbsp;In the spring and autumn season, it hangs in the sunny place, and it hangs in the sun where it can not be exposed to the sun in summer. (protect from light)</p>\r\n<p>&nbsp;Because flies are fond of stinking objects, it is suggested that bait should be selected for food, such as fish intestines, rotten fruits, etc., as far as 20 centimeters away from the ground.</p>\r\n<p>This product is widely used in public places, such as parks, families, vegetable farms (farmers market), canteens, restaurants, slaughterhouses, farms, greening belts, food processing plants, toilets, garbage rooms (fields), and other public places and outdoor environments.</p>\r\n<p>This product is a highly efficient, environmentally friendly, and safe new fly fishing apparatus, which is made strictly by dozens of processes. It is easy to operate, easy to understand, and has a high catch fly rate.</p>\r\n<p>Its principle is to use food bait to entice flies into the cage and enter the cage without food to die naturally.</p>\r\n<p><strong>&nbsp;Specification:</strong></p>\r\n<p>Safe, Non-toxic &amp; effective.</p>\r\n<p>Traps &amp; Kills up to 20,000 flies.</p>\r\n<p>Flies Away makes your home a No-Fly Zone.</p>\r\n<p>Currently used by farmers, equestrians to get rid of flies.</p>\r\n<p>Bio-degradable and non-toxic bait.</p>\r\n<p>Protect your farm, your home, your property, &amp; your barbecues from fly invasion.</p>\r\n<p><strong>Package Include:</strong></p>\r\n<p>1x Box&nbsp;</p>\r\n<p>&nbsp;</p>', 'Available', 'facebook_ads', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-23 05:33:49', '2021-06-23 05:33:49', NULL, NULL),
(336, 'Surgical Medical Operation Loupe', 145.00, 64.31, 80.69, 954, '61351.74', 3715833, '65+', 2, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Health ,Beauty,Surgical Medical Operation Loupe', 'Health & Beauty', '<p><strong>Suitable for dentists and the Department of Stomatology, widely used in daily dental surgery and clinical operation. Our Black Set models a set of 3.5x magnification flip-down loupe lenses and a 5W led headlight. a clip to attach loupes on your own prescription glasses. This anti-fog, easy-clean, clear-view powerhouse is perfect for locating canals in tricky endodontic cases or giving your composite masterpieces that extra bit of detail in your restorative work.</strong></p>\r\n<p><strong>Features:</strong></p>\r\n<p>Flip Grip; Ultra LightWeight.<br />The most popular model among den~tal students,den~tal hygienists, and den~tist. Wide field of view and generous depth of field with high enough power for daily procedures. Conveniently fixed at the waist. Free your hands.<br />Flexible Headband;<br />Safety Soft Touch Frame. Using the rechargeable lithium battery, lightweight, longevity, and the more comfortable carry, it is suitable for all kinds of sur~gical opera~tion.<br />Large Depth Field of View;<br />Adjustable Angular Viewing.</p>\r\n<p><strong>Specification:</strong></p>\r\n<p>&nbsp;Magnification:&nbsp; 3.5X</p>\r\n<p>Working distance: 420mm</p>\r\n<p>Depth of field: 80mm</p>\r\n<p>Field of View: 60mm</p>\r\n<p>Weight: 52g</p>\r\n<p><strong>Package list:</strong></p>\r\n<p>1x Surgical Medical Operation Loupe.</p>', 'Available', 'facebook_ads', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-23 05:39:51', '2021-06-23 05:39:51', NULL, NULL);
