(337, 'Super bright LED Garage Lights', 33.99, 21.92, 12.07, 5, '109.60', 7289613, '18-24,25-34,34-44,45-54,55-64', 2, 'Men', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Electronics,Super bright LED', 'Electronics', '<p>LED Garage Lights is the newest &amp; the most perfect replacement for conventional fluorescence bulbs which are dim and unsafe. to provide powerful lighting in any area. Best Garage Lighting! You Need These Bright LED Lights For Your Garage, Barn, or Shop. than regular bulbs. Instantly brighten your garage, basement &amp; more!</p>\r\n<p><strong>FEATURES:</strong></p>\r\n<p><strong>Deformable Design: </strong>LED panel heads can be adjusted, each light head can be folded up to 90&deg;. The maximum coverage angle can reach 360&deg;, This will make the light cover a wide area. The lighting is adjustable so that you can angle the LEDs to shine where you want them</p>\r\n<p><strong>Super Bright: </strong>60 W, 6500Lumens, 6000K Cold light, no dark areas, ghosting, or glare. Garage-led Ceiling Light throws out an amazing amount of light, unique wide-angle design, and brings the best-lighted area. High lumens output makes this garage led light perfect for garage, warehouse, basement, barn, office, station, Attic, workshop, display area, etc</p>\r\n<p><strong>Durable &amp; Long Service Life: </strong>Premium Aluminum alloy heat dissipated, high-temperature resistant, along with the hollow-out structure greatly improved cooling efficiency for maximum performance and over 50,000 hours of constant runtime. This 60W Garage Light can replace a 300W traditional halogen bulb, maintenance costs are greatly reduced</p>\r\n<p><strong>Install as Bulb, More Advanced than Bulb:</strong> The installation was as easy as screwing in a standard lightbulb-E26/E27: Plug and Play. No more need for fluorescent light tubes and ballasts. Which is the closest light to sunlight inside your home you can get!</p>\r\n<p><strong>SPECIFICATIONS:<br /></strong><strong>Power: </strong>60W<br /><strong>Lumen:</strong> 6500LM<br /><strong>Light color: </strong>6000K Daylight<br /><strong>Suitable for:</strong> indoor special lighting<br /><strong>LED:</strong> Super Bright LED Module<br /><strong>Life:</strong> 50000h<br /><strong>Material: </strong>Aeronautical Aluminum<br /><strong>Base Type: </strong>E26/E27 medium base<br /><strong>Adjustable Angle: </strong>90&deg;<br /><strong>Color:</strong> Black / White&nbsp;</p>\r\n<p><strong>PACKAGE INCLUDES:<br /></strong>1 x Deformable LED Garage Light</p>\r\n<p>&nbsp;</p>', 'Available', 'untapped_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-23 05:43:03', '2021-06-23 05:43:03', NULL, NULL),
(338, 'ELECTRIC WRENCH', 109.99, 41.25, 68.74, 462, '19057.50', 8146633, '18-24,25-34,34-44,45-54,55-64', 1, 'Men', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Garden Improvement,Garden', 'Garden Improvement', '<p>Whether working on your car project, a construction project, or in your daily jobs, the last thing you want is to lose much of your energy or time trying to fasten or loosen nuts and bolts. As an auto mechanic, tightening or removing nuts and bolts can be the most energy-sucking activity if you don\'t have the right tools. A cordless ratchet is a battery-powered ratchet, which will give you freedom from air hoses and electric wires as well as make tightening and removing nuts and bolts easier.</p>\r\n<p><strong>Features:</strong></p>\r\n<p><strong>This&nbsp; electric ratchet machine:<br /></strong>This&nbsp; Electric Ratchet Machine has a Maximum of 90NM large torque system, 260 RPM speed, powerful power, and effective protection against machine damage caused by excessive motor temperature.</p>\r\n<p><strong>Large capacity battery:<br /></strong>It has a large-capacity lithium battery with easy charging and long battery life. It can be recharged within 60-80 minutes and keeps a super long working time of about 80 minutes.</p>\r\n<p><strong>Thin square head:<br /></strong>It comes with a 3/8 inch manganese steel spindle. The metal balls are accurately clamped, and the sleeve can be removed without being removed.</p>\r\n<p><strong>Led working light:<br /></strong>It has LED work lights which automatically light up during work, making it easy to work in the dark.</p>\r\n<p><strong>Specifications:<br /></strong><strong>Color: </strong>Blue<br /><strong>Plug:</strong> US<br /><strong>Input:</strong> 110-240V 50/60Hz<br /><strong>Maximum Torque: </strong>90N.m<br /><strong>No-load Rotating Speed: </strong>230 RPM<br /><strong>Battery Capacity: </strong>7800mAh<br /><strong>Speed: </strong>260 RPM<br /><strong>Battery Voltage: </strong>42V<br /><strong>Head Size:</strong> 3/8\"(10mm)<br /><strong>Product Size:</strong> 50*75*315mm</p>\r\n<p><strong>Package Include:<br /></strong>1 x Right Angle Wrench Ratchet<br />1 x US Plug Charger (We will send you the suitable adapter according to your location)<br />1 / 2 x Lithium-Ion Battery<br />1 x User Manual</p>\r\n<p>&nbsp;</p>', 'Available', 'facebook_ads', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-23 06:03:06', '2021-06-23 06:03:06', NULL, NULL),
(339, 'Universal Docking Compact Splicing Mini Electrical Wire Connector', 14.99, 1.36, 13.63, 69, '93.84', 1564732, '18-24,25-34,34-44,45-54,55-64', 1, 'Men', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Electronics', 'Electronics', '<p>Just push in wire &amp; lock to secure! This is your perfect connector for a variety of electrical and even hobby projects for a fast, easy, and reliable wiring connection.</p>\r\n<p><strong>Features:<br /></strong><strong>Easy to use:<br /></strong>Instead of traditional electrical tape and twist-type electrical butt connectors. Don\'t need more tools to connect wires, just use your hands.&nbsp;</p>\r\n<p><strong>Arbitrary combination:<br /></strong>Each wire connector is provided with 4 slots and 4 clasps on two sides, which can be flexibly assembled or disassembled into 2, 3, 4, 6bit (way) butt connectors as needed.</p>\r\n<p><strong>Universal compatibility:<br /></strong>Soft and hard wire universal. Connect any combination of solid, stranded, and flexible copper wires. Suit for 0.08-4 sqm / 28-12 AWG They work with almost every gauge of normal household wiring: ceiling fans, sockets, switches, cars, speakers, lighting, electrical boxes, chandeliers, light switches, and other wire connecting parts.</p>\r\n<p><strong>Reusable:<br /></strong>&nbsp;When you need to change other wires, just flip the little lever up and pull out what you need, and replace it.</p>\r\n<p><strong>Safe and reliable:<br /></strong>Selecting the best flame retardant insulating material modified nylon pa6.6, which is long life, no corrosion, anti-aging, pressure 4kv, and against electrical shock.</p>\r\n<p><strong>Fast &amp; effective:<br /></strong>Better than traditional electrical tape. Simplify circuit design, when you combine the wires or need to jumper, you don\'t worry about the twist between the wires.</p>\r\n<p><strong>Specifications:<br /></strong><strong>Hard wire:</strong> 0.75-2.5mm&sup2;<br /><strong>Soft wire: </strong>0.75-4.0mm&sup2;<br /><strong>Maximum voltage/current:</strong> 400V/4KV/, 32A<br /><strong>Product material Shell: </strong>flame retardant PC, internal PA<br /><strong>Diversion bar: </strong>electrolytic copper (surface tinned spring nickel-chromium alloy steel)<br /><strong>Wiring length: </strong>9-10mm<br /><strong>Dimensions</strong>: 39mm*18mm*8mm</p>\r\n<p><strong>Package includes:<br /></strong>1 x SPL-1、1*（transparent plastic storage box).</p>\r\n<p>&nbsp;</p>', 'Available', 'trending_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-23 06:15:11', '2021-06-23 06:15:11', NULL, NULL),
(340, 'Caulking Nozzle Applicator Finishing Tool', 27.99, 8.85, 19.14, 1, '8.85', 134719, '18-24,25-34,34-44,45-54,55-64', 2, 'Men', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Home Improvement,Home', 'Home Improvement', '<p>Stainless steel joint sealer is a set of nozzles specially made for joint sealant, which can save a lot of time and make the sealant smooth when applying glue. Ideal auxiliary tool for all sealing operations. When it comes to caulking, these tools are perfect for getting the job done!</p>\r\n<p><strong>Features:<br /></strong><strong>Perfectly fill in and seal gaps:<br /></strong>&nbsp;It is designed with a 45-degree muzzle that can soothe and fill caulk jobs easily, without messy and uneven finishes, giving your home a new look.</p>\r\n<p><strong>Wide variety of sizes:<br /></strong>It comes in 14 different sizes that can easily meet your needs in sealing different places and angles.</p>\r\n<p><strong>Perfect for caulking and sealing:<br /></strong>The perfect helping tool for all sealing jobs. The caulking toolset is easy to clean and reusable.</p>\r\n<p><strong>Wide application:<br /></strong>The caulk toolset can be widely applied for kitchen, bathroom, tank, door, window, kitchen, bathroom, tank, sink joint filling finishing.</p>\r\n<p><strong>Your home caulk finishing helper:&nbsp;<br /></strong>Made with high-quality stainless steel, rust-resistant, and anti-corrosion properties. Durable and non-sticky.</p>\r\n<p><strong>Easy to use:<br /></strong>Create and remove excess caulk like a pro while soothing materials into gaps easily with the all-new easy caulk finishing attachment.</p>\r\n<p><strong>Easy to clean:<br /></strong>The product is reusable and easy to clean, use a plastic bag, a thin string, or a small cleaning tool to insert and pass through to complete the cleaning.</p>\r\n<p><strong>Specifications:<br /></strong><strong>Material:</strong> Stainless Steel<br /><strong>Sizes (mm): </strong>5, 6, 7, 9, 10, 12, 13, 16, 20, 25, 26, 28, 30, 35&nbsp;</p>\r\n<p><strong>Package include:<br /></strong>14pcs x Caulking Nozzle Applicator Finishing Tool</p>', 'Available', 'untapped_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-23 06:27:01', '2021-06-23 06:27:01', NULL, NULL),
(341, 'Special Chainsaw Grinding Tool', 19.99, 2.96, 17.03, 13, '38.48', 1068599, '18-24,25-34,34-44,45-54,55-64', 2, 'Men', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Garden Improvement,Garden', 'Garden Improvement', '<p>Description:</p>\r\n<p>peace Do you know what the problem with all of our cutting tools is? They need to be sharpened occasionally. I guess it\\\'s not really a problem so much as a hassle, but what can you do? Sharpen it up with a chainsaw. This chainsaw teeth sharpener makes it easy to sharpen your chainsaw in no time at all.</p>\r\n<p><strong>Features:</strong></p>\r\n<p><strong>EASY TO USE: </strong>It can be easily screwed onto an electric grinder and can easily sharpen chains and serrated blades.</p>\r\n<p><strong>USE WITH ELECTRIC GRINDER: </strong>This product is an electric grinding accessories kit, and it should be used with an electric grinder (an Electric grinder is not included).</p>\r\n<p><strong>HIGH HARDNESS HIGH HEAT RESISTANCE:</strong> High-speed steel grinding heads have features of high hardness, high wear resistance, high heat resistance, and impact resistance, so you don\'t have to worry about it being damaged.</p>\r\n<p><strong>BEST SHARPENING ANGLE: </strong>The guides in the accessories provide the best sharpening angle.Usage Scenarios Suitable for all chainsaws.Using MethodsTwist it onto an electric grinder and grind chains and serrated blades with ease.</p>\r\n<p><strong>Specification:<br /></strong><strong>Materials:</strong>ABS+ Quality Metal<br /><strong>Product Size:</strong>70 x 50 MM</p>\r\n<p><strong>Package Contents</strong>:<br />Special Chainsaw Grinding Tool x 1<br />Matching Grinding Rod x 3<br />Wrench x 1</p>\r\n<p>&nbsp;</p>', 'Available', 'trending_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-23 06:37:32', '2021-06-23 06:37:32', NULL, NULL),
(342, 'Car Dent Removal Tool Set', 19.99, 7.40, 12.59, 588, '4351.20', 4854263, '18-24,25-34,34-44,45-54', 1, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Car Accessories,Car Dent Removal,Car Dent Removal Tool Set', 'Car Accessories', '<p>When you have a car you can\'t help the small, little dents that you acquire. You may acquire these dents through bad maneuvering, or forceful parking in small spaces.&nbsp; We really can\'t help it but the result is a dented car chassis. And it is so expensive just bringing your car to the auto shop just to fix the small dents in it.&nbsp;</p>\r\n<p><strong>Features:</strong></p>\r\n<p><strong>Easy to use:<br /></strong>It can be easily screwed onto an electric grinder and can easily sharpen chains and serrated blades.</p>\r\n<p><strong>Use with electric grinder:<br /></strong>This product is an electric grinding accessories kit, and it should be used with an electric grinder.</p>\r\n<p><strong>High hardness high heat resistance:<br /></strong>High-speed steel grinding heads have features of high hardness, high wear resistance, high heat resistance, and impact resistance, so you don\'t have to worry about it being damaged.</p>\r\n<p><strong>Best sharpening angle:<br /></strong>The guides in the accessories provide the best sharpening angle.</p>\r\n<p><strong>Specifications:<br /></strong><strong>Materials:</strong> ABS+ Quality Metal<br /><strong>Product Size:</strong> 70 x 50 MM</p>\r\n<p><strong>Package includes:</strong></p>\r\n<p>Special Chainsaw Grinding Tool x 1<br />Matching Grinding Rod x 3<br />Wrench x 1</p>\r\n<p>&nbsp;</p>', 'Available', 'facebook_ads', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-23 06:49:45', '2021-06-23 06:49:45', NULL, NULL),
(343, 'Rod Roller Cat Toy', 19.95, 8.84, 11.11, 191, '1688.44', 98047, '18-24', 1, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Pet Accessories,Rod Roller Cat Toy', 'Pet Accessories', '<p><strong>Description:</strong></p>\r\n<p>Tumblr Swing Toys for Cats Kitten Interactive Balance Car Cat Chasing Toy with Catnip Ball Funny Pet Products The Balance Swing Car for Cat\'s Toy will make cats improve IQ,&nbsp; be more interactive with owners, and cats, and cats can keep moving with each other. When the product is erected, it can swing back and forth to attract cats to play. Movement by external force can also be moved by the force of its own weight generated by the main body swinging back and forth. Without an electric drive, the toy can move by itself while the cat is playing. When the product is placed horizontally, the toy rotates like a turntable, attracting the cat\'s interest in playing.</p>\r\n<p>Catnip ball in the base. What cat can resist their favorite smell!</p>\r\n<p>The eye-catching moving ball moved back and forth but is weighed to stay upright!</p>\r\n<p>The base that rolls &amp; rotates like a turntable to keep them guessing!</p>\r\n<p>Keep your cat\'s mind busy for less mischievous time!!</p>\r\n<p><strong>Feature:</strong></p>\r\n<p><strong>Interactive cat toys:</strong> the top has a built-in high connotation: a Mint ball and interactive cat ball, which can attract the cat\'s attention and increase the cat\'s interest in the game. This interactive cat toy is made of healthy and environment-friendly food-grade ABS material, which is safe, non-toxic, and durable.</p>\r\n<p><strong>Specification:<br /></strong><strong>Color: </strong>Black and White<br /><strong>Size: </strong>24 * 5.7cm/9.44*2.24\'\'<br /><strong>Material:</strong> ABS</p>\r\n<p><strong>Package:<br /></strong>&nbsp;1x Catnip Ball Included.</p>\r\n<p>&nbsp;</p>', 'Available', 'trending_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-23 07:02:12', '2021-06-23 07:02:12', NULL, NULL),
(344, 'SUSHI ROLLER BAZOOKA', 18.81, 3.42, 15.39, 267, '913.14', 3095539, '18-24,25-34,34-44', 1, 'Women', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Kitchen & household,Kitchen', 'Kitchen & household', '<p><strong>Description:</strong></p>\r\n<p>With easy-to-follow instructions, Sushi Bazooka creates perfectly formed sushi quickly and reliably with no guesswork and no trial and error. Using your own choice of imaginative fillings will make you a sushi expert and have your guests coming back for more. The Sushi Bazooka can also be used for a variety of dessert items. Walnut rolls, fudge rolls, cake rolls, and biscuit cookies are only a few of the possibilities! Perfect sushi is no longer an expensive restaurant food. Professional, round sushi can now be created in your own kitchen with your own choice of fillings. With just three easy steps, you can make roll after roll. Kids will love to make their own rice crispy rolls and will enjoy being able to make their own personal candy sushi.</p>\r\n<p><strong>Features:</strong></p>\r\n<p><strong>✔ DISHWASHER SAFETY &amp; CLEAN</strong>: Say goodbye to old rolling pads that are difficult to wash and impossible to use. Made with durable materials to make your sushi tools durable.</p>\r\n<p><strong>✔ INGENIOUS DESIGN:</strong> The compact design is easy to use, even for children, it can be used to make sushi. Simply lay your sushi rice and favorite ingredients into the sushi roller machine, close it, and press out a perfectly rolled sushi roll. The uniquely designed side clips make it not pop off.</p>\r\n<p><strong>✔ PORTABLE &amp; IMPRESSIVE:</strong> Without a complicated Sushi Making kit, you could make sushi easily with our sushi machine on Camping, Picnic, Date Night, Family and kids gathering. DIY your sushi, it\'s up to you to create your favorite combinations. Make an unusual dinner to impress your friends and families.</p>\r\n<p><strong>✔ SAVE YOUR TIME AND BEST GIFT:</strong> Use our sushi-making tools to make sure your sushi rolls are perfectly rounded, fast and easy, so you can easily make the perfect sushi roll at home. This is a perfect family gift for friends and beginners who like sushi.</p>\r\n<p>Features:</p>\r\n<p><strong>Lock &amp; Load Easy Use:</strong> Making delicious sushi is now as easy as it gets! All you have to do is open the sushi bazooka, &ldquo;load&rdquo; it with rice and other ingredients, close it and squeeze out your finished sushi!</p>\r\n<p><strong>A Healthy Diet Choice</strong>: If you&rsquo;re looking to add a healthy option to your diet, you found it! Plus, all the parts are made of food-grade, BPA-free plastic which means they are safe and healthy to use.</p>\r\n<p><strong>Affordable Sushi Solution: </strong>Instead of spending money in an expensive Japanese restaurant, why not make your own sushi at home? After all, it&rsquo;s healthier, easy to prepare, AND more cost-effective!</p>\r\n<p><strong>A Unique Gift Idea: </strong>This sushi bazooka tool makes the ideal gift for a birthday, anniversary, or housewarming party. This time get your friends something unique that they&rsquo;ll enjoy for a very long time!</p>\r\n<p><strong>specifications:</strong></p>\r\n<p>11.4 x 2.8 x 11.4 inches. Includes sushi tube, plunger, and end-cap, all the materials of sushi bazooka are made of safe food-grade high-quality ABS+PP material, BPA-free plastics. Everything is as sanitized and hygienic as it gets!</p>\r\n<p><strong>Package:</strong></p>\r\n<p>1*SUSHI ROLLER BAZOOKA</p>', 'Available', 'trending_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-23 07:13:50', '2021-06-23 07:13:50', NULL, NULL),
