(349, 'Wooden Rainbow Stacker', 38.99, 21.08, 17.91, 671, '14144.68', 8139286, '18-24', 1, 'Baby', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Baby & Kids,Baby', 'Baby & Kids', '<p>The Wooden Rainbow Stacking Toy is a great educational tool for your child to learn motor skills, cognitive abilities, and color recognition. The bright colors of the rainbow toy inspire children&rsquo;s imagination and creativity while teaching them how to balance the toy and use their hand-eye coordination. The rainbow stacker is one of the most versatile toys. Little ones can begin exploring size and color differences, then work toward stacking and building. Kids love its bright colors and will have hours of fun arranging it in every possible way.</p>\r\n<p><strong>Features:</strong></p>\r\n<p><strong>Educational toy for children:<br /></strong>&nbsp;The rainbow stacking toy has bright, vibrant colors that stimulate children&rsquo;s brains while teaching them color recognition and influencing their creativity. The toys are also hands-on and improve hand-eye coordination, motor skills, and cognitive abilities.&nbsp;</p>\r\n<p><strong>A large set of rainbow-colored pieces:&nbsp;<br /></strong>The stacking toy comes with 6 rainbow arches of various sizes and colors that are stackable. The set also comes with 6 multi-colored wooden pegs that can also be stacked and used for designs.</p>\r\n<p><strong>Non-toxic, kid-friendly material:<br /></strong>&nbsp;The rainbow stacking toys are made of non-toxic wood and the paint is a water-based paint. The wood pieces are smooth and have round edges.</p>\r\n<p><strong>Can create a variety of designs with the wood stackers:<br /></strong>&nbsp;Children can use their imagination to create a variety of designs with these building stackers, including a full rainbow, a tunnel, a bridge, and more.</p>\r\n<p><strong>Product Specifications:<br /></strong><strong>Material: </strong>Non-toxic wood, water-based paint<br /><strong>Various sizes:</strong> Full rainbow size: 3cm (1.18in) x 7cm (2.76in) x 14cm (5.51in). Wooden peg size: 2.5cm (0.98in) x 4.5cm (1.77in)<br /><strong>Recommended Ages:</strong> Ages 3 and Up +<br /><strong>Warning:</strong> Choking Hazard, small parts. Not meant for children under 3 years old.</p>\r\n<p><strong>Package Includes:<br /></strong>6 x Wooden Rainbow Arches.<br />6 x Wooden Pegs.</p>\r\n<p>&nbsp;</p>', 'Available', 'trending_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-23 09:37:31', '2021-06-23 09:37:31', NULL, NULL),
(350, 'Manual Food Chopping System', 22.95, 4.65, 18.30, 3063, '14242.95', 8139284, '18-24,25-34,34-44,45-54,55-64', 1, 'Women', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Kitchen & household,Kitchen', 'Kitchen & household', '<p><strong>Description:</strong></p>\r\n<p>This Instant Food Chopper is a new innovative tough, durable, lightweight food chopper that is easy to wash, easy to store, has a military-grade parachute material nylon cord, is dishwasher safe, and features a non-slip base. A spill-proof, most unique way to efficiently chop the pieces into fine pieces is here-the manual food chopping system. This is an unparalleled device to chop your food items. It works with the help of two systems-the blades are attached to the with a pulling handle. The second system is the container. One can easily cut the desired food item by simply putting the item to be chopped into the container and then closing it tightly. Further, the handle on the outside has to be pulled and released multiple times as per the level of cutting intended.&nbsp;<br />The Manual Food Chop System is perfectly essential for slicing vegetables, fruits, salads, cutting various foods, chopping nuts, herbs, veggies, pesto, hummus, salsa, guacamole, meat for meatloaf, and more!</p>\r\n<p><strong>Features:</strong></p>\r\n<p>Chopper system with twin components-blade and container</p>\r\n<p>Makes use of the manual chopping system</p>\r\n<p>Can be easily and readily used by kids</p>\r\n<p>Spill-proof and airtight</p>\r\n<p>It can chop a variety of food items into the minutest pieces</p>\r\n<p><strong>Specifications:<br /></strong><strong>Size: </strong>12.5x8.5 cm<br /><strong>Color</strong>: Light Green / Red<br /><strong>Blades: </strong>stainless steel</p>\r\n<p><strong>package Included:<br /></strong>1x box<br />1x Manual Food Chopping System</p>\r\n<p>&nbsp;</p>', 'Available', 'untapped_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-23 09:49:33', '2021-06-23 09:49:33', NULL, NULL),
(351, 'Electric Air pump', 94.90, 52.58, 42.32, 342, '17982.36', 455786, '18-24,25-34,34-44,45-54', 2, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Electric Air pump,Car Accessories', 'Car Accessories', '<p><strong>Dynamic and static compartments are safe and durable.</strong><br /><strong>The small body takes into account the excellent heat dissipation, the shock pad can reduce the working vibration of the cylinder, and the hand-held operation is more comfortable. 18650 power lithium battery, excellent power supply, and endurance.</strong></p>\r\n<h2><strong>Features:</strong></h2>\r\n<p><strong>Inflate Anything -</strong> Cars, Bikes, Balls, Scooters, and more!<br /><strong>Take It Anywhere - </strong>Compact and Portable Design.<br /><strong>Long-Lasting -</strong> Ultra Extended Lithium Battery.<br /><strong>Premium Digital Display - </strong>Detect Tire Pressure Accurately.<br /><strong>Super Powerful - </strong>Heavy Duty Compressor support up to 150 psi.<br />Compatible With Different Type of Nozzles.<br />Automatically stops at the desired pressure.<br />LED Lighting.<br /><strong>Easy Charging - </strong>USB Compatible.</p>\r\n<h3><strong>Specification:</strong></h3>\r\n<p><strong>Product size: </strong>124x71x45.3mm (without air pipe)<br /><strong>Product model:</strong> MJCQ01QJ<br /><strong>Charging interface:</strong> Micro-USB<br /><strong>Inflation pressure range:</strong> 0.2-10.3bar/3-150psi<br /><strong>Charging parameters:</strong> 5V-2A<br /><strong>Battery capacity: </strong>2000mAh (14.8Wh)<br /><strong>Sensor accuracy:</strong> &plusmn;2psi<br /><strong>Working noise: </strong>noise less than 80dB from 1 meter<br /><strong>Operating humidity: </strong>charging 0 &deg; C -45 &deg; C, discharge -10 &deg; C -45 &deg; C<br /><strong>Tracheal size: </strong>tracheal pull-out length 180mm, including nozzle (without thread) adapter<br /><strong>Charging time:</strong> less than 3 hours</p>\r\n<h4><strong>Package Contents:</strong></h4>\r\n<p>Inflatable treasure x1,<br />French air nozzle adapter x1,<br />Gas needle x1,<br />Charging cable x1,<br />Storage bag x1,<br />Manual x1</p>', 'Available', 'trending_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-23 09:54:54', '2021-06-23 09:54:54', NULL, NULL),
(353, 'Portable Mini Pocket Sax', 45.95, 11.49, 34.46, 12, '137.88', 1242479, '18-24,25-34,34-44,45-54,55-64', 2, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Portable Mini Pocket Sax,Man\'s Fashion,Home Improvement', 'Home Improvement', '<p><strong>This Portable Mini Pocket Sax is such a great gift idea for a music lover or especially for the saxophonist. Portable and compact, much lighter than sax and clarinet, easy to carry.</strong></p>\r\n<h2><strong>Features:</strong></h2>\r\n<p>Play it in an acoustic space and it will sound like a full-size saxophone. Make friends while doing spiritual music.<br />It will give you the joy to create a sense of music wherever you are.<br />A true portable instrument that can be carried everywhere.<br />The saxophone will be a great gift for friends.<br />Each handmade saxophone is a work of art that you will appreciate forever.<br />Ideal to practice wherever you go.<br />Mini sax, light, and portable.</p>\r\n<h3>Specification:</h3>\r\n<p><strong>Material: </strong>ABS plastic + copper + reed<br /><strong>Saxophone color: </strong>black<br /><strong>Reed clip color: </strong>gold<br /><strong>Reed color: </strong>black<br /><strong>Saxophone size: </strong>330*30*30mm/13*1.18*1.18inch<br /><strong>Net weight: </strong>115g/4.05oz<br /><strong>Total weight: </strong>150g/5.29oz</p>\r\n<h4><strong>Package includes:</strong></h4>\r\n<p>1* Pocket Saxophone<br />1* Velvet bag<br />2* Reed Reed</p>', 'Available', 'facebook_ads', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-23 10:01:45', '2021-06-23 10:01:45', NULL, NULL),
(354, 'Classic Jigsaw Puzzle Football Game Stadiums', 52.99, 14.36, 38.63, 320, '4595.20', 8139275, '18-24', 1, 'Baby', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Baby & Kids,Baby', 'Baby & Kids', '<p>An exciting Nanostad 3D puzzle that features one of the UK\'s most famous stadiums - Wembley. This high-quality replica stadium puzzle is designed for children aged seven and upwards although younger children may need a bit of help from Mum or Dad. It\'s fantastically rewarding to create and a great father-son activity. The Wembley stadium can be recreated in spectacular color and detail in around three-five hours without the need for scissors.</p>\r\n<p><strong>Features:</strong></p>\r\n<p>Challenging 1000-piece jigsaw puzzle from MasterPieces Puzzle Company.</p>\r\n<p>Support your team and show off your team spirit.</p>\r\n<p>Photograph puzzle images featuring a stunning, detailed panoramic view.</p>\r\n<p>Hours of fun &amp; entertainment; Suitable for ages 13 and up.</p>\r\n<p><strong>Specifications:<br /></strong><strong>Brand:</strong> Houlwond<br /><strong>Part number:&nbsp;</strong> Houlwond<br /><strong>Color: </strong>Noun camp stadium<br /><strong>Product dimensions: </strong>12.2 x 8.7 x 1.5 inches<br /><strong>Item weight</strong>: 16.96 ounces</p>\r\n<p><strong>Package Include:<br /></strong>1x box</p>\r\n<p>Classic Jigsaw Puzzle Football Game Stadiums</p>\r\n<p>&nbsp;</p>', 'Available', 'untapped_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-23 10:04:26', '2021-06-23 10:04:26', NULL, NULL),
(355, '3D Rainbow Window Film', 21.99, 8.11, 13.88, 2368, '19204.48', 3881090, '18-24,25-34,34-44,45-54,55-64', 1, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', '3D Rainbow Window Film,Home Improvement', 'Home Improvement', '<p><strong>Conceal private spaces or reveal your personal style with DIY window film in a variety of textures, patterns, and colors.</strong></p>\r\n<h2><strong>BENEFITS:</strong></h2>\r\n<p>Anti-scratch protective layer.<br />Bask in the benefits of sunlight-filled rooms, without sacrificing personal comfort or the beauty of your home furnishing.<br />99% Harmful rays will be blocked protecting your furnishings from fading under strong sunlight and cooling your home.<br />Easy to apply, remove and reuse without leaving any trace.<br />Environmental friendly, using biodegradable material.<br />Waterproof and oilproof.<br />Easy to clean and do not need special maintenance.<br />For buildings, home to add a beautiful outdoor environment (Living room bedroom bathroom door window office, etc.).</p>\r\n<h3><strong>Specification:&nbsp;</strong></h3>\r\n<p><strong>Surface Treatment: </strong>Opaque<br /><strong>Type:</strong> Glass Film<br /><strong>Adsorption: </strong>Electrostatic Adsorption<br /><strong>Color:</strong> White<br /><strong>Material: </strong>Environmentally friendly PVC electrostatic film<br /><strong>Size:</strong> 40 x 18 in (100 x 45cm)</p>\r\n<h4><strong>Package Includes:</strong></h4>\r\n<p>1 x Static Glass Sticker</p>', 'Available', 'untapped_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-23 10:09:14', '2021-06-23 10:09:14', NULL, NULL),
(357, 'Neon Nightlife Led Light Up Glasses', 29.89, 8.55, 21.34, 2872, '24555.60', 860051, '18-24,25-34,34-44,45-54', 1, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Neon Nightlife Led Light Up Glasses,Man\'s Fashion,Women\'s Fashion', 'Women\'s Fashion,Man\'s Fashion', '<p><strong>This pair of glasses will make you feel the soul of the 80\'s again with New Retro\'s high-quality raw material technology!&nbsp;</strong></p>\r\n<h2><strong>BENEFITS:</strong></h2>\r\n<p><strong>Draw Attention:</strong> It is definitely an eye-catching pair of glasses that will draw attention in an event, party, carnival, or club.<br /><strong>Durable Materials: </strong>High-quality materials for scratch resistance and high resistance to breakage. Uses wireless and silent LED technology.<br /><strong>Wearing Comfort: </strong>When designing glasses, we have made wearing comfort a priority. The lenses\' extra padding and the molded nose pads make you comfortable.<br /><strong>Two LEDs on Each Arm: </strong>The location of two LEDs on each arm makes it the perfect support for a cyberpunk look. They emit light from the lens.<br /><strong>Suitable for All Occasions:</strong> Can be used for role-playing, parties, and all occasions.</p>\r\n<h3><strong>SPECIFICATIONS:</strong></h3>\r\n<p><strong>Material: </strong>acrylic full frame<br /><strong>Power supply: </strong>2 button batteries<br /><strong>Color:</strong> press the switch to change the color<br /><strong>Switch control: </strong>control by pressing the switch, long press to close<br /><strong>Size: </strong>about 150*180*5mm/5.91*7.09*0.20in<br /><strong>Battery capacity: </strong>210mAh (replaceable)<br /><strong>Working time: </strong>about 60min<br /><strong>Lighting mode: </strong>colorful constant light/breathing/burst flashing/flowing water/combination<br /><strong>Applicable occasions:</strong> concerts, bars, KTV, dancing, and other entertainment venues<br /><strong>Applicable people:</strong> recommended for children and adults over 12 years old</p>\r\n<h4><strong>Packing List:</strong></h4>\r\n<p>Luminous Glasses*1</p>', 'Available', 'trending_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-23 10:16:54', '2021-06-23 10:16:54', NULL, NULL),
