(363, 'INSERT WAVES HERE', 72.00, 17.55, 54.45, 174, '3053.70', 102062, '18-24,25-34,34-44,45-54,55-64', 2, 'Women', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'INSERT WAVES HERE,Beauty Hair', 'Beauty Hair', '<p><strong>This LCD Display Ceramic Triple Barrel Curling Iron can easily glide through hair and create beautiful waves and curly hairstyles. This iron reduces hair breakage and is perfect for any hair type and length. Heats up in 60 seconds and creates smooth, soft, and frizz-free, glamorously shining hair for you. Perfect for achieving the natural wavy look!</strong></p>\r\n<h2><strong>Feature:</strong></h2>\r\n<p>Unique 3 tubes design.<br />A high-quality heater with curls function provides unmatched heat distribution.<br />Temperature control technology.<br />With one switch and 2 modes ( 170 Deg. C and 220 Deg. C ) adjustable temperature, safer to use.<br />PTC heating body.<br />Release large amounts of negative ions and repair the damaged hair automatically, which can make your hair more healthy, natural and hair shape more lasting.<br />Fast heating equipment.<br />Immediately heating up for the most suitable feeling within 30 seconds.</p>\r\n<h3><strong>Specifications:</strong></h3>\r\n<p><strong>TYPE:</strong> Hair Curler<br /><strong>COLOR: </strong>Black, Pink (Optional)<br /><strong>MATERIAL: </strong>Aluminium<br /><strong>WORKING TEMPERATURE: </strong>80&deg;-210&deg;<br /><strong>DIAMETER:</strong> 28mm<br /><strong>VOLTAGE: </strong>220V-240V<br /><strong>POWER:</strong> 45W-65W<br /><strong>CABLE LENGTH: </strong>Approx. 250cm / 98.4in</p>\r\n<h4><strong>Package Includes:</strong></h4>\r\n<p>1 X LCD Display Ceramic Triple Barrel Curling Iron.</p>', 'Available', 'trending_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-23 10:53:28', '2021-06-23 10:53:28', NULL, NULL),
(364, 'Deep Water Fishing Magnet', 19.97, 2.22, 17.75, 1365, '3030.30', 2091045, '18-24,25-34,34-44,45-54,55-64', 1, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Home Improvement,Deep Water Fishing Magnet', 'Home Improvement', '<p><strong>Do you like going to rivers, lakes, or beaches and have a little treasure hunting? Isn&rsquo;t it fascinating what surprise item you might get under nature&rsquo;s waters? We offer you a quick and easy way to do treasure hunting! The Deep Water Fishing Magnet is a compact and powerful fishing magnet that is an ideal tool for fishers and treasure hunters as it desires maximum performance, functionality, and productivity.&nbsp;</strong></p>\r\n<p><strong>Features:<br /></strong>The most powerful:<br />This fishing magnet is 4.72 inches (120 mm) in diameter and adopts a strong neodymium magnet for its base. It can offer 1500 lbs. (680kg) pulling strength under ideal conditions.</p>\r\n<p>High quality:&nbsp;<br />The powerful magnetic force is only concentrated at the bottom, the other three sides are protected by steel cups that have almost no magnetic force and a magnetic force equivalent to 10 times the volume of the same magnet. force permanent, long service life. Made under 9001 quality systems. 60 days money back guaranteed!</p>\r\n<p>Best coating:&nbsp;<br />Ni+Cu+Ni triple layer coated. The best coating available, which provides a shiny and rust-resistant coated steel cup provides protection for the magnet and helps to prevent chipping or cracking.</p>\r\n<p>Multi-use:&nbsp;<br />Unique design with countersunk hole and eyebolt great for salvaging of various iron-containing nickel material underwater and Good idea for magnet fishing, lifting, hanging, retrieving applications. Have fun searching for items like eyebolts, screws, hooks, fasteners, and so on in your warehouse garage or yard.</p>\r\n<p>Permanent strength:&nbsp;<br />Neodymium is a kind of rare earth metal, it\'s suitable for making permanent &amp; powerful magnets. This fishing magnet has permanent magnetism, it will be the same power even decades after.</p>\r\n<p><strong>Specifications:</strong></p>\r\n<p>Material: Neodymium Magnet N52+A3 Steel+Black Resin<br />Coating: Ni+Cu+NiTriple Layer Coated<br />Max Working Temperature: 80℃<br />Pulling Force: up to 480 KG</p>\r\n<p><strong>Package Include:</strong></p>\r\n<p>1x Magnetic Salvage Fishing Magnet.</p>', 'Available', 'trending_product', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-24 04:34:48', '2021-06-24 04:34:48', NULL, NULL),
