(367, 'Arctic Air Ultra 2X Cooling Effect', 30.75, 7.82, 22.93, 13, '101.66', 470592, '18-24,25-34,34-44,45-54,55-64', 2, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Home Improvement,Arctic Air Ultra 2X Cooling Effect', 'Home Improvement', '<p><strong>Are you looking for a way to stay cool this summer? Do you want to save energy and money? Then this Mini Portable Air Conditioner Personal AC Unit is perfect for you! This portable air conditioner has a large water tank so it is simple to add water to it. After you fill the water tank, plug the portable ac into any outlet or USB port to power it. There are three speeds on the portable ac unit so you can adjust the intensity to the setting you like. The air filter on our small portable air conditioner is removable so you can easily and efficiently clean it.</strong></p>\r\n<p><strong>Features:</strong></p>\r\n<p>Three functions, one device:<br />Port chill is intelligently designed to rapidly cool your space in only a couple of minutes. The new evaporative air filter is made with sponge material with an anti-microbial coating. Moreover, its multi-layer filters purify the air to make sure you are not breathing any harmful toxins or germs.</p>\r\n<p>Quick temperature drop:&nbsp;<br />As soon as you fill-up the water inlet and switch on the cooler, the motor will immediately take in the warm air and blow out cold air with proper humidification.</p>\r\n<p>Show off its convenience:&nbsp;<br />This small portable air conditioner is lightweight and sub-powered so you can easily connect it with your laptop or power bank if you wish to take it outdoors. The cooler has a wider outlet that distributes air to a wider range, giving you an all-around cooling. It will give you optimum moisture levels and cooling.</p>\r\n<p>Super quiet and adjustable fan speed:<br />This mini air conditioner is specially constructed as a quiet yet powerful device so that you can use it throughout the night witho