(368, 'Solar Powered Lights', 29.99, 7.05, 22.94, 589, '4152.45', 206975, '18-24,25-34,34-44,45-54,55-64', 1, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Garden Improvement,Gerden', 'Garden Improvement', '<p>Beautiful Solar-Powered Raindrop lights that glimmer just like the real thing! These beautiful solar-powered string lights make a stunning decorative light that won\'t increase your electricity bills!</p>\r\n<p><strong>Unique Design &amp; Size:</strong> The design of these solar string lights is inspired by the natural element &mdash;water drop, aiming to create a colorful festive atmosphere in your home by the crystalline water drop shape. The total length of these string lights is 20.8FT, the lamp length is 14.2FT and the lead length is 6.6FT. With 30 LEDs, each lamp head is spaced 6in apart. 2 string lights with solar panels and brackets.</p>\r\n<p><strong>8 Modes and Memory: </strong>Press the mode button of the raindrop style solar light string select 8 different modes: including in waves, sequential, combination, slow glow, chasing/flash, slow fade, twinkle/ flash, steady on. Multiple colors and different styles of lighting changing effects are intertwined, just like appearing splendid rainbow in the night and having the built-in memory chip will automatically remember the last setting, saving you the trouble of resetting.</p>\r\n<p><strong>Energy Saving and Auto On/Off: </strong>Charged by solar energy, eco-friendly, and without electric cost, the battery can last more than 18 months. Light sensor controls the water drop solar garden string lights auto on keeping on lighting 6-8h at dark and auto off at daytime.</p>\r\n<p><strong>Waterproof &amp; Wide application:</strong> The outdoor string lights can withstand all kinds of weather. It can be lighting as usual whether it is windy or rainy when the solar battery is fully charged. If you want to decorate your garden, courtyard, roof, porch, home, etc, these solar st