 up to 3 people</p>\r\n<p><br /><strong>Package Include:<br /></strong>1x Box</p>\r\n<p>&nbsp;</p>', 'Available', 'facebook_ads', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-24 05:27:12', '2021-06-24 05:27:12', NULL, NULL),
(374, 'Bath Toy Swimming Turtle Set', 19.95, 0.01, 19.94, 347, '3.47', 912603, '18-24', 1, 'Baby', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Baby & Kids,Baby', 'Baby & Kids', '<p>Make bath time fun with these adorable bath toys! These cute creatures will surely make your little ones laugh and giggle. This is a great baby bathing toy, bringing the perfect bath time for your child.</p>\r\n<p><strong>FEATURE:</strong></p>\r\n<p><strong>Kids Like Bathing: </strong>Bright colors and cute appearance design, easy to draw your kid&rsquo;s attention, fun turtle toys to entice your child into taking baths.</p>\r\n<p><strong>Safe and Easy Cleaning Water Toy: </strong>These bath toys are made by ABS, sealed construction of the bottom which prevents water from flowing into the interior. Unique leaky new design in 2020 makes bath toys dry instantly. No small parts, safe for children Ideal gift for infants and birthdays, Christmas and so on.</p>\r\n<p><strong>Great Educational Toys: </strong>Three different colors let Baby learn color perception during the bath. Help kids understand physical buoyancy and develop their hand-eye coordination, dexterity, motor skill.</p>\r\n<p><strong>Lots of ways to play: </strong>Except you can play with these kid toys in the bath or swim in the pool. The cool thing is that you can take it with you when you play at the beach, it will be a multifunctional water toy.</p>\r\n<p><strong>specification:</strong></p>\r\n<p><strong>Product:</strong> wind-up turtle<br /><strong>Material: </strong>ABS<br /><strong>Specifications: </strong>9 * 8 * 5.5cm / 3.54 * 3.15 * 2.17inches<br /><strong>Color: </strong>blue, green, red<br /><strong>Applicable age: 1</strong>2 months and above</p>\r\n<p><strong>Package Contents:<br /></strong>1 x wind-up turtle Random head color</p>\r\n<p><strong>Note:</strong></p>\r\n<p>Light and monitor settings may cause slight color differences.<br />Please allow slight deviation as all dimensions are measured manually. The image is only for reference.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', 'Available', 'untapped_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-24 05:36:05', '2021-06-24 05:36:05', NULL, NULL),
(375, 'Purple Rose Water Bottle', 19.99, 2.95, 17.04, 167, '492.65', 1144269, '18-24,25-34,34-44,45-54', 2, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Garden Improvement,Garden', 'Garden Improvement', '<p>A 2.2 Litre BPA Free, Premium Quality, Reusable Water Bottle designed to bring fun, style, and fashion to all your health and hydration goals. It&rsquo;s as simple as One Day, One Bottle to bring out the best of you!</p>\r\n<p><strong>Features:</strong></p>\r\n<p>&nbsp;Built-in handle And Super cool and innovative design.</p>\r\n<p>With a durable fashionable strap and handle, easy to carry</p>\r\n<p>One-Step flip Cap, easy to open and drink.</p>\r\n<p>Bottle-neck with an extra-large mouthpiece, easy to clean.</p>\r\n<p>100% BPA Free eco-friendly plastic material which is food grade and safe for body health.</p>\r\n<p>&nbsp;No unpleasant smell of plastic or chemicals.</p>\r\n<p>Free of (synthetic substance) and DEHP (softener) - this way there aren\'t any health implications.</p>\r\n<p>Good quality, made of robust plastic.</p>\r\n<p><strong>Specifications:<br /></strong><strong>Material: </strong>Polyethylene Terephthalate Glycol PETG<br /><strong>Color:</strong> Black,blue<br /><strong>Height: </strong>Approx 27cm/10.62inch<br /><strong>Diameter: </strong>Approx 13cm/5.11inch<br /><strong>Capacity:</strong> 2.2L</p>\r\n<p><strong>Package Includes:<br /></strong>1 x Sports Water Bottle</p>\r\n<p>&nbsp;</p>', 'Available', 'trending_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-24 05:45:50', '2021-06-24 05:45:50', NULL, NULL),
(376, 'Oil Spray Bottle', 27.95, 9.04, 18.91, 1426, '12891.04', 2442282, '18-24,25-34,34-44,45-54,55-64', 1, 'Women', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Kitchen & household,Kitchen', 'Kitchen & household', '<p>Switch to healthy living with this ingenious solution to minimize the oil you use for your daily cooking. A perfect tool to control the amount of oil you use and enjoy low-fat-high-flavor cooking. Whether frying, saut&eacute;ing, roasting, baking, grilling, or flavoring, this Oil Spray Bottle helps you cut down the amount of oil you use. With every pump, ensure a healthier meal for your family! A perfect tool to control the amount of oil you use and enjoy low-fat-high-flavor cooking.</p>\r\n<p><strong>Features:</strong></p>\r\n<p><strong>PREMIUM QUALITY - </strong>Made of high-quality stainless steel and glass, BPA-free, and eco-friendly. 100% food-safe.</p>\r\n<p><strong>ERGONOMICALLY DESIGNED - </strong>The transparent glass design makes it easy for you to tell the amount of remaining liquid in the bottle. The size of the bottle makes it easy for you to grip it.</p>\r\n<p><strong>MULTI-PURPOSE -</strong> You can not only use this with the oil of your choice but with soy sauce, lemon and lime juice, sherry, etc. It can widely be used for salad making, cooking, baking, roasting, grilling, frying, BBQ, and so on.</p>\r\n<p><strong>EASY TO USE-</strong> The oil sprayer employs a simple method of pump and press to create a fine mist of the oil that you have filled in the jar.</p>\r\n<p><strong>EASY TO CLEAN-</strong>&nbsp; Simply unscrew the lid and rinse with dish detergent or warm water.</p>\r\n<p><strong>Specifications:<br /></strong><strong>Material: </strong>Stainless Steel + Lead-free Glass<br /><strong>Color: </strong>transparent<br /><strong>Size:</strong> height: about 17.5 cm, base diameter: about 4 cm<br /><strong>​Capacity: </strong>100 ml<br /><strong>Weight: </strong>About 240g</p>\r\n<p><strong>Package Included :<br /></strong>1 pc x Convenient Cooking Oil Spray Bottle</p>\r\n<p>&nbsp;</p>', 'Available', 'trending_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-24 05:54:23', '2021-06-24 05:54:23', NULL, NULL),
(377, 'Iphone Square Ring Light', 59.95, 16.80, 43.15, 187, '3141.60', 78285, '18-24,25-34,34-44,45-54,55-64', 1, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Mobile Accessories,Mobile', 'Mobile Accessories', '<p>The Portable iPhone Selfie Light Ring is a light ring you can fit in your pocket and take anywhere. With an Ultra-Slim Design, Adjustable Lighting Modes, and 6+ Hours of Battery Life, never worry about setting up a ring light again.&nbsp;</p>\r\n<p><strong>Features:</strong></p>\r\n<p><strong>Details:<br /></strong>Gethin luminous selfie flashlight case for iphone12 plus features a built-in flashlight so you can always take beautiful selfies and facetime, even when there is not enough light, with just one click on the button on your new case.</p>\r\n<p><strong>Light colors:&nbsp;<br /></strong>There are 3 modes of light which are bright, medium and cold !!! New colors come with almost every outfit and you would become the center of attention.</p>\r\n<p><strong>Lighting settings easy:&nbsp;<br /></strong>When taking a selfie, the flashlight ring pops up with one button press and switches three lights mode with another button.</p>\r\n<p><strong>Rechargeable:&nbsp;<br /></strong>Comes with a rechargeable battery itself which is portable and enjoy your selfie time with excellent endurance ability.</p>\r\n<p><strong>Protect your phone:&nbsp;<br /></strong>The tough and durable plastic case would withstand drops from waist level without any damages. We\'ve got you covered.</p>\r\n<p><strong>Specifications:<br /></strong><strong>Product Net Weight:</strong> 91 g<br /><strong>Input: </strong>5V / 500 mAh<br /><strong>Output: </strong>3.7 V / 0.35 W<br /><strong>Battery: </strong>250 mAh<br /><strong>Size: </strong>110 * 195 * 28 mm&nbsp;</p>\r\n<p><strong>Package Include:<br /></strong>Iphone Square Ring Light</p>\r\n<p>&nbsp;</p>', 'Available', 'facebook_ads', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-0