(378, 'Convales Era Clean Refrigerator Deodorizing Disinfection Machine', 99.97, 23.99, 75.98, 2611, '62637.89', 3562864, '18-24,25-34,34-44,45-54,55-64', 1, 'Women', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Kitchen & household,Kitchen,House', 'Kitchen & household', '<p>There are more than 700 kinds of bacteria in the refrigerator! Convales&reg; Eraclean Refrigerator Deodorizing Disinfection Machine helps you protect your refrigerator with professional disinfection, bacteriostasis, and deodorization which keep your food in the refrigerator fresh &amp; healthy!</p>\r\n<p><strong>Features:</strong></p>\r\n<p><strong>Keep your food fresher for longer:<br /></strong>During ripening, many fruits, such as bananas and apples, release ethylene gas, which speeds up the ripening process. This fridge freshener produces suitable reactive oxygen, which is very effective in removing ethylene through chemical reactions to extend the storage life of many fruits and vegetables.</p>\r\n<p><strong>Mini air purifier:&nbsp;<br /></strong>Better and much more convenient than baking soda, just place it in a small space ( max deodorization space 106ft&sup3;), ozone can decompose the odor into oxygen without residue, not only acting on the odor of the refrigerator, but also on other odor including those from smoke, pets, cooking, mold, and mildew.</p>\r\n<p><strong>Completely portable:&nbsp;<br /></strong>Cordless, built-in battery, and rechargeable with a used cable. The refrigerator deodorizer is small and light enough to be carried and used during travel to disinfect rooms, towels, linens, clothes, or your luggage.</p>\r\n<p><strong>One charge for one month:&nbsp;<br /></strong>Under the high-efficiency mode, the ozone machine works 30 mins and stands by for 90 mins so that the circle runs automatically until the battery runs out. It should last for at least 30 days per charge.</p>\r\n<p><strong>Warming:&nbsp;<br /></strong>If you use this fridge deodorizer in your car or at home, keep people or pets away from the area until 30 minutes after ozone generation ends. As all ozone generators should only be used in unoccupied spaces.</p>\r\n<p><strong>Specifications:<br /></strong><strong>Origin: </strong>CN(Origin)<br /><strong>Certification:</strong> NONE<br /><strong>Product Name:</strong> Eraclean Refrigerator Deodorizer<br /><strong>Product Model: </strong>CW-B01<br /><strong>Rated Voltage:</strong> 5VDC<br /><strong>Charging Time: </strong>2h<br /><strong>Battery Capacity: </strong>800mAh<br /><strong>Net Weight: </strong>About 70gFeature1: Mini Compact.</p>\r\n<p><strong>Package Include:<br /></strong>Ozone Generator<br />USB cable<br />User instruction</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', 'Available', 'untapped_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-24 06:10:47', '2021-06-24 06:10:47', NULL, NULL),
(379, 'Willie The Sprinkler Whale Bath Toy', 24.95, 9.16, 15.79, 642, '5880.72', 82941, '18-24', 1, 'Baby', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Baby & Kids,Baby,kids', 'Baby & Kids', '<p>Kids are loving this bath toy! Let your child discover the wonder of deep-sea whales during bath time with Willie The Sprinkler Whale! Now they\'ll look forward to taking baths on their own!</p>\r\n<p><strong>FEATURES:&nbsp;</strong></p>\r\n<p><strong>Automatically Spray Toy: </strong>Spray water bath toys can automatically absorb water, spraying a soft water column like a lifelike whale, and flashing colored lights, which are very attractive for your babies.</p>\r\n<p><strong>Safety &amp; Durable: </strong>The kid toy made of the kid feeding bottle material, BPA free, non-toxic, environmentally friendly, drop resistant. Fine sanding a smooth surface will not cut the baby\'s skin.</p>\r\n<p><strong>Start Immediately After Entering The Water: </strong>The Whale Baby Bath Toy powered by 3 * AAA batteries(Not included), just install the batteries and put the toy into the water then the bathtub toys will automatically spray water and flash colorful lights. Please make sure that the cover screws are tightened after the battery is installed.</p>\r\n<p><strong>Funny and Cute Whale Toy:</strong> The size of the little whale toy is 4.4 feet 4 feet 3.6 feet, very small and cute, suitable for 1 2 3 4 5 6 years old babies to play, Please check our size carefully to make sure you get the toy you like.</p>\r\n<p><strong>SPECIFICATIONS:&nbsp;<br /></strong><strong>Material: </strong>ABS plastic<br /><strong>Dimensions:</strong> 4.3\" x 3.9\" x 3.5\" inches<br /><strong>Batteries: </strong>3X AAA (batteries not included)<br /><strong>Color: </strong>Comes in gray and white. For the bundle deal, the color of the item is shown in the photo.</p>\r\n<p><strong>PACKAGE INCLUDES:<br /></strong>1 * Box</p>\r\n<p>&nbsp;</p>', 'Available', 'trending_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-24 06:19:26', '2021-06-24 06:19:26', NULL, NULL),
(380, 'LED Bike Wheel Lights', 19.99, 3.69, 16.30, 72, '265.68', 1110769, '18-24,25-34,34-44', 2, 'Men', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Bike Accessories,Bike', 'Bike Accessories', '<p>Stay safe and turn heads while cycling with these amazing LED bike wheel lights. Gain greater visibility from all directions so you and your loved ones are safer in low-light conditions. Normal bike lights can only be seen from the front and back, leaving you vulnerable from the sides. These lights help you STAND OUT from all angles.</p>\r\n<p><strong>FEATURES:<br /></strong>Automatic lighting<br />Motion sensing - turns on automatically when the bike moves and turns off when no motion for 1 minute<br />Light sensing - turns on at night when the bike move<br />2 meters of 20 LEDs light string - fits most bike wheel<br />No speed limit for starting up<br />Flashlight mode<br />Make your riding visible and safe at night<br />Fast and easy installation - no tool required</p>\r\n<p><strong>SPECIFICATIONS:<br /></strong>Light Color Options: RGB/ Red/ Blue<br />String Light Length: 6-5/9 ft (2 meters)<br />Battery Compartment Dimension: 2-3/4\"L x 1-2/5\"W x 4/5\"H (L7cm x W3.5cm x H2cm)<br />Power Supply: 2x 1.5V AA Battery</p>\r\n<p><strong>PACKAGE INCLUDES:<br /></strong>1x LED Light String (for 1 Wheel)<br />1x Battery Compartment<br />1 Set of Screws</p>\r\n<p><strong>NOTICE:<br /></strong>AA battery is not included.<br />Please measure the circumference of your bike wheel and the circumference should be no more than 2 meters. (Our light string is 2 meters long.)</p>\r\n<p>&nbsp;</p>', 'Available', 'facebook_ads', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-24 06:46:17', '2021-06-24 06:46:17', NULL, NULL),
(381, 'Galaxy Projector Blue Stars', 89.99, 45.70, 44.29, 313, '14304.10', 74573, '18-24,25-34,34-44', 2, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Electronics,Galaxy Projector Blue Stars', 'Electronics', '<p><strong>Enter the next generation of Galaxy Lamp&rsquo;s popular Galaxy Projector &ndash; a futuristic device that fills your space with mesmerizing spotlights. Once the beam leaves the matrix and strikes a surface, you&rsquo;ll be immersed in an alternate universe of constellations, nebulae, and crashing ocean waves. Bring the night sky indoors and explore outer space from the comfort of home.</strong></p>\r\n<p><strong>FEATURES:&nbsp;</strong></p>\r\n<p>ADJUSTABLE: This ceiling night light projector can be adjusted in brightness simply with the remote control. You can choose a setting that is suitable for sleeping or to create a wonderful atmosphere in your home.</p>\r\n<p>SPEED CONTROL: As well as brightness adjustments, you can also control how fast the stars rotate in your room. This can be great if you have a few people over and want to liven things up a little.</p>\r\n<p>COMPACT: This night sky projector measures only 6.6 inches, so you can move it around easily and try it out in different rooms. It won\'t take much space, and will actually look like a beautiful ornament sitting in your home.</p>\r\n<p><strong>SPECIFICATIONS:&nbsp;</strong></p>\r\n<p>Shell material: ABS</p>\r\n<p>Laser wavelength: 523 nm</p>\r\n<p>Green laser: &lt;1 MW</p>\r\n<p>Maximum LED power: 6W</p>\r\n<p>Input power: AC110-220V</p>\r\n<p>Operating temperature: 14 &deg; F and 104 &deg; F (0 &deg; C to 40 &deg; C)</p>\r\n<p>Projection area: 161-538 square feet (15-50 square meters)</p>\r\n<p>Remote control: 20/30 meters wireless remote control</p>\r\n<p>Battery type: AAA battery (not included)</p>\r\n<p>Plug type: US</p>\r\n<p><strong>PACKAGE INCLUDES:</strong></p>\r\n<p>1 x Sky Projector</p>', 'Available', 'untapped_product', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-24 06:56:56', '2021-06-24 06:56:56', NULL, NULL),
