NULL, NULL, 'Biplob Sheikh', '2021-06-24 07:11:16', '2021-06-24 07:11:16', NULL, NULL),
(383, 'Ultrasonic Firework Humidifier & Oil Diffuser', 74.99, 32.78, 42.21, 354, '11604.12', 580523, '18-24,25-34,34-44,45-54,55-64', 1, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Home Improvement,Oil Diffuser', 'Home Improvement', '<p><strong>Aromatherapy can fortify immunity and help ease the symptoms of seasonal illnesses. The powerful compounds in essential oils originally serve as protection for the plants they come from. And these compounds can have similar effects on you.</strong></p>\r\n<p><strong>Features:</strong></p>\r\n<p><strong>Hand made glass diffuser &amp; more elegant design:<br /></strong>An aromatherapy diffuser is a glass marble pattern vase design, a perfect addition to any contemporary home, office, gym, spa, or studio. Compact and portable, the aroma diffuser&rsquo;s cover can be effortlessly removed, easy to fill with water and a few drops of essential oil, helping you readily reap aromatherapy benefits.</p>\r\n<p><strong>All in one function:<br /></strong>&nbsp;Aromatherapy essential oil diffuser, cool mist humidifier, night light. Multifunction: moisten skin, humidify the air, reinforce immunity, relieve stress, and improve sleep. With 7 soothing led lights, you can cycle seven colors or freeze on one fixed color. Lights could be turned on as night light at any time. A wonderful gift for family and friends.</p>\r\n<p><strong>Whisper-quiet ultrasonic technology:&nbsp;<br /></strong>Aromatherapy essential diffuser adopted advanced ultrasonic technology, it is extremely quiet without annoying noise that won\'t disturb you when you sleep or at work. No heat is used, making it safe for kids and pets.</p>\r\n<p><strong>Safety design &amp; auto shut off:&nbsp;<br /></strong>Aromatherapy essential oil diffuser will automatically stop working and keep your unit from being damaged as soon as its water content has been used up. 4-time setting modes: 0.5h, 1h, 2hs, 3hs+ (continuous misting mode), you can set the time when you use it. It will stop working automatically when it reaches the time setting.</p>\r\n<p><strong>Quality assured:&nbsp;<br /></strong>All of our products passed the safety and durable test, certified under ETL and fcc certification.</p>\r\n<p><strong>Specifications:<br />Size:</strong> 6 inches x 9.85 inches<br /><strong>Material: </strong>Glass, ABS, PP<br /><strong>Capacity:</strong> 100mL<br /><strong>Humidifying Capacity: </strong>30mL/hour<br /><strong>Power Type: </strong>USB<br /><strong>Noise Level:</strong> 36 Decibels<br /><strong>Voltage:</strong> 5V<br /><strong>Light Colors:</strong> 7 colors (Green, Light Green, Yellow, Blue, Purple, Red, Pink)</p>\r\n<p><strong>Package:<br /></strong>1 x Stardust Essential Oil Diffuser and Humidifier<br />1x Power Adapter<br />1x User Manual</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', 'Available', 'trending_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-24 07:18:32', '2021-06-24 07:18:32', NULL, NULL),
(384, 'Electric Fish Toy For Cats', 21.74, 4.34, 17.40, 11249, '48820.66', 205173, '18-24,25-34,34-44', 1, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Pet Accessories,Electric Fish Toy For Cats', 'Pet Accessories', '<p><strong>The Interactive Cat Fish Toy is a super fun and entertaining electronic fish that your cat is definitely going to love. It\'s so realistic that it even flops around as a real fish would! Simply insert some batteries, charge it up, insert a bit of catnip if you want to, and switch it on! Watch as your kitty gets absolutely entranced and enthralled with this new friend of theirs. Get an Interactive Cat Fish Toy for you and your feline friend today!</strong></p>\r\n<p><strong>Features:</strong></p>\r\n<p>Automatic Moving Fish Cat Toy: Built-in touch sensor, every time your feline touches this cat kicker toy, Cat toys will make a sound by swinging and making their own movements, which will attract your cat to kick and play.</p>\r\n<p>&nbsp;Realistic Fish Simulation: The vivid moving fish toy looks like a real fish, an eye-catcher for cats, keeping your kitty on her paws and engaged in real-time, alleviating boredom and loneliness when you are away from home.</p>\r\n<p>&nbsp;Safe &amp; Durable Materials: This kitty toy is made of durable cotton plush, safe and non-toxic for your kitten.</p>\r\n<p>&nbsp;Infused Catnips: Most cats can get excited and happy at the smell of catnips. Catnips could relieve your kitty of depression and stress.</p>\r\n<p>&nbsp;USB Chargeable: This toy is USB chargeable which saves you from the hassle and costs to replace batteries. USB cable is included in the package. The infused chargeable motor is detachable for convenient cleaning of the plush toy.</p>\r\n<p><strong>Specifications:</strong></p>\r\n<p>Product Type: Electronic Pet Cat Toy</p>\r\n<p>Material: PP cotton</p>\r\n<p>Color: Multicolor</p>\r\n<p>Features: durable</p>\r\n<p>Target Audience: Cat</p>\r\n<p>Size: 30cm</p>\r\