(392, 'Portable Fishing Rod & Tackle Bag', 59.99, 27.75, 32.24, 4, '111.00', 2068787, '18-24,25-34,34-44,45-54,55-64,65+', 2, 'Men', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Portable Fishing Rod & Tackle Bag,Garden Improvement', 'Garden Improvement', '<p><strong>This Fishing Rod Case is a must-have organizer for anyone who loves to fish.</strong><br /><strong>The Portable Fishing Rod &amp; Tackle Bag is the perfect hands-free solution to lugging all your fishing gear to and from your car to the spot where you throw your line in. Designed similarly to a tent bag with drawstrings, the inside of the bag has various pockets to store your tackle + with 5 pockets on the outside allowing you to carry up to 5 fishing rods at any given time! Collapsible and ergonomic in functionality means it\'s easy to take with you and with a padded shoulder strap means it has the comfort side of things covered too!</strong><br /><strong>This Waterproof Fishing Rod &amp; Tackle Bag is the perfect hands-free solution for lugging all your fishing gear to and from your car to the spot where you throw your line in.</strong></p>\r\n<h2><strong>FEATURES:</strong></h2>\r\n<p><strong>Humanized design: </strong>Both hands carry an adjustable shoulder strap to provide comfort whether you like hand or shoulder to carry. And it has advanced high-tech polyester fiber. The shoulder strap can be adjusted. If you love fishing, this is the perfect organizer for you.<br /><strong>Multi-function: </strong>Be designed with many pocket grid compartments and straps. Store your pliers, fishing boxes, bait, small scrolls, and other accessories that are safe and orderly. You can use it for hiking, camping, outdoors, and even daily work.<br /><strong>Recommendation:</strong> The bag is similar to a duffle bag and is not rigid. You can buy a 48\" x 8\" cardboard tube at the local home improvement store and insert the bag if you want the bag to be rigid.</p>\r\n<h3><strong>SPECIFICAT