(395, 'Flashlight Protector', 48.42, 16.66, 31.76, 1, '16.66', 78285, '18-24,25-34,34-44,45-54,55-64', 2, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Electronics,Flashlight Protector', 'Electronics', '<p><strong>The Roadside HERO will most likely become the best and most useful tool you\'ve ever owned. Your flashlight collection is not complete without this solar-powered multi-function survival flashlight with a hammer, belt cutter, magnet, compass, and power bank. It can be used as a regular 3-mode 200-lumen standard flashlight, 10 LED bright white work light, or red emergency SOS light. The unique tip has a belt cutter, hammer (for breaking glass in case of an emergency), and a magnet to pick stuff up or to mount the flashlight. The solar panel allows you to get endless power to its built-in 2000mah 18650 battery. This flashlight also doubles as a power bank to charge your USB devices. This is the perfect item to keep in the car, home, backpack, bug-out bag, or pretty much ANYWHERE.</strong></p>\r\n<p><strong>Features:</strong></p>\r\n<p>7 Working modes flashlight---Headlight(4-6hrs) -High, medium and Flashing, Side White Lamp (4-7hrs) - High and medium, Side Red Light (6-7hrs)- Flashing and Slow-flashing; Press the switch to change working mode and long press 1.5s to change working LED.</p>\r\n<p>Car emergency escape tool---Features with window breaker break the stuck window and the seat belt cutter to cut the jammed seat belt; bring safe escape in emergencies, having self-defense LED flashlight tactical can help you get out of most sticky situations.</p>\r\n<p>Hands-free---With a powerful magnet on the side of the flashlight head, you could attach it to the car or other metallic surface to use as a work light, camping lamp, or emergency warning light.</p>\r\n<p>Reliable and necessary---Flashlight is water-resistant &amp; shock-resistant for use under the most rugged, emergency condition. It comes with a weather-resistant anodized aluminum alloy body, easy to grip, tail with a compass for outdoors; Not just for auto emergencies, also great for working, camping, or hiking as it\'s designed to withstand lots of abuse.</p>\r\n<p>Rechargeable emergency power bank---This solar flashlight has a built-in 2000mAh 18650 battery, which could be charged with included USB Cable (4-5hrs) or Solar Power (30hrs), using the USB cable to connect your phone with the flashlight and charging your phone for emergencies.</p>\r\n<p><strong>Specification:</strong></p>\r\n<p>Length: 7 3/4&rdquo; (197mm)</p>\r\n<p>Handle Diameter: 1 1/4&rdquo; (32mm)</p>\r\n<p>Head Diameter w/o hammer &amp; cutter: 1 3/4&rdquo; (45mm)</p>\r\n<p>Head Diameter Full: 2 1/2&rdquo; (64mm)</p>\r\n<p>Weight: 10oz (284g)</p>\r\n<p>Manufacturer:&nbsp; &nbsp; &nbsp;Shenzhen Chengweiben Technology Co., Ltd</p>\r\n<p>Product Dimensions:&nbsp; &nbsp; &nbsp;7.7 x 1.7 x 2.7 inches</p>\r\n<p><strong>Package Includes:</strong></p>\r\n<p>1x&nbsp; &nbsp;Solar Power Multi-Function Flashlight</p>\r\n<p>1x&nbsp; USB Cable</p>\r\n<p>1x&nbsp; &nbsp;Gift Box</p>\r\n<p>1x&nbsp; &nbsp;User Manual</p>', 'Available', 'untapped_product', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-24 08:42:47', '2021-06-24 08:42:47', NULL, NULL),
(396, 'Tail Light Repair Kit', 16.97, 4.37, 12.60, 68, '297.16', 149291, '18-24,25-34,34-44,45-54,55-64', 2, 'Men', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Tail Light Repair Kit,Car Accessories', 'Car Accessories', '<p><strong>Broken car lights? Fix it up quickly using the Tail Light Repair Kit! No need for expensive shop repairs. This handy kit lets you easily fix any broken car light in minutes by yourself.</strong><br /><strong>Each pack contains red, amber, and clear-colored panels with a pre-formed grid pattern to closely match the color and reflective quality of any car lens. It&rsquo;s easy to install with a special self-adhesive that dries in a weatherproof seal. It&rsquo;s applicable to any car light.&nbsp;</strong></p>\r\n<h2><strong>FEATURES:</strong></h2>\r\n<p><strong>DIY Car Lens Repair:</strong>&nbsp;Quick and easy fix for broken car lights, saving you time and money from expensive shop repairs.&nbsp;<br /><strong>Seamless Fix:</strong>&nbsp;Has a pre-formed grid pattern that closely matches the color and reflective quality of the car lens.&nbsp;<br /><strong>Weatherproof Seal:</strong>&nbsp;Backed by a special self-adhesive that forms a waterproof seal.&nbsp;<br /><strong>Easy to Use:</strong>&nbsp;Easy peel-and-stick application on flat and curved surfaces. No need to remove the light from the housing.&nbsp;<br /><strong>Multi-Color Pack:</strong>&nbsp;Contains red, amber, and clear colored panels, allowing you to repair any light.&nbsp;<br /><strong>Widely Applicable:</strong>&nbsp;Ideal for repairing headlights, tail lights, turn signals, and markers.&nbsp;</p>\r\n<h3><strong>SPECIFICATIONS:</strong></h3>\r\n<p><strong>Color: </strong>Red, Amber, Clear<br /><strong>Size: </strong>19.6 cm x 9.5 cm</p>\r\n<h4><strong>PACKAGE INCLUDES:</strong></h4>\r\n<p>3 sheets x Tail Light Repair Kit</p>', 'Available', 'untapped_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-24 08:44:24', '2021-06-24 08:44:24', NULL, NULL),
(397, 'Drink Saver', 41.97, 1.08, 40.89, 3786, '4088.88', 1338522, '18-24,25-34,34-44,45-54,55-64', 1, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Home Improvement,Drink Saver', 'Home Improvement', '<p><strong>Did your children spill juice out of a heavy drink bottle? Are you tired of cleaning up sticky stains? Here is a good product for you. Our beverage dispense machine helps you and your kids have the drink easily. Our Drink Saver allows you to get the most value to your money by draining each container to the last drop. It also makes dispensing of drinks faster and easier. This portable device is portable enough and great for a picnic and other events.</strong></p>\r\n<p><strong>FEATURES:</strong></p>\r\n<p>KEEP YOUR SODA FIZZY: Stop drinking dull soda anymore! Keep your soda fizzy with this creative upside-down fizz saver dispenser. Not only for the fizzy cold drink, but also great for beers, juice, water, and more!</p>\r\n<p>EASY TO USE: Super simple to use. Just gently twist this drink dispenser on the top of a 2-liter large bottle, then invert the bottle. Tip! If you use a needle, it helps to increase pressure and pour out easily.</p>\r\n<p>GREAT GIFT IDEA: This product will be a perfect gift for your kids and friends! Great to use for the home bar, office, entertaining, outdoor activities, and more!</p>\r\n<p>PEACE OF MIND: It is made of eco-friendly ABS material. At Eutuxia, it is our priority to design products that are safe and comfortable to use. We always hope you are highly satisfied with our products.</p>\r\n<p><strong>Specification:</strong></p>\r\n<p>Color: Red</p>\r\n<p>Weight: 79g</p>\r\n<p>Size:13.8cm/10cm/6.5cm/7.9cm</p>\r\n<p><strong>Package Includes:</strong></p>\r\n<p>1x Drink Saver.</p>', 'Available', 'trending_product', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-24 08:54:37', '2021-06-24 08:54:37', NULL, NULL),
(398, 'Portable Blender', 39.95, 19.72, 20.23, 35, '690.20', 326561, '18-24,25-34,34-44,45-54,55-64', 2, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Portable Blender,Kitchen & household', 'Kitchen & household', '<p><strong>Integrated design with built-in battery and blade, blend and drink directly from the bottle, great for home, office, gym, and travel with on-the-go portability. Just load your ingredients into the bottle and simply click the button the blender allows you to make smooth, evenly blended drinks to your desired consistency and taste every time, no matter which fruits or vegetables you choose to use.</strong></p>\r\n<h2><strong>Features:</strong></h2>\r\n<p>At 1lb, Goblendy is lightweight and has a capacity of 500ml or 17oz! So simple, with two clicks of a button, you can blend your perfect smoothie on the go.&nbsp;<br />It\'s the perfect gift for your loved ones. Goblendy is so easy to use that anyone will love it! Just add some liquid and fruits, and presto! You\'ve made a smoothie.<br />Your portable blender will still look like a bottle. Blades designed to be hidden under the cup, Goblendy is the perfect fit for your gym bag, working space, or even your car\'s cup holder!&nbsp;<br />Never worry about missing your cool smoothie because Goblendy is the perfect partner to make your iced smoothies and shakes!<br />Goblendy is also easy to clean! Just blend your Goblendy with some soap until it\'s good as new! <br />All orders come with free worldwide shipping. Your favorite smoothie and protein shakes are all now on the go. Get your Goblendy within the standard shipping time of 2-7 days directly from our warehouse in the United States or Australia. For a more detailed shipping estimate, visit our shipping policy.</p>\r\n<h3><strong>Specification:</strong></h3>\r\n<p><strong>Voltage: </strong>3.7V<br /><strong>Battery capacity: </strong>2400mAh<br /><strong>Motor speed: </strong>17000 RPM<br /><strong>Main material: </strong>Baby food-grade plastic and SUS304 stainless steel blade<br /><strong>Capacity: </strong>300ml<br /><strong>Size: </strong>11.2 * 11.2 * 20.7cm<br /><strong>Weight:</strong> 0.6 kg<br /><strong>Color:</strong> pink/blue/white</p>\r\n<h4><strong>Package:</strong></h4>\r\n<p>1*portable juice machine,<br />1*USB charging cable,<br />1*User guide</p>', 'Available', 'facebook_ads', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-24 08:54:55', '2021-06-24 08:54:55', NULL, NULL),
(399, 'L-Shape Angled Bottle Brush', 25.96, 5.23, 20.73, 3, '15.69', 1635115, '18-24,25-34,34-44,45-54,55-64', 2, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Home Improvement,L-Shape Angled Bottle Brush', 'Home Improvement', '<p><strong>Solve all bottle cleaning problems! Clean hard-to-reach areas! Use this flexible L-Shape Angled Bottle Brush! Reach all insides of any bottle and never miss a spot!</strong></p>\r\n<p><strong>Features:</strong></p>\r\n<p>L-SHAPE TIP: Curved end design brush head gives hard-to-reach corners a thorough cleaning. Effectively cleans baby bottles, milk bottles, dishes, sports bottles, beer bottles, wine tumblers, long cups, vacuum mugs, and even vases!</p>\r\n<p>LONG HANDLE: Reach the end of your bottles with their long handle. Prevent hurting your hands or knuckles by trying to fit your cleaning brushes up to the ends of your bottle. Seriously scrub with no damage to your items!</p>\r\n<p>NON-SLIP GRIP: The easy-hand-hold design provides a comfortable grip, even when wet. Clean your bottles with a firm grip!</p>\r\n<p>HANGING HOLE: Hang it easily on any hook for quick drying and easy storage.</p>\r\n<p>BPA-FREE &amp; NON-TOXIC MATERIAL: Made of high-quality nylon fiber without any smell or any harmful toxins. Its steel wire will not be banned or snapped easily while scrubbing. This brush is really sturdy and durable to withstand even daily use.</p>\r\n<p><strong>SPECIFICATIONS:</strong></p>\r\n<p>Material: 304 stainless steel, PU sleeve, nylon</p>\r\n<p>Weight: 57g</p>\r\n<p>Size: 25.5 x 6cm</p>\r\n<p><strong>Package Includes:</strong></p>\r\n<p>1 pc. L-Shape Angled Bottle Brush</p>', 'Available', 'untapped_product', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-24 09:03:34', '2021-06-24 09:03:34', NULL, NULL),
(400, 'Simulation Rocket Shooting Mortar Toy', 48.97, 28.80, 20.17, 19, '547.20', 1042561, '18-24,25-34,34-44', 2, 'Baby', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Simulation Rocket Shooting Mortar Toy,Baby & Kids', 'Garden Improvement,Baby & Kids', '<p><strong>Take Your Nerf Battles To The Next Level With the Soft Foam Mortar Launcher!</strong><br /><strong>This toy mortar is lightweight, absolutely simple to use, and honestly pretty fun. Kids could play with this mortar for hours at a time. This rocket launcher is the easiest type of toy explosive to set up and use for little mortar fans. Buy 2 to start the shooting battle. A very fun combat toy available for your kids and even for you.</strong><br /><strong>During your next all-out shooting battle, bring in superior long-range firepower with this cool new Soft Foam Mortar Launcher. This realistic-looking portable mortar launcher.</strong><br /><strong>Just take the soft mortar shell, prime it in the cylinder to load the internal spring, and then drop it down the tube to automatically launch it out at your enemy. It\'s just like the real thing, except that it\'s safe for everyone and there\'s no explosions and screaming.</strong></p>\r\n<h2><strong>FEATURES:</strong></h2>\r\n<p>Comes with 3 x 60mm caliber giant foam bullets, one tripod mortar launcher, along with a priming mechanism to push the spring forward in each bullet.<br />Bullets are made from a soft spongy foam material, the foam shells are soft enough to not actually hurt anyone if they get hit.<br />An added shooting tactic to your shooting games.<br />Adjustable shooting angle with a range up to 20 feet,<br />Suitable for outdoor cs battle games.<br />A fantastic gift to your little boy.</p>\r\n<h3><strong>Specifications:</strong></h3>\r\n<p><strong>Color: </strong>Dark Green<br /><strong>Material: </strong>Plastic + Sponge<br /><strong>Product Weight: </strong>1300g<br /><strong>Package Dimensions:</strong> 58*20*20cm<br /><strong>Packing: </strong>Carton Box</p>\r\n<h4><strong>Package Included:</strong></h4>\r\n<p>1 x Target<br />1 x Transmitter<br />3 x Bullet<br />1 x Pressure Reed Cylinder</p>', 'Available', 'trending_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-24 09:05:38', '2021-06-24 09:05:38', NULL, NULL);
