(402, 'Fun Time Bottle Opener Fun Time Bottle Opener', 14.73, 0.01, 14.72, 609, '6.09', 4052604, '18-24,25-34,34-44', 2, 'Men,Women', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Kitchen ,household,Fun Time Bottle Opener Fun Time Bottle Opener', 'Kitchen & household', '<p><strong>This is a great party piece and conversation starter. Instead of using a regular bottle opener, impress your guests with this as it shoots the bottle caps. It comes in Red, Black, and Gray. Super magnet to hold the bottle cap and a spring-loaded slider to eject the cap.</strong></p>\r\n<p><strong>FEATURES:&nbsp;</strong></p>\r\n<p>Remove Caps &amp; Shoot: Impress your friends with this exciting bottle cap gun now! Easily open your bottles with the least effort, double up as a cap launcher!</p>\r\n<p>Your Fun Must-Have Opener: Simply pull the slide back, open your bottle, &amp; pull to shoot the cap! No mess or spill when using this bottle opener</p>\r\n<p>For Trendy Drink Games: Target drink cans, pop the cap, aim, fire, then just sit back and chill. Make sure you don&rsquo;t shoot people! Shoot up to 5 meters</p>\r\n<p>Play with Party Friends: Easily set up paper cups, water balloons anywhere &amp; shoot! See who scores the highest. Bring you and your drinking partners the most fun!</p>\r\n<p>For All Cap Collectors: Cute pistol style, very easy to carry &amp; use. Perfect for cap collection by easily opening the bottles without denting the tops</p>\r\n<p>Exciting Gift for Everyone: Popular gifts for dad, boyfriend, birthday, anniversary, Valentine\'s Day. Not a toy for kids! Best for bar, kitchen, patio, cabin, home, party, and so on.</p>\r\n<p><strong>SPECIFICATIONS:&nbsp;</strong></p>\r\n<p>Product material: ABS + metal + magnet</p>\r\n<p>Product color: red, gray, black</p>\r\n<p>Product size: 13*5.5*3.8cm</p>\r\n<p>Product weight: 50g</p>\r\n<p>Product packaging: OPP bag</p>\r\n<p><strong>PACKAGE INCLUDES:</strong></p>\r\n<p>1X FunTime Bottle Opener</p>', 'Available', 'facebook_ads', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-24 09:11:02', '2021-06-24 09:11:02', NULL, NULL),
(404, 'Door Opener Tools', 18.99, 4.19, 14.80, 46, '192.74', 4612693, '18-24,25-34,34-44,45-54,55-64', 2, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Jewellery,Door Opener Tools', 'Jewellery', '<p><strong>Avoid touching multiple daily surfaces and keep the viruses away with the patent-pending Keysmart CleanKey Brass Hand Tool. Sankey is a brand new product that helps reduce your surface point of contact by up to 99%! By limiting your physical touch to a key you avoid up to 99% of surface exposure and transmission of germs. Made from high-grade zinc alloy, this product is antimicrobial.&nbsp;</strong></p>\r\n<p><strong>FEATURES:</strong></p>\r\n<p>Brass Hand Tool</p>\r\n<p>Helps Avoid Touching Public Touchscreens and Other Surfaces</p>\r\n<p>Reduce Point of Contact Area by over 99%</p>\r\n<p>Ergonomic Design Easily opens Door, Presses Buttons and Pulls Levers</p>\r\n<p>Easy To Carry</p>\r\n<p>Comes with Retractable Carabiner</p>\r\n<p>Heavy Duty Brass</p>\r\n<p><strong>Specifications:</strong></p>\r\n<p>Brand Name: sticks jewelry</p>\r\n<p>Metals Type: Zinc Alloy</p>\r\n<p>Fine or Fashion: Fashion</p>\r\n<p>Model Number: YSK-00001</p>\r\n<p>Gender: UnisexItem&nbsp;</p>\r\n<p>Type: Key Chains</p>\r\n<p>Material: Metal</p>\r\n<p>Shape\\pattern: Key</p>\r\n<p>Style: Punk</p>\r\n<p><strong>Package:</strong></p>\r\n<p>1x Box</p>', 'Available', 'untapped_product', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-24 09:18:43', '2021-06-24 09:18:43', NULL, NULL),
(405, 'Orthopedic Corrector Sleeve', 24.99, 2.94, 22.05, 11473, '33730.62', 244092, '18-24,25-34,34-44,45-54,55-64', 1, 'Women', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Orthopedic Corrector Sleeve,Health & Beauty,Health', 'Health & Beauty', '<p><strong>Our brand new InnoBunion&trade; Orthopedic Corrector Sleeves are ideal for any and all sufferers of moderate to severe bunions, toe drifting, and/or toe-overlap. They are perfect for walkers, runners, cyclists, and all alike! Simply put on the InnoBunion&trade;, align the toe separator, and enjoy your everyday life with all-day-long comfortable relief!</strong></p>\r\n<h2><strong>FEATURES:</strong></h2>\r\n<p><strong>ANTISLIP SOCKS:</strong> Bunion correctors should be worn in socks or shoes to anti-slip if need to walk in the daytime or sleep at night. Fits for men and women, day and night.<br /><strong>PAIN RELIEVER:</strong> Bunion sleeve provides pain relief for hallux valgus, a toe overlapping, a bunion, or toe drift via the gel pad to reduce friction between bunions and outside.<br /><strong>BIG GEL PADS: </strong>Compare with simple feet sleeves, the bunion corrector has big gel pads to separate thumbs and toes.<br /><strong>STRAIGHTEN CURVED TOES: </strong>Re-adjust the toe joints and gently help straighten the curved toes, with a pressure of the soft silicone, the toe straightener helps straighten and correct toe day by day.<br /><strong>HIGH-QUALITY: </strong>Made of high-quality and soft gel, the bunion support brace brings you a comfortable wearing experience.</p>\r\n<h3><strong>SPECIFICATIONS:&nbsp;</strong></h3>\r\n<p><strong>Type:</strong> Orthopedic Supplies<br /><strong>Size: </strong>other&nbsp;<br /><strong>Power Source: </strong>None Electric<br /><strong>Material: </strong>Silicone</p>\r\n<h4><strong>PACKAGE INCLUDES:</strong></h4>\r\n<p>1&nbsp; Pair Foot&nbsp; Tool</p>', 'Available', 'untapped_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-24 09:19:43', '2021-06-24 09:19:43', NULL, NULL),
(406, 'Solar LED Lawn Light', 19.99, 5.30, 14.69, 120, '636.00', 2839847, '18-24,25-34,34-44,45-54,55-64', 1, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Garden Improvement,Solar LED Lawn Light', 'Garden Improvement', '<p><strong>These In-Ground Solar Lights are an innovative way of illuminating the exterior of the house and making an everlasting impact on the guests that come to visit. These durable and decorative outdoor lights are easy to install and provide the right beam angles and brightness, unlike traditional landscape fixtures.</strong></p>\r\n<p><strong>Features:</strong></p>\r\n<p><strong>Integrated Light Sensor: </strong>The highly effective light sensor will turn on the fixture automatically at night and turn off during the day.</p>\r\n<p><strong>Easy-to-install:</strong>&nbsp;Outdoor solar ground lights come with 2 plastic wedge connectors that can be hooked in the holes on the underside to be easily secured in the ground.</p>\r\n<p><strong>Waterproof design:&nbsp;</strong>IP44 waterproofing protects from the intrusion of water. Made of stainless steel, they don&rsquo;t incur rust and the tight-fitting is perfect for outdoor landscaping use. The switch is also water-resistant instead of elementary pinhole switches.</p>\r\n<p><strong>Higher Power Efficiency:&nbsp;</strong>These lights are power-efficient with an energy conversion rate of up to 14%.</p>\r\n<p><strong>Applications:&nbsp;</strong>Because of the decorative nature of these Solar Pathway Lights, they can be affixed on driveways, sidewalks, lawn parameters, or placed on entrance stairs.</p>\r\n<p><strong>Long Working Time:</strong>&nbsp;With its 4 pieces Solar LED lights, the brightness emitted is up to 40lm, and with a built-in 400mAh rechargeable battery, it only needs 6-8 hours to be fully charged and can last for 8-10 hours.</p>\r\n<p><strong>Specification :<br /></strong><strong>Lamp type: </strong>LED<br /><strong>Light color:</strong> as the picture shows<br /><strong>Charging time:</strong> &ge; 8 hours<br /><strong>Material: </strong>Stainless steel and ABS<br /><strong>Solar panel power: </strong>2V/100mA<br /><strong>Working time: </strong>full charged can be lighting about 8 hours<br /><strong>Waterproof rating: </strong>IP65<br /><strong>Working mode:</strong> light control + switch</p>\r\n<p><strong>Included:<br /></strong>1X Solar Powered Ground Lights</p>\r\n<p><strong>NOTES:<br /></strong>Please allow 1-3cm measuring deviation due to manual measurement.</p>\r\n<p>&nbsp;</p>', 'Available', 'trending_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-24 09:23:59', '2021-06-24 09:23:59', NULL, NULL),
(407, 'Waterproof Inspection Camera.', 23.99, 4.72, 19.27, 3298, '15566.56', 2442282, '[\"18-24\",\"25-34\",\"34-44\"]', 1, '[\"Unisex\"]', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Mobile Accessories,Waterproof Inspection Camera', '[\"Home & Gerden\"]', '<p><strong>An inspection camera for your android phone or laptop PC&nbsp; that is waterproof and comes with a 2-5 Meter flexible cable. Use it to look, inspect and solve all sorts of problems and issues like backed up sewer lines or inspect tight areas when fixing your car. This Endoscope is waterproof and comes with 6 LED lights so going in dark areas is not a problem.</strong></p>\r\n<p><strong>FEATURES:&nbsp;</strong></p>\r\n<p>This Mini USB Inspection Camera makes use of optoelectronic technology to investigate hard-to-reach areas.</p>\r\n<p>This inspection camera has many applications including ear detection, oral examination, search and rescue, pipeline inspection, engine inspection, video monitor, sewer pipe inspection, cast mold inwall inspection, etc.</p>\r\n<p>High resolution with 1/9 CMOS camera.</p>\r\n<p>Built-in 6 LED lights (with Brightness Control) on the camera head to illuminate the inspection area.</p>\r\n<p>Waterproof wire endoscope.</p>\r\n<p>With a 7mm camera head.</p>\r\n<p>Photo shooting and video recording.</p>\r\n<p><strong>SPECIFICATIONS:&nbsp;</strong></p>\r\n<p>USB interface: USB 2.0</p>\r\n<p>Cable Length: 2M</p>\r\n<p>Camera head outer diameter: 7mm.</p>\r\n<p>Pixels: 300000 pixels.</p>\r\n<p>Resolution: 640*480(VGA), 30 ft.</p>\r\n<p>LED: 6 white LED bright light.</p>\r\n<p>Focal distance: 2cm-infinite.</p>\r\n<p>Waterproof level: IP67.</p>\r\n<p>Temperature: -20 ~ 100&deg;.</p>\r\n<p><strong>PACKAGE INCLUDES:</strong></p>\r\n<p>1 * Mini USB Endoscope</p>\r\n<p>1 * Small hook</p>\r\n<p>1 * Magnet</p>\r\n<p>1 * Side audition</p>\r\n<p>1* Micro to USB line</p>\r\n<p>1* Micro to Type C (If you choose it)</p>\r\n<p>1 * User\'s Manual&nbsp;</p>', 'Available', '[\"trending_product\"]', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-24 09:25:53', '2021-06-24 09:30:30', NULL, NULL),
(410, 'Mypet Portable Pet Grapple', 47.52, 14.17, 33.35, 1304, '18477.68', 9098743, '18-24,25-34,34-44,45-54', 1, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Mypet Portable Pet Grapple,Pet Accessories', 'Pet Accessories', '<p><strong>It is a practical and easy-to-handle water dispenser that will help you keep YOUR PET HYDRATED with ease during the ride.</strong><br /><strong>Have you ever stopped to think that whenever we go out for a walk with our PETs we have difficulty hydrating them?</strong><br /><strong>Now, imagine if, in addition to the walk, physical activity of you and your friend, you could still create the feeling that he is drinking water at home?</strong><br /><strong>That\'s right, research has already proven the efficiency of the MyPET bottle, The MyPET Bottle manages to promote more well-being for your pet while they are strolling through the neighborhood. The best outlet for your pet.</strong></p>\r\n<h2><strong>FEATURES:</strong></h2>\r\n<p><strong>Design &amp; Material: </strong>4 colors for choice, Design in fashion stylish.in order to avoid the water spill out of everywhere, according to this problem, designed in safe locking. we adopted in food-grade ABS and Silicone Seal ring for leakproof. To ensure safety put it in your handbag.<br /><strong>Special Gift to Your Dog: </strong>For your dog, this can improve dog drink quality, so that we put the activated carbon in a bottle to absorb impurities to purify the water .not only you can feel relaxed about your dog\'s health, but also can safe to drink by the dog.<br /><strong>One-Hand to Feed:</strong> If you call someone or busy doing something, you don&rsquo;t have time to feeder water for the dog. we take that into account, so we have designed one-hand feeding with one key to lock/open.<br /><strong>How to Install: </strong>The filter element combine with activated carbon, then until the tighten, just push in the bottle. that&rsquo;s all.<br /><strong>Good Quality:</strong> Shatter-resistant .when the bottle falls down the floor, Don&rsquo;t worry about it .it is made of a high polymer material.</p>\r\n<h3><strong>SPECIFICATION:</strong></h3>\r\n<p><strong>Name:</strong> Portable water bottle for dog cat<br /><strong>Material: </strong>ABS+PC<br /><strong>Color: </strong>Blue, Green, Pink<br /><strong>Capacity:</strong> 300ml<br /><strong>Size: </strong>64x188mm<br /><strong>After pulling up: </strong>64x270mm</p>\r\n<h4><strong>Packing Include :</strong></h4>\r\n<p>1pc Dog Drinking Bottle&nbsp;<br />1pc Filter</p>', 'Available', 'untapped_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-24 09:38:30', '2021-06-24 09:38:30', NULL, NULL),
(411, 'Magnet Multifunctional Ruler', 24.99, 4.21, 20.78, 191, '804.11', 2839847, '18-24,25-34,34-44,45-54', 1, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Home Improvement,home,Magnet Multifunctional Ruler', 'Home Improvement', '<p><strong>Make your drawing easier with our Multifunctional Magnetic Drawing Ruler. Not only does it work great as a straight and curved metallic ruler, but it is also a compass and a protractor. With this tool in hand, you will be well-equipped to draw perfect circles and patterns effortlessly.&nbsp; It lets you make perfect circles, lines, arcs, and measure drawings, make mandala patterns, even let you rest your pen in it when you are taking a break. Besides, you will also open a nice soda bottle while you are on that break.</strong></p>\r\n<p><strong>Features:&nbsp;</strong></p>\r\n<p><strong>Portable and Efficient</strong> &nbsp;The stationery item is portable with many more handy capabilities. It doesn&rsquo;t poke holes through papers as it has no sharp point, and yet it is stable enough to not move around thanks to the specially designed rolling base. You can use it as a protractor for high-precision arcs.&nbsp;</p>\r\n<p><strong>Magnetic Function </strong>It has a hole at its base that you can use to place the compass wherever you need and magnetically allows the ruler units to snap to it. Once magnetically attached, the ruler units swing freely at 360&deg; around the base, allowing you to create circles and measure arcs nearly perfectly without piercing the paper.&nbsp;</p>\r\n<p><strong>Multifunctional&nbsp; </strong>The multifunctional wings are the cornerstone of the functionality of this gadget. You will have the flexibility to use whichever wing meets your needs, whether to draw straight or curved lines, or angles.&nbsp; The straight attachable wing gives you the power to draw perfect circles from a radius of 16mm to 80 mm. The holes are spaced with 4mm increments. It also doubles as a ruler, which enables you to draw straight lines, angles, and beautiful arcs.&nbsp;</p>\r\n<p><strong>Convenient Design&nbsp; &nbsp;</strong>It comes in a convenient design; it can be easily slotted into a notebook, making it the perfect little bookmark, which is also capable of drawing guidelines and circles. You can use the backside of the wing and book edge to assist in faster drawing.&nbsp;</p>\r\n<p><strong>Easy to Use&nbsp;</strong> &nbsp; The ruler is not complex to use. Markings on the compass base let you measure degrees as you draw circular lines, giving you control and intuition, bundled together in tools that don&rsquo;t change the way you make circles or lines. Thanks to its minimal design, you will innovatively cut the clutter and improve the process.&nbsp;</p>\r\n<p><strong>Pen Holder&nbsp;</strong>You can use the tool to hold pens of different sizes as long as the diameter is no bigger than 11.8 mm. When placed on the desk, it can hold a pen as well as the wings. The holes can comfortably accommodate various cartridges of pens, pencils, and makers.&nbsp;</p>\r\n<p><strong>Versatility&nbsp;</strong>It is great for designers, artists, architects, periodical enthusiasts, mandala enthusiasts, illustrators, tattoo artists, students, and creative professionals.&nbsp; &nbsp;</p>\r\n<p><strong>Multiple Modules&nbsp;</strong>The tool comprises two utility modules,&nbsp; a straight ruler with linear perforations, and a second abstract ruler with a curved profile, drawing guides, a set of wrenches, and a bottle opener. These modules can be used independently as you would a scale or a French curve ruler, but things get more interesting when you introduce base to the mix.&nbsp; &nbsp;</p>\r\n<p><strong>Specifications: </strong><br /><strong>aterial:</strong> Stainless Steel + Alloy Steel + Magnet&nbsp;<br /><strong>&nbsp;Color:</strong> Black&nbsp;<br />&nbsp;Size: approx. 8 clong&nbsp;&nbsp;<br /><strong>&nbsp;PACKAGE INCLUDES:&nbsp;</strong></p>\r\n<p>1 x Multifunctional Magnetic Drawing Ruler</p>', 'Available', 'untapped_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-24 09:41:11', '2021-06-24 09:41:11', NULL, NULL),
