arge-capacity battery, you want to charge whenever you want.<br /><strong>Sealed and Waterproof:</strong> It is not afraid of rainy days. It ensures that you do not have to worry about rainwater embedding on rainy days, and you can still use it normally.</p>\r\n<h3><strong>SPECIFICATIONS:</strong></h3>\r\n<p><strong>Color: </strong>red / black / orange / blue<br /><strong>Material: </strong>ABS<br /><strong>Size: </strong>width 2.4\'\'* length 4.7\'\'<br /><strong>Chuck range: </strong>50-80MM (4-6.3 inch mobile phone)<br /><strong>Durance: </strong>6-12 hours<br /><strong>Charging type:</strong> USB charging<br /><strong>Charging time: </strong>5 hours<br /><strong>Battery capacity: </strong>2000/4000 mAh<br /><strong>Output voltage / current: </strong>0.8A<br /><strong>Headlight brightness: </strong>400 lumens<br /><strong>Lamp type: </strong>LED lamp beads *2<br /><strong>Light mode: </strong>glare / write light / strobe<br /><strong>Speaker decibel: </strong>130 decibels<br /><strong>Sound mode:</strong> 5 sound modes</p>\r\n<h4><strong>Package Includes:</strong></h4>\r\n<p>4 in 1 Multifunctional bicycle light<br />1 x USB cable</p>', 'Available', 'untapped_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-24 10:09:30', '2021-06-24 10:09:30', NULL, NULL),
