(418, 'Deep Massage Pillow', 99.95, 49.68, 50.27, 2225, '110538.00', 2866212, '18-24,25-34,34-44,45-54,55-64,65+', 1, 'Women', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Deep Massage Pillow,Health & Beauty,Health', 'Health & Beauty', '<p><strong>Don&rsquo;t let your cervical problem or vulnerability trouble your sleep and comfort. Order a cutting-edge heated electric massage pillow to get relief and a good night&rsquo;s sleep as well. It is equipped with 16 massage heads that behave just as human hands massaging would. The pillow carries out a kneading massage using infrared heating. It involves three major techniques like push, pressure, and squeeze. Just use it as your regular pillow to see a difference.</strong></p>\r\n<h2><strong>Features:</strong></h2>\r\n<p><strong>RELIEVE PAIN &amp; RELEASE TENSION: </strong>Electric back massages help relax tight muscles and alleviate soreness.<br /><strong>PORTABLE &amp; VERSATILE: </strong>Ergonomic shiatsu back massager fits perfectly behind the neck and body contour.<br /><strong>FEEL MORE PRODUCTIVE, CONFIDENT &amp; SOOTHED:&nbsp;</strong>Do stress and anxiety keep you awake at night? Are you struggling with sore muscles or lower back pain? Now you can alleviate the symptoms of back or shoulder pain, reduce stress, and feel more energized with our massage cushion.<br /><strong>Enjoy soothing massages: </strong>Enjoy soothing massages at home, at your office, or even in your car and feel all the tension and soreness melt away.</p>\r\n<h3><strong>Specification:</strong></h3>\r\n<p><strong>Product name: </strong>Cervical massage pillow.<br /><strong>Rated voltage:</strong> 12 V.<br /><strong>Product model: </strong>RP2.<br /><strong>Rated power:</strong> 24 W.<br /><strong>Product functions: </strong>Kneading, massage, hot compress, speed regulation.<br /><strong>Product feature: </strong>16 positive and negative massage heads.<br /><strong>Color box size: </strong>43.5 * 14.5 *26 cm.<br /><