(419, 'Ice Maker', 29.99, 9.30, 20.69, 471, '4380.30', 1111536, '18-24,25-34,34-44,45-54,55-64', 2, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Home Improvement,Ice Maker', 'Home Improvement', '<p><strong>This is a manual ice maker that\'ll save you space in your freezer by replacing up to 10 traditional ice cube trays. It\'ll hold up to 120 cubes at once, enough for a group of friends or family members. When you\'re not using it to store ice in your freezer, you can also use it to keep bottled drinks cold, and you may even want to fill it with ice cream.</strong></p>\r\n<p><strong>FEATURES:&nbsp;</strong></p>\r\n<p>Fast frozen bottled drinks. Keep your red wine undiluted and cool.</p>\r\n<p>The perfect circle is much smaller than the traditional ice maker.</p>\r\n<p>There\'s plenty of room in the fridge. Use an airtight lid to keep the cube fresh and tasteless.</p>\r\n<p>Ice froze in outer space. The inner cylinder stores them.</p>\r\n<p>Unique double cavity design.</p>\r\n<p>Easy to use, just fill and store ice cubes.</p>\r\n<p>Portable, equipped with the cover and anti-skid bucket, convenient to carry.</p>\r\n<p>Suitable for many places and drinks, suitable for family, house, bar, cafe, hotel, restaurant, party, buffet, etc. Fast frozen bottled drinks such as whiskey, cocktails, and beverages are provided.</p>\r\n<p><strong>SPECIFICATIONS:&nbsp;</strong></p>\r\n<p>Color: Blue</p>\r\n<p>Weight: 280g</p>\r\n<p>Material: Made with safe silicone material, BPA-free.</p>\r\n<p><strong>PACKAGE INCLUDES:</strong></p>\r\n<p>1 x Ice Maker.</p>', 'Available', 'facebook_ads', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-24 10:30:55', '2021-06-24 10:30:55', NULL, NULL),
(420, 'Magic Tubby Pet Supplies Dog Foot Washer', 31.99, 7.74, 24.25, 2131, '16493.94', 8139283, '18-24,25-34,34-44,45-54', 1, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Pet Accessories, Tubby Pet Supplies Dog Foot Washer,Magic Tubby Pet Supplies', 'Pet Accessories', '<p><strong>The Safest and Most Effective Way To Clean Your Dog\'s Feet is with this Clever, Pet Paw Cleaner. Did you know that over 2 million people each year get sick from bacteria that was present on their dog\'s paws? The unfortunate truth is, each day your dog walks through dirt, trash, urine, and even feces, and then, they track all of these dangerous germs right back into your home or car, around your family, and even into your bed! YUCK. There is good news, however! With the Pet Paw Cleaner, you\'ll never have to worry about your adventurous pup\'s dirty paws again! Now, your best friend can have all the outdoor fun it wants, without tracking harmful bacteria into your home or vehicle. The Pet Paw Cleaner features soft, thick, silicone bristles inside of an easy-to-grip, BPA-free tumbler that works like a small agitation washer as it cleans your pet\'s paws. To use, simply fill the cup with water, insert your dog\'s dirty paw, give the cup a few twists and pull out a perfectly clean paw. You can repeat two or three more times, if necessary, then dab them dry and you\'re good to go.</strong></p>\r\n<p><strong>Features:</strong></p>\r\n<p>-The medium MudBuster is perfectly sized for medium-sized dogs: it measures 6 inches tall and 4 inches wide</p>\r\n<p>-To use, add a little water, insert the muddy paw, do the twist, dab the paw dry, repeat for 3 more paws</p>\r\n<p>-The gentle silicone bristles will help remove dirt and mud from your dog\'s paws- keeping the mess in the MudBuster and not in your house</p>\r\n<p>-Keep the MudBuster handy after trips to the park, after walks or hikes, or by your backdoor</p>\r\n<p>-Simple and easy to use, just rinse and keep on hand for the next muddy encounter. BPA free</p>\r\n<p>-Patent No. D799,126, US and Foreign Patents Pending</p>\r\n<p><strong>SPECIFICATIONS:</strong></p>\r\n<p><strong>Material:</strong> PP<br /><strong>Size: </strong>L, M, S (as the picture shows)<br /><strong>Colors:</strong> Green, blue, orange</p>\r\n<p><strong>PACKAGE INCLUDED.<br /></strong>1* Magic Tubby Pet Supplies Dog Foot Washer</p>\r\n<p>&nbsp;</p>', 'Available', 'untapped_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-24 10:34:42', '2021-06-24 10:34:42', NULL, NULL),
(421, 'Blue Rose Flower Tea Mug', 29.99, 14.03, 15.96, 105, '1473.15', 2259511, '18-24,25-34,34-44,45-54,55-64', 2, 'Women', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Blue Rose Flower Tea Mug,Outdoor', 'Outdoor', '<p><strong>Enamel metal handle with elegant butterfly and blue rose flower design, refined and noble. There are no cups exactly like yours in the world. Yours is only one and never fades as time passes.</strong></p>\r\n<h2><strong>FEATURES:</strong></h2>\r\n<p><strong>High-quality: </strong>lead-free crystal glass materials are a healthier choice over plastic mugs, glass does not discolor, retain smells or leach chemicals into drinks.<br /><strong>Elegant style:</strong> The glass tea mug has a fashion style and a blue rose flower design.&nbsp;<br /><strong>Elegant gift box:</strong> The ideal gift, our glass mug is attractive at your party, wedding, and display on the guest room and kitchen countertop.&nbsp;<br /><strong>Perfect for drinking: </strong>Flower teacup can be used for warm or cold drinks like tea, coffee, milk, juice, soda water, and vegetable juice, or some other daily uses.<br />The bright colors of the handles, base, and spoon won&rsquo;t fade, and the clear glass will remain translucent even if you use it daily.</p>\r\n<h3><strong>SPECIFICATIONS:</strong></h3>\r\n<p><strong>Volume: </strong>Short Tea Cup 11oz / Tall Tea Cup 12oz;<br /><strong>Weight(S,T,S+T):</strong> 0.63KG,0.66KG,1.07KG;<br /><strong>Material:</strong> Lead-free /heat resistant glass;<br /><strong>Product Dimensions: </strong>4.7 x 2.5 x 4.9 inches</p>\r\n<h4><strong>PACKAGE INCLUDES:</strong></h4>\r\n<p>1 * Glass Mug,<br />1 * Spoon,<br />1 * Drink Coaster,<br />1 *&nbsp; Cleaning Cloth,<br />1 * Gift Box;</p>', 'Available', 'trending_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-24 10:38:42', '2021-06-24 10:38:42', NULL, NULL),
(422, 'Foldable Car Window Windshield Sunshade Umbrella', 79.99, 13.32, 66.67, 4435, '59074.20', 297614, '18-24,25-34,34-44,45-54,55-64', 1, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Car Accessories,Foldable Car Window Windshield Sunshade Umbrella', 'Car Accessories', '<p><strong>This car windshield sunshade uses high-quality aluminum foil material to block a large amount of heat and reflect sunlight, which can effectively reduce the temperature inside the car and prevent damage and aging of the car interior.</strong></p>\r\n<p><strong>FEATURES:&nbsp;</strong></p>\r\n<p>Sun Protection &amp; Heat Insulation: The car windshield sunshade umbrella uses high-quality aluminum foil material to reflect sunlight and block most of the heat, which can effectively reduce the temperature in the car and provide a cool driving environment for you, and prevent damage and aging of the car interior.</p>\r\n<p>Easy to Fold: The car windshield sunshade is time-saving and convenient, easy to use, and non-destructive installation. Convenient for daily use and is an ideal sunshade accessory for cars in summer!</p>\r\n<p>Easy to Store: Small in storage after folding (with a leather storage bag), which can be placed on the side of the door or the central storage box, saving space and easy storage.</p>\r\n<p>Environmentally Friendly Material &amp; No Scratch to Car: Heat resistant, preventing damage from direct sunlight. Under the conditions of sunlight and high temperature, the car windshield visor sunshade will not emit odors and harmful gases, keep the air in the car fresh, and ensure green travel. The unique design of wrapped umbrella beads does not damage the car interior and paint and is non-destructive to installation and use.</p>\r\n<p>Good Quality: The car windshield retractable sunshade umbrella is made of high-hardness steel, which is strong, durable, and corrosion-resistant, and has a long cycle life, giving you a better sunshade experience!</p>\r\n<p><strong>SPECIFICATIONS:&nbsp;</strong></p>\r\n<p>Name Car Sun Shade / Car Windshield umbrella.</p>\r\n<p>Material: UPE Alloy.</p>\r\n<p>Small Size: 65X125cm.</p>\r\n<p>Big Size: 79X145cm.</p>\r\n<p>Suitable: for Sedan SUV Hatchback Multi-Purpose Vehicles (Please according to the actual situation choose the size).</p>\r\n<p><strong>PACKAGE INCLUDES:</strong></p>\r\n<p>Car sun umbrella &times; 1.</p>\r\n<p>Storage bag &times; 1.</p>\r\n<p>&nbsp;</p>', 'Available', 'trending_product', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Biplob Sheikh', '2021-06-24 10:43:37', '2021-06-24 10:43:37', NULL, NULL),
