(436, 'Cute Cat Pencil Bag', 26.90, 3.41, 23.49, 3689, '12579.49', 1521699, '18-24,25-34,34-44', 1, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Cute Cat Pencil Bag,Bag\'s & Shoes', 'Bag\'s & Shoes', '<p><strong>The cute pencil bag features a telescopic design of being both a pencil bag and a pencil cup that can stand stable well on the table. This cartoon stands up pencil cases for both girls, boys, kids, and Adults. This pencil case is a perfect gift for your artist kids, friends, and students!&nbsp;</strong></p>\r\n<h2><strong>Features:&nbsp;</strong></h2>\r\n<p><strong>Fed up of taking all your pens out to find the right one? </strong>Our Kitty Kat Telescopic Cat Pencil Case is our &uml;&curren; La Mode range. An innovative design that can extend out as a pencil case. but can also retract to be a pencil stand or pot for your makeup brushes. It is extremely versatile to save space in your bag. Trendy Pretty and the latest style. for children and adults to use.<br /><strong>Dimensions:</strong> It comes in a decent size of about 17 x 12 cm (top) / 8.5cm (base) .It will hold enough pens. pencils. erasers. a tape. a stapler. a scissor. clips. crayons. and a sharpener without taking up too much space. It also keeps things neatly organized and accessible.<br /><strong>All-round protection: </strong>Made with premium quality fabric with good stretchy. anti-scratch. dirt-resistant. easy to clean. and carry it around. To protect your pens. pencils. makeup brush. and all your goodies.<br /><strong>Huge application use: </strong>It can be for pen cases. cosmetic bag.office accessories organizer. ideal for students. office staff. and travelers.</p>\r\n<h3><strong>Specifications:&nbsp;</strong></h3>\r\n<p><strong>Brand:</strong> ANGOO<br /><strong>Material:</strong> Canvas<br /><strong>Full Size: </strong>W85 x D60 x H195mm&nbsp;<br /><strong>Folded Half Size: </strong>W85 x D60 x H115mm&nbsp;<br /><strong>Zip Length: </strong>130mm<br /><strong>Weight: </strong>115g</p>\r\n<h4><strong>Package Includes:</strong></h4>\r\n<p>1 x Kawaii Animal Stand-Up Foldable Pencil Case<br />1x box</p>', 'Available', 'untapped_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-26 04:33:31', '2021-06-26 04:33:31', NULL, NULL),
(437, 'Super Squiggles Outline Marker Set', 16.96, 6.77, 10.19, 1320, '8936.40', 600511, '18-24,25-34,34-44', 1, 'Baby', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Super Squiggles Outline Marker Set,Baby & Kids', 'Baby & Kids', '<p><strong>Zebra Mildliner Highlighters are beloved for their signature mild color which is both pleasant to look at and great for layering. The double tips consist of a chisel tip on one end, and a bullet tip on the other for a variety of applications. Perfect for taking notes, bullet journaling, lettering, or drawing.&nbsp;</strong></p>\r\n<h2><strong>Features:</strong></h2>\r\n<p><strong>Fun for the whole family: </strong>Our magic outline markers are loved by both parents and kids. Draw and doodle for hours on end with these magically appearing multi-colored outline markers.<br /><strong>FUN FOR EVERYONE: </strong>Some good old-fashioned fun or a creative project can go a long way! Especially when trying to keep kids occupied. Well, our magic outline markers can do just that.<br /><strong>Your imagination is the limit: </strong>Craft and creates amazing DIY posters and cards for family and friends, or simply just doodle and draw to destress after a long day at work. Our magic outline markers are fun for the entire family.<br /><strong>What colors are included?</strong> Black, Purple, Orange, Light Blue, Pink, Dark Blue, Green, And Yellow.<br /><strong>SUPER SIMPLE TO USE:</strong> For the best long-lasting results, store the makers horizontally and after each use make sure to re-cap the makers immediately.</p>\r\n<p>Simply shake the maker well to ensure that the ink is fully mixed. Then take the cap off and press the tip of the maker onto your surface. Keep repeating this in a pumping action a few times to activate the ink until it starts to flow and circulate. As the image below demonstrates.<br />We wanted to make SuperSquiggles as safe and eco-friendly as possible. This is why we made sure our Outline Markers are made using the best ingredients possible, using our unique one-of-a-kind opaque xylene-free ink which is non-toxic and child-friendly.<br />Also, we made sure the markers can be used on all surfaces. Including metal, glass, wood, plastic, and even pottery. Allowing your creativity to run free no matter what the surface.</p>\r\n<h3><strong>Specifications:</strong></h3>\r\n<p><strong>Refill material:</strong> fiber<br /><strong>Outer rod material:</strong> plastic<br /><strong>Size: </strong>14.3cm/5.63in; diameter 1cm/0.39in<br /><strong>Refill thickness: </strong>about 0.5mm-3mm/0.02-0.12in<br /><strong>Weight: </strong>105g</p>\r\n<h4><strong>Package included :</strong></h4>\r\n<p>12 x Highlighter Pens</p>', 'Available', 'facebook_ads', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-26 04:44:01', '2021-06-26 04:44:01', NULL, NULL),
(438, 'Stuffed Meatballs Maker', 15.00, 0.68, 14.32, 178, '121.04', 488744, '18-24,25-34,34-44,45-54,55-64', 2, 'Women', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Stuffed Meatballs Maker,Kitchen & household,Kitchen', 'Kitchen & household', '<p><strong>An ideal must-have for the homemade cooking enthusiast, this meatball maker is your perfect go-to partner when it comes to cooking perfectly shaped meatballs at home! It is a very practical and easy tool to make 4 large stuffed or unstuffed meatballs simultaneously at a single press. It&rsquo;s so convenient, you can use it every day.</strong><br /><strong>Streamline the process of serving delicious meatballs to your friends and family with this Homemade Stuffed Meatball Maker.&nbsp;</strong></p>\r\n<h2>FEATURES:</h2>\r\n<p><strong>A MUST-HAVE KITCHEN GADGET: </strong>Ensures that your meatballs are perfectly sized.&nbsp;<br /><strong>EASY AND PRACTICAL KITCHEN AID FOR EVERYDAY USE: </strong>Simultaneously makeup to 4 large stuffed or unstuffed meatballs.&nbsp;<br /><strong>PROTECT YOUR HANDS: </strong>No sticky fingers and no spilling of meat in your hands. Just fill and press.&nbsp;<br /><strong>BPA FREE: </strong>Made of eco-friendly plastic material. Dishwasher friendly.</p>\r\n<h3><strong>HOW TO USE:</strong></h3>\r\n<p>Simply add meat onto the red compartments where the white pressing tool is attached and then press the tool onto it in order to make a pocket.<br />Add your desired meatball filling.<br />Add meat onto the opposite red compartment then close the top.<br />Now have your stuffed meatballs ready for cooking.&nbsp;</p>\r\n<h3><strong>SPECIFICATIONS:</strong></h3>\r\n<p><strong>Material:</strong> PP Plastic<br /><strong>Color: </strong>Multi-Color</p>\r\n<p><strong>PACKAGE DETAILS:</strong></p>\r\n<p><strong>Package weight:</strong> 0.11kg (0.24lb.)<br /><strong>Package Size: </strong>1cm x 1cm x 1cm (0.39in x 0.39in x 0.39in)&nbsp;</p>\r\n<h4><strong>PACKAGE INCLUDES:</strong></h4>\r\n<p>1 X Meatball Maker</p>', 'Available', 'trending_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-26 05:22:41', '2021-06-26 05:22:41', NULL, NULL),
(439, 'Portable Baby Pillow', 48.44, 21.61, 26.83, 2, '43.22', 66037, '18-24,25-34,34-44', 2, 'Baby', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Portable Baby Pillow,Baby & Kids', 'Baby & Kids', '<p><strong>This portable baby bed made with a premium quality memory foam pad and breathable mesh provides excellent comfort for your baby. Let your baby sleep peacefully.</strong></p>\r\n<h2><strong>Features:</strong></h2>\r\n<p><strong>Soft Material &amp; Breathable: </strong>This portable baby bed made with a premium quality memory foam pad and breathable mesh, provides excellent comfort for your baby. Let your baby sleep peacefully.<br /><strong>Special Design: </strong>Unique design with head support, back support, and lifted legs support. Head support is flat with a porch for a nice round head, ideal for keeping the baby\'s head nice and round and preventing plagiocephaly, the ergonomic baby sleeping pad reduces the risk of suffocation. An adjustable leg support roll made of micro-granules raises the baby\'s legs to help with digestion, breathing, and colic and lets your baby play, rest, and nap comfortably.<br /><strong>Adjustable Size: </strong>Adjust the leg roll to the size of your little one for a perfect fit from birth up to 3 months (Recommend to use until baby can roll over on their own)<br /><strong>Portable &amp; Fits Anywhere: </strong>Hand-washable, lightweight (0.55lbs), and foldable for easy travel and care. Efficient design is simple to insert in any stroller, baby bouncer, rocker, crib bedding, cradled, car seat, or swing.<br /><strong>Premium Quality and Service: </strong>Your satisfaction is our #1 priority. If you have any problems with it or questions, please contact us and we will respond in time. We\'re standing by to assist you all the time.</p>\r\n<h3><strong>Specification:</strong></h3>\r\n<p><strong>Size: </strong>55 * 38cm<br /><strong>Product thickness:</strong> 2-3 cm<br /><strong>Weight: </strong>350 grams<br /><strong>Age: </strong>0-12Months</p>\r\n<h4><strong>Package Includes:</strong></h4>\r\n<p>1 x Baebee Crib Portable Baby Bed</p>', 'Available', 'untapped_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-26 05:36:40', '2021-06-26 05:36:40', NULL, NULL),
(442, 'Mobile Phone HD Projection Bracket', 24.99, 12.06, 12.93, 1, '12.06', 9498296, '18-24,25-34,34-44,45-54', 2, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Mobile Phone HD Projection Bracket,Mobile Accessories', 'Mobile Accessories', '<p><strong>The combination of a mobile phone amplifier and a lazy stand. Cell phone amplifiers reduce discomfort and visual fatigue caused by long-term focus on small screens; the stand keeps the screen at an appropriate distance from the eye, protecting your vision and neck.</strong></p>\r\n<h2><strong>Features:</strong></h2>\r\n<p><strong>Your personal cinema: </strong>Adopt high-definition optical technology, the image on the mobile phone screen is enlarged, the image is clear, the color is bright, the action is strong, and the radiation protection. Zoom in on your smartphone screen display to make it easier to watch movie videos or news on your phone.<br /><strong>Sturdy &amp; easy to adjust: </strong>The material is strong and flexible and is easily twisted. The gooseneck is equipped with high-quality magnesium alloy for higher stability and flexible adjustment. 360&deg; rotation allows you to enjoy any angle and completely lose your hands so you can lie comfortably on your bed or sofa.<br /><strong>Best holiday gift choice: </strong>This will be the best holiday gift for your friends and family. Gifts to friends or family who like to watch movies, 3d mobile movies with more stereo effects; also suitable for seniors watching movies, reading, and news.<br /><strong>Safe &amp; environmental-friendly: </strong>Acrylic lens material, materials used for this product are environmental, smell-less.<br /><strong>Portable home cinema: </strong>Collapsible design can be carried around in a purse, bag, or pocket easily when going outdoors. A portable and mini cinema for your family or party outside, suitable for indoor, camping, journey, leisure, etc.</p>\r\n<h3><strong>Specifications:</strong></h3>\r\n<p><strong>Color: </strong>black<br /><strong>Size: </strong>10-inch / 12-inch screen<br /><strong>Cable length: </strong>20 cm / 60 cm<br /><strong>Material:&nbsp;</strong> aluminum alloy aerospace material+abs + ultra-clear acrylic blue lens.</p>\r\n<h4><strong>Package includes:</strong></h4>\r\n<p>1 x mobile phone pro</p>', 'Available', 'facebook_ads', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-26 06:22:05', '2021-06-26 06:22:05', NULL, NULL),
(443, 'Digital Angle Finder', 59.99, 28.93, 31.06, 833, '24098.69', 3751417, '18-24,25-34,34-44,45-54,55-64', 1, 'Men', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Digital Angle Finder,Electronics,Garden Improvement', 'Garden Improvement,Electronics', '<p><strong>A one-of-a-kind product that measures any angle accurately and quickly, this is ideal for any of your needs at home be it for remodeling, cabinet installation, counter installation, mounting of windows or doors, fitting up carpet or tile floors, and more! For our ingenious and resourceful handymen out there, this is the perfect product for you and your home!</strong></p>\r\n<h2><strong>FEATURES:</strong></h2>\r\n<p><strong>LCD Display: </strong>Has a high-tech LCD display that&rsquo;ll clearly show you the angle you&rsquo;re measuring!<br /><strong>DURABLE: </strong>Made of high-quality material that ensures you can use this for a long time.<br /><strong>COMPATIBILITY: </strong>Can be used for a variety of activities such as checking and conveying angles for remodeling, cabinet installation, counter installation, measuring roof angles, mounting up windows or doors, aligning wood forms for pouring concrete, fitting up carpet and parquet or tile floors, aligning and checking stair railings and rails, checking for proper fit-up to an angled surface, and much more.</p>\r\n<h3><strong>SPECIFICATIONS:</strong></h3>\r\n<p><strong>Length:</strong> 16 \"<br /><strong>Measuring angle range: </strong>0-225 Degree<br /><strong>Increase / decrease angle:</strong> 0.1 Degree Steps<br /><strong>Measuring precision: </strong>+ -0.5 degrees<br /><strong>Digital Accuracy: </strong>0.1 degrees for all ranges</p>\r\n<h4><strong>PACKAGE INCLUSIONS:</strong></h4>\r\n<p>1 x&nbsp; Digital Angle Finder</p>', 'Available', 'trending_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-26 06:37:03', '2021-06-26 06:37:03', NULL, NULL),
(444, 'Theft Protection Roller Stamp', 18.99, 2.99, 16.00, 123, '367.77', 163177, '18-24,25-34,34-44,45-54,55-64', 2, 'Men', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Theft Protection Roller Stamp,Garden Improvement,Home Improvement', 'Home Improvement,Garden Improvement', '<p><strong>Are you in trouble with those junk emails? Do you want to recycle magazines and envelopes but have to put them in a shredder machine? Now say goodbye to the shredder machine and use our Identity Theft Protection Roller Stamp for the recollection of paper!</strong></p>\r\n<h2><strong>FEATURES:</strong></h2>\r\n<p><strong>Identity Theft Protection Solution: </strong>Effectively used to hide hides addresses, social security numbers, account numbers, or ID numbers on junk mail, bills, and other important documents. Protect your information safely.<br /><strong>Great Alternative to A Shredder:</strong> Paper can be recycled after using a roller stamp, no need for a shredder. In addition, a pre-inked mount eliminates the use of a separate, messy ink pad.<br /><strong>Wide Coverage: </strong>A unique designed pattern combined with the formulated ink works on most papers, perfect for covering large swaths of private information in a quick and clean way.<br /><strong>Unlimited Re-Inking: </strong>The total length of stamp coverage can reach 100 meters. Ink (not included) can be refilled on the stamp side when the ink runs out.<br /><strong>Good Time Saver: </strong>The ink quickly dries. Stamp works well on all regular paper, envelopes, and package addresses. One swipe and the info is covered, no need to go for a shredder.</p>\r\n<h3><strong>SPECIFICATIONS:&nbsp;</strong></h3>\r\n<p><strong>MATERIAL: </strong>ABS<br /><strong>FEATURES:</strong> Identity Theft Protection / Rolling Stamp<br /><strong>STAMP WIDTH:</strong> S: 17mm, L: 34mm<br /><strong>OCCASION: </strong>Indoor / Outdoor<br /><strong>PRODUCT WEIGHT: </strong>S: 60G, L: 90G<br /><strong>PRODUCT SIZE: </strong>S: 62 &times; 30 &times; 60mm, L: 37 &times; 30 &times; 60mm</p>\r\n<h4><strong>PACKAGE CONTENTS:&nbsp;</strong></h4>\r\n<p>1&times; Secure Protection Roller Stamp</p>', 'Available', 'untapped_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-26 06:55:19', '2021-06-26 06:55:19', NULL, NULL),
(445, 'Comfy Calming Pet Bed', 41.31, 10.64, 30.67, 2295, '24418.80', 5001493, '18-24,25-34,34-44,45-54,55-64', 1, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Comfy Calming Pet Bed,Pet Accessories', 'Pet Accessories', '<p><strong>This luxury bed has a round shape design with a lot of cushioning and raised sides to help your pet feel warm, contained, and comfortable. Because we understand that dogs love to curl up in their comfy bed, much like we do in ours. Your pet will feel at ease and feel safe and protective when returning there.&nbsp;</strong></p>\r\n<h2><strong>Features:</strong></h2>\r\n<p><strong>Extra comfort: </strong>Ideal for pets who love to curl up! The raised rim provides head and neck support, while the super-soft filling offers joint and muscle pain relief. Your pet will be so relaxed!<br /><strong>Eases Anxiety: </strong>The raised rim creates a sense of security &amp; coziness. Cleaning dog hair is easier - When your pet sleeps, it sheds hair. Let them sleep in an area where it is concentrated, and you will have less to clean up!<br /><strong>Ultra Soft, VEGAN Fur Fabric: </strong>Made from ultra-soft vegan fur. It is one of the comfiest materials we sell. Its long fibers are soft durable and machine-washable.<br /><strong>Luxurious design:</strong> Sleek design, this bed is a great addition to accommodate the design of any home!<br /><strong>Easy to clean:</strong> Every bed is safe in the washing machine and dryer (Machine wash, gentle cycle. Tumble dry, low heat).</p>\r\n<h3><strong>Specification:</strong></h3>\r\n<p><strong>Name:</strong> Pet bed<br /><strong>Material:</strong> Luxury Long Plush+PP cotton<br /><strong>Colors: </strong>20+ colors available</p>\r\n<p><strong>Sizes: XS/S/M/L/XL/XXL</strong></p>\r\n<p>XS Diameter 40cm fit for pet less than 2.5KG<br />S&nbsp; Diameter 50cm fit for pet less than 5KG<br />M Diameter 60cm fit for pet less than 9KG<br />L&nbsp; Diameter 70cm fit for pet less than 18KG<br />XL Diameter 80cm fit for pet less than 25KG<br />XXL Diameter 100cm fit for pet less than 45KG</p>\r\n<h4><strong>Package includes:</strong></h4>\r\n<p>1 x comfy calming dog/cat bed</p>', 'Available', 'facebook_ads', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-26 07:13:59', '2021-06-26 07:13:59', NULL, NULL),
(446, 'Flower Napkin Holder', 21.43, 3.30, 18.13, 25, '82.50', 813029, '18-24,25-34,34-44,45-54', 2, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Flower Napkin Holder,Home Improvement,Kitchen & household,Kitchen', 'Kitchen & household', '<p><strong>Our flower napkin holders are shaped to look like long, lovely floral stems and turn ordinary napkins into blossoming flowers! Transform a regular napkin into a stunning rose, tulip, or amaryllis in seconds by simply twisting a napkin and attaching it to the stem-like napkin holder. Mix &amp; match different colored napkins to create your own special flower bouquet for your loved ones. Perfect for a romantic dinner, ladies luncheon, gathering of family and friends, or any other special occasion.</strong></p>\r\n<h2><strong>Features:</strong></h2>\r\n<p>Shape and display your napkins beautifully and impress your guests at your next social gathering.<br />These flower napkin holders are shaped to look like long, lovely floral stems and will turn ordinary napkins into amazing blossoming flowers.<br />Transform a regular napkin into an elegant tulip-shaped flower in seconds by attaching it to the stem-like holder, then simply twisting.<br />Mix &amp; match different colored napkins to create your own unique flower bouquet. They\'re guaranteed to impress your guests.<br />Perfect for romantic dinners, formal events, weddings, or any other special occasion where you want to wow your guests.</p>\r\n<h3><strong>Specification:</strong></h3>\r\n<p><strong>Material: </strong>PP.<br /><strong>Color: </strong>green<br /><strong>Size: </strong>approx. 19.5&times;6&times;2.8cm/7.7&times;2.4&times;1.1 inch</p>\r\n<h4><strong>Package included:</strong></h4>\r\n<p>4/8/16PCS Plastic Flower Buds Serviette Holder.</p>', 'Available', 'trending_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-26 08:23:17', '2021-06-26 08:23:17', NULL, NULL),
(447, 'Portable Air Compressor Pump', 80.00, 33.59, 46.41, 6111, '205268.49', 352545, '18-24,25-34,34-44,45-54', 1, 'Unisex', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Portable Air Compressor Pump,Car Accessories', 'Car Accessories', '<p><strong>Unlike any tire inflator you&rsquo;ve seen before is a sleek and clear-shaped cylinder. It is the first tire inflator that got rid of all physical buttons and features a large LCD digital display of 1.18x0.67 inches with capacitive touch. Even when you don\'t need to inflate your tires, you can connect to them at any time to gauge the tire pressure. The screen shows your current pressure immediately when connected like the picture shows above.</strong></p>\r\n<h2><strong>Features:</strong></h2>\r\n<p><strong>INTEGRATED DESIGN: </strong>It has a compact and sleek design, portable, and easy to store.<br /><strong>ADJUSTABLE AIR PRESSURE: </strong>LCD digital pressure gauge with backlight has 3 optional units, you can preset tire pressure to what the tire needs and test the tire pressure at any time.<br /><strong>AUTO STOP:</strong> The air pump will automatically stop inflating when the inflation reaches the preset value to avoid overinflating.<br /><strong>LED FLASHLIGHT:</strong> With 8 LED beads and independent switch control that provides a convenient brighter light that can be used as emergency lighting.&nbsp;</p>\r\n<h3><strong>Specifications:</strong></h3>\r\n<p><strong>Color:</strong> Black<br /><strong>Car Power Input: </strong>12V 3A<br /><strong>Input Voltage: </strong>5V/2A<br /><strong>Size:</strong> 250 55 45mm / 9.8 2.2 2.2in<br /><strong>Weight:</strong> 600g / 1.3lb</p>\r\n<h4><strong>Package includes:</strong></h4>\r\n<p>1 x Electric Portable Air Compressor Pump<br />1 x Power Cord<br />1 x Zipper Bag<br />1 x Adaptor<br />3 x Nozzle<br />1 x Instructional Manual</p>', 'Available', 'untapped_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-26 08:43: