(449, 'Tactical Gloves', 33.95, 7.52, 26.43, 969, '7286.88', 223053, '18-24,25-34,34-44,45-54,55-64', 1, 'Men', 'United States, Canada, Australia, Japan, Netherlands, Europe, Singapur', 'Tactical Gloves,Man\'s Fashion', 'Man\'s Fashion', '<p><strong>Our tactical gloves effectively protect your hands from scratches, cuts, bruises, insect stings, heat, cold, etc. It is widely used for various outdoor sports &amp; activities. With ventilation holes on the back of your hands, our gloves give you breathable comfort in both hot &amp; cold conditions. No more sweating hands inside the gloves. The fingertip undersides are touchscreen compatible so you never have to remove the gloves when accessing your touchscreen gadgets.</strong></p>\r\n<h2><strong>Features:</strong></h2>\r\n<p><strong>Knuckle protection: </strong>Ergonomic cushions for knuckles are designed to absorb the impact, giving your hands stronger protection in critical situations.<br /><strong>Wear-resistant:</strong> Made of high-quality microfiber, sewed with double thread, these gloves have high durability, resistant to abrasion and tearing.<br /><strong>Breathable comfort:</strong> Achieved by odor-free breathable materials &amp; functional vent design, comfortable to use in hot weather as well as in mild winter seasons.<br /><strong>Anti-slip:</strong> The reinforced PU layer of the palm improves anti-slip performance for hunting, shooting, archery, tactical training, etc. Do not affect the natural movement.<br />Excellent grip with dual-layer synthetic leather palm featured by anti-skid gridding.</p>\r\n<h3><strong>Specifications:</strong></h3>\r\n<p><strong>Material: </strong>microfiber, nylon, rubber knuckle<br /><strong>Color: </strong>black, green, brown, dark brown<br /><strong>Size: </strong>S/M/L/XL/XXL</p>\r\n<h4><strong>Package Includes:</strong></h4>\r\n<p>1 x Glove</p>', 'Available', 'untapped_product', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sumon Mia', '2021-06-26 09:18:39', '2021-06-26 