INSERT INTO `refund_policies` (`id`, `content`, `created_at`, `updated_at`) VALUES
(1, '<h2>Try Before Buying</h2>\r\n\r\n<p><a href=\"http://127.0.0.1:8000/refund-policy#\">WP ERP Demo</a> is available so that you can try and check what you are buying. We have included all the extensions of WP ERP within the demo just for you. You can request the demo directly from <a href=\"http://127.0.0.1:8000/refund-policy#\">here.</a></p>\r\n\r\n<h2>Our No Question Asked Refund Policy After Purchase</h2>\r\n\r\n<p>It&rsquo;s really simple!</p>\r\n\r\n<p>We are so confident that you will definitely <strong>LOVE</strong> and <strong>BENEFIT</strong> from our products, we offer a <strong>14-day no-questions-asked refund policy.</strong></p>\r\n\r\n<p>If you don&rsquo;t like our product or it causes you trouble, we will be happy to offer you a full 100% refund within 14 days of your original purchase and no questions will be asked.</p>\r\n\r\n<p>However, we might invite you to suggest us how to improve ourselves while refunding. Also, we would really appreciate if you give insights what made you ask for a refund.</p>\r\n\r\n<p>At WP ERP, we exist to provide enhanced web experience with WordPress. Our products focus on empowering small to large enterprises as well as individuals with the best user experience. Thus, we aim to deliver WordPress plugins and themes spiced up with the latest development trends and best practices.</p>\r\n\r\n<p>Our mission is to help you create exciting and lasting transformations through using our products. We, therefore, provide our customers with live demos, articles, tutorials, documentation, product interface images, detailed descriptions, feature lists, videos, access to our social media channels, and hundreds of customer reviews so you can make an informed buying decision.</p>\r\n\r\n<blockquote>\r\n<p>We do not refund if the product has been purchased on discount.</p>\r\n</blockquote>\r\n\r\n<p>So, if you are buying any product on discount or when an offer campaign is going on, please make sure you are agreeing with the policy of not getting any refund for that purchase. In such case, the decision of the Sales &amp; Support team is final.</p>\r\n\r\n<h2>A couple of small points you should consider</h2>\r\n\r\n<ol>\r\n	<li>We will process your refund as soon as we&rsquo;re able to. In some cases, we might ask you for the opportunity to resolve the issue for you.</li>\r\n	<li>We may refuse to refund clients who act in bad faith or misused the services.</li>\r\n	<li>Refunds may only be issued within 14 days of the purchase date. After 14 days no refunds can be processed.</li>\r\n	<li>Refunds do not apply to discounted products, upgrades or renewals.</li>\r\n</ol>\r\n\r\n<h2>Policy for Automatic Payments</h2>\r\n\r\n<p>WP ERP extensions require renewal of subscriptions every year, but you can choose whether to renew your subscription or not. We suggest to renew your subscriptions because we are always improving our products and releasing new updates. A valid subscription is required for receiving updates.</p>\r\n\r\n<p>Please note that when you purchase any product using PayPal or Stripe, you create an automatic payment account. This means both Pay Pal and Stripe records your information and prepares your payment account. This helps the payment gateways to automatically charge from you to complete automatic payments.</p>\r\n\r\n<p>If you do not cancel automatic payments from your account, it will &ndash;</p>\r\n\r\n<ol>\r\n	<li>Renew the product subscription after one year</li>\r\n	<li>Charge from your account automatically</li>\r\n</ol>\r\n\r\n<blockquote>\r\n<p>We do not refund auto renewal payments for any product.</p>\r\n</blockquote>\r\n\r\n<p>So, please make sure to cancel automatic payment while purchasing if you don&rsquo;t want to renew your license after one year.</p>\r\n\r\n<h2>Policy for Automatic Payments</h2>\r\n\r\n<p>When you are placing an order for any of our products, you indicate that you have read this refund policy properly. This also proves that you agree with and fully accept the terms of this refund policy. We ask you not to place an order with us if you do not agree with the terms and conditions.</p>\r\n\r\n<p>If the above criteria mentioned in this policy are met, then you are eligible for a refund. <a href=\"http://127.0.0.1:8000/refund-policy#\">Please use the contact form</a> and we will reply within 2 working days.</p>', NULL, '2021-08-14 23:31:09');
